INSERT INTO `product` VALUES (1, 'img/sanpham/huawei/nova3i/2.jpg', 'HUAWEI NOVA 3I', 3, 5390000, 30, 3, 4, 2, 12, 'img/sanpham/huawei/nova3i/1.jpg', 'img/sanpham/huawei/nova3i/2.jpg', 'img/sanpham/huawei/nova3i/3.jpg', 'img/sanpham/huawei/nova3i/4.jpg', 'LTPS LCD, 6.3\", Full HD+', '	Chính 24 MP & Phụ 2 MP', 'Chính 16 MP & Phụ 2 MP', 'Bản nâng cấp hoàn hảo của Huawei Nova 2i', 'Cuốn hút từ vẻ đẹp bên ngoài', 'Màn hình Fullview tỷ lệ 19.5:9\r\n', 'Điện thoại Huawei Nova 3i ra đời nhầm thực hiện chuỗi tiếp nối thành công vào dòng phân khúc điện thoại tầm trung của một trong những hãng điện thoại hàng đầu Trung Quốc. Có thể xem Nova 3i là phiên bản nâng cấp lý tưởng của Nova 2i với cụm camera kép selfie với khung kim loại chắc chắn.\r\n', 'Được thiết kế nguyên khối với màn hình tai thỏ ở mặt trước. Huawei nova 3i được hoàn thiện bởi mặt lưng kính cong 2.5D sang trọng, kết hợp bộ khung kim loại chắc chắn mang lại vẻ đẹp bóng bẩy, sang trọng nhưng cũng không kém phần tinh tế. Các góc cạnh được bo cong nhẹ nhàng, nhằm đem lại cảm giác cầm nắm êm tai và dễ chịu hơn, kết hợp với màu sắc nổi bật, Nova 3i sẽ là một chiếc điện thoại mà bất kỳ đối tượng nào cũng mong muốn có.\r\n\r\n', 'Màn hình Nova 3i được bao quanh bởi các cạnh viền mỏng, kích thước màn hình to 6.3 inch đi kèm tỷ lệ màn hình mới 19.5:9 cùng chuẩn phân giải hình ảnh lên đến Full HD+ mang đến những khung hình sắc nét và chi tiết. Công nghệ màn hình LTPS giúp cho góc nhìn được mở rộng hơn, màu sắc được tái tạo chính xác, chân thực và sống động.\r\n\r\n', 'img/sanpham/huawei/nova3i/mota/1.jpg', 'img/sanpham/huawei/nova3i/mota/2.jpg', 'img/sanpham/huawei/nova3i/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Bản nâng cấp hoàn hảo của Huawei Nova 2i</h1><p>Điện thoại Huawei Nova 3i ra đời nhầm thực hiện chuỗi tiếp nối thành công vào dòng phân khúc điện thoại tầm trung của một trong những hãng điện thoại hàng đầu Trung Quốc. Có thể xem Nova 3i là phiên bản nâng cấp lý tưởng của Nova 2i với cụm camera kép selfie với khung kim loại chắc chắn.\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/huawei/nova3i/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Cuốn hút từ vẻ đẹp bên ngoài</h1><p>Được thiết kế nguyên khối với màn hình tai thỏ ở mặt trước. Huawei nova 3i được hoàn thiện bởi mặt lưng kính cong 2.5D sang trọng, kết hợp bộ khung kim loại chắc chắn mang lại vẻ đẹp bóng bẩy, sang trọng nhưng cũng không kém phần tinh tế. Các góc cạnh được bo cong nhẹ nhàng, nhằm đem lại cảm giác cầm nắm êm tai và dễ chịu hơn, kết hợp với màu sắc nổi bật, Nova 3i sẽ là một chiếc điện thoại mà bất kỳ đối tượng nào cũng mong muốn có.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/huawei/nova3i/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Màn hình Fullview tỷ lệ 19.5:9\r\n</h1><p>Màn hình Nova 3i được bao quanh bởi các cạnh viền mỏng, kích thước màn hình to 6.3 inch đi kèm tỷ lệ màn hình mới 19.5:9 cùng chuẩn phân giải hình ảnh lên đến Full HD+ mang đến những khung hình sắc nét và chi tiết. Công nghệ màn hình LTPS giúp cho góc nhìn được mở rộng hơn, màu sắc được tái tạo chính xác, chân thực và sống động.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/huawei/nova3i/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (2, 'img/sanpham/huawei/mate20/2.jpg', 'HUAWEI MATE 20', 3, 6020000, 30, 4, 4, 3, 12, 'img/sanpham/huawei/mate20/1.jpg', 'img/sanpham/huawei/mate20/2.jpg', 'img/sanpham/huawei/mate20/3.jpg', 'img/sanpham/huawei/mate20/4.jpg', 'IPS LCD, 6.5\", Full HD+', '24 MP', 'Chính 12 MP & Phụ 16 MP, 8 MP', 'Bản nâng cấp hoàn hảo của Huawei Nova 2i', 'Cụm 3 camera tối ưu\r\n', 'Cấu hình mạnh mẽ\r\n', 'Điện Thoại Huawei Mate 20 - Hàng Chính Hãng  được trang bị lớp vỏ bằng kính cường lực, mà theo Huawei đây là loại kính đặc biệt giúp cầm chắc chắn hơn, ít trơn trượt hơn và ít để lại dấu vân tay hơn so với các loại kính cường lực khác. Điều này giúp sản phẩm luôn bóng đẹp trong trường hợp người dùng sử dụng mà không dùng đến lớp vỏ bảo vệ. Mate 20 vẫn được trang bị cảm biến vân tay ở mặt lưng và sở hữu “tai thỏ” dạng giọt nước rất nhỏ gọn để bố trí camera trước.\r\n\r\n', 'Điện thoại Mate 20 được trang bị camera chính độ phân giải 20 megapixel (khẩu độ f/1.8), camera góc rộng 16 megapixel (khẩu độ f/2.2) và camera tele 8 megapixel (khẩu độ f/2.4) hỗ trợ zoom quang học 2x. Người dùng có thể kết hợp cả 3 camera trên bộ đôi sản phẩm để tạo ra bức ảnh ultra-macro, cho phép chụp đối tượng ở khoảng cách gần nhưng vẫn rõ nét.\r\n\r\n', 'Về cấu hình, Huawei Mate 20 series đều sử dụng con chip mới nhất Kirin 980 mạnh mẽ, đi kèm tuỳ chọn dung lượng RAM 4/6GB, bộ nhớ trong 128GB (hỗ trợ mở rộng thẻ nhớ ngoài 256GB), chạy Android (9.0 Pie) tuỳ biến giao diện Huawei Emotion UI.  \r\n\r\n', 'img/sanpham/huawei/mate20/mota/1.jpg', 'img/sanpham/huawei/mate20/mota/2.jpg', 'img/sanpham/huawei/mate20/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Bản nâng cấp hoàn hảo của Huawei Nova 2i</h1><p>Điện Thoại Huawei Mate 20 - Hàng Chính Hãng  được trang bị lớp vỏ bằng kính cường lực, mà theo Huawei đây là loại kính đặc biệt giúp cầm chắc chắn hơn, ít trơn trượt hơn và ít để lại dấu vân tay hơn so với các loại kính cường lực khác. Điều này giúp sản phẩm luôn bóng đẹp trong trường hợp người dùng sử dụng mà không dùng đến lớp vỏ bảo vệ. Mate 20 vẫn được trang bị cảm biến vân tay ở mặt lưng và sở hữu “tai thỏ” dạng giọt nước rất nhỏ gọn để bố trí camera trước.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/huawei/mate20/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Cụm 3 camera tối ưu\r\n</h1><p>Điện thoại Mate 20 được trang bị camera chính độ phân giải 20 megapixel (khẩu độ f/1.8), camera góc rộng 16 megapixel (khẩu độ f/2.2) và camera tele 8 megapixel (khẩu độ f/2.4) hỗ trợ zoom quang học 2x. Người dùng có thể kết hợp cả 3 camera trên bộ đôi sản phẩm để tạo ra bức ảnh ultra-macro, cho phép chụp đối tượng ở khoảng cách gần nhưng vẫn rõ nét.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/huawei/mate20/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Cấu hình mạnh mẽ\r\n</h1><p>Về cấu hình, Huawei Mate 20 series đều sử dụng con chip mới nhất Kirin 980 mạnh mẽ, đi kèm tuỳ chọn dung lượng RAM 4/6GB, bộ nhớ trong 128GB (hỗ trợ mở rộng thẻ nhớ ngoài 256GB), chạy Android (9.0 Pie) tuỳ biến giao diện Huawei Emotion UI.  \r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/huawei/mate20/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (3, 'img/sanpham/huawei/p30pro/2.jpg', 'HUAWEI P30 PRO', 3, 20690000, 30, 5, 5, 3, 12, 'img/sanpham/huawei/p30pro/1.jpg', 'img/sanpham/huawei/p30pro/2.jpg', 'img/sanpham/huawei/p30pro/3.jpg', '/img/sanpham/huawei/p30pro/.jpg', '	OLED, 6.47\", Full HD+', '	32 MP', 'Chính 40 MP & Phụ 20 MP, 8 MP, TOF 3D', 'Thiết kế chắc chắn', 'Chip xử lý HiSilicon Kirin 980 mạnh mẽ\r\n', 'Dung lượng pin lớn\r\n', 'Điện Thoại Huawei P30 Pro được xem là mẫu flagship mong đợi nhất của thương hiệu Huawei, sở hữu thiết kế mặt lưng kính cao cấp, bóng bẩy kết hợp cùng khung kim loại được hoàn thiện tốt. P30 Pro cho cảm giác cầm tay chắc chắn, thoải mái vô cùng.\r\n\r\n', 'Huawei P30 Pro trang bị chip xử lý HiSilicon Kirin 980 mạnh mẽ, chip đồ hoạ Mali-G76 MP10, bộ xử lý Octa core. Đi kèm RAM 8GB, bộ nhớ trong 256GB đáp ứng nhu cầu lưu trữ dữ liệu lớn của người dùng. Với nền tảng hiệu năng như trên, người dùng hoàn toàn thoải mái thực hiện các tác vụ từ cơ bản đến yêu cầu cao về hiệu năng, có thể chơi mượt mà các tựa game đồ hoạ cao mà không lo lắng giật, lag.\r\n\r\n', 'Huawai P30 Pro sử dụng viên pin lớn dung lượng lên tới 4.200 mAh cho thời lượng sử dùng dài lâu. Chưa hết, P30 Pro còn hỗ trợ sạc nhanh để đáp ứng kịp thời nhu cầu nạp năng lượng cho thiết bị, phục vụ người dùng có nhu cầu sử dụng smartphone thường xuyên, liên tục phục vụ công việc.\r\n\r\n', 'img/sanpham/huawei/p30pro/mota/1.jpg', 'img/sanpham/huawei/p30pro/mota/2.jpg', 'img/sanpham/huawei/p30pro/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Thiết kế chắc chắn</h1><p>Điện Thoại Huawei P30 Pro được xem là mẫu flagship mong đợi nhất của thương hiệu Huawei, sở hữu thiết kế mặt lưng kính cao cấp, bóng bẩy kết hợp cùng khung kim loại được hoàn thiện tốt. P30 Pro cho cảm giác cầm tay chắc chắn, thoải mái vô cùng.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/huawei/p30pro/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Chip xử lý HiSilicon Kirin 980 mạnh mẽ\r\n</h1><p>Huawei P30 Pro trang bị chip xử lý HiSilicon Kirin 980 mạnh mẽ, chip đồ hoạ Mali-G76 MP10, bộ xử lý Octa core. Đi kèm RAM 8GB, bộ nhớ trong 256GB đáp ứng nhu cầu lưu trữ dữ liệu lớn của người dùng. Với nền tảng hiệu năng như trên, người dùng hoàn toàn thoải mái thực hiện các tác vụ từ cơ bản đến yêu cầu cao về hiệu năng, có thể chơi mượt mà các tựa game đồ hoạ cao mà không lo lắng giật, lag.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/huawei/p30pro/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Dung lượng pin lớn\r\n</h1><p>Huawai P30 Pro sử dụng viên pin lớn dung lượng lên tới 4.200 mAh cho thời lượng sử dùng dài lâu. Chưa hết, P30 Pro còn hỗ trợ sạc nhanh để đáp ứng kịp thời nhu cầu nạp năng lượng cho thiết bị, phục vụ người dùng có nhu cầu sử dụng smartphone thường xuyên, liên tục phục vụ công việc.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/huawei/p30pro/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (4, 'img/sanpham/huawei/y7pro/2.jpg', 'HUAWEI Y7 PRO', 3, 6990000, 30, 2, 2, 3, 12, 'img/sanpham/huawei/y7pro/1.jpg', 'img/sanpham/huawei/y7pro/2.jpg', 'img/sanpham/huawei/y7pro/3.jpg', 'img/sanpham/huawei/y7pro/4.jpg', 'IPS LCD, 6.26\", HD+', '16 MP', '	Chính 13 MP & Phụ 2 MP', 'Thiết kế chắc chắn', 'Tận hưởng màn hình 6.26 inch giọt nước cực lớn\r\n', 'Bộ vi xử lý Qualcomm Snapdragon 450\r\n', 'Điện Thoại Huawei Y7 PRO (2019) thừa hưởng thiết kế màn hình \"giọt nước\" thời thượng và tích hợp camera selfie 16MP mạnh mẽ, tối ưu không gian trải nghiệm cho người dùng. Nhờ thiết kế thông minh của Huawei mà máy dù có màn hình rộng tới 6.26 inch nhưng vẫn cho cảm giác cầm vừa vặn, thoải mái trên tay hay bỏ trong túi.\r\n\r\n', 'Màn hình Huawei Y7 Pro 2019 được thiết kế theo dạng tràn viền giọt nước kiểu mới, cho không gian hiển thị cực lớn nhờ viền siêu mỏng. Bạn sẽ được tận hưởng màn hình lớn tới 6.26 inch cùng độ phân giải HD+ (720 x 1520 Pixels), nội dung hiển thị rõ nét và trải nghiệm xem tuyệt vời. Tấm nền IPS giúp bạn có thể trải nghiệm góc nhìn rộng 178° đem lại hình ảnh sắc nét, sống động và độ tương phản cao ngay cả ở những góc nhìn hẹp.\r\n\r\n', 'Huawei Y7 Pro 2019 trang bị bộ vi xử lý Qualcomm Snapdragon 450 đi cùng 3GB RAM, cho trải nghiệm nhanh và mượt mà ở mọi ứng dụng. Bộ nhớ trong 32GB hỗ trợ thẻ nhớ tối đa 512GB mang tới không gian lưu trữ thoải mái để lưu lại mọi nội dung bạn yêu thích.\r\n\r\n', 'img/sanpham/huawei/y7pro/mota/1.jpg', 'img/sanpham/huawei/y7pro/mota/2.jpg', 'img/sanpham/huawei/y7pro/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Thiết kế chắc chắn</h1><p>Điện Thoại Huawei Y7 PRO (2019) thừa hưởng thiết kế màn hình \"giọt nước\" thời thượng và tích hợp camera selfie 16MP mạnh mẽ, tối ưu không gian trải nghiệm cho người dùng. Nhờ thiết kế thông minh của Huawei mà máy dù có màn hình rộng tới 6.26 inch nhưng vẫn cho cảm giác cầm vừa vặn, thoải mái trên tay hay bỏ trong túi.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/huawei/y7pro/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Tận hưởng màn hình 6.26 inch giọt nước cực lớn\r\n</h1><p>Màn hình Huawei Y7 Pro 2019 được thiết kế theo dạng tràn viền giọt nước kiểu mới, cho không gian hiển thị cực lớn nhờ viền siêu mỏng. Bạn sẽ được tận hưởng màn hình lớn tới 6.26 inch cùng độ phân giải HD+ (720 x 1520 Pixels), nội dung hiển thị rõ nét và trải nghiệm xem tuyệt vời. Tấm nền IPS giúp bạn có thể trải nghiệm góc nhìn rộng 178° đem lại hình ảnh sắc nét, sống động và độ tương phản cao ngay cả ở những góc nhìn hẹp.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/huawei/y7pro/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Bộ vi xử lý Qualcomm Snapdragon 450\r\n</h1><p>Huawei Y7 Pro 2019 trang bị bộ vi xử lý Qualcomm Snapdragon 450 đi cùng 3GB RAM, cho trải nghiệm nhanh và mượt mà ở mọi ứng dụng. Bộ nhớ trong 32GB hỗ trợ thẻ nhớ tối đa 512GB mang tới không gian lưu trữ thoải mái để lưu lại mọi nội dung bạn yêu thích.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/huawei/y7pro/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (5, 'img/sanpham/samsung/a7/2.jpg', 'SAMSUNG GALAXY A7', 1, 3090000, 30, 3, 3, 2, 12, 'img/sanpham/samsung/a7/1.jpg', 'img/sanpham/samsung/a7/2.jpg', 'img/sanpham/samsung/a7/3.jpg', 'img/sanpham/samsung/a7/4.jpg', 'Super AMOLED, 6.0\", Full HD+', '24 MP', '	Chính 24 MP & Phụ 8 MP, 5 MP', 'Thiết kế nguyên khối với mặt kính cao cấp\r\n', 'Màn hình Infinity-U kích thước lớn\r\n', 'Cấu hình ổn định, dung lượng Ram lớn', 'Điện Thoại Samsung Galaxy A70 (128GB/6GB) - Hàng Chính Hãng (Đã Kích Hoạt) Bảo Hành 12 Tháng sản phẩm vẫn được làm bằng chất liệu nhựa giả thủy tinh nhưng là nhựa cao cấp với tên gọi 3D Graffitistic, mang đến sự cứng cáp và chắc chắn khi cầm nắm.\r\n\r\nBên cạnh đó, màu sắc trên lưng máy được trang bị thêm hiệu ứng lấp lánh nên khi nhìn theo góc nghiêng sẽ rất đẹp mắt. Đáng tiếc là A70 vẫn bị bám mồ hôi và dấu vân tay. Ngoài ra, viền bezel của máy cũng được làm rất mỏng, so với các máy thuộc dòng Galaxy A thì A70 là mỏng nhất.', 'Galaxy A70 được trang bị màn hình giọt nước có kích thước lên tới 6.7 inch cùng độ phân giải đạt Full HD+, so với A50 thì màn hình này lớn hơn một chút. Bên cạnh đó, thiết bị vẫn sử dụng tấm nền Super AMOLED mang đến chất lượng hiển thị màu sắc rực rỡ, chân thực, sắc nét.\r\n\r\nNgoài ra, A70 sở hữu cảm biến vân tay quang học trong màn hình nhưng so với A50 thì tốc độ mở khoá không nhanh hơn quá nhiều.\r\n\r\n', 'Galaxy A70 được trang bị cấu hình mạnh mẽ mang đến khả năng đa nhiệm mượt mà, đáp ứng tốt các nhu cầu hàng ngày, kể cả các game nặng\r\n\r\nGalaxy A70 được cung cấp năng lượng bởi con chip Snapdragon 675 mạnh mẽ, kết hợp RAM 6GB / 8GB và ROM 128GB, cùng viên pin có dung lượng lớn lên tới 4,500mAh. Với cấu hình này, A70 mang đến khả năng đa nhiệm mượt mà đồng thời đáp ứng tốt các nhu cầu hàng ngày, kể cả giải trí với các game nặng. Ngoài ra, A70 còn được hỗ trợ công nghệ sạc nhanh 25W, tương đương với Galaxy S10 cao cấp.\r\n\r\nKhi lên kệ, máy được cài sẵn hệ điều hành Android 9.0 Pie với giao diện OneUI 1.1.', 'img/sanpham/samsung/a7/mota/1.jpg', 'img/sanpham/samsung/a7/mota/2.jpg', 'img/sanpham/samsung/a7/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Thiết kế nguyên khối với mặt kính cao cấp\r\n</h1><p>Điện Thoại Samsung Galaxy A70 (128GB/6GB) - Hàng Chính Hãng (Đã Kích Hoạt) Bảo Hành 12 Tháng sản phẩm vẫn được làm bằng chất liệu nhựa giả thủy tinh nhưng là nhựa cao cấp với tên gọi 3D Graffitistic, mang đến sự cứng cáp và chắc chắn khi cầm nắm.\r\n\r\nBên cạnh đó, màu sắc trên lưng máy được trang bị thêm hiệu ứng lấp lánh nên khi nhìn theo góc nghiêng sẽ rất đẹp mắt. Đáng tiếc là A70 vẫn bị bám mồ hôi và dấu vân tay. Ngoài ra, viền bezel của máy cũng được làm rất mỏng, so với các máy thuộc dòng Galaxy A thì A70 là mỏng nhất.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/a7/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Màn hình Infinity-U kích thước lớn\r\n</h1><p>Galaxy A70 được trang bị màn hình giọt nước có kích thước lên tới 6.7 inch cùng độ phân giải đạt Full HD+, so với A50 thì màn hình này lớn hơn một chút. Bên cạnh đó, thiết bị vẫn sử dụng tấm nền Super AMOLED mang đến chất lượng hiển thị màu sắc rực rỡ, chân thực, sắc nét.\r\n\r\nNgoài ra, A70 sở hữu cảm biến vân tay quang học trong màn hình nhưng so với A50 thì tốc độ mở khoá không nhanh hơn quá nhiều.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/a7/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Cấu hình ổn định, dung lượng Ram lớn</h1><p>Galaxy A70 được trang bị cấu hình mạnh mẽ mang đến khả năng đa nhiệm mượt mà, đáp ứng tốt các nhu cầu hàng ngày, kể cả các game nặng\r\n\r\nGalaxy A70 được cung cấp năng lượng bởi con chip Snapdragon 675 mạnh mẽ, kết hợp RAM 6GB / 8GB và ROM 128GB, cùng viên pin có dung lượng lớn lên tới 4,500mAh. Với cấu hình này, A70 mang đến khả năng đa nhiệm mượt mà đồng thời đáp ứng tốt các nhu cầu hàng ngày, kể cả giải trí với các game nặng. Ngoài ra, A70 còn được hỗ trợ công nghệ sạc nhanh 25W, tương đương với Galaxy S10 cao cấp.\r\n\r\nKhi lên kệ, máy được cài sẵn hệ điều hành Android 9.0 Pie với giao diện OneUI 1.1.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/a7/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (6, 'img/sanpham/samsung/a10/2.jpg', 'SAMSUNG GALAXY A10', 1, 3690000, 28, 1, 2, 2, 12, 'img/sanpham/samsung/a10/1.jpg', 'img/sanpham/samsung/a10/2.jpg', 'img/sanpham/samsung/a10/3.jpg', 'img/sanpham/samsung/a10/4.jpg', 'IPS LCD, 6.2\", HD+', '5 MP', '13 MP', 'Thiết kế nguyên khối với mặt kính cao cấp\r\n', 'Máy ảnh độ phân giải cao\r\n', 'Cấu hình ổn định\r\n', 'Điện Thoại Samsung Galaxy A10 - chiếc smartphone rẻ nhất ở dòng A của Samsung vừa được trình làng nhưng sở hữu nhiều đặc điểm ưu việt cùng thiết kế bo tròn với màn hình tràn viền kiểu \"giọt nước\" kiểu mới mà Samsung gọi đó là Infinity-V. Kiểu thiết kế này trông khá dễ thương và cho tỉ lệ hiển thị màn hình được đạt tối đa.\r\n\r\nMàn hình của máy khá lớn 6.2 inch với tấm nền IPS LCD có độ phân giải HD+ mang đến cho bạn những trải nghiệm hình ảnh sắc nét và sinh động nhất là khi xem phim chất lượng cao. ', '\"Cậu út\" trong dòng A của Samsung sử dụng ống kính đơn ở mặt sau có độ phân giải 13 MP chụp hình đẹp mắt với chế độ làm đẹp huyền thoại và có khả năng quay video FullDH 1080.\r\n\r\nỞ mặt trước máy sử dụng ống kính 5 MP có tích hợp Sticker AR chụp hình vui nhộn, bạn có thể tự do tạo một avatar dễ thương để khoe với mọi người mà không cần tải thêm một ứng dụng chụp hình icon nào khác để hỗ trợ. Ngoài ra, những tính năng hấp dẫn như chụp ảnh xóa phông, tự động lấy nét, HDR, Parorama, sẽ đáp ứng được hầu hết các nhu cầu hằng ngày của người dùng.', 'Galaxy A10 được trang bị con chip Exynos 7884 \"cây nhà lá vườn\" của Samsung đủ cho máy cho máy có độ ổn định tốt trong các tác vụ hằng ngày của bạn như lướt web, chơi game nhẹ, xem phim, Dung lượng của máy với 2 GB RAM và 32 GB bộ nhớ trong. Máy có thể mở rộng dung lượng bằng thẻ nhớ MicroSD lên đến 512 GB đáp ứng nhu cầu lưu trữ dữ liệu cá nhân của bạn. \r\n\r\nMột điểm ở Galaxy A10 ghi điểm với người dùng là nó được cài đặt chạy trên hệ điều hành Android 9.0 (Pie) với giao diện One UI giúp tối ưu hóa việc chạy các ứng dụng trên máy cũng như cải thiện việc tiêu tốn năng lượng pin.', 'img/sanpham/samsung/a10/mota/1.png', 'img/sanpham/samsung/a10/mota/2.png', 'img/sanpham/samsung/a10/mota/3.png', 1, '<h1 class=\"font-weight-bold\">Thiết kế nguyên khối với mặt kính cao cấp\r\n</h1><p>Điện Thoại Samsung Galaxy A10 - chiếc smartphone rẻ nhất ở dòng A của Samsung vừa được trình làng nhưng sở hữu nhiều đặc điểm ưu việt cùng thiết kế bo tròn với màn hình tràn viền kiểu \"giọt nước\" kiểu mới mà Samsung gọi đó là Infinity-V. Kiểu thiết kế này trông khá dễ thương và cho tỉ lệ hiển thị màn hình được đạt tối đa.\r\n\r\nMàn hình của máy khá lớn 6.2 inch với tấm nền IPS LCD có độ phân giải HD+ mang đến cho bạn những trải nghiệm hình ảnh sắc nét và sinh động nhất là khi xem phim chất lượng cao. </p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/a10/mota/1.png\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Máy ảnh độ phân giải cao\r\n</h1><p>\"Cậu út\" trong dòng A của Samsung sử dụng ống kính đơn ở mặt sau có độ phân giải 13 MP chụp hình đẹp mắt với chế độ làm đẹp huyền thoại và có khả năng quay video FullDH 1080.\r\n\r\nỞ mặt trước máy sử dụng ống kính 5 MP có tích hợp Sticker AR chụp hình vui nhộn, bạn có thể tự do tạo một avatar dễ thương để khoe với mọi người mà không cần tải thêm một ứng dụng chụp hình icon nào khác để hỗ trợ. Ngoài ra, những tính năng hấp dẫn như chụp ảnh xóa phông, tự động lấy nét, HDR, Parorama, sẽ đáp ứng được hầu hết các nhu cầu hằng ngày của người dùng.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/a10/mota/2.png\"/></br><h1 class=\"font-weight-bold\">Cấu hình ổn định\r\n</h1><p>Galaxy A10 được trang bị con chip Exynos 7884 \"cây nhà lá vườn\" của Samsung đủ cho máy cho máy có độ ổn định tốt trong các tác vụ hằng ngày của bạn như lướt web, chơi game nhẹ, xem phim, Dung lượng của máy với 2 GB RAM và 32 GB bộ nhớ trong. Máy có thể mở rộng dung lượng bằng thẻ nhớ MicroSD lên đến 512 GB đáp ứng nhu cầu lưu trữ dữ liệu cá nhân của bạn. \r\n\r\nMột điểm ở Galaxy A10 ghi điểm với người dùng là nó được cài đặt chạy trên hệ điều hành Android 9.0 (Pie) với giao diện One UI giúp tối ưu hóa việc chạy các ứng dụng trên máy cũng như cải thiện việc tiêu tốn năng lượng pin.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/a10/mota/3.png\"/></div></br>');
INSERT INTO `product` VALUES (7, 'img/sanpham/samsung/a20/2.jpg', 'SAMSUNG GALAXY A20', 1, 4390000, 30, 2, 2, 3, 12, 'img/sanpham/samsung/a20/1.jpg', 'img/sanpham/samsung/a20/2.jpg', 'img/sanpham/samsung/a20/3.jpg', 'img/sanpham/samsung/a20/4.jpg', 'Super AMOLED, 6.4\", HD+', '	8 MP', 'Chính 13 MP & Phụ 5 MP', 'Trang bị các tính năng cao cấp từ các dòng flagship\r\n', 'Màn hình Infinity-U hoàn toàn mới mẻ\r\n', 'Camera kép xóa phông, selfie đẹp\r\n', 'Điện Thoại Samsung Galaxy A20 vừa mới được trình làng tại thị trường Việt Nam. Máy nằm giữa A10 và A30 cả về thông số và mức giá. Đây là chiếc máy rẻ nhất trong dòng Galaxy A của Samsung mang lại cho người dùng những trải nghiệm cao cấp. Samsung Galaxy A20 có thiết kế nguyên khối vuống vắn, các đường góc bo cong mềm mại mang đúng “chất” Samsung.\r\n\r\n', 'Chiếc điện thoại Samsung dòng A mới mang trong mình màn hình có kích thước lên tới 6.4 inch mang lại một không gian rất thoải mái để các bạn chơi game hay xem phim. Nhờ tỉ lệ màn hình 19:9 cùng thiết kế Infinity-U, bạn sẽ có một trải nghiệm khá mới mẻ và thích thú so với các màn hình 18:9 thông thường.\r\n\r\n', 'Samsung Galaxy A20 sở hữu cho mình cụm camera kép ở mặt lưng có độ phân giải lần lượt là chính 13 MP (khẩu độ f/1.9) và ống kính góc siêu rộng 5MP (khẩu độ f/2.2, 123 độ). Điểm mạnh của máy chính là khả năng chụp và lưu ảnh rất nhanh giúp bạn không bị bỏ lỡ bất cứ khoảnh khắc đẹp nào trong cuộc sống. Ngoài ra, những tính năng hấp dẫn như chụp ảnh xóa phông, tự động lấy nét, HDR, Parorama, sẽ đáp ứng được hầu hết các nhu cầu hằng ngày của người dùng.\r\n\r\n', 'img/sanpham/samsung/a20/mota/1.jpg', 'img/sanpham/samsung/a20/mota/2.jpg', 'img/sanpham/samsung/a20/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Trang bị các tính năng cao cấp từ các dòng flagship\r\n</h1><p>Điện Thoại Samsung Galaxy A20 vừa mới được trình làng tại thị trường Việt Nam. Máy nằm giữa A10 và A30 cả về thông số và mức giá. Đây là chiếc máy rẻ nhất trong dòng Galaxy A của Samsung mang lại cho người dùng những trải nghiệm cao cấp. Samsung Galaxy A20 có thiết kế nguyên khối vuống vắn, các đường góc bo cong mềm mại mang đúng “chất” Samsung.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/a20/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Màn hình Infinity-U hoàn toàn mới mẻ\r\n</h1><p>Chiếc điện thoại Samsung dòng A mới mang trong mình màn hình có kích thước lên tới 6.4 inch mang lại một không gian rất thoải mái để các bạn chơi game hay xem phim. Nhờ tỉ lệ màn hình 19:9 cùng thiết kế Infinity-U, bạn sẽ có một trải nghiệm khá mới mẻ và thích thú so với các màn hình 18:9 thông thường.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/a20/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Camera kép xóa phông, selfie đẹp\r\n</h1><p>Samsung Galaxy A20 sở hữu cho mình cụm camera kép ở mặt lưng có độ phân giải lần lượt là chính 13 MP (khẩu độ f/1.9) và ống kính góc siêu rộng 5MP (khẩu độ f/2.2, 123 độ). Điểm mạnh của máy chính là khả năng chụp và lưu ảnh rất nhanh giúp bạn không bị bỏ lỡ bất cứ khoảnh khắc đẹp nào trong cuộc sống. Ngoài ra, những tính năng hấp dẫn như chụp ảnh xóa phông, tự động lấy nét, HDR, Parorama, sẽ đáp ứng được hầu hết các nhu cầu hằng ngày của người dùng.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/a20/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (8, 'img/sanpham/samsung/a30/2.jpg', 'SAMSUNG GALAXY A30', 1, 6290000, 30, 3, 3, 3, 12, 'img/sanpham/samsung/a30/1.jpg', 'img/sanpham/samsung/a30/2.jpg', 'img/sanpham/samsung/a30/3.jpg', 'img/sanpham/samsung/a30/4.jpg', 'Super AMOLED, 6.4\", Full HD+', '16 MP', '	Chính 16 MP & Phụ 5 MP', 'Trang bị các tính năng cao cấp từ các dòng flagship\r\n', 'Cụm camera kép góc rộng\r\n', 'Mở khóa vân tay mặt sau\r\n', 'Có thể bạn sẽ bất ngờ bởi chiếc điện thoại Samsung Galaxy A30 (32GB/3GB) mới sở hữu cho mình màn hình có kích thước lên tới 6.4 inch, tương đương với màn hình của chiếc Samsung Galaxy S10+.\r\n\r\n', 'Bộ đôi camera kép ở mặt sau của máy có độ phân giải chính 16 MP và phụ 5 MP, trong đó ống kính phụ góc rộng là 5 MP cho phép chụp ảnh được bao quát và lạ mắt hơn.\r\n\r\n', 'Samsung đã chuyển cảm biến vân tay của mình ra mặt sau của máy và đặt nó khá vừa tầm tay khi cầm, để người dùng có thể mở khóa nhanh, đây là một sự thay đổi hợp lí.\r\n\r\n', 'img/sanpham/samsung/a30/mota/1.jpg', 'img/sanpham/samsung/a30/mota/2.jpg', 'img/sanpham/samsung/a30/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Trang bị các tính năng cao cấp từ các dòng flagship\r\n</h1><p>Có thể bạn sẽ bất ngờ bởi chiếc điện thoại Samsung Galaxy A30 (32GB/3GB) mới sở hữu cho mình màn hình có kích thước lên tới 6.4 inch, tương đương với màn hình của chiếc Samsung Galaxy S10+.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/a30/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Cụm camera kép góc rộng\r\n</h1><p>Bộ đôi camera kép ở mặt sau của máy có độ phân giải chính 16 MP và phụ 5 MP, trong đó ống kính phụ góc rộng là 5 MP cho phép chụp ảnh được bao quát và lạ mắt hơn.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/a30/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Mở khóa vân tay mặt sau\r\n</h1><p>Samsung đã chuyển cảm biến vân tay của mình ra mặt sau của máy và đặt nó khá vừa tầm tay khi cầm, để người dùng có thể mở khóa nhanh, đây là một sự thay đổi hợp lí.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/a30/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (9, 'img/sanpham/xiaomi/mi9lite/2.jpg', 'XIAOMI MI9 LITE', 2, 9990000, 30, 4, 3, 3, 12, 'img/sanpham/xiaomi/mi9lite/1.jpg', 'img/sanpham/xiaomi/mi9lite/2.jpg', 'img/sanpham/xiaomi/mi9lite/3.jpg', 'img/sanpham/xiaomi/mi9lite/4.jpg', 'Super AMOLED, 6.39\", Full HD+', '32 MP', 'Chính 48 MP & Phụ 8 MP, 2 MP', 'Tổng quan sản phẩm\r\n', 'Màn hình OLED 6.39 inch\r\n', 'Bộ vi xử lý Qualcomm Snapdragon 710\r\n', 'Điện Thoại Xiaomi Mi 9 Lite có thiết kế tinh tế, cao cấp và sang trọng đến từng đường nét khi được chế tác từ kính gradient như người anh em Mi 8 Lite. Phần lưng kính cong cho trải nghiệm cầm nắm chắc chắn và đầy phong cách. Đồng thời, phần khung kim loại chắc chắn giúp chúng ta có được một chiếc điện thoại bền vững, yên tâm hơn khi sử dụng.\r\n\r\n', 'Xiaomi Mi 9 Lite có màn hình kích thước 6,39 inch khá lớn so với sản phẩm tiền nhiệm. Đây là tấm nền OLED với một notch giọt nước nhỏ ở chính giữa và độ phân giải Full HD +. Theo Xiaomi, màn hình này đạt được độ sáng tối đa 600 nits và tỷ lệ tương phản 6.000: 1. Để bảo vệ màn hình, Xiaomi Mi 9 Lite được trang bị kính cường lực Gorilla Glass 5 chống trầy xước và va đập.\r\n\r\n', 'Bên trong, Xiaomi Mi 9 Lite được trang bị bộ xử lý Qualcomm Snapdragon 710 với GPU Adreno 616, đi kèm với RAM 6GB và dung lượng lưu trữ 64 hoặc 128GB (bộ nhớ UFS 2.1). Đó là một phần cứng giúp người dùng có được hiệu suất rất tốt trong mọi tình huống trong khi vẫn duy trì mức tiêu thụ năng lượng khá thấp.\r\n\r\n', 'img/sanpham/xiaomi/mi9lite/mota/1.jpg', 'img/sanpham/xiaomi/mi9lite/mota/2.jpg', 'img/sanpham/xiaomi/mi9lite/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Tổng quan sản phẩm\r\n</h1><p>Điện Thoại Xiaomi Mi 9 Lite có thiết kế tinh tế, cao cấp và sang trọng đến từng đường nét khi được chế tác từ kính gradient như người anh em Mi 8 Lite. Phần lưng kính cong cho trải nghiệm cầm nắm chắc chắn và đầy phong cách. Đồng thời, phần khung kim loại chắc chắn giúp chúng ta có được một chiếc điện thoại bền vững, yên tâm hơn khi sử dụng.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/xiaomi/mi9lite/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Màn hình OLED 6.39 inch\r\n</h1><p>Xiaomi Mi 9 Lite có màn hình kích thước 6,39 inch khá lớn so với sản phẩm tiền nhiệm. Đây là tấm nền OLED với một notch giọt nước nhỏ ở chính giữa và độ phân giải Full HD +. Theo Xiaomi, màn hình này đạt được độ sáng tối đa 600 nits và tỷ lệ tương phản 6.000: 1. Để bảo vệ màn hình, Xiaomi Mi 9 Lite được trang bị kính cường lực Gorilla Glass 5 chống trầy xước và va đập.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/xiaomi/mi9lite/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Bộ vi xử lý Qualcomm Snapdragon 710\r\n</h1><p>Bên trong, Xiaomi Mi 9 Lite được trang bị bộ xử lý Qualcomm Snapdragon 710 với GPU Adreno 616, đi kèm với RAM 6GB và dung lượng lưu trữ 64 hoặc 128GB (bộ nhớ UFS 2.1). Đó là một phần cứng giúp người dùng có được hiệu suất rất tốt trong mọi tình huống trong khi vẫn duy trì mức tiêu thụ năng lượng khá thấp.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/xiaomi/mi9lite/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (10, 'img/sanpham/xiaomi/mi9t/2.jpg', 'XIAOMI M9T', 2, 8490000, 30, 4, 3, 3, 12, 'img/sanpham/xiaomi/mi9t/1.jpg', 'img/sanpham/xiaomi/mi9t/2.jpg', 'img/sanpham/xiaomi/mi9t/3.jpg', 'img/sanpham/xiaomi/mi9t/4.jpg', 'AMOLED, 6.39\", Full HD+', '20 MP', 'Chính 48 MP & Phụ 13 MP, 8 MP', 'Tổng quan sản phẩm\r\n', 'Màn hình tràn viền với 91.9% diện tích mặt trước\r\n', 'Con chip Snapdragon 730 mạnh mẽ nhất\r\n', 'Điện Thoại Xiaomi Mi 9T mang một phong cách độc đáo đầy mê hoặc. Chỉ cần ánh sáng chiếu vào, bạn sẽ thấy các họa tiết trên mặt lưng lấp lánh rất thú vị. Hơn thế nữa, mỗi màu sắc của Xiaomi Mi 9T 64GB đều mang sắc thái riêng. Bạn có thể lựa chọn màu đỏ hoặc xanh năng động, hiện đại. Ngoài ra còn có phiên bản màu đen carbon cổ điển thể hiện sự đứng đắn, từng trải. Với thiết kế cong 3D, Xiaomi Mi 9T nằm gọn trong lòng bàn tay một cách mượt mà.\r\n\r\n', 'Với camera trước dạng pop-up, Xiaomi Mi 9T 64GB sở hữu màn hình tràn viền đúng nghĩa, không hề có bất cứ điểm khuyết nào ảnh hưởng đến trải nghiệm xem của bạn. Bạn sẽ được tận hưởng những nội dung tuyệt vời trên màn hình 6,39 inch AMOLED tràn viền cả 4 cạnh, chiếm tới 91.9% diện tích mặt trước. Màn hình sáng đẹp rực rỡ và tràn viền hoàn hảo, Xiaomi Mi 9T mang tới trải nghiệm thực sự khác biệt khi xem phim hay chơi game.\r\n\r\n', 'Được trang bị bộ vi xử lý Snapdragon 730, con chip mới và mạnh mẽ hàng đầu hiện nay, Xiaomi Mi 9T 64GB có hiệu năng đáp ứng hoàn hảo mọi yêu cầu của bạn. Snapdragon 730 sản xuất trên tiến trình 8nm, mạnh hơn tới 35% và tiết kiệm điện hơn 10%. Ngoài ra bạn còn có GPU đồ họa Adreno 618 và tính năng Dual Turbo, cho trải nghiệm game tuyệt vời. Tha hồ “chiến” những game nặng và luôn luôn mượt mà, hãy yên tâm về Xiaomi Mi 9T.\r\n\r\n', 'img/sanpham/xiaomi/mi9t/mota/1.jpg', 'img/sanpham/xiaomi/mi9lite/mota/2.jpg', 'img/sanpham/xiaomi/mi9lite/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Tổng quan sản phẩm\r\n</h1><p>Điện Thoại Xiaomi Mi 9T mang một phong cách độc đáo đầy mê hoặc. Chỉ cần ánh sáng chiếu vào, bạn sẽ thấy các họa tiết trên mặt lưng lấp lánh rất thú vị. Hơn thế nữa, mỗi màu sắc của Xiaomi Mi 9T 64GB đều mang sắc thái riêng. Bạn có thể lựa chọn màu đỏ hoặc xanh năng động, hiện đại. Ngoài ra còn có phiên bản màu đen carbon cổ điển thể hiện sự đứng đắn, từng trải. Với thiết kế cong 3D, Xiaomi Mi 9T nằm gọn trong lòng bàn tay một cách mượt mà.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/xiaomi/mi9t/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Màn hình tràn viền với 91.9% diện tích mặt trước\r\n</h1><p>Với camera trước dạng pop-up, Xiaomi Mi 9T 64GB sở hữu màn hình tràn viền đúng nghĩa, không hề có bất cứ điểm khuyết nào ảnh hưởng đến trải nghiệm xem của bạn. Bạn sẽ được tận hưởng những nội dung tuyệt vời trên màn hình 6,39 inch AMOLED tràn viền cả 4 cạnh, chiếm tới 91.9% diện tích mặt trước. Màn hình sáng đẹp rực rỡ và tràn viền hoàn hảo, Xiaomi Mi 9T mang tới trải nghiệm thực sự khác biệt khi xem phim hay chơi game.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/xiaomi/mi9lite/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Con chip Snapdragon 730 mạnh mẽ nhất\r\n</h1><p>Được trang bị bộ vi xử lý Snapdragon 730, con chip mới và mạnh mẽ hàng đầu hiện nay, Xiaomi Mi 9T 64GB có hiệu năng đáp ứng hoàn hảo mọi yêu cầu của bạn. Snapdragon 730 sản xuất trên tiến trình 8nm, mạnh hơn tới 35% và tiết kiệm điện hơn 10%. Ngoài ra bạn còn có GPU đồ họa Adreno 618 và tính năng Dual Turbo, cho trải nghiệm game tuyệt vời. Tha hồ “chiến” những game nặng và luôn luôn mượt mà, hãy yên tâm về Xiaomi Mi 9T.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/xiaomi/mi9lite/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (11, 'img/sanpham/xiaomi/mi8lite/2.jpg', 'XIAOMI MI8 LITE', 2, 3690000, 30, 3, 3, 3, 12, 'img/sanpham/xiaomi/mi8lite/1.jpg', 'img/sanpham/xiaomi/mi8lite/2.jpg', 'img/sanpham/xiaomi/mi8lite/3.jpg', 'img/sanpham/xiaomi/mi8lite/4.jpg', '6.26 inch IPS LCD', '24MP', '16 MP và 5 MP (2 camera)', 'Thiết kế màn hình Infinity-V\r\n', 'Thiết kế cực kỳ độc đáo\r\n', 'Màn hình 6.26 inch Full HD+\r\n', 'Điện Thoại Xiaomi Mi 8 Lite được Xiaomi trình làng trong sự kiện vào ngày 19.9 tại thành phố Thành Đô, Trung Quốc. Đây được xem là phiên bản rút gọn cấu hình và tùy chỉnh một chút thiết kế so với flagship Mi 8 hứa hẹn mang đến những trải nghiệm ấn tượng cho người dùng.\r\n\r\n', ' Mi 8 Lite có mặt lưng được làm bằng thủy tinh với hiệu ứng màu gradient cực kì độc đáo và đẹp mắt, áp dụng quy trình mạ nano nhúng gương tương tự như Huawei P20, mang lại vẻ ngoài cao cấp và sang trọng hơn. Xiaomi còn mạnh dạn so sánh Mi 8 Lite với iPhone XR và điện thoại của Xiaomi có khung máy mỏng hơn, viền bezel mỏng hơn và phần tai thỏ ở phía trên cũng nhỏ hơn.\r\n\r\n ', 'Mi 8 Lite có màn hình 6.26 inch Full HD+ (2.560 x 1.080 pixel), tỉ lệ khung hình 19:9 mang đến những hình ảnh sắc nét vô cùng sống động  nâng cao chất lượng hình ảnh, video giúp bạn thưởng thức những hình ảnh, thước phim chân thực nhất.\r\n\r\n', 'img/sanpham/xiaomi/mi8lite/mota/1.jpg', 'img/sanpham/xiaomi/mi8lite/mota/2.jpg', 'img/sanpham/xiaomi/mi8lite/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Thiết kế màn hình Infinity-V\r\n</h1><p>Điện Thoại Xiaomi Mi 8 Lite được Xiaomi trình làng trong sự kiện vào ngày 19.9 tại thành phố Thành Đô, Trung Quốc. Đây được xem là phiên bản rút gọn cấu hình và tùy chỉnh một chút thiết kế so với flagship Mi 8 hứa hẹn mang đến những trải nghiệm ấn tượng cho người dùng.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/xiaomi/mi8lite/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Thiết kế cực kỳ độc đáo\r\n</h1><p> Mi 8 Lite có mặt lưng được làm bằng thủy tinh với hiệu ứng màu gradient cực kì độc đáo và đẹp mắt, áp dụng quy trình mạ nano nhúng gương tương tự như Huawei P20, mang lại vẻ ngoài cao cấp và sang trọng hơn. Xiaomi còn mạnh dạn so sánh Mi 8 Lite với iPhone XR và điện thoại của Xiaomi có khung máy mỏng hơn, viền bezel mỏng hơn và phần tai thỏ ở phía trên cũng nhỏ hơn.\r\n\r\n </p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/xiaomi/mi8lite/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Màn hình 6.26 inch Full HD+\r\n</h1><p>Mi 8 Lite có màn hình 6.26 inch Full HD+ (2.560 x 1.080 pixel), tỉ lệ khung hình 19:9 mang đến những hình ảnh sắc nét vô cùng sống động  nâng cao chất lượng hình ảnh, video giúp bạn thưởng thức những hình ảnh, thước phim chân thực nhất.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/xiaomi/mi8lite/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (12, 'img/sanpham/xiaomi/mia3/2.jpg', 'XIAOMI MIA3', 2, 4990000, 30, 3, 3, 3, 12, 'img/sanpham/xiaomi/mia3/1.jpg', 'img/sanpham/xiaomi/mia3/2.jpg', 'img/sanpham/xiaomi/mia3/3.jpg', 'img/sanpham/xiaomi/mia3/4.jpg', 'AMOLED, 6.01\", HD+', '32 MP', 'Chính 48 MP & Phụ 8 MP, 2 MP', 'Thiết kế màn hình Infinity-V\r\n', 'Vi xử lý mới siêu mạnh mẽ và tiết kiệm điện\r\n', 'Cảm biến vân tay trong màn hình\r\n', 'Điện Thoại Xiaomi Mi A3 sử dụng tới 3 camera sau, trong đó cảm biến camera chính đến từ Sony có độ phân giải lên tới 48MP có độ phân giải lên đến 48MP, cao gấp 4 lần so với 12MP của smartphone thông thường. Bạn có thể chụp ảnh và phóng to để xem rõ hơn từng chi tiết mà mọi thứ vẫn rất sắc nét kể cả trong đêm tối. Camera góc siêu rộng mang đến những góc nhìn thực sự khác biệt, thu gọn khung cảnh rộng lớn vào trong một khung hình duy nhất.\r\n\r\n', 'Sức mạnh của Xiaomi Mi A3 đến từ bộ vi xử lý Snapdragon 665 sản xuất trên tiến trình mới 11nm, mạnh mẽ hơn nhưng cũng tiết kiệm điện năng hơn. Với 8 nhân Kryo 260 CPU cùng GPU Adreno 610, Xiaomi Mi A3 đủ sức chạy mượt mà mọi ứng dụng và chơi tốt tất cả những tựa game bạn yêu thích.\r\n\r\n', 'Sử dụng công nghệ cảm biến vân tay dưới màn hình tiên tiến, điện thoại nhận diện chính xác và mở khóa ngay lập tức khi bạn chạm tay vào khu vực cảm biến. Cảm biến vân tay trong màn hình giúp cho thiết kế máy hoàn toàn liền lạc vì không phải mất vị trí cho cảm biến, đồng thời nằm ngay trên màn hình mặt trước thao tác vô cùng tiện lợi. Tất nhiên Mi A3 cũng đi kèm nhận diện khuôn mặt AI để bạn có thể mở khóa theo bất cứ cách nào.\r\n\r\n', 'img/sanpham/xiaomi/mia3/mota/1.jpg', 'img/sanpham/xiaomi/mia3/mota/2.jpg', 'img/sanpham/xiaomi/mia3/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Thiết kế màn hình Infinity-V\r\n</h1><p>Điện Thoại Xiaomi Mi A3 sử dụng tới 3 camera sau, trong đó cảm biến camera chính đến từ Sony có độ phân giải lên tới 48MP có độ phân giải lên đến 48MP, cao gấp 4 lần so với 12MP của smartphone thông thường. Bạn có thể chụp ảnh và phóng to để xem rõ hơn từng chi tiết mà mọi thứ vẫn rất sắc nét kể cả trong đêm tối. Camera góc siêu rộng mang đến những góc nhìn thực sự khác biệt, thu gọn khung cảnh rộng lớn vào trong một khung hình duy nhất.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/xiaomi/mia3/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Vi xử lý mới siêu mạnh mẽ và tiết kiệm điện\r\n</h1><p>Sức mạnh của Xiaomi Mi A3 đến từ bộ vi xử lý Snapdragon 665 sản xuất trên tiến trình mới 11nm, mạnh mẽ hơn nhưng cũng tiết kiệm điện năng hơn. Với 8 nhân Kryo 260 CPU cùng GPU Adreno 610, Xiaomi Mi A3 đủ sức chạy mượt mà mọi ứng dụng và chơi tốt tất cả những tựa game bạn yêu thích.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/xiaomi/mia3/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Cảm biến vân tay trong màn hình\r\n</h1><p>Sử dụng công nghệ cảm biến vân tay dưới màn hình tiên tiến, điện thoại nhận diện chính xác và mở khóa ngay lập tức khi bạn chạm tay vào khu vực cảm biến. Cảm biến vân tay trong màn hình giúp cho thiết kế máy hoàn toàn liền lạc vì không phải mất vị trí cho cảm biến, đồng thời nằm ngay trên màn hình mặt trước thao tác vô cùng tiện lợi. Tất nhiên Mi A3 cũng đi kèm nhận diện khuôn mặt AI để bạn có thể mở khóa theo bất cứ cách nào.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/xiaomi/mia3/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (13, 'img/sanpham/realme/3pro/2.jpg', 'REALME 3 PRO', 4, 4990000, 30, 3, 3, 3, 12, 'img/sanpham/realme/3pro/1.jpg', 'img/sanpham/realme/3pro/2.jpg', 'img/sanpham/realme/3pro/3.jpg', 'img/sanpham/realme/3pro/4.jpg', 'IPS LCD, 6.3\", Full HD+', '	25 MP', 'Chính 16 MP & Phụ 5 MP', 'Thiết kế đơn giản và tinh tế\r\n', 'Hiệu năng cải tiến mạnh mẽ\r\n', 'Camera selfie chất lượng\r\n', 'Điện Thoại Realme 3 Pro (128GB/6GB) có thiết kế ấn tượng, không thua kém các smartphone cao cấp và đắt tiền nào. Máy sở hữu mặt lưng với khả năng thay đổi màu sắc rất độc đáo, người dùng sẽ có các màu sắc khác nhau tùy vào góc nghiêng khác nhau rất thích mắt. Với kích thước nhỏ gọn và trọng lượng nhẹ, chiếc điện thoại cho phép bạn dễ dàng mang theo bất cứ đâu.\r\n\r\n', 'Hiệu năng của Realme 3 Pro đã được cải tiến khá đáng kể với con chip vi xử lý Snapdragon 710 8 nhân 64-bit. Ưu điểm của con chip này là khả năng tiết kiệm năng lượng hơn 30% so với Snapdragon 660 trang bị trên thế hệ cũ. Mức RAM của máy lên đến 6 GB cùng bộ nhớ trong 128GB cho bạn thoải mái lưu trữ được nhiều dữ liệu và hình ảnh. Trải nghiệm thực tế cho thấy, Realme 3 Pro hoàn toàn có thể xử lý mượt mà và trơn tru mọi tác vụ cơ bản như duyệt web, xem phim độ phân giải cao hay chỉnh sửa ảnh.\r\n\r\n', 'Camera luôn là điểm mạnh của các sản phẩm Realme và trên Realme 3 Pro thì hãng tiếp tục duy trì lợi thế này của mình. Camera trước độ phân giải 25 MP với tính năng làm đẹp bằng AI hứa hẹn sẽ làm hài lòng ngay cả những người dùng khó tính nhất.\r\n\r\n', 'img/sanpham/realme/3pro/mota/1.gif', 'img/sanpham/realme/3pro/mota/2.jpg', 'img/sanpham/realme/3pro/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Thiết kế đơn giản và tinh tế\r\n</h1><p>Điện Thoại Realme 3 Pro (128GB/6GB) có thiết kế ấn tượng, không thua kém các smartphone cao cấp và đắt tiền nào. Máy sở hữu mặt lưng với khả năng thay đổi màu sắc rất độc đáo, người dùng sẽ có các màu sắc khác nhau tùy vào góc nghiêng khác nhau rất thích mắt. Với kích thước nhỏ gọn và trọng lượng nhẹ, chiếc điện thoại cho phép bạn dễ dàng mang theo bất cứ đâu.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/realme/3pro/mota/1.gif\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Hiệu năng cải tiến mạnh mẽ\r\n</h1><p>Hiệu năng của Realme 3 Pro đã được cải tiến khá đáng kể với con chip vi xử lý Snapdragon 710 8 nhân 64-bit. Ưu điểm của con chip này là khả năng tiết kiệm năng lượng hơn 30% so với Snapdragon 660 trang bị trên thế hệ cũ. Mức RAM của máy lên đến 6 GB cùng bộ nhớ trong 128GB cho bạn thoải mái lưu trữ được nhiều dữ liệu và hình ảnh. Trải nghiệm thực tế cho thấy, Realme 3 Pro hoàn toàn có thể xử lý mượt mà và trơn tru mọi tác vụ cơ bản như duyệt web, xem phim độ phân giải cao hay chỉnh sửa ảnh.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/realme/3pro/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Camera selfie chất lượng\r\n</h1><p>Camera luôn là điểm mạnh của các sản phẩm Realme và trên Realme 3 Pro thì hãng tiếp tục duy trì lợi thế này của mình. Camera trước độ phân giải 25 MP với tính năng làm đẹp bằng AI hứa hẹn sẽ làm hài lòng ngay cả những người dùng khó tính nhất.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/realme/3pro/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (14, 'img/sanpham/realme/c2/2.jpg', 'REALME C2', 4, 2990000, 30, 2, 2, 3, 12, 'img/sanpham/realme/c2/1.jpg', 'img/sanpham/realme/c2/2.jpg', 'img/sanpham/realme/c2/3.jpg', 'img/sanpham/realme/c2/4.jpg', 'IPS LCD, 6.1\", HD+', '5 MP', 'Chính 13 MP & Phụ 2 MP', 'Thiết kế đơn giản và tinh tế\r\n', 'Camera kép AI thế hệ mới\r\n', 'Pin dung lượng cao 4000 mAh\r\n', 'Điện Thoại Realme C2 (2GB/16GB) sở hữu màn hình tràn viền dạng “giọt nước” thời thượng, màn hình lớn 6,1 inch tỉ lệ 19.5:9 chuẩn điện ảnh. Việc viền màn hình được thu lại cực mỏng giúp màn hình chiếm tới 89,35% diện tích hiển thị mặt trước, mang lại không gian màn hình rộng lớn nhưng vẫn đảm bảo máy nhỏ gọn. Những đoạn video được xem trên Realme C2 sẽ thú vị hơn bao giờ hết với màn hình lớn, sống động dạng tràn viền cực đã.\r\n\r\n', 'Với cụm camera kép mặt sau, Realme C2 hỗ trợ trí tuệ nhân tạo AI, camera chính 13MP và camera phụ 2MP đo độ sâu trường ảnh, giúp bạn dễ dàng chụp được những bức ảnh chân dung xóa phông, làm mờ hậu cảnh đầy kỳ ảo. Khả năng quay video cũng không kém phần ấn tượng khi Realme C2 có thể quay video độ phân giải Full HD và những đoạn video chuyển động chậm slow-motion rất nghệ thuật.\r\n\r\n', 'Với viên pin dung lượng cao 4000 mAh và bộ vi xử lý sản xuất trên tiến trình 12nm tiết kiệm năng lượng, Realme C2 cho phép bạn sử dụng thoải mái trong suốt cả ngày dài mà không lo hết pin. Tha hồ làm những điều mình thích, từ nghe nhạc, xem Youtube, nhắn tin cho bạn bè cho đến chơi game, chụp ảnh. Điện thoại vẫn luôn đồng hành bên bạn.\r\n\r\n', 'img/sanpham/realme/c2/mota/1.jpg', 'img/sanpham/realme/c2/mota/2.jpg', 'img/sanpham/realme/c2/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Thiết kế đơn giản và tinh tế\r\n</h1><p>Điện Thoại Realme C2 (2GB/16GB) sở hữu màn hình tràn viền dạng “giọt nước” thời thượng, màn hình lớn 6,1 inch tỉ lệ 19.5:9 chuẩn điện ảnh. Việc viền màn hình được thu lại cực mỏng giúp màn hình chiếm tới 89,35% diện tích hiển thị mặt trước, mang lại không gian màn hình rộng lớn nhưng vẫn đảm bảo máy nhỏ gọn. Những đoạn video được xem trên Realme C2 sẽ thú vị hơn bao giờ hết với màn hình lớn, sống động dạng tràn viền cực đã.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/realme/c2/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Camera kép AI thế hệ mới\r\n</h1><p>Với cụm camera kép mặt sau, Realme C2 hỗ trợ trí tuệ nhân tạo AI, camera chính 13MP và camera phụ 2MP đo độ sâu trường ảnh, giúp bạn dễ dàng chụp được những bức ảnh chân dung xóa phông, làm mờ hậu cảnh đầy kỳ ảo. Khả năng quay video cũng không kém phần ấn tượng khi Realme C2 có thể quay video độ phân giải Full HD và những đoạn video chuyển động chậm slow-motion rất nghệ thuật.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/realme/c2/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Pin dung lượng cao 4000 mAh\r\n</h1><p>Với viên pin dung lượng cao 4000 mAh và bộ vi xử lý sản xuất trên tiến trình 12nm tiết kiệm năng lượng, Realme C2 cho phép bạn sử dụng thoải mái trong suốt cả ngày dài mà không lo hết pin. Tha hồ làm những điều mình thích, từ nghe nhạc, xem Youtube, nhắn tin cho bạn bè cho đến chơi game, chụp ảnh. Điện thoại vẫn luôn đồng hành bên bạn.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/realme/c2/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (15, 'img/sanpham/realme/3/2.jpg', 'REALME 3', 4, 6990000, 30, 3, 3, 4, 12, 'img/sanpham/realme/3/1.jpg', 'img/sanpham/realme/3/2.jpg', 'img/sanpham/realme/3/3.jpg', 'img/sanpham/realme/3/4.jpg', '	IPS LCD, 6.22\", HD+', '13 MP', 'Chính 13 MP & Phụ 2 MP', 'Màn hình lớn tương đương Galaxy S10+\r\n', 'Màn hình giọt nước tràn viền\r\n', 'Hiệu năng vượt trội\r\n', 'Điện Thoại Realme 3 có thiết kế nguyên khối kim loại chắc chắn, bốn góc bo tròn nhẹ nhàng. Cùng với đó là mặt lưng với hiệu ứng đổi màu gradient sắc sảo và tinh tế. Viền màn hình mỏng khiến chiếc điện thoại càng gọn gàng, cầm chắc tay, cho bạn dễ dàng mang theo bất cứ nơi đâu.\r\n\r\nĐiện Thoại Realme 3 có thiết kế nguyên khối kim loại chắc chắn, bốn góc bo tròn nhẹ nhàng. Cùng với đó là mặt lưng với hiệu ứng đổi màu gradient sắc sảo và tinh tế. Viền màn hình mỏng khiến chiếc điện thoại càng gọn gàng, cầm chắc tay, cho bạn dễ dàng mang theo bất cứ nơi đâu.\r\n\r\n', 'Realme 3 sở hữu màn hình kích thước lớn tới 6.22 inch được thiết kế kiểu màn hình giọt nước viền siêu mỏng tiên tiến, mang đến trải nghiệm xem tuyệt vời. Mọi thứ đều được hiển thị lớn hơn, đẹp hơn, dễ dàng cho bạn các thông tin trực quan và giải trí hấp dẫn. Nhờ viền mỏng nên dù màn hình lớn thì Realme 3 vẫn đủ gọn gàng trong bàn tay bạn.\r\n\r\n', 'Về thông số cấu hình, Realme 3 dùng vi xử lý MediaTek Helio P60 8 nhân 64-bit, card đồ họa Adreno 506 mạnh mẽ cùng bộ nhớ RAM 3GB, cho tốc độ xử lý ổn định khi bạn lướt web, giải trí, xem phim. Bên cạnh đó, với bộ nhớ trong 32GB cùng khe cắm thẻ nhớ ngoài tối đa lên đến 256GB, chiếc điện thoại giúp người dùng lưu trữ dữ liệu cũng như hình ảnh, video một cách thoải mái. \r\n\r\n', 'img/sanpham/realme/3/mota/1.jpg', 'img/sanpham/realme/3/mota/2.jpg', 'img/sanpham/realme/3/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Màn hình lớn tương đương Galaxy S10+\r\n</h1><p>Điện Thoại Realme 3 có thiết kế nguyên khối kim loại chắc chắn, bốn góc bo tròn nhẹ nhàng. Cùng với đó là mặt lưng với hiệu ứng đổi màu gradient sắc sảo và tinh tế. Viền màn hình mỏng khiến chiếc điện thoại càng gọn gàng, cầm chắc tay, cho bạn dễ dàng mang theo bất cứ nơi đâu.\r\n\r\nĐiện Thoại Realme 3 có thiết kế nguyên khối kim loại chắc chắn, bốn góc bo tròn nhẹ nhàng. Cùng với đó là mặt lưng với hiệu ứng đổi màu gradient sắc sảo và tinh tế. Viền màn hình mỏng khiến chiếc điện thoại càng gọn gàng, cầm chắc tay, cho bạn dễ dàng mang theo bất cứ nơi đâu.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/realme/3/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Màn hình giọt nước tràn viền\r\n</h1><p>Realme 3 sở hữu màn hình kích thước lớn tới 6.22 inch được thiết kế kiểu màn hình giọt nước viền siêu mỏng tiên tiến, mang đến trải nghiệm xem tuyệt vời. Mọi thứ đều được hiển thị lớn hơn, đẹp hơn, dễ dàng cho bạn các thông tin trực quan và giải trí hấp dẫn. Nhờ viền mỏng nên dù màn hình lớn thì Realme 3 vẫn đủ gọn gàng trong bàn tay bạn.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/realme/3/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Hiệu năng vượt trội\r\n</h1><p>Về thông số cấu hình, Realme 3 dùng vi xử lý MediaTek Helio P60 8 nhân 64-bit, card đồ họa Adreno 506 mạnh mẽ cùng bộ nhớ RAM 3GB, cho tốc độ xử lý ổn định khi bạn lướt web, giải trí, xem phim. Bên cạnh đó, với bộ nhớ trong 32GB cùng khe cắm thẻ nhớ ngoài tối đa lên đến 256GB, chiếc điện thoại giúp người dùng lưu trữ dữ liệu cũng như hình ảnh, video một cách thoải mái. \r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/realme/3/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (16, 'img/sanpham/realme/2pro/2.jpg', 'REALME 2 PRO', 4, 3290000, 30, 3, 3, 2, 12, 'img/sanpham/realme/2pro/1.jpg', 'img/sanpham/realme/2pro/2.jpg', 'img/sanpham/realme/2pro/3.jpg', 'img/sanpham/realme/2pro/4.jpg', 'IPS LCD, 6.3\", Full HD+', '16 MP', 'Chính 16 MP & Phụ 2 MP', 'Màn hình lớn tương đương Galaxy S10+\r\n', 'Màn hình giọt nước bắt mắt\r\n', 'Hiệu năng mạnh mẽ\r\n', 'Điện Thoại Realme 2 Pro có thiết kế nguyên khối kim loại chắc chắn, bốn góc bo tròn nhẹ nhàng. Mặt lưng máy được chế tác tinh xảo từ 15 lớp để màu sắc có hiệu ứng bóng bẩy bắt mắt. Cả 2 màu sắc của điện thoại đều rất tinh tế, đẹp nhẹ nhàng và sang trọng. Công nghệ ép lớp còn giúp mặt lưng Realme 2 Pro chắc chắn và mượt mà hơn trên bàn tay người dùng.\r\n\r\n', 'Realme 2 Pro sở hữu màn hình kích thước lớn tới 6.3 inch với độ phân giải Full HD+ (1080 x 2340 Pixels), được thiết kế dạng giọt nước đúng theo xu hướng của các smartphone mới nhất hiện nay. Toàn bộ camera trước, đèn thông báo, cảm biến, tai nghe thoại đều được đặt gọn gàng trong một khu vực để nhường lại không gian cho màn hình. Phần notch tai thỏ rất nhỏ, ít ảnh hưởng tới trải nghiệm của người dùng mà còn đem lại sự thoải mái tối đa khi nhìn vào điện thoại. Nhờ viền mỏng nên dù màn hình lớn thì Realme 2 Pro vẫn đủ gọn gàng trong bàn tay bạn.\r\n\r\n', 'Về thông số cấu hình, Realme 2 dùng vi xử lý Qualcomm Snapdragon 660 8 nhân, card đồ họa Adreno 512 mạnh mẽ cùng bộ nhớ RAM 6GB, cho tốc độ xử lý ổn định khi bạn lướt web, giải trí, xem phim. Bên cạnh đó, với bộ nhớ trong 64GB cùng khe cắm thẻ nhớ ngoài tối đa lên đến 256GB, chiếc điện thoại giúp người dùng lưu trữ dữ liệu cũng như hình ảnh, video một cách thoải mái. Ngoài ra, bộ vi xử lý Snap 660 trên Realme 2 Pro cũng tích hợp trí tuệ nhân tạo AI, phản hồi nhanh hơn, quản lý tài nguyên tốt hơn, đồng thời tiết kiệm năng lượng hơn.\r\n\r\n', 'img/sanpham/realme/2pro/mota/1.jpg', 'img/sanpham/realme/2pro/mota/2.jpg', 'img/sanpham/realme/2pro/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Màn hình lớn tương đương Galaxy S10+\r\n</h1><p>Điện Thoại Realme 2 Pro có thiết kế nguyên khối kim loại chắc chắn, bốn góc bo tròn nhẹ nhàng. Mặt lưng máy được chế tác tinh xảo từ 15 lớp để màu sắc có hiệu ứng bóng bẩy bắt mắt. Cả 2 màu sắc của điện thoại đều rất tinh tế, đẹp nhẹ nhàng và sang trọng. Công nghệ ép lớp còn giúp mặt lưng Realme 2 Pro chắc chắn và mượt mà hơn trên bàn tay người dùng.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/realme/2pro/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Màn hình giọt nước bắt mắt\r\n</h1><p>Realme 2 Pro sở hữu màn hình kích thước lớn tới 6.3 inch với độ phân giải Full HD+ (1080 x 2340 Pixels), được thiết kế dạng giọt nước đúng theo xu hướng của các smartphone mới nhất hiện nay. Toàn bộ camera trước, đèn thông báo, cảm biến, tai nghe thoại đều được đặt gọn gàng trong một khu vực để nhường lại không gian cho màn hình. Phần notch tai thỏ rất nhỏ, ít ảnh hưởng tới trải nghiệm của người dùng mà còn đem lại sự thoải mái tối đa khi nhìn vào điện thoại. Nhờ viền mỏng nên dù màn hình lớn thì Realme 2 Pro vẫn đủ gọn gàng trong bàn tay bạn.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/realme/2pro/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Hiệu năng mạnh mẽ\r\n</h1><p>Về thông số cấu hình, Realme 2 dùng vi xử lý Qualcomm Snapdragon 660 8 nhân, card đồ họa Adreno 512 mạnh mẽ cùng bộ nhớ RAM 6GB, cho tốc độ xử lý ổn định khi bạn lướt web, giải trí, xem phim. Bên cạnh đó, với bộ nhớ trong 64GB cùng khe cắm thẻ nhớ ngoài tối đa lên đến 256GB, chiếc điện thoại giúp người dùng lưu trữ dữ liệu cũng như hình ảnh, video một cách thoải mái. Ngoài ra, bộ vi xử lý Snap 660 trên Realme 2 Pro cũng tích hợp trí tuệ nhân tạo AI, phản hồi nhanh hơn, quản lý tài nguyên tốt hơn, đồng thời tiết kiệm năng lượng hơn.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/realme/2pro/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (17, 'img/sanpham/oppo/a5s/2.jpg', 'OPPO A5S', 5, 3690000, 30, 2, 2, 4, 12, 'img/sanpham/oppo/a5s/1.jpg', 'img/sanpham/oppo/a5s/2.jpg', 'img/sanpham/oppo/a5s/3.jpg', 'img/sanpham/oppo/a5s/4.jpg', 'IPS LCD, 6.2\", HD+', '8 MP', 'Chính 13 MP & Phụ 2 MP', 'Thiết kế tinh tế và sang trọng\r\n', 'Hiệu năng trên OPPO A5s ấn tượng cùng với chip Helio P35, 3GB RAM và ColorOS 5.1\r\n', 'OPPO A5s sở hữu camera selfie đặc trưng của OPPO và camera sau 13 MP\r\n', 'Điện Thoại OPPO A5s - Hàng Chính Hãng sở hữu ngôn ngữ thiết kế hiện đại với màn hình giọt nước giúp tối đa không gian màn hình. Các hình ảnh lộ diện gần đây cho thấy máy sẽ có 2 phiên bản màu sắc gồm đỏ và đen mang lại vẻ đẹp tinh tế, sang trọng và hợp thời trang. Bên cạnh đó, thiết bị còn có hệ thống cảm biến vân tay ở mặt lưng để tăng tính tiện lợi cho người dùng.\r\n\r\n', 'OPPO A5s mang sức mạnh đến từ con chip MediaTek Helio P35. Con chip này được tích hợp NeuroPilot - công nghệ khai thác kiến trúc tính toán AI nhằm mang lại hiệu năng tốt để hỗ trợ các ứng dụng AI như nhận diện khuôn mặt, nhận diện vật thể, giúp OPPO A5s trở thành chiếc điện thoải có khả năng selfie ảo diệu.\r\n\r\n', 'Nhắc đến OPPO là nhắc đến những dòng smartphone với camera selfie đỉnh cao và OPPO A5s sẽ không làm bạn thất vọng. Camera trước của máy với độ phân giải 8 MP kèm những chế độ làm đẹp “trứ danh” của OPPO chắc chắn sẽ cho người dùng những tấm ảnh selfie ảo diệu, ưng ý. Với sự hỗ trợ của công nghệ AI, những bức hình của bạn sẽ đẹp tự nhiên, nhìn không bị giả.\r\n\r\n', 'img/sanpham/oppo/a5s/mota/1.jpg', 'img/sanpham/oppo/a5s/mota/2.jpg', 'img/sanpham/oppo/a5s/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Thiết kế tinh tế và sang trọng\r\n</h1><p>Điện Thoại OPPO A5s - Hàng Chính Hãng sở hữu ngôn ngữ thiết kế hiện đại với màn hình giọt nước giúp tối đa không gian màn hình. Các hình ảnh lộ diện gần đây cho thấy máy sẽ có 2 phiên bản màu sắc gồm đỏ và đen mang lại vẻ đẹp tinh tế, sang trọng và hợp thời trang. Bên cạnh đó, thiết bị còn có hệ thống cảm biến vân tay ở mặt lưng để tăng tính tiện lợi cho người dùng.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/oppo/a5s/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Hiệu năng trên OPPO A5s ấn tượng cùng với chip Helio P35, 3GB RAM và ColorOS 5.1\r\n</h1><p>OPPO A5s mang sức mạnh đến từ con chip MediaTek Helio P35. Con chip này được tích hợp NeuroPilot - công nghệ khai thác kiến trúc tính toán AI nhằm mang lại hiệu năng tốt để hỗ trợ các ứng dụng AI như nhận diện khuôn mặt, nhận diện vật thể, giúp OPPO A5s trở thành chiếc điện thoải có khả năng selfie ảo diệu.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/oppo/a5s/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">OPPO A5s sở hữu camera selfie đặc trưng của OPPO và camera sau 13 MP\r\n</h1><p>Nhắc đến OPPO là nhắc đến những dòng smartphone với camera selfie đỉnh cao và OPPO A5s sẽ không làm bạn thất vọng. Camera trước của máy với độ phân giải 8 MP kèm những chế độ làm đẹp “trứ danh” của OPPO chắc chắn sẽ cho người dùng những tấm ảnh selfie ảo diệu, ưng ý. Với sự hỗ trợ của công nghệ AI, những bức hình của bạn sẽ đẹp tự nhiên, nhìn không bị giả.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/oppo/a5s/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (18, 'img/sanpham/oppo/a9/2.jpg', 'OPPO A9', 5, 4290000, 30, 5, 4, 2, 12, 'img/sanpham/oppo/a9/1.jpg', 'img/sanpham/oppo/a9/2.jpg', 'img/sanpham/oppo/a9/3.jpg', 'img/sanpham/oppo/a9/4.jpg', 'TFT, 6.5\", HD+', '	16 MP', 'Chính 48 MP & Phụ 8 MP, 2 MP, 2 MP', 'Thiết kế tinh tế và sang trọng\r\n', 'Chụp ảnh sắc nét với cụm 4 camera\r\n', 'Màn hình giọt nước trải nghiệm tối ưu\r\n', 'Điện Thoại OPPO A9 (128G/8GB) được trang bị con chip tầm trung mới Snapdragon 665 mang đến hiệu năng mạnh mẽ và tối ưu tiết kiệm điện hơn, cho trải nghiệm giải trí, chơi game trở nên mượt mà và dễ dàng hơn bao giờ hết.\r\n\r\n', 'OPPO A9 (2020) có sự thay đổi lớn về số camera cũng như độ phân giải camera sau, giúp hình ảnh đạt độ chi tiết và sắc nét cao hơn hẳn.\r\n\r\nMáy bao gồm một camera chính 48 MP và ba cảm biến phụ có độ phân giải lần lượt là 8 MP, 2 MP và 2 MP.\r\n\r\n', 'OPPO A9 (2020) có màn hình giọt nước rộng đến 6.5 inch, độ phân giải HD+, tỉ lệ 19.5:9 và đạt đến 90.7% diện tích trải nghiệm.\r\n\r\nViệc xem phim, chơi game sẽ trở nên đã mắt và không còn gặp nhiều giới hạn cùng với dung lượng pin khủng đến 5000 mAh.\r\n\r\n', 'img/sanpham/oppo/a9/mota/1.jpg', 'img/sanpham/oppo/a9/mota/2.jpg', 'img/sanpham/oppo/a9/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Thiết kế tinh tế và sang trọng\r\n</h1><p>Điện Thoại OPPO A9 (128G/8GB) được trang bị con chip tầm trung mới Snapdragon 665 mang đến hiệu năng mạnh mẽ và tối ưu tiết kiệm điện hơn, cho trải nghiệm giải trí, chơi game trở nên mượt mà và dễ dàng hơn bao giờ hết.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/oppo/a9/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Chụp ảnh sắc nét với cụm 4 camera\r\n</h1><p>OPPO A9 (2020) có sự thay đổi lớn về số camera cũng như độ phân giải camera sau, giúp hình ảnh đạt độ chi tiết và sắc nét cao hơn hẳn.\r\n\r\nMáy bao gồm một camera chính 48 MP và ba cảm biến phụ có độ phân giải lần lượt là 8 MP, 2 MP và 2 MP.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/oppo/a9/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Màn hình giọt nước trải nghiệm tối ưu\r\n</h1><p>OPPO A9 (2020) có màn hình giọt nước rộng đến 6.5 inch, độ phân giải HD+, tỉ lệ 19.5:9 và đạt đến 90.7% diện tích trải nghiệm.\r\n\r\nViệc xem phim, chơi game sẽ trở nên đã mắt và không còn gặp nhiều giới hạn cùng với dung lượng pin khủng đến 5000 mAh.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/oppo/a9/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (19, 'img/sanpham/oppo/f7/2.jpg', 'OPPO F7', 5, 4490000, 30, 3, 3, 3, 12, 'img/sanpham/oppo/f7/1.jpg', 'img/sanpham/oppo/f7/2.jpg', 'img/sanpham/oppo/f7/3.jpg', 'img/sanpham/oppo/f7/4.jpg', 'ISP LCD, 6.23 inch', '16MP', '25MP', 'Thiết kế cong 3D tuyệt đẹp\r\n', 'Chuyên gia chụp ảnh trí tuệ nhân tạo với camera trước 25MP\r\n', 'Cấu hình mạnh mẽ\r\n', 'OPPO F7 sở hữu màn hình LCD 6.23 inch với độ phân giải 2280 x 1080 kèm tỷ lệ khung hình 19:9 cho trải nghiệm xem phim hay chơi game tuyệt vời hơn. Công nghệ màn hình IPS với độ phân giải đạt Full HD+ sẽ làm hài lòng nhu cầu sử dụng của bạn.\r\n\r\n', 'Ứng dụng trí tuệ nhân tạo AI vào trong công nghệ làm đẹp của OPPO F7 cho khả năng chụp ảnh \"càng chụp càng đẹp\" bổ sung cho công nghệ làm đẹp trứ danh của hãng. Camera trước 25MP chính là điểm nhấn của dòng điện thoại này, camera sau 16MP sắc nét với chế độ xóa phông chân dung và rất nhiều chế độ chụp ảnh dễ dàng và tiên tiến khác.\r\n\r\n', 'OPPO F7 được trang bị cấu hình phần cứng mạnh mẽ nhờ vi xử lý MediaTek P60 với 8 nhân xử lý tốc độ 2.0 GHz. Đặc biệt nhất là bộ nhớ RAM lên 4GB đa nhiệm rất tốt, bộ nhớ trong đạt 64GB. Tích hợp hệ điều hành Color OS 5.0 trên nền Android 8.1 với giao diện cực đẹp mắt, bóng bẩy và tùy biến theo sở thích cá nhân dễ dàng.\r\n\r\n', 'img/sanpham/oppo/f7/mota/1.jpg', 'img/sanpham/oppo/f7/mota/2.jpg', 'img/sanpham/oppo/f7/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Thiết kế cong 3D tuyệt đẹp\r\n</h1><p>OPPO F7 sở hữu màn hình LCD 6.23 inch với độ phân giải 2280 x 1080 kèm tỷ lệ khung hình 19:9 cho trải nghiệm xem phim hay chơi game tuyệt vời hơn. Công nghệ màn hình IPS với độ phân giải đạt Full HD+ sẽ làm hài lòng nhu cầu sử dụng của bạn.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/oppo/f7/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Chuyên gia chụp ảnh trí tuệ nhân tạo với camera trước 25MP\r\n</h1><p>Ứng dụng trí tuệ nhân tạo AI vào trong công nghệ làm đẹp của OPPO F7 cho khả năng chụp ảnh \"càng chụp càng đẹp\" bổ sung cho công nghệ làm đẹp trứ danh của hãng. Camera trước 25MP chính là điểm nhấn của dòng điện thoại này, camera sau 16MP sắc nét với chế độ xóa phông chân dung và rất nhiều chế độ chụp ảnh dễ dàng và tiên tiến khác.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/oppo/f7/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Cấu hình mạnh mẽ\r\n</h1><p>OPPO F7 được trang bị cấu hình phần cứng mạnh mẽ nhờ vi xử lý MediaTek P60 với 8 nhân xử lý tốc độ 2.0 GHz. Đặc biệt nhất là bộ nhớ RAM lên 4GB đa nhiệm rất tốt, bộ nhớ trong đạt 64GB. Tích hợp hệ điều hành Color OS 5.0 trên nền Android 8.1 với giao diện cực đẹp mắt, bóng bẩy và tùy biến theo sở thích cá nhân dễ dàng.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/oppo/f7/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (20, 'img/sanpham/oppo/f9/2.jpg', 'OPPO F9', 5, 6990000, 30, 3, 3, 2, 12, 'img/sanpham/oppo/f9/1.jpg', 'img/sanpham/oppo/f9/2.jpg', 'img/sanpham/oppo/f9/3.jpg', 'img/sanpham/oppo/f9/4.jpg', 'LTPS LCD, 6.3\", Full HD+', '25 MP', 'Chính 16 MP & Phụ 2 MP', 'Thiết kế cong 3D tuyệt đẹp\r\n', 'Sắc màu chuyển động không giới hạn\r\n', 'Sạc cực nhanh với sự trở lại của VOOC\r\n', 'Điện thoại OPPO F9 sở hữu màn hình viền mỏng ấn tượng hơn bao giờ hết, khoe trọn vẹn vẻ đẹp của thiết bị với duy nhất một phần khuyết cực nhỏ trên màn hình dành cho vị trí của camera trước, loa thoại được đặt khéo léo ở phần viền rất mỏng cạnh trên. Đây là thiết kế tuyệt đẹp với viền màn hình siêu mỏng mang lại trải nghiệm hình ảnh mở rộng với tỷ lệ hơn 90%. Độ phân giải FUll HD+ cùng màn hình Fullview 19:9 nhất định sẽ cho bạn những phút giây thư giãn đỉnh cao.\r\n\r\n', 'Thiết kế mặt lưng với vân kim cương cùng khả năng chuyển màu độc đáo. OPPO F9 mang lại vẻ đẹp khác biệt và sáng tạo không hòa lẫn với bất kỳ thiết bị di động nào, mỗi thao tác sử dụng, mặt lưng lại chuyển những sắc màu đậm nhạt khác nhau, sẽ thu hút bạn ngay từ cái nhìn đầu tiên.\r\n\r\n', 'Sạc nhanh có lẽ là một trong những tính năng mà OPPO tự hào nhất trên OPPO F9. Công nghệ sạc mới nhất VOOC của OPPO cho phép chỉ cần sạc 5 phút để có thêm 2 giờ đàm thoại, một con số rất ấn tượng. So với các công nghệ sạc nhanh khác thì VOOC không chỉ có tốc độ nhanh hơn mà còn an toàn hơn khi không kích cường độ dòng điện lên quá cao. Công nghệ mới sử dụng \"điện áp thấp và cường độ dòng điện cao\", tích hợp 5 cấp độ an toàn độc quyền của hãng, bộ sạc của OPPO F9 vừa giữ được tốc độ sạc nhanh, vừa đem lại sự an toàn tuyệt đối cho người sử dụng, kể cả khi vừa xài vừa chơi game.\r\n\r\n', 'img/sanpham/oppo/f9/mota/1.jpg', 'img/sanpham/oppo/f9/mota/2.jpg', 'img/sanpham/oppo/f9/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Thiết kế cong 3D tuyệt đẹp\r\n</h1><p>Điện thoại OPPO F9 sở hữu màn hình viền mỏng ấn tượng hơn bao giờ hết, khoe trọn vẹn vẻ đẹp của thiết bị với duy nhất một phần khuyết cực nhỏ trên màn hình dành cho vị trí của camera trước, loa thoại được đặt khéo léo ở phần viền rất mỏng cạnh trên. Đây là thiết kế tuyệt đẹp với viền màn hình siêu mỏng mang lại trải nghiệm hình ảnh mở rộng với tỷ lệ hơn 90%. Độ phân giải FUll HD+ cùng màn hình Fullview 19:9 nhất định sẽ cho bạn những phút giây thư giãn đỉnh cao.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/oppo/f9/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Sắc màu chuyển động không giới hạn\r\n</h1><p>Thiết kế mặt lưng với vân kim cương cùng khả năng chuyển màu độc đáo. OPPO F9 mang lại vẻ đẹp khác biệt và sáng tạo không hòa lẫn với bất kỳ thiết bị di động nào, mỗi thao tác sử dụng, mặt lưng lại chuyển những sắc màu đậm nhạt khác nhau, sẽ thu hút bạn ngay từ cái nhìn đầu tiên.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/oppo/f9/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Sạc cực nhanh với sự trở lại của VOOC\r\n</h1><p>Sạc nhanh có lẽ là một trong những tính năng mà OPPO tự hào nhất trên OPPO F9. Công nghệ sạc mới nhất VOOC của OPPO cho phép chỉ cần sạc 5 phút để có thêm 2 giờ đàm thoại, một con số rất ấn tượng. So với các công nghệ sạc nhanh khác thì VOOC không chỉ có tốc độ nhanh hơn mà còn an toàn hơn khi không kích cường độ dòng điện lên quá cao. Công nghệ mới sử dụng \"điện áp thấp và cường độ dòng điện cao\", tích hợp 5 cấp độ an toàn độc quyền của hãng, bộ sạc của OPPO F9 vừa giữ được tốc độ sạc nhanh, vừa đem lại sự an toàn tuyệt đối cho người sử dụng, kể cả khi vừa xài vừa chơi game.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/oppo/f9/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (21, 'img/sanpham/samsung/a30s/2.jpg', 'SAMSUNG GALAXY A30s', 1, 6290000, 30, 3, 3, 3, 12, 'img/sanpham/samsung/a30s/1.jpg', 'img/sanpham/samsung/a30s/2.jpg', 'img/sanpham/samsung/a30s/3.jpg', 'img/sanpham/samsung/a30s/4.jpg', '6.4 inches, 720 x 1560 (HD+) Super AMOLED', '16.0 MP', '25.0 MP + 5.0 MP + 8.0 MP', 'Màn hình lớn, vân tay thời thượng\r\n', 'Bộ 3 camera đỉnh cao\r\n', 'Hiệu suất mạnh mẽ cho trải nghiệm hoàn hảo\r\n', 'Điện Thoại Samsung Galaxy A30s (64GB/4GB) đắm chìm trong thế giới giải trí đỉnh cao trên Màn Hình Vô Cực Infinity-V 6.4 inch, tỷ lệ khung hình rộng ấn tượng. Công nghệ Super AMOLED chuẩn HD+ cho bạn thoả sức chơi game, xem phim hay quay video trực tuyến với chi tiết hình ảnh luôn sắc nét và hoàn hảo.\r\n\r\n', 'Máy sở hữu ống kính chính sẽ có độ phân giải 25 MP, ống kính thứ 2 là ống kính góc siêu rộng có độ phân giải 8 MP và một ống kính 5 MP hỗ trợ đo độ sâu trường ảnh. Ngoài ra, những tính năng chụp ảnh xóa phông, tự động lấy nét, HDR, Parorama, sẽ đáp ứng được nhu cầu nắm bắt khoảnh khắc hàng ngày của bạn và chia sẻ với bạn bè. Tính năng Live Focus trên Galaxy A30s cho khả năng xóa phông thời thượng bằng cách nhận diện khuôn mặt và làm mờ phần phông nền phía sau.\r\n\r\n', 'RAM 4GB và bộ xử lý Octa-core mạnh mẽ từ Galaxy A30s giúp mọi tác vụ và trải nghiệm của bạn luôn mượt mà hoàn hảo. Tải xuống hay lưu trữ bất tận mọi dữ liệu với bộ nhớ trong lên đến 128GB và thẻ nhớ microSD ngoài đến 512GB.\r\n\r\n', 'img/sanpham/samsung/a30s/mota/1.jfif', 'img/sanpham/samsung/a30s/mota/2.jfif', 'img/sanpham/samsung/a30s/mota/3.jfif', 1, '<h1 class=\"font-weight-bold\">Màn hình lớn, vân tay thời thượng\r\n</h1><p>Điện Thoại Samsung Galaxy A30s (64GB/4GB) đắm chìm trong thế giới giải trí đỉnh cao trên Màn Hình Vô Cực Infinity-V 6.4 inch, tỷ lệ khung hình rộng ấn tượng. Công nghệ Super AMOLED chuẩn HD+ cho bạn thoả sức chơi game, xem phim hay quay video trực tuyến với chi tiết hình ảnh luôn sắc nét và hoàn hảo.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/a30s/mota/1.jfif\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Bộ 3 camera đỉnh cao\r\n</h1><p>Máy sở hữu ống kính chính sẽ có độ phân giải 25 MP, ống kính thứ 2 là ống kính góc siêu rộng có độ phân giải 8 MP và một ống kính 5 MP hỗ trợ đo độ sâu trường ảnh. Ngoài ra, những tính năng chụp ảnh xóa phông, tự động lấy nét, HDR, Parorama, sẽ đáp ứng được nhu cầu nắm bắt khoảnh khắc hàng ngày của bạn và chia sẻ với bạn bè. Tính năng Live Focus trên Galaxy A30s cho khả năng xóa phông thời thượng bằng cách nhận diện khuôn mặt và làm mờ phần phông nền phía sau.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/a30s/mota/2.jfif\"/></br><h1 class=\"font-weight-bold\">Hiệu suất mạnh mẽ cho trải nghiệm hoàn hảo\r\n</h1><p>RAM 4GB và bộ xử lý Octa-core mạnh mẽ từ Galaxy A30s giúp mọi tác vụ và trải nghiệm của bạn luôn mượt mà hoàn hảo. Tải xuống hay lưu trữ bất tận mọi dữ liệu với bộ nhớ trong lên đến 128GB và thẻ nhớ microSD ngoài đến 512GB.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/a30s/mota/3.jfif\"/></div></br>');
INSERT INTO `product` VALUES (22, 'img/sanpham/samsung/m10/2.jpg', 'SAMSUNG GALAXY M10', 1, 3490000, 30, 1, 1, 3, 12, 'img/sanpham/samsung/m10/1.jpg', 'img/sanpham/samsung/m10/2.jpg', 'img/sanpham/samsung/m10/3.jpg', 'img/sanpham/samsung/m10/4.jpg', 'LCD 6.2\" HD+, Infinity V Display', '5 MP', '13 MP và 5 MP (2 camera)', 'Trải nghiệm đẳng cấp cùng màn hình siêu tràn viền Infinity-V 6.2 inch\r\n', 'Exynos 7870  \"cân\" mọi tác vụ cơ bản\r\n', 'Sáng tạo bất tận với khung hình rộng\r\n', 'Điện Thoại Samsung Galaxy M10 là chiếc smartphone đầu tiên của Samsung sở hữu màn hình tràn viền mới Infinity-V. Cùng với kích thước lớn 6.2 inch và độ phân giải HD+, máy cho diện tích trải nghiệm rộng rãi, hình ảnh được hiển thị đầy đủ và tối đa. Hơn nữa, thiết kế nguyên khối của máy cùng phần viền được bo cong nhẹ cho người dùng cảm giác cầm nắm được thoải mái.\r\n\r\n', 'Chiếc điện thoại Samsung mới này được trang bị chip Exynos 7870 \"cây nhà lá vườn\" do chính hãng sản xuất cùng với RAM 2 GB. Galaxy M10 chạy trên hệ điều hành Android 8.1 Oreo với giao diện Samsung Experience 9.5 giúp hiệu năng của máy được tối ưu tốt hơn, giao diện trực quan dễ sử dụng. Với cấu hình trên, Samsung M10 đáp ứng nhu cầu giải trí lướt web bình thường hay chơi các game nhẹ nhàng: Nông trại, kim cương,\r\n\r\n', 'Samsung Galaxy M10 trang bị camera sau kép với 01 Camera Chính và 01 Camera Góc Siêu Rộng sẵn sàng cùng bạn thu trọn mọi khung cảnh đáng nhớ chỉ trong một khung hình. Dễ dàng chụp được các chuyển động nhanh một cách mượt mà chuẩn như máy ảnh chuyên nghiệp.\r\n\r\n', 'img/sanpham/samsung/m10/mota/1.jpg', 'img/sanpham/samsung/m10/mota/2.jpg', 'img/sanpham/samsung/m10/mota/3.png', 1, '<h1 class=\"font-weight-bold\">Trải nghiệm đẳng cấp cùng màn hình siêu tràn viền Infinity-V 6.2 inch\r\n</h1><p>Điện Thoại Samsung Galaxy M10 là chiếc smartphone đầu tiên của Samsung sở hữu màn hình tràn viền mới Infinity-V. Cùng với kích thước lớn 6.2 inch và độ phân giải HD+, máy cho diện tích trải nghiệm rộng rãi, hình ảnh được hiển thị đầy đủ và tối đa. Hơn nữa, thiết kế nguyên khối của máy cùng phần viền được bo cong nhẹ cho người dùng cảm giác cầm nắm được thoải mái.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/m10/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Exynos 7870  \"cân\" mọi tác vụ cơ bản\r\n</h1><p>Chiếc điện thoại Samsung mới này được trang bị chip Exynos 7870 \"cây nhà lá vườn\" do chính hãng sản xuất cùng với RAM 2 GB. Galaxy M10 chạy trên hệ điều hành Android 8.1 Oreo với giao diện Samsung Experience 9.5 giúp hiệu năng của máy được tối ưu tốt hơn, giao diện trực quan dễ sử dụng. Với cấu hình trên, Samsung M10 đáp ứng nhu cầu giải trí lướt web bình thường hay chơi các game nhẹ nhàng: Nông trại, kim cương,\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/m10/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Sáng tạo bất tận với khung hình rộng\r\n</h1><p>Samsung Galaxy M10 trang bị camera sau kép với 01 Camera Chính và 01 Camera Góc Siêu Rộng sẵn sàng cùng bạn thu trọn mọi khung cảnh đáng nhớ chỉ trong một khung hình. Dễ dàng chụp được các chuyển động nhanh một cách mượt mà chuẩn như máy ảnh chuyên nghiệp.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/m10/mota/3.png\"/></div></br>');
INSERT INTO `product` VALUES (23, 'img/sanpham/xiaomi/redmi7a/2.jpg', 'XIAOMI REDMI 7A', 2, 2390000, 20, 1, 1, 3, 12, 'img/sanpham/xiaomi/redmi7a/1.jpg', 'img/sanpham/xiaomi/redmi7a/2.jpg', 'img/sanpham/xiaomi/redmi7a/3.jpg', 'img/sanpham/xiaomi/redmi7a/4.jpg', 'IPS LCD, 5.45\"\", HD+', '5 MP', '13 MP', 'Màn hình tràn viền IPS LCD 5.45\"\r\n', 'Khả năng kháng nước an toàn\r\n', 'Hiệu năng tốt với chip Qualcomm Snapdragon 439\r\n', 'Điện Thoại Xiaomi Redmi 7A (2GB/16GB) sở hữu vẻ ngoài khá thời trang với một màn hình tràn viền IPS LCD 5.45 inch ở mặt trước. Đặc biệt với thiết kế màn hình có độ sáng khá tốt giúp người tiêu dùng có thể dễ dàng sử dụng ngoài trời. Bên cạnh đó máy còn được tích hợp công nghệ lọc ánh sáng xanh gây hại được phát ra từ màn hình rất đáng khen.\r\n\r\n', 'Máy cũng có khả năng \"kháng nước nhẹ\" khi mặt lưng được phủ một lớp nano P2i còn các chi tiết khác như jack cắm tai nghe, lỗ cắm sạc cũng được bảo vệ bằng lớp vỏ bọc cao su để nước không thấm vào bên trong.\r\n\r\n', 'Xiaomi Redmi 7A được cung cấp sức mạnh bởi con chip Qualcomm Snapdragon 439 8 nhân 64-bit cùng với đó là 2 GB RAM và 16 GB bộ nhớ trong. Máy phản hồi khá nhanh các thao tác hằng ngày của người dùng từ lướt facebook, xem YouTube tới chơi một số game nhẹ. Ngoài ra chiếc smartphone này cũng hỗ trợ thẻ nhớ với dung lượng tối đa lên tới 512 GB thoải mái cho bạn lưu trữ dữ liệu.\r\n\r\n', 'img/sanpham/xiaomi/redmi7a/mota/1.jpg', 'img/sanpham/xiaomi/redmi7a/mota/2.jpg', 'img/sanpham/xiaomi/redmi7a/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Màn hình tràn viền IPS LCD 5.45\"\r\n</h1><p>Điện Thoại Xiaomi Redmi 7A (2GB/16GB) sở hữu vẻ ngoài khá thời trang với một màn hình tràn viền IPS LCD 5.45 inch ở mặt trước. Đặc biệt với thiết kế màn hình có độ sáng khá tốt giúp người tiêu dùng có thể dễ dàng sử dụng ngoài trời. Bên cạnh đó máy còn được tích hợp công nghệ lọc ánh sáng xanh gây hại được phát ra từ màn hình rất đáng khen.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/xiaomi/redmi7a/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Khả năng kháng nước an toàn\r\n</h1><p>Máy cũng có khả năng \"kháng nước nhẹ\" khi mặt lưng được phủ một lớp nano P2i còn các chi tiết khác như jack cắm tai nghe, lỗ cắm sạc cũng được bảo vệ bằng lớp vỏ bọc cao su để nước không thấm vào bên trong.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/xiaomi/redmi7a/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Hiệu năng tốt với chip Qualcomm Snapdragon 439\r\n</h1><p>Xiaomi Redmi 7A được cung cấp sức mạnh bởi con chip Qualcomm Snapdragon 439 8 nhân 64-bit cùng với đó là 2 GB RAM và 16 GB bộ nhớ trong. Máy phản hồi khá nhanh các thao tác hằng ngày của người dùng từ lướt facebook, xem YouTube tới chơi một số game nhẹ. Ngoài ra chiếc smartphone này cũng hỗ trợ thẻ nhớ với dung lượng tối đa lên tới 512 GB thoải mái cho bạn lưu trữ dữ liệu.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/xiaomi/redmi7a/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (24, 'img/sanpham/samsung/a10s/2.jpg', 'SAMSUNG GALAXY A10s', 3, 3690000, 24, 1, 2, 2, 12, 'img/sanpham/samsung/a10s/1.jpg', 'img/sanpham/samsung/a10s/2.jpg', 'img/sanpham/samsung/a10s/3.jpg', 'img/sanpham/samsung/a10s/4.jpg', '6.2 inch HD+ PLS TFT LCD', ' 5MP', '13.0 MP + 2.0 MP', 'Trải Nghiệm Hoàn Hảo Trên Màn Hình Lớn\r\n', 'Bộ Đôi Camera Kép Bắt Trọn Mọi Khoảnh Khắc\r\n', 'Bảo Vệ Tối Ưu\r\n', 'Điện Thoại Samsung Galaxy A10s (32GB/2GB) - Hàng Chính Hãng xem phim bất tận hay chơi game nhập vai MMORPG đỉnh cao trên Màn Hình Tràn Viền Infinity-V rộng 6.2 inch từ Galaxy A10s. Độ phân giải HD+ PLS mang đến cả thế giới giải trí sống động, chân thực hoàn hảo ngay trong bàn tay bạn.\r\n\r\n', 'Bức hình thêm rõ ràng và sắc nét với bộ đôi camera kép từ Galaxy A10s. Thoả sức sáng tạo, chụp trên mọi hành trình với Camera Chiều Sâu 13MP và 2MP cho ra những bức ảnh cực chất, đậm cá tính riêng bạn.\r\n', 'Galaxy A10s trang bị công nghệ bảo mật quét vân tay tối ưu tại mặt sau, giúp bạn dễ dàng mở khóa điện thoại hay đăng nhập vào các ứng dụng có hỗ trợ. Tiện lợi hơn, an toàn hơn.\r\n', 'img/sanpham/samsung/a10s/mota/1.bmp', 'img/sanpham/samsung/a10s/mota/2.bmp', 'img/sanpham/samsung/a10s/mota/3.bmp', 1, '<h1 class=\"font-weight-bold\">Trải Nghiệm Hoàn Hảo Trên Màn Hình Lớn\r\n</h1><p>Điện Thoại Samsung Galaxy A10s (32GB/2GB) - Hàng Chính Hãng xem phim bất tận hay chơi game nhập vai MMORPG đỉnh cao trên Màn Hình Tràn Viền Infinity-V rộng 6.2 inch từ Galaxy A10s. Độ phân giải HD+ PLS mang đến cả thế giới giải trí sống động, chân thực hoàn hảo ngay trong bàn tay bạn.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/a10s/mota/1.bmp\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Bộ Đôi Camera Kép Bắt Trọn Mọi Khoảnh Khắc\r\n</h1><p>Bức hình thêm rõ ràng và sắc nét với bộ đôi camera kép từ Galaxy A10s. Thoả sức sáng tạo, chụp trên mọi hành trình với Camera Chiều Sâu 13MP và 2MP cho ra những bức ảnh cực chất, đậm cá tính riêng bạn.\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/a10s/mota/2.bmp\"/></br><h1 class=\"font-weight-bold\">Bảo Vệ Tối Ưu\r\n</h1><p>Galaxy A10s trang bị công nghệ bảo mật quét vân tay tối ưu tại mặt sau, giúp bạn dễ dàng mở khóa điện thoại hay đăng nhập vào các ứng dụng có hỗ trợ. Tiện lợi hơn, an toàn hơn.\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/a10s/mota/3.bmp\"/></div></br>');
INSERT INTO `product` VALUES (25, 'img/sanpham/oppo/f5youth/2.jpg', 'OPPO F5 YOUTH', 5, 4490000, 30, 2, 2, 3, 12, 'img/sanpham/oppo/f5youth/1.jpg', 'img/sanpham/oppo/f5youth/2.jpg', 'img/sanpham/oppo/f5youth/3.jpg', 'img/sanpham/oppo/f5youth/4.jpg', 'IPS LCD 6 inch Full HD', '16 MP', '13 MP', 'Thiết kế nguyên khối, màn hình tràn viền\r\n', 'Màn hình 6 inch, tấm nền IPS\r\n', 'Camera sắc nét, làm đẹp AI \r\n', 'Điện Thoại OPPO F5 Youth mang trong mình thiết kế nguyên khối toàn phần với mặt lưng liền mạch cho vẻ đẹp sang trọng và tối giản tinh tế. Chất liệu vỏ nhựa nhưng được gia công rất tốt với lớp sơn phủ giả kim loại cho cảm giác trên tay thực sự rất giống các máy vỏ nhôm khác. Trọng lượng nhẹ nhàng, các góc bo tròn cầm nắm thoải mái.\r\n\r\n', 'OPPO F5 Youth có kích thước màn hình 6 inch và có mặt trước được bảo vệ bởi tấm kính cường lực Corning Gorilla Glass và các góc cạnh bo cong 2.5D thời thượng tương tự các thế hệ OPPO trước.\r\n\r\n', 'Công nghệ chụp ảnh làm đẹp khuôn mặt của OPPO F5 Youth được nâng lên một tầm cao mới nhờ ứng dụng công nghệ trí tuệ nhân tạo AI. Theo công bố từ OPPO, công nghệ này giúp phân tích và tự rút kinh nghiệm để ảnh chụp đẹp hơn. Thông số camera cũng được rút gọn với độ phân giải camera trước 16 MP và camera sau 13 MP, độ sắc nét hình ảnh có thể giảm đi một chút bù lại các công nghệ vẫn được giữ lại. \r\n\r\n', 'img/sanpham/oppo/f5youth/mota/1.jpg', 'img/sanpham/oppo/f5youth/mota/2.jpg', 'img/sanpham/oppo/f5youth/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Thiết kế nguyên khối, màn hình tràn viền\r\n</h1><p>Điện Thoại OPPO F5 Youth mang trong mình thiết kế nguyên khối toàn phần với mặt lưng liền mạch cho vẻ đẹp sang trọng và tối giản tinh tế. Chất liệu vỏ nhựa nhưng được gia công rất tốt với lớp sơn phủ giả kim loại cho cảm giác trên tay thực sự rất giống các máy vỏ nhôm khác. Trọng lượng nhẹ nhàng, các góc bo tròn cầm nắm thoải mái.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/oppo/f5youth/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Màn hình 6 inch, tấm nền IPS\r\n</h1><p>OPPO F5 Youth có kích thước màn hình 6 inch và có mặt trước được bảo vệ bởi tấm kính cường lực Corning Gorilla Glass và các góc cạnh bo cong 2.5D thời thượng tương tự các thế hệ OPPO trước.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/oppo/f5youth/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Camera sắc nét, làm đẹp AI \r\n</h1><p>Công nghệ chụp ảnh làm đẹp khuôn mặt của OPPO F5 Youth được nâng lên một tầm cao mới nhờ ứng dụng công nghệ trí tuệ nhân tạo AI. Theo công bố từ OPPO, công nghệ này giúp phân tích và tự rút kinh nghiệm để ảnh chụp đẹp hơn. Thông số camera cũng được rút gọn với độ phân giải camera trước 16 MP và camera sau 13 MP, độ sắc nét hình ảnh có thể giảm đi một chút bù lại các công nghệ vẫn được giữ lại. \r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/oppo/f5youth/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (26, 'img/sanpham/oppo/a5/2.jpg', 'OPPO A5', 5, 5490000, 30, 3, 4, 3, 12, 'img/sanpham/oppo/a5/1.jpg', 'img/sanpham/oppo/a5/2.jpg', 'img/sanpham/oppo/a5/3.jpg', 'img/sanpham/oppo/a5/4.jpg', 'TFT, 6.5\", HD+', '8 MP', 'Chính 12 MP & Phụ 8 MP, 2 MP, 2 MP', 'Thiết kế hiện đại, bắt mắt\r\n', 'Hiệu năng mạnh mẽ\r\n', 'Pin trâu không lo bị hết\r\n', 'Điện Thoại Oppo A5 ( 4GB/128GB) sở hữu cho mình một ngoại hình rất thu hút sẽ khiến người dùng có nhiều cảm tình hơn và dẫn tới quyết định mua một chiếc smartphone.\r\n\r\n', 'OPPO A5 cũng được trang bị bộ vi xử lý Snapdragon 665 nhưng đi kèm với RAM 3GB + ROM 64GB hoặc RAM 4GB + ROM 128GB. Ngoài ra, nó cũng có 1 khay cắm 2 SIM + thẻ microSD.\r\n\r\n', 'Chiếc smartphone OPPO này được cung cấp năng lượng bởi viên pin dung lượng lên đến 5.000 mAh, kết hợp với hệ điều hành ColorOS 6.1 và phần cứng mới giúp sản phẩm tối ưu hơn trong việc sử dụng.\r\n\r\n', 'img/sanpham/oppo/a5/mota/1.jpg', 'img/sanpham/oppo/a5/mota/2.jpg', 'img/sanpham/oppo/a5/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Thiết kế hiện đại, bắt mắt\r\n</h1><p>Điện Thoại Oppo A5 ( 4GB/128GB) sở hữu cho mình một ngoại hình rất thu hút sẽ khiến người dùng có nhiều cảm tình hơn và dẫn tới quyết định mua một chiếc smartphone.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/oppo/a5/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Hiệu năng mạnh mẽ\r\n</h1><p>OPPO A5 cũng được trang bị bộ vi xử lý Snapdragon 665 nhưng đi kèm với RAM 3GB + ROM 64GB hoặc RAM 4GB + ROM 128GB. Ngoài ra, nó cũng có 1 khay cắm 2 SIM + thẻ microSD.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/oppo/a5/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Pin trâu không lo bị hết\r\n</h1><p>Chiếc smartphone OPPO này được cung cấp năng lượng bởi viên pin dung lượng lên đến 5.000 mAh, kết hợp với hệ điều hành ColorOS 6.1 và phần cứng mới giúp sản phẩm tối ưu hơn trong việc sử dụng.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/oppo/a5/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (27, 'img/sanpham/xiaomi/redmi8a/2.jpg', 'XIAOMI REDMI 8A', 2, 3490000, 30, 1, 2, 5, 12, 'img/sanpham/xiaomi/redmi8a/1.jpg', 'img/sanpham/xiaomi/redmi8a/2.jpg', 'img/sanpham/xiaomi/redmi8a/3.jpg', 'img/sanpham/xiaomi/redmi8a/4.jpg', 'IPS LCD, 6.2\", HD+ (720 x 1520 Pixels)', '8 MP', '12 MP', 'Dung lượng pin khủng, sạc nhanh\r\n', 'RAM 3 GB, chip Snapdragon mới mượt mà\r\n', 'Bộ đôi camera hỗ trợ AI\r\n', 'Điện Thoại Xiaomi Redmi 8A (2GB/32GB) - Hàng Chính Hãng được trang bị viên pin có dung lượng cực lớn, lên tới 5000 mAh, cho bạn thỏa sức trải nghiệm cả ngày, chẳng cần bận tâm quá nhiều đến thời lượng pin.\r\n\r\n', 'Redmi 8A sở hữu RAM 2GB, vi xử lý Qualcomm Snapdragon 439 tám nhân 64-bit chạy trên giao diện MIUI 10 nổi tiếng của Xiaomi (trên nền tảng Android 9 Pie).\r\n\r\n', 'Camera chính 12 MP AI sử dụng cảm biến Sony IMX363 khẩu độ f/1.8, giao diện chụp ảnh có nhiều chế độ chụp như HDR, chụp đêm, thủ công, đáp ứng đầy đủ các nhu cầu chụp ảnh thường ngày của người dùng.\r\n\r\nẢnh chụp bằng Xiaomi Redmi 8A theo khuynh hướng chân thực, giữ màu sắc chính xác, không nịnh mắt, ảnh chụp ban ngày cho độ chi tiết rất tốt, tuy nhiên ở điều kiện thiếu sáng, đã xuất hiện một số chi tiết nhiễu.', 'img/sanpham/xiaomi/redmi8a/mota/1.jpg', 'img/sanpham/xiaomi/redmi8a/mota/2.jpg', 'img/sanpham/xiaomi/redmi8a/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Dung lượng pin khủng, sạc nhanh\r\n</h1><p>Điện Thoại Xiaomi Redmi 8A (2GB/32GB) - Hàng Chính Hãng được trang bị viên pin có dung lượng cực lớn, lên tới 5000 mAh, cho bạn thỏa sức trải nghiệm cả ngày, chẳng cần bận tâm quá nhiều đến thời lượng pin.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/xiaomi/redmi8a/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">RAM 3 GB, chip Snapdragon mới mượt mà\r\n</h1><p>Redmi 8A sở hữu RAM 2GB, vi xử lý Qualcomm Snapdragon 439 tám nhân 64-bit chạy trên giao diện MIUI 10 nổi tiếng của Xiaomi (trên nền tảng Android 9 Pie).\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/xiaomi/redmi8a/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Bộ đôi camera hỗ trợ AI\r\n</h1><p>Camera chính 12 MP AI sử dụng cảm biến Sony IMX363 khẩu độ f/1.8, giao diện chụp ảnh có nhiều chế độ chụp như HDR, chụp đêm, thủ công, đáp ứng đầy đủ các nhu cầu chụp ảnh thường ngày của người dùng.\r\n\r\nẢnh chụp bằng Xiaomi Redmi 8A theo khuynh hướng chân thực, giữ màu sắc chính xác, không nịnh mắt, ảnh chụp ban ngày cho độ chi tiết rất tốt, tuy nhiên ở điều kiện thiếu sáng, đã xuất hiện một số chi tiết nhiễu.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/xiaomi/redmi8a/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (28, 'img/sanpham/xiaomi/mi9/2.jpg', 'XIAOMI MI 9', 2, 14990000, 30, 4, 4, 3, 12, 'img/sanpham/xiaomi/mi9/1.jpg', 'img/sanpham/xiaomi/mi9/2.jpg', 'img/sanpham/xiaomi/mi9/3.jpg', 'img/sanpham/xiaomi/mi9/4.jpg', '6.39inch, 1080 x 2340 pixels', '20 MP', ' 48 MP, 16 MP và 12MP (3 camera)', 'Màn hình giọt nước độc đáo\r\n', 'Công nghệ cảm biến vân tay tối ưu\r\n', 'Chip Snapdragon 855 mạnh mẽ\r\n', 'Điện Thoại Xiaomi Mi 9 được trang bị màn hình khuyết đỉnh hình giọt nước, viền màn hình được làm mỏng đáng kể. Màn hình của máy có kích thước 6,4 inch Full HD, độ sáng 600 nit và tỉ lệ màn hình trên thân máy lên đến 90,7%. Đáng chú ý, các thông tin chia sẻ, màn hình mà Mi 9 dùng do Samsung cung cấp với độ phân giải Full HD+ dùng công nghệ AMOLED. \r\n\r\n', 'Mi 9 cũng trang bị công nghệ cảm biến vân tay trong màn hình thế hệ mới, một tính năng được xem là xu hướng smartphone năm 2019. Xiaomi tiết lộ rằng, công nghệ cảm biến quang học trong màn hình thứ 5 của hãng được cải tiến có tốc độ mở khóa rất nhạy, tăng thêm 25%.\r\n\r\n', 'Xiaomi sẽ trang bị những thứ tốt nhất cho Mi 9 với chip Snapdragon 855 mạnh mẽ. Hãng này còn trang bị thêm tính năng Game Turbo dành cho người chơi game để tăng hiệu suất mạnh mẽ nhưng tiết kiệm pin đáng kể. \r\n\r\n', 'img/sanpham/xiaomi/mi9/mota/1.jpg', 'img/sanpham/xiaomi/mi9/mota/2.jpg', 'img/sanpham/xiaomi/mi9/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Màn hình giọt nước độc đáo\r\n</h1><p>Điện Thoại Xiaomi Mi 9 được trang bị màn hình khuyết đỉnh hình giọt nước, viền màn hình được làm mỏng đáng kể. Màn hình của máy có kích thước 6,4 inch Full HD, độ sáng 600 nit và tỉ lệ màn hình trên thân máy lên đến 90,7%. Đáng chú ý, các thông tin chia sẻ, màn hình mà Mi 9 dùng do Samsung cung cấp với độ phân giải Full HD+ dùng công nghệ AMOLED. \r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/xiaomi/mi9/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Công nghệ cảm biến vân tay tối ưu\r\n</h1><p>Mi 9 cũng trang bị công nghệ cảm biến vân tay trong màn hình thế hệ mới, một tính năng được xem là xu hướng smartphone năm 2019. Xiaomi tiết lộ rằng, công nghệ cảm biến quang học trong màn hình thứ 5 của hãng được cải tiến có tốc độ mở khóa rất nhạy, tăng thêm 25%.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/xiaomi/mi9/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Chip Snapdragon 855 mạnh mẽ\r\n</h1><p>Xiaomi sẽ trang bị những thứ tốt nhất cho Mi 9 với chip Snapdragon 855 mạnh mẽ. Hãng này còn trang bị thêm tính năng Game Turbo dành cho người chơi game để tăng hiệu suất mạnh mẽ nhưng tiết kiệm pin đáng kể. \r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/xiaomi/mi9/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (29, 'img/sanpham/samsung/a50s/2.jpeg', 'SAMSUNG GALAXY A50s', 1, 7790000, 30, 3, 3, 3, 12, 'img/sanpham/samsung/a50s/1.jpg', 'img/sanpham/samsung/a50s/2.jpeg', 'img/sanpham/samsung/a50s/3.jpeg', 'img/sanpham/samsung/a50s/4.jpg', '6.4” Super AMOLED, chuẩn điện ảnh 19.5:9 Infinity-U FHD+', '32 MP', '48MP (F2.0) + 5MP (F2.2) + 8MP (F2.2)', 'Sắc màu sống động trên màn hình lớn\r\n', 'Thiết kế thời thượng, hoa văn ba chiều\r\n', 'Chi tiết ấn tượng\r\n', 'Điện Thoại Samsung Galaxy A50s mang đến trải nghiệm Kỷ Nguyên Trực Tuyến thêm sống động trên màn hình tràn viền 6.4 inch từ Galaxy A50s. Công nghệ Super AMOLED FHD+ cho mọi chất lượng hình ảnh trở nên sắc nét, màu sắc sống động như cuộc sống.\r\n\r\n', 'Nâng tầm phong cách thời thượng với kiểu dáng sang trọng, thiết kế vừa vặn trong lòng bàn tay từ Galaxy A50s. Mặt lưng sáng bóng kết hợp các lớp màu nổi ba chiều cho bạn thêm đậm dấu ấn khác biệt. Thoả thích lựa chọn các phối màu cá tính: Đen, Trắng, Tím hoặc Xanh làm hài lòng mọi tín đồ thời trang.\r\n\r\n', 'Chụp ảnh thêm chi tiết, sắc nét với Bộ Ba Camera cao cấp từ Galaxy A50s. Camera chính 48MP cho mọi khung hình trở nên sống động ấn tượng, bất chấp mọi điều kiện sáng. Thu lại khung hình rộng ấn tượng với camera Góc Siêu Rộng 8MP đỉnh cao. Thoả sức sáng tạo với camera Chiều Sâu 5MP xoá phông như máy chuyên nghiệp.\r\n\r\n', 'img/sanpham/samsung/a50s/mota/1.jpeg', 'img/sanpham/samsung/a50s/mota/2.jpeg', 'img/sanpham/samsung/a50s/mota/3.jpeg', 1, '<h1 class=\"font-weight-bold\">Sắc màu sống động trên màn hình lớn\r\n</h1><p>Điện Thoại Samsung Galaxy A50s mang đến trải nghiệm Kỷ Nguyên Trực Tuyến thêm sống động trên màn hình tràn viền 6.4 inch từ Galaxy A50s. Công nghệ Super AMOLED FHD+ cho mọi chất lượng hình ảnh trở nên sắc nét, màu sắc sống động như cuộc sống.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/a50s/mota/1.jpeg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Thiết kế thời thượng, hoa văn ba chiều\r\n</h1><p>Nâng tầm phong cách thời thượng với kiểu dáng sang trọng, thiết kế vừa vặn trong lòng bàn tay từ Galaxy A50s. Mặt lưng sáng bóng kết hợp các lớp màu nổi ba chiều cho bạn thêm đậm dấu ấn khác biệt. Thoả thích lựa chọn các phối màu cá tính: Đen, Trắng, Tím hoặc Xanh làm hài lòng mọi tín đồ thời trang.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/a50s/mota/2.jpeg\"/></br><h1 class=\"font-weight-bold\">Chi tiết ấn tượng\r\n</h1><p>Chụp ảnh thêm chi tiết, sắc nét với Bộ Ba Camera cao cấp từ Galaxy A50s. Camera chính 48MP cho mọi khung hình trở nên sống động ấn tượng, bất chấp mọi điều kiện sáng. Thu lại khung hình rộng ấn tượng với camera Góc Siêu Rộng 8MP đỉnh cao. Thoả sức sáng tạo với camera Chiều Sâu 5MP xoá phông như máy chuyên nghiệp.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/a50s/mota/3.jpeg\"/></div></br>');
INSERT INTO `product` VALUES (30, 'img/sanpham/samsung/a70/2.jpg', 'SAMSUNG GALAXY A70', 1, 9900000, 30, 4, 4, 3, 12, 'img/sanpham/samsung/a70/1.jpg', 'img/sanpham/samsung/a70/2.jpg', 'img/sanpham/samsung/a70/3.jpg', 'img/sanpham/samsung/a70/4.jpg', 'Super AMOLED 6.7 inch Full HD+ (1080 x 2220 Pixels)', '32 MP', '32 MP + 8 MP + 5 MP', 'Thiết kế màn hình Infinity-U tối ưu hiển thị\r\n', 'Cấu hình mạnh mẽ tăng cường khả năng trải nghiệm\r\n', 'Cảm biến vân tay trong màn hình\r\n', 'Điện Thoại Samsung Galaxy A70 (128GB/6GB) - Hàng Chính Hãng được Samsung đồng bộ hóa thiết kế tương tự như những người anh em Samsung A50 của mình với ngoại hình “giọt nước” cùng viền mỏng ở mặt trước nhường chỗ cho không gian hiển thị của màn hình được rộng rãi nhất.\r\n\r\nChiếc smartphone này sở hữu màn hình kích thước 6.7 inch, độ phân giải 1080 x 2400 pixel và thiết kế theo công nghệ Infinity-U (tỷ lệ 20 : 9) mang đến trải nghiệm thuận tiện cho người dùng. Với tấm nền công nghệ Super AMOLED được chính Samsung phát triển, Samsung Galaxy A70 mang đến chất lượng hiển thị cực kỳ sắc nét với độ chi tiết cao và khả năng tái tạo màu sắc rực rỡ.', 'Samsung Galaxy A70 được trang bị bộ vi xử lý 8 nhân, được hỗ trợ bởi hai tùy chọn bộ nhớ là RAM 6GB đi kèm với dung lượng bộ nhớ trong 128GB cùng hệ điều hành Android 9.0 Pie mới nhất cho hiệu năng mượt mà cùng tiết kiệm điện năng hiệu quả. Qua đó việc \"chiến\" các game hot hiện này như Liên Quân, PUBG một cách mượt mà.', 'Samsung Galaxy A70 là chiếc smartphone tầm trung được Samsung ưu ái trang bị cảm biến vân tay bên trong màn hình giúp tăng vẻ đẹp thẩm mỹ cho máy. Tốc độ nhận diện và mở khóa máy khá nhanh giúp bạn tiết kiệm được thời gian so với việc nhập mật khẩu thông thường.\r\n\r\nViệc mở khóa trên máy diễn ra rất đơn giản, bạn chỉ cần đặt ngón tay lên màn hình, cảm biến sẽ xuất hiện và điện thoại sẽ sẵn sàng để sử dụng.', 'img/sanpham/samsung/a70/mota/1.jpg', 'img/sanpham/samsung/a70/mota/2.jpg', 'img/sanpham/samsung/a70/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Thiết kế màn hình Infinity-U tối ưu hiển thị\r\n</h1><p>Điện Thoại Samsung Galaxy A70 (128GB/6GB) - Hàng Chính Hãng được Samsung đồng bộ hóa thiết kế tương tự như những người anh em Samsung A50 của mình với ngoại hình “giọt nước” cùng viền mỏng ở mặt trước nhường chỗ cho không gian hiển thị của màn hình được rộng rãi nhất.\r\n\r\nChiếc smartphone này sở hữu màn hình kích thước 6.7 inch, độ phân giải 1080 x 2400 pixel và thiết kế theo công nghệ Infinity-U (tỷ lệ 20 : 9) mang đến trải nghiệm thuận tiện cho người dùng. Với tấm nền công nghệ Super AMOLED được chính Samsung phát triển, Samsung Galaxy A70 mang đến chất lượng hiển thị cực kỳ sắc nét với độ chi tiết cao và khả năng tái tạo màu sắc rực rỡ.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/a70/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Cấu hình mạnh mẽ tăng cường khả năng trải nghiệm\r\n</h1><p>Samsung Galaxy A70 được trang bị bộ vi xử lý 8 nhân, được hỗ trợ bởi hai tùy chọn bộ nhớ là RAM 6GB đi kèm với dung lượng bộ nhớ trong 128GB cùng hệ điều hành Android 9.0 Pie mới nhất cho hiệu năng mượt mà cùng tiết kiệm điện năng hiệu quả. Qua đó việc \"chiến\" các game hot hiện này như Liên Quân, PUBG một cách mượt mà.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/a70/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Cảm biến vân tay trong màn hình\r\n</h1><p>Samsung Galaxy A70 là chiếc smartphone tầm trung được Samsung ưu ái trang bị cảm biến vân tay bên trong màn hình giúp tăng vẻ đẹp thẩm mỹ cho máy. Tốc độ nhận diện và mở khóa máy khá nhanh giúp bạn tiết kiệm được thời gian so với việc nhập mật khẩu thông thường.\r\n\r\nViệc mở khóa trên máy diễn ra rất đơn giản, bạn chỉ cần đặt ngón tay lên màn hình, cảm biến sẽ xuất hiện và điện thoại sẽ sẵn sàng để sử dụng.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/a70/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (31, 'img/sanpham/samsung/note9/2.jpg', 'SAMSUNG GALAXY NOTE 9', 1, 22990000, 30, 4, 4, 3, 12, 'img/sanpham/samsung/note9/1.jpg', 'img/sanpham/samsung/note9/2.jpg', 'img/sanpham/samsung/note9/3.jpg', 'img/sanpham/samsung/note9/4.jpg', '6.4 inch 2960 x 1440 pixels', '8 MP', '12 MP Dual-camera', 'Thiết kế sang trọng, đẳng cấp\r\n', 'Màn hình vô cực Quad HD+ \r\n', 'Hình ảnh sắc nét dưới ánh sáng gắt\r\n', 'Điện Thoại Samsung Galaxy Note 9 (128GB/6GB) - Hàng Chính Hãng (Đã Kích Hoạt) Bảo Hành 12 Tháng sở hữu thiết kế hợp kim nguyên khối sang trọng kết hợp khung viền kim loại sắc sảo và chắc chắn với phong cách thiết kế đa diện. Camera sau ẩn vào lưng máy cho trải nghiệm hoàn toàn mượt mà và vô cùng quyến rũ. Bên cạnh đó, Samsung Galaxy Note 9 mang đến nhiều màu sắc nổi bật cho bạn thỏa sức thể hiện phong cách cá tính từ sắc xanh đại dương mạnh mẽ, màu đen huyền bí thanh lịch hay màu đồng ánh kim thời thượng cùng bút S Pen cùng màu.\r\n\r\n', 'Tận hưởng màu sắc rực rỡ cùng những chuyển động trung thực trên màn hình Galaxy Note9. Chế độ tự điều chỉnh tương phản dựa trên điều kiện ánh sáng, hiển thị chi tiết rõ nét dù là trong nhà hay dưới ánh sáng mặt trời.\r\n', 'Galaxy Note 9 được trang bị màn hình Super AMOLED 6.4inch mang đến trải nghiệm thị giác không giới hạn kết hợp độ phân giải Quad HD+ (2K+) tạo nên sự đột phá so các dòng điện thoại trên thị trường với màn hình gần như chiếm trọn mặt trước. Bên cạnh đó, bộ cảm biến và quét mống mắt được giấu khéo léo để không cản trở tầm nhìn tới ưu hơn. \r\n\r\n', 'img/sanpham/samsung/note9/mota/1.jpg', 'img/sanpham/samsung/note9/mota/2.jpg', 'img/sanpham/samsung/note9/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Thiết kế sang trọng, đẳng cấp\r\n</h1><p>Điện Thoại Samsung Galaxy Note 9 (128GB/6GB) - Hàng Chính Hãng (Đã Kích Hoạt) Bảo Hành 12 Tháng sở hữu thiết kế hợp kim nguyên khối sang trọng kết hợp khung viền kim loại sắc sảo và chắc chắn với phong cách thiết kế đa diện. Camera sau ẩn vào lưng máy cho trải nghiệm hoàn toàn mượt mà và vô cùng quyến rũ. Bên cạnh đó, Samsung Galaxy Note 9 mang đến nhiều màu sắc nổi bật cho bạn thỏa sức thể hiện phong cách cá tính từ sắc xanh đại dương mạnh mẽ, màu đen huyền bí thanh lịch hay màu đồng ánh kim thời thượng cùng bút S Pen cùng màu.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/note9/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Màn hình vô cực Quad HD+ \r\n</h1><p>Tận hưởng màu sắc rực rỡ cùng những chuyển động trung thực trên màn hình Galaxy Note9. Chế độ tự điều chỉnh tương phản dựa trên điều kiện ánh sáng, hiển thị chi tiết rõ nét dù là trong nhà hay dưới ánh sáng mặt trời.\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/note9/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Hình ảnh sắc nét dưới ánh sáng gắt\r\n</h1><p>Galaxy Note 9 được trang bị màn hình Super AMOLED 6.4inch mang đến trải nghiệm thị giác không giới hạn kết hợp độ phân giải Quad HD+ (2K+) tạo nên sự đột phá so các dòng điện thoại trên thị trường với màn hình gần như chiếm trọn mặt trước. Bên cạnh đó, bộ cảm biến và quét mống mắt được giấu khéo léo để không cản trở tầm nhìn tới ưu hơn. \r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/note9/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (32, 'img/sanpham/samsung/note10/2.jpg', 'SAMSUNG GALAXY NOTE 10', 1, 22990000, 30, 5, 5, 3, 12, 'img/sanpham/samsung/note10/1.jpg', 'img/sanpham/samsung/note10/2.jpg', 'img/sanpham/samsung/note10/3.jpg', 'img/sanpham/samsung/note10/4.jpg', 'Full HD+ (1080 x 2280 Pixels)', '10 MP', 'Chính 12 MP & Phụ 12 MP, 16 MP', 'Màu sắc được chắt lọc từ sắc độ sáng tự nhiên.\r\n', 'Giao diện đồng nhất cho bạn trải nghiệm mượt mà\r\n', 'Biến chiếc điện thoại thành ổ cứng di động ngay trong tầm tay với bộ nhớ hơn 512GB\r\n', 'Sự kết hợp của những dải màu nổi bật và sinh động. Với lớp kính cường lực Gorilla 6 bảo vệ vững chắc, và chất liệu thủy tinh đánh bóng bắt sáng cao cấp sắc sảo kiến tạo nên ánh quang đậm chất đương đại.\r\n\r\n', 'Thao tác sử dụng Galaxy Note10 và Note10+ trực quan hơn nhờ Giao diện Đồng nhất, thân thiện với thói quen thường ngày, cho trải nghiệm Galaxy trở nên vô tận.\r\n\r\n', 'Với bộ nhớ trong đến 512GB và có thể mở rộng lên tới 1TB qua thẻ nhớ microSD, bạn luôn có đủ không gian để lưu trữ toàn bộ kho nhạc, hình ảnh và video của mình.\r\n\r\n', 'img/sanpham/samsung/note10/mota/1.jpg', 'img/sanpham/samsung/note10/mota/2.jpg', 'img/sanpham/samsung/note10/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Màu sắc được chắt lọc từ sắc độ sáng tự nhiên.\r\n</h1><p>Sự kết hợp của những dải màu nổi bật và sinh động. Với lớp kính cường lực Gorilla 6 bảo vệ vững chắc, và chất liệu thủy tinh đánh bóng bắt sáng cao cấp sắc sảo kiến tạo nên ánh quang đậm chất đương đại.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/note10/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Giao diện đồng nhất cho bạn trải nghiệm mượt mà\r\n</h1><p>Thao tác sử dụng Galaxy Note10 và Note10+ trực quan hơn nhờ Giao diện Đồng nhất, thân thiện với thói quen thường ngày, cho trải nghiệm Galaxy trở nên vô tận.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/note10/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Biến chiếc điện thoại thành ổ cứng di động ngay trong tầm tay với bộ nhớ hơn 512GB\r\n</h1><p>Với bộ nhớ trong đến 512GB và có thể mở rộng lên tới 1TB qua thẻ nhớ microSD, bạn luôn có đủ không gian để lưu trữ toàn bộ kho nhạc, hình ảnh và video của mình.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/note10/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (33, 'img/sanpham/huawei/p30/2.jpg', 'HUAWEI P30', 3, 16990000, 30, 4, 4, 3, 12, 'img/sanpham/huawei/p30/1.jpg', 'img/sanpham/huawei/p30/2.jpg', 'img/sanpham/huawei/p30/3.jpg', 'img/sanpham/huawei/p30/4.jpg', '6.1 inch (1080 x 2340 pixels)', '24 MP', '40 MP x 16 MP x 8 MP', 'Thiết kế nguyên khối cao cấp, mặt kính cao cấp\r\n', 'Hệ thống camera chất lượng cao\r\n', 'Màn hình lớn - Khả năng hiển thị tuyệt vời\r\n', 'Điện Thoại Huawei P30 sở hữu thiết kế mặt lưng kính cao cấp cùng phần khung viền kim loại được hoàn thiện tốt, tạo cảm giác cao cấp. P30 cho cảm giác cầm tay thoải mái, chắc chắn. Viền bezels được tối ưu tốt, các góc máy hơi được bo cong, tạo cảm giác mềm mại.\r\n\r\n', 'Huawei P30 trang bị hệ thống camera sau 3 ống kính với camera chính độ phân giải 40MP, camera phụ 16MP và một camera độ phân giải 8MP, cùng với đó là camera selfie độ phân giải 32MP, khẩu độ f/1.8 và đèn flash LED. Loại ống kính sử dụng trên P30 là dạng kính tiềm vọng cao cấp và mới mẻ. Nếu là người dùng yêu thích chụp ảnh, quay video thì P30 chắc chắn sẽ làm hài lòng bạn.\r\n\r\n', 'P30 sử dụng tấm nền màn hình OLED kích thước lên tới 6.1 inch, độ phân giải FullHD+ (1080 x 2340 pixels), tỷ lệ màn hình 19:9, mật độ điểm ảnh 422ppi, tỷ lệ hiển thị là 85.61%. Với một màn hình lớn và chất lượng hiển thị như trên, P30 hứa hẹn chinh phục người dùng quan tâm và khắt khe với chất lượng hình ảnh, video trên smartphone.\r\n\r\n', 'img/sanpham/huawei/p30/mota/1.ipg', 'img/sanpham/huawei/p30/mota/2.jpg', 'img/sanpham/huawei/p30/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Thiết kế nguyên khối cao cấp, mặt kính cao cấp\r\n</h1><p>Điện Thoại Huawei P30 sở hữu thiết kế mặt lưng kính cao cấp cùng phần khung viền kim loại được hoàn thiện tốt, tạo cảm giác cao cấp. P30 cho cảm giác cầm tay thoải mái, chắc chắn. Viền bezels được tối ưu tốt, các góc máy hơi được bo cong, tạo cảm giác mềm mại.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/huawei/p30/mota/1.ipg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Hệ thống camera chất lượng cao\r\n</h1><p>Huawei P30 trang bị hệ thống camera sau 3 ống kính với camera chính độ phân giải 40MP, camera phụ 16MP và một camera độ phân giải 8MP, cùng với đó là camera selfie độ phân giải 32MP, khẩu độ f/1.8 và đèn flash LED. Loại ống kính sử dụng trên P30 là dạng kính tiềm vọng cao cấp và mới mẻ. Nếu là người dùng yêu thích chụp ảnh, quay video thì P30 chắc chắn sẽ làm hài lòng bạn.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/huawei/p30/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Màn hình lớn - Khả năng hiển thị tuyệt vời\r\n</h1><p>P30 sử dụng tấm nền màn hình OLED kích thước lên tới 6.1 inch, độ phân giải FullHD+ (1080 x 2340 pixels), tỷ lệ màn hình 19:9, mật độ điểm ảnh 422ppi, tỷ lệ hiển thị là 85.61%. Với một màn hình lớn và chất lượng hiển thị như trên, P30 hứa hẹn chinh phục người dùng quan tâm và khắt khe với chất lượng hình ảnh, video trên smartphone.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/huawei/p30/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (34, 'img/sanpham/huawei/y6prime/2.jpg', 'HUAWEI Y6 PRIME', 3, 3690000, 30, 1, 2, 3, 12, 'img/sanpham/huawei/y6prime/1.jpg', 'img/sanpham/huawei/y6prime/2.jpg', 'img/sanpham/huawei/y6prime/3.jpg', 'img/sanpham/huawei/y6prime/4.jpg', ' IPS 5 inch HD 720 x 1280 pixels', '5 MP', '13.0 MP + 2.0 MP', 'Trang bị các tính năng cao cấp từ các dòng flagship\r\n', 'Tận hưởng màn hình 6.26 inch giọt nước cực lớn\r\n', 'Bộ vi xử lý Qualcomm Snapdragon 450\r\n', 'Điện Thoại Huawei Y6 Prime thừa hưởng thiết kế màn hình \"giọt nước\" thời thượng và tích hợp camera selfie 16MP mạnh mẽ, tối ưu không gian trải nghiệm cho người dùng. Nhờ thiết kế thông minh của Huawei mà máy dù có màn hình rộng tới 6.26 inch nhưng vẫn cho cảm giác cầm vừa vặn, thoải mái trên tay hay bỏ trong túi.\r\n\r\n', 'Màn hình Huawei Y6 Prime được thiết kế theo dạng tràn viền giọt nước kiểu mới, cho không gian hiển thị cực lớn nhờ viền siêu mỏng. Bạn sẽ được tận hưởng màn hình lớn tới 6.26 inch cùng độ phân giải HD+ (720 x 1520 Pixels), nội dung hiển thị rõ nét và trải nghiệm xem tuyệt vời. Tấm nền IPS giúp bạn có thể trải nghiệm góc nhìn rộng 178° đem lại hình ảnh sắc nét, sống động và độ tương phản cao ngay cả ở những góc nhìn hẹp.\r\n\r\n', 'Huawei Y6 Prime trang bị bộ vi xử lý Qualcomm Snapdragon 450 đi cùng 3GB RAM, cho trải nghiệm nhanh và mượt mà ở mọi ứng dụng. Bộ nhớ trong 32GB hỗ trợ thẻ nhớ tối đa 512GB mang tới không gian lưu trữ thoải mái để lưu lại mọi nội dung bạn yêu thích.\r\n\r\n', 'img/sanpham/huawei/y6prime/mota/1.jpg', 'img/sanpham/huawei/y6prime/mota/2.jpg', 'img/sanpham/huawei/y6prime/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Trang bị các tính năng cao cấp từ các dòng flagship\r\n</h1><p>Điện Thoại Huawei Y6 Prime thừa hưởng thiết kế màn hình \"giọt nước\" thời thượng và tích hợp camera selfie 16MP mạnh mẽ, tối ưu không gian trải nghiệm cho người dùng. Nhờ thiết kế thông minh của Huawei mà máy dù có màn hình rộng tới 6.26 inch nhưng vẫn cho cảm giác cầm vừa vặn, thoải mái trên tay hay bỏ trong túi.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/huawei/y6prime/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Tận hưởng màn hình 6.26 inch giọt nước cực lớn\r\n</h1><p>Màn hình Huawei Y6 Prime được thiết kế theo dạng tràn viền giọt nước kiểu mới, cho không gian hiển thị cực lớn nhờ viền siêu mỏng. Bạn sẽ được tận hưởng màn hình lớn tới 6.26 inch cùng độ phân giải HD+ (720 x 1520 Pixels), nội dung hiển thị rõ nét và trải nghiệm xem tuyệt vời. Tấm nền IPS giúp bạn có thể trải nghiệm góc nhìn rộng 178° đem lại hình ảnh sắc nét, sống động và độ tương phản cao ngay cả ở những góc nhìn hẹp.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/huawei/y6prime/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Bộ vi xử lý Qualcomm Snapdragon 450\r\n</h1><p>Huawei Y6 Prime trang bị bộ vi xử lý Qualcomm Snapdragon 450 đi cùng 3GB RAM, cho trải nghiệm nhanh và mượt mà ở mọi ứng dụng. Bộ nhớ trong 32GB hỗ trợ thẻ nhớ tối đa 512GB mang tới không gian lưu trữ thoải mái để lưu lại mọi nội dung bạn yêu thích.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/huawei/y6prime/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (35, 'img/sanpham/oppo/a3s/2.jpg', 'OPPO A3s', 5, 4690000, 30, 2, 2, 3, 12, 'img/sanpham/oppo/a3s/1.jpg', 'img/sanpham/oppo/a3s/2.jpg', 'img/sanpham/oppo/a3s/3.jpg', 'img/sanpham/oppo/a3s/4.jpg', '6.2 inch (Màn hình siêu tràn), HD+', '8 MP', '13 MP + 2 MP (Camera kép)', 'Ngoại hình bắt mắt với thiết kế tai thỏ độc đáo\r\n', 'Cấu hình vừa đủ dùng\r\n', 'Cụm camera kép xóa phông hoàn hảo\r\n', 'Điện thoại OPPO A3s sở hữu mặt lưng kính có thể biến đổi màu sắc từ những góc nhìn khác nhau tạo nên vẻ đẹp vô cùng sang trọng không kém các sản phẩm cao cấp. Dù sử dụng chất liệu nhựa để mang lại giá bán rẻ cho người dùng, máy vẫn toát lên vẻ đẹp cuốn hút nhờ khung viền kim loại và cách tạo độ bóng trên mặt lưng nhựa khiến nó trông như làm từ kính. Bên cạnh đó bốn góc được bo tròn mềm mại tạo cảm giác cầm nắm dễ chịu, thoải mái.\r\n\r\n', 'Cấu hình vừa đủ dùng với vi xử lý Snapdragon 450 và RAM 3GB kết hợp với giao diện Color Os 5.1 được tuỳ biến từ Android 8.1 mang lại mặt trải nghiệm thú vị về mặt phần mềm cho người dùng, đủ đáp ứng các nhu cầu sử dụng cơ bản và chơi mượt mà ở các tựa game HOT hiện nay như Liên Quân, PUBG ở mức độ họa trung bình.\r\n\r\n', 'OPPO A3s tích hợp cụm camera kép 13MP+2MP với khẩu độ ống kính tương ứng là F/2.2 và F/2.4 hỗ trợ chế độ chân dung xoá phôngvà nhiều chế độ chụp ảnh dễ dàng và tiên tiến khác. Phía trước của Oppo A3s là camera selfie 8MP khẩu độ F/2.2 với tính năng làm đẹp nổi tiếng của hãng được tích hợp sẽ cho bạn bức ảnh selfie ấn tượng. Trong điều kiện ánh sáng đầy đủ, camera OPPO A3s đáp ứng tốt với hình ảnh và độ chi tiết lên rất chân thực, chụp xóa phông chỉ ở mức khá với các chi tiết còn bị lẫn với chủ thể.\r\n\r\n', 'img/sanpham/oppo/a3s/mota/1.jpg', 'img/sanpham/oppo/a3s/mota/2.jpg', 'img/sanpham/oppo/a3s/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Ngoại hình bắt mắt với thiết kế tai thỏ độc đáo\r\n</h1><p>Điện thoại OPPO A3s sở hữu mặt lưng kính có thể biến đổi màu sắc từ những góc nhìn khác nhau tạo nên vẻ đẹp vô cùng sang trọng không kém các sản phẩm cao cấp. Dù sử dụng chất liệu nhựa để mang lại giá bán rẻ cho người dùng, máy vẫn toát lên vẻ đẹp cuốn hút nhờ khung viền kim loại và cách tạo độ bóng trên mặt lưng nhựa khiến nó trông như làm từ kính. Bên cạnh đó bốn góc được bo tròn mềm mại tạo cảm giác cầm nắm dễ chịu, thoải mái.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/oppo/a3s/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Cấu hình vừa đủ dùng\r\n</h1><p>Cấu hình vừa đủ dùng với vi xử lý Snapdragon 450 và RAM 3GB kết hợp với giao diện Color Os 5.1 được tuỳ biến từ Android 8.1 mang lại mặt trải nghiệm thú vị về mặt phần mềm cho người dùng, đủ đáp ứng các nhu cầu sử dụng cơ bản và chơi mượt mà ở các tựa game HOT hiện nay như Liên Quân, PUBG ở mức độ họa trung bình.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/oppo/a3s/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Cụm camera kép xóa phông hoàn hảo\r\n</h1><p>OPPO A3s tích hợp cụm camera kép 13MP+2MP với khẩu độ ống kính tương ứng là F/2.2 và F/2.4 hỗ trợ chế độ chân dung xoá phôngvà nhiều chế độ chụp ảnh dễ dàng và tiên tiến khác. Phía trước của Oppo A3s là camera selfie 8MP khẩu độ F/2.2 với tính năng làm đẹp nổi tiếng của hãng được tích hợp sẽ cho bạn bức ảnh selfie ấn tượng. Trong điều kiện ánh sáng đầy đủ, camera OPPO A3s đáp ứng tốt với hình ảnh và độ chi tiết lên rất chân thực, chụp xóa phông chỉ ở mức khá với các chi tiết còn bị lẫn với chủ thể.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/oppo/a3s/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (36, 'img/sanpham/oppo/f11pro/2.jpg', 'OPPO F11 PRO', 5, 8490000, 30, 4, 3, 3, 12, 'img/sanpham/oppo/f11pro/1.jpg', 'img/sanpham/oppo/f11pro/2.jpg', 'img/sanpham/oppo/f11pro/3.jpg', 'img/sanpham/oppo/f11pro/4.jpg', 'LTPS LCD, 6.53\", Full HD+ (1080 x 2340 Pixels)', '16 MP', '48MP + 5MP (2 camera)', 'Thiết kế độc đáo, thu hút ánh nhìn\r\n', 'Hiệu năng mạnh mẽ\r\n', 'Camera trước với chế độ làm đẹp Al\r\n', 'Điện thoại Oppo F11 Pro được khoác lên mình thiết kế khung viền kim loại cùng 2 mặt kính bóng bẩy. Mặt lưng được thiết kế theo hiệu ứng gradient đổi màu hứa hẹn sẽ khiến giới trẻ \"phát cuồng\". Các viền kính được làm bo cong ôm sát vào viền kim loại để cung cấp trải nghiệm cầm nắm thoải mái, dù điện thoại có kích thước khá lớn.\r\n\r\n', 'Máy được trang bị con chip MediaTek Helio P70 8 nhân đủ để trải nghiệm các dòng game hot: PUBG, Liên quân ở mức cấu hình tầm trung và đặc biệt máy sở hữu tới 6 GB RAM. Với dung lượng RAM này bạn có thể tự tin sử dụng nhiều ứng dụng cùng lúc mà máy vẫn chuyển qua lại một cách mượt mà. Một điểm cộng khác là máy chạy sẵn Android 9.0 (Pie) ngay khi bán ra cho bạn nhiều trải nghiệm mới mẻ.\r\n\r\n', 'Oppo F11 Pro sở hữu camera trước độ phân giải 16 MP. Chế độ làm đẹp bằng AI hay những công nghệ mà những chiếc smartphone Oppo đã mang đến thì bạn hoàn toàn có thể tự tin với khả năng selfie của Oppo F11 Pro. Camera trước có chức năng nhận diện khuôn mặt, chế độ làm đẹp, quay video Full HD, tự động lấy nét, Selfie ngược sáng HDR, sticker AR (biểu tượng thực tế ảo), quay video HD, cho bạn những bức hình sống động.\r\n\r\n', 'img/sanpham/oppo/f11pro/mota/1.jpg', 'img/sanpham/oppo/f11pro/mota/2.jpg', 'img/sanpham/oppo/f11pro/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Thiết kế độc đáo, thu hút ánh nhìn\r\n</h1><p>Điện thoại Oppo F11 Pro được khoác lên mình thiết kế khung viền kim loại cùng 2 mặt kính bóng bẩy. Mặt lưng được thiết kế theo hiệu ứng gradient đổi màu hứa hẹn sẽ khiến giới trẻ \"phát cuồng\". Các viền kính được làm bo cong ôm sát vào viền kim loại để cung cấp trải nghiệm cầm nắm thoải mái, dù điện thoại có kích thước khá lớn.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/oppo/f11pro/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Hiệu năng mạnh mẽ\r\n</h1><p>Máy được trang bị con chip MediaTek Helio P70 8 nhân đủ để trải nghiệm các dòng game hot: PUBG, Liên quân ở mức cấu hình tầm trung và đặc biệt máy sở hữu tới 6 GB RAM. Với dung lượng RAM này bạn có thể tự tin sử dụng nhiều ứng dụng cùng lúc mà máy vẫn chuyển qua lại một cách mượt mà. Một điểm cộng khác là máy chạy sẵn Android 9.0 (Pie) ngay khi bán ra cho bạn nhiều trải nghiệm mới mẻ.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/oppo/f11pro/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Camera trước với chế độ làm đẹp Al\r\n</h1><p>Oppo F11 Pro sở hữu camera trước độ phân giải 16 MP. Chế độ làm đẹp bằng AI hay những công nghệ mà những chiếc smartphone Oppo đã mang đến thì bạn hoàn toàn có thể tự tin với khả năng selfie của Oppo F11 Pro. Camera trước có chức năng nhận diện khuôn mặt, chế độ làm đẹp, quay video Full HD, tự động lấy nét, Selfie ngược sáng HDR, sticker AR (biểu tượng thực tế ảo), quay video HD, cho bạn những bức hình sống động.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/oppo/f11pro/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (37, 'img/sanpham/oppo/reno2/2.jpg', 'OPPO RENO 2', 5, 14990000, 30, 5, 5, 3, 12, 'img/sanpham/oppo/reno2/1.jpg', 'img/sanpham/oppo/reno2/2.jpg', 'img/sanpham/oppo/reno2/3.jpg', 'img/sanpham/oppo/reno2/4.jpg', 'AMOLED, 6.5\", Full HD+', '16 MP', 'Chính 48 MP & Phụ 13 MP, 8 MP, 2 MP', 'Màn hình AMOLED tràn viền, độ phân giải 2400x1080 pixel\r\n', '4 camera sau zoom 20x cùng camera selfie “vây cá mập” độc đáo\r\n', 'Hiệu năng ổn định với chip Snapdragon 730G\r\n', 'OPPO Reno 2 sẽ có màn hình tràn viền hoàn hảo đúng nghĩa nhờ thiết kế camera selfie độc đáo, thực sự không có bất cứ một phần khuyết nào trên màn hình. Màn hình tràn viền tỷ lệ 19,5:9 cùng với một kích thước lên tới 6.5 inch, nhưng thực chất chỉ nằm gọn trong lòng bàn tay vì tỉ lệ màn hình chiếm tới 93% mặt trước.\r\n\r\nĐi kèm với đó là tấm nền AMOLED đạt chuẩn 2.400x1.080 pixel đem đến chất lượng hiển thị cao, cho người trải nghiệm thị giác đẹp và ấn tượng. Ngoài ra, Reno 2 còn được trang bị cho cả mặt trước và sau kính cường lực Gorilla Glass thế hệ 6. Qua đó, đem lại cho máy khả năng chống xước và chống va đập tốt hơn.', 'Dường như camera selfie “vây cá mập” đã là đặc trưng và đặc điểm nhận diện của dòng OPPO Reno, được thiết kế bởi một hình tam giác giống như chiếc vây cá mập. Bên cạnh đó, còn được tích hợp một module có khả năng thò ra thụt vào khi cần thiết nhưng không phải toàn bộ mà chỉ nâng một bên và một bên cố định. Độ phân giải của camera selfie của OPPO Reno 2 lên đến 16 MP được tích hợp công nghệ làm đẹp AI hứa hẹn sẽ mang đến những bức ảnh selfie lung linh, sắc nét và sinh động cho người dùng. Tốc độ mở camera trước nhanh hơn 28.5% so với các tiền nhiệm giúp bạn không phải chờ đợi lâu khi sử dụng camera pop-up.', 'OPPO Reno 2 được trang bị bộ vi xử lý Snapdragon 730G, một con chip thường được sử dụng trên những chiếc máy tầm trung. Theo Qualcomn, chip này có tốc độ xử lý mạnh hơn đàn anh Snapdragon 660 đến 20%, Adreno 618 cho tác vụ xử lý hình ảnh tốt hơn 35% so với GPU Adreno 512. Hơn nữa, các tác vụ liên quan tới AI gấp 2 lần so với Snapdragon 660.', 'img/sanpham/oppo/reno2/mota/1.jpg', 'img/sanpham/oppo/reno2/mota/2.jpg', 'img/sanpham/oppo/reno2/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Màn hình AMOLED tràn viền, độ phân giải 2400x1080 pixel\r\n</h1><p>OPPO Reno 2 sẽ có màn hình tràn viền hoàn hảo đúng nghĩa nhờ thiết kế camera selfie độc đáo, thực sự không có bất cứ một phần khuyết nào trên màn hình. Màn hình tràn viền tỷ lệ 19,5:9 cùng với một kích thước lên tới 6.5 inch, nhưng thực chất chỉ nằm gọn trong lòng bàn tay vì tỉ lệ màn hình chiếm tới 93% mặt trước.\r\n\r\nĐi kèm với đó là tấm nền AMOLED đạt chuẩn 2.400x1.080 pixel đem đến chất lượng hiển thị cao, cho người trải nghiệm thị giác đẹp và ấn tượng. Ngoài ra, Reno 2 còn được trang bị cho cả mặt trước và sau kính cường lực Gorilla Glass thế hệ 6. Qua đó, đem lại cho máy khả năng chống xước và chống va đập tốt hơn.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/oppo/reno2/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">4 camera sau zoom 20x cùng camera selfie “vây cá mập” độc đáo\r\n</h1><p>Dường như camera selfie “vây cá mập” đã là đặc trưng và đặc điểm nhận diện của dòng OPPO Reno, được thiết kế bởi một hình tam giác giống như chiếc vây cá mập. Bên cạnh đó, còn được tích hợp một module có khả năng thò ra thụt vào khi cần thiết nhưng không phải toàn bộ mà chỉ nâng một bên và một bên cố định. Độ phân giải của camera selfie của OPPO Reno 2 lên đến 16 MP được tích hợp công nghệ làm đẹp AI hứa hẹn sẽ mang đến những bức ảnh selfie lung linh, sắc nét và sinh động cho người dùng. Tốc độ mở camera trước nhanh hơn 28.5% so với các tiền nhiệm giúp bạn không phải chờ đợi lâu khi sử dụng camera pop-up.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/oppo/reno2/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Hiệu năng ổn định với chip Snapdragon 730G\r\n</h1><p>OPPO Reno 2 được trang bị bộ vi xử lý Snapdragon 730G, một con chip thường được sử dụng trên những chiếc máy tầm trung. Theo Qualcomn, chip này có tốc độ xử lý mạnh hơn đàn anh Snapdragon 660 đến 20%, Adreno 618 cho tác vụ xử lý hình ảnh tốt hơn 35% so với GPU Adreno 512. Hơn nữa, các tác vụ liên quan tới AI gấp 2 lần so với Snapdragon 660.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/oppo/reno2/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (38, 'img/sanpham/realme/5pro/2.jpg', 'REALME 5 PRO', 4, 6290000, 30, 3, 4, 3, 12, 'img/sanpham/realme/5pro/1.jpg', 'img/sanpham/realme/5pro/2.jpg', 'img/sanpham/realme/5pro/3.jpg', 'img/sanpham/realme/5pro/4.jpg', 'IPS LCD, 6.3\", Full HD+', '16 MP', 'Chính 48 MP & Phụ 8 MP, 2 MP, 2 MP', 'Thiết kế gradient, mặt kính 3D, góc cạnh được bo tròn, bảo mật vân tay\r\n', 'Màn hình IPS LCD 6.3 inches độ phân giải Full HD+, tỉ lệ 19.5:9\r\n', 'Camera sau 48MP-8MP-2MP-2MP, camera trước 16MP\r\n', 'Điện Thoại Realme 5 Pro sở hữu thiết kế cao cấp và đẹp mắt, từng đường nét được chăm chút tỉ mỉ cùng độ mỏng vừa phải càng làm tôn vẻ thẩm mỹ bên ngoài của chiếc máy. Với ý tưởng thiết kế mặt lưng chuyển màu sắc độc đáo ôm khít thân máy, các góc cạnh được bo tròn mềm mại giúp Realme 5 Pro nằm gọn trong lòng bàn tay bạn.\r\n\r\nRealme 5 Pro có 2 màu sắc xanh đại dương và xanh thảo nguyên độc đáo. Máy có thiết kế nhân trắc học hướng tới người dùng, kích thước vừa đủ để thao tác bằng một tay cùng mặt kính 3D cong phía sau đem lại cảm giác thoải mái và cao cấp.', 'Realme 5 Pro trang bị màn hình tràn viền có kích thước lớn 6.3 inches và độ phân giải Full HD+ (1080 x 2340 pixels) tỉ lệ 19.5:9 cho khung hình hiển thị tràn viền mang đến nội dung chi tiết, hình ảnh sắc nét tuyệt vời.\r\n\r\nTấm nền công nghệ IPS LCD mang lại sắc màu rực rỡ, độ tương phản cao thích hợp trình chiếu các bộ phim hấp dẫn hay đáp ứng nhu cầu chơi game hạng nặng của các bạn trẻ. Ngoài ra máy còn trang bị lớp kính bảo vệ Gorilla Glass 5 nên có thể dễ dàng nhìn thấy dưới ánh nắng mặt trời.', 'Không phải là hai, ba mà là bốn thấu kính cho cụm camera phía sau trên Realme 5 Pro, cho phép người dùng chụp những tấm hình đẹp và chân thực một cách dễ dàng. Với bốn ống kính, trải nghiệm sẽ trở nên phong phú hơn cho phép người dùng thỏa sức sáng tạo và lưu giữ, kiến tạo và sẻ chia những hình ảnh đầy ấn tượng. Chi tiết hơn, ống kính 48 MP dùng để bắt đối tượng chính, ống kính 8 MP cho góc chụp rộng lên đến 120 độ, ống kính 2MP hỗ trợ khả năng zoom ảnh và cảm biến 2MP tạo hiệu ứng chiều sâu.', 'img/sanpham/realme/5pro/mota/1.jpg', 'img/sanpham/realme/5pro/mota/2.gif', 'img/sanpham/realme/5pro/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Thiết kế gradient, mặt kính 3D, góc cạnh được bo tròn, bảo mật vân tay\r\n</h1><p>Điện Thoại Realme 5 Pro sở hữu thiết kế cao cấp và đẹp mắt, từng đường nét được chăm chút tỉ mỉ cùng độ mỏng vừa phải càng làm tôn vẻ thẩm mỹ bên ngoài của chiếc máy. Với ý tưởng thiết kế mặt lưng chuyển màu sắc độc đáo ôm khít thân máy, các góc cạnh được bo tròn mềm mại giúp Realme 5 Pro nằm gọn trong lòng bàn tay bạn.\r\n\r\nRealme 5 Pro có 2 màu sắc xanh đại dương và xanh thảo nguyên độc đáo. Máy có thiết kế nhân trắc học hướng tới người dùng, kích thước vừa đủ để thao tác bằng một tay cùng mặt kính 3D cong phía sau đem lại cảm giác thoải mái và cao cấp.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/realme/5pro/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Màn hình IPS LCD 6.3 inches độ phân giải Full HD+, tỉ lệ 19.5:9\r\n</h1><p>Realme 5 Pro trang bị màn hình tràn viền có kích thước lớn 6.3 inches và độ phân giải Full HD+ (1080 x 2340 pixels) tỉ lệ 19.5:9 cho khung hình hiển thị tràn viền mang đến nội dung chi tiết, hình ảnh sắc nét tuyệt vời.\r\n\r\nTấm nền công nghệ IPS LCD mang lại sắc màu rực rỡ, độ tương phản cao thích hợp trình chiếu các bộ phim hấp dẫn hay đáp ứng nhu cầu chơi game hạng nặng của các bạn trẻ. Ngoài ra máy còn trang bị lớp kính bảo vệ Gorilla Glass 5 nên có thể dễ dàng nhìn thấy dưới ánh nắng mặt trời.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/realme/5pro/mota/2.gif\"/></br><h1 class=\"font-weight-bold\">Camera sau 48MP-8MP-2MP-2MP, camera trước 16MP\r\n</h1><p>Không phải là hai, ba mà là bốn thấu kính cho cụm camera phía sau trên Realme 5 Pro, cho phép người dùng chụp những tấm hình đẹp và chân thực một cách dễ dàng. Với bốn ống kính, trải nghiệm sẽ trở nên phong phú hơn cho phép người dùng thỏa sức sáng tạo và lưu giữ, kiến tạo và sẻ chia những hình ảnh đầy ấn tượng. Chi tiết hơn, ống kính 48 MP dùng để bắt đối tượng chính, ống kính 8 MP cho góc chụp rộng lên đến 120 độ, ống kính 2MP hỗ trợ khả năng zoom ảnh và cảm biến 2MP tạo hiệu ứng chiều sâu.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/realme/5pro/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (39, 'img/sanpham/samsung/s10plus/2.jpg', 'SAMSUNG GALAXY S10+', 1, 22990000, 30, 5, 5, 3, 12, 'img/sanpham/samsung/s10plus/1.jpg', 'img/sanpham/samsung/s10plus/2.jpg', 'img/sanpham/samsung/s10plus/3.jpg', 'img/sanpham/samsung/s10plus/4.jpg', 'Super AMOLED, 6.44\"\", Quad HD+ (2K+)', 'Camera kép (10MP (2PD) f1.9, Depth Camera 8MP f2.2)', ' 3 camera (Tele 12MP (2PD) f2.4 + góc rộng 12MP f1.5/2.4 + siêu rộng 16MP f2.2 123 độ)', 'Thiết kế không chỉ nổi bật mà còn tạo nên sự khác biệt tuyệt đối\r\n', 'Hiển thị chuẩn điện ảnh sống động đến khó tin\r\n', 'Chế độ bảo vệ mắt\r\n', 'Điện Thoại Samsung Galaxy S10 Plus kiệt tác tái thiết kế hoàn hảo loại bỏ trở ngại tầm nhìn, không có tai thỏ, không bị hạn chế. Đường cắt viền laser tỉ mỉ, màn hình Dynamic AMOLED thân thiện đôi mắt giúp Màn Hình Infinity-O trở thành màn hình Galaxy mang tính cải tiến đỉnh cao nhất từ trước đến nay.\r\n\r\n', 'Công nghệ màn hình Dynamic AMOLED thế hệ mới sở hữu độ phân giải chuẩn HDR10+ cho khả năng điều chỉnh dải màu sắc tối ưu, mang đến sắc màu cùng độ tương phản chân thực trên từng khung hình - kể cả thước phim tối nhất. Màn hình sáng hơn giúp bạn nhìn rõ từng chi tiết ngay cả dưới ánh sáng ban ngày. Kết hợp cùng hệ thống loa vòm Dolby Atmos, bạn sẽ đắm mình vào những trải nghiệm giải trí đích thực.\r\n\r\n        *Màn hình của Galaxy S10e, S10 Plus và S10 Plus+ được Tổ chức VDE của Đức chứng nhận khả năng hiển thị 100% dải màu với tỷ lệ tương phản 2.000.000:1.', 'Chế độ bảo vệ mắt điều chỉnh ánh sáng cho trải nghiệm thị giác tối ưu. Một hỗn hợp chất lỏng đặc biệt của công nghệ Dynamic AMOLED giúp giảm đến 42% ánh sáng xanh có hại mà không thay đổi màu sắc trên màn hình. Ít mỏi mắt hơn dù xem phim đến tận tối muộn, giấc ngủ cũng ngon hơn.\r\n\r\n', 'img/sanpham/samsung/s10plus/mota/1.jpg', 'img/sanpham/samsung/s10plus/mota/2.jpg', 'img/sanpham/samsung/s10plus/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Thiết kế không chỉ nổi bật mà còn tạo nên sự khác biệt tuyệt đối\r\n</h1><p>Điện Thoại Samsung Galaxy S10 Plus kiệt tác tái thiết kế hoàn hảo loại bỏ trở ngại tầm nhìn, không có tai thỏ, không bị hạn chế. Đường cắt viền laser tỉ mỉ, màn hình Dynamic AMOLED thân thiện đôi mắt giúp Màn Hình Infinity-O trở thành màn hình Galaxy mang tính cải tiến đỉnh cao nhất từ trước đến nay.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/s10plus/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Hiển thị chuẩn điện ảnh sống động đến khó tin\r\n</h1><p>Công nghệ màn hình Dynamic AMOLED thế hệ mới sở hữu độ phân giải chuẩn HDR10+ cho khả năng điều chỉnh dải màu sắc tối ưu, mang đến sắc màu cùng độ tương phản chân thực trên từng khung hình - kể cả thước phim tối nhất. Màn hình sáng hơn giúp bạn nhìn rõ từng chi tiết ngay cả dưới ánh sáng ban ngày. Kết hợp cùng hệ thống loa vòm Dolby Atmos, bạn sẽ đắm mình vào những trải nghiệm giải trí đích thực.\r\n\r\n        *Màn hình của Galaxy S10e, S10 Plus và S10 Plus+ được Tổ chức VDE của Đức chứng nhận khả năng hiển thị 100% dải màu với tỷ lệ tương phản 2.000.000:1.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/s10plus/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Chế độ bảo vệ mắt\r\n</h1><p>Chế độ bảo vệ mắt điều chỉnh ánh sáng cho trải nghiệm thị giác tối ưu. Một hỗn hợp chất lỏng đặc biệt của công nghệ Dynamic AMOLED giúp giảm đến 42% ánh sáng xanh có hại mà không thay đổi màu sắc trên màn hình. Ít mỏi mắt hơn dù xem phim đến tận tối muộn, giấc ngủ cũng ngon hơn.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/s10plus/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (40, 'img/sanpham/xiaomi/mimix3/2.jpg', 'XIAOMI MI MIX 3', 2, 12990000, 30, 4, 4, 3, 12, 'img/sanpham/xiaomi/mimix3/1.jpg', 'img/sanpham/xiaomi/mimix3/2.jpg', 'img/sanpham/xiaomi/mimix3/3.jpg', 'img/sanpham/xiaomi/mimix3/4.jpg', '6.39 inch (1080 x 2340) pixels, IPS LCD', 'Camera kép 24MP + 2MP', 'Camera kép 12MP + 12MP', 'Thiết kế siêu ấn tượng', 'Màn hình 6.39 inch, IPS LCD\r\n', 'Camera kép, độ phân giải khủng\r\n', 'Điện Thoại Xiaomi Mi Mix 3 có sự đột phá ấn tượng với màn hình 4 cạnh “tràn viền” thực sự ở mặt trước với kích thước lên đến 6.5 inch lớn nhất thế giới smartphone từ trước tới nay. Sau 2 năm tìm tòi và nghiên cứu công nghệ mới, Xiaomi cuối cùng cũng đã thành công trong việc tích hợp màn hình tràn cả 4 cạnh mặt trước trên Xiaomi Mi Mix 3. Đồng thời, các góc cạnh Mi Mix 3 được gia công bo tròn vừa phải tạo cảm giác cầm nắm thoải mái, lại vừa có phần vuông vức đầy nam tính của một sản phẩm thiên nhiều về tính nghệ thuật.', 'Mi Mix 3 với màn hình sở hữu 4 viền tràn cạnh, được trang bị màn hình kích thước 6.39 inch, độ phân giải (1080 x 2340) pixels, tỷ lệ 19.5:9 trên tấm nền IPS LCD mang lại những hình ảnh sắc nét với màu sắc trung thực. Nhờ tối ưu phần viền cực mỏng Xiaomi đưa được một không gian hiển thị rất rộng vào một thiết bị không quá cồng kềnh, đáp ứng hoàn hảo nhu cầu xem phim, chơi game giải trí trên màn hình lớn.\r\n', 'Bằng việc được trang bị cụm camera kép với 2 cảm biến lần lượt 12MP + 20MP được xếp theo chiều dọc ở mặt lưng, Mi Mix 3 thừa sức cho ra những bức ảnh siêu chất lượng. Đặc biệt, máy còn đi kèm với cụm đèn flash LED 2 tông màu giúp người dùng thu sáng tốt hơn trong những điều kiện môi trường kém thuận lợi. Mặt trước, chúng ta có camera selfie 24MP cùng với sự hỗ trợ của trí thông minh nhân tạo, đảm nhiệm tính năng hậu chỉnh sửa ảnh, giúp những tác vụ như chụp “tự sướng” hay quay video call trở nên sắc nét hơn bao giờ hết.\r\n', 'img/sanpham/xiaomi/mimix3/mota/1.jpg', 'img/sanpham/xiaomi/mimix3/mota/2.jpg', 'img/sanpham/xiaomi/mimix3/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Thiết kế siêu ấn tượng</h1><p>Điện Thoại Xiaomi Mi Mix 3 có sự đột phá ấn tượng với màn hình 4 cạnh “tràn viền” thực sự ở mặt trước với kích thước lên đến 6.5 inch lớn nhất thế giới smartphone từ trước tới nay. Sau 2 năm tìm tòi và nghiên cứu công nghệ mới, Xiaomi cuối cùng cũng đã thành công trong việc tích hợp màn hình tràn cả 4 cạnh mặt trước trên Xiaomi Mi Mix 3. Đồng thời, các góc cạnh Mi Mix 3 được gia công bo tròn vừa phải tạo cảm giác cầm nắm thoải mái, lại vừa có phần vuông vức đầy nam tính của một sản phẩm thiên nhiều về tính nghệ thuật.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/xiaomi/mimix3/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Màn hình 6.39 inch, IPS LCD\r\n</h1><p>Mi Mix 3 với màn hình sở hữu 4 viền tràn cạnh, được trang bị màn hình kích thước 6.39 inch, độ phân giải (1080 x 2340) pixels, tỷ lệ 19.5:9 trên tấm nền IPS LCD mang lại những hình ảnh sắc nét với màu sắc trung thực. Nhờ tối ưu phần viền cực mỏng Xiaomi đưa được một không gian hiển thị rất rộng vào một thiết bị không quá cồng kềnh, đáp ứng hoàn hảo nhu cầu xem phim, chơi game giải trí trên màn hình lớn.\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/xiaomi/mimix3/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Camera kép, độ phân giải khủng\r\n</h1><p>Bằng việc được trang bị cụm camera kép với 2 cảm biến lần lượt 12MP + 20MP được xếp theo chiều dọc ở mặt lưng, Mi Mix 3 thừa sức cho ra những bức ảnh siêu chất lượng. Đặc biệt, máy còn đi kèm với cụm đèn flash LED 2 tông màu giúp người dùng thu sáng tốt hơn trong những điều kiện môi trường kém thuận lợi. Mặt trước, chúng ta có camera selfie 24MP cùng với sự hỗ trợ của trí thông minh nhân tạo, đảm nhiệm tính năng hậu chỉnh sửa ảnh, giúp những tác vụ như chụp “tự sướng” hay quay video call trở nên sắc nét hơn bao giờ hết.\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/xiaomi/mimix3/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (41, 'img/sanpham/xiaomi/redmi5plus/2.jpg', 'XIAOMI REDMI 5 PLUS', 2, 5690000, 30, 3, 2, 3, 12, 'img/sanpham/xiaomi/redmi5plus/1.jpg', 'img/sanpham/xiaomi/redmi5plus/2.jpg', 'img/sanpham/xiaomi/redmi5plus/3.jpg', 'img/sanpham/xiaomi/redmi5plus/4.jpg', 'FHD + 2160 x 1080 pixel', '5 MP', '12MP f2.2', 'Màn hình cảm ứng điện dung', 'Qualcomm Snapdragon 625 Octa Core 2.0GHz', 'Giúp bạn lưu giữ những khoảng khắc tuyệt vời.', 'hiển thị toàn màn hình 18:9 được kết hợp với thân máy mỏng 8.0mm, thoải mái để vừa vặn trong tay bạn.', 'Qualcomm Snapdragon 625 Octa Core 2.0GHz. Tùy chọn 3 + 32GB, 4 + 64GB, Cung cấp bộ nhớ dung lượng lớn cho âm nhạc, ứng dụng, ảnh và video của bạn', 'Camera trước 5.0MP và camera sau 12.0MP, giúp bạn lưu giữ những khoảng khắc tuyệt vời.', 'img/sanpham/xiaomi/redmi5plus/mota/1.jpg', 'img/sanpham/xiaomi/redmi5plus/mota/2.jpg', 'img/sanpham/xiaomi/redmi5plus/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Màn hình cảm ứng điện dung</h1><p>hiển thị toàn màn hình 18:9 được kết hợp với thân máy mỏng 8.0mm, thoải mái để vừa vặn trong tay bạn.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/xiaomi/redmi5plus/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Qualcomm Snapdragon 625 Octa Core 2.0GHz</h1><p>Qualcomm Snapdragon 625 Octa Core 2.0GHz. Tùy chọn 3 + 32GB, 4 + 64GB, Cung cấp bộ nhớ dung lượng lớn cho âm nhạc, ứng dụng, ảnh và video của bạn</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/xiaomi/redmi5plus/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Giúp bạn lưu giữ những khoảng khắc tuyệt vời.</h1><p>Camera trước 5.0MP và camera sau 12.0MP, giúp bạn lưu giữ những khoảng khắc tuyệt vời.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/xiaomi/redmi5plus/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (42, 'img/sanpham/vsmart/live64gb/2.jpg', 'Vsmart Live (64GB/6GB)', 6, 3299000, 28, 4, 3, 2, 12, 'img/sanpham/vsmart/live64gb/1.jpg', 'img/sanpham/vsmart/live64gb/2.jpg', 'img/sanpham/vsmart/live64gb/3.jpg', 'img/sanpham/vsmart/live64gb/4.jpg', '	AMOLED', '20MP', 'Chính 48 MP & Phụ 8 MP, 5 MP', 'Sống phong cách - Dám bứt phá', 'Màn hình Super Amoled tích hợp cảm biến vân tay', 'Phối màu cực ngầu', 'Điện Thoại Vsmart Live với 3 camera đẳng cấp, cảm biến vân tay dưới màn hình cùng hiệu năng xuất sắc, Vsmart Live mang đến cho bạn cuộc sống phong cách và đầy bứt phá.', 'Nâng tầm nhiếp ảnh di động với bộ 3 camera hoàn hảo trên Vsmart Live. Camera chính có độ phân giải lên tới 48MP, khẩu độ cực lớn f/1.7, cho khả năng chụp siêu sắc nét và chụp đêm đẳng cấp. Hai camera còn lại có khả năng hỗ trợ chụp ảnh xóa phông và chụp góc siêu rộng 120 độ, mang tới những bức ảnh chuyên nghiệp, độc đáo của riêng bạn.', 'Tận hưởng những nội dung yêu thích qua màn hình 6,2 inch Super AMOLED cao cấp, độ phân giải Full HD+ sắc nét. Ngoài ra, Vsmart Live còn tích hợp cảm biến vân tay ngay dưới màn hình, một phương thức bảo mật tiện lợi của tương lai. Chỉ cần một cú chạm vào màn hình, điện thoại sẽ mở khóa ngay lập tức.', 'img/sanpham/vsmart/live64gb/mota/1.jpg', 'img/sanpham/vsmart/live64gb/mota/2.png', 'img/sanpham/vsmart/live64gb/mota/3.png', 1, '<h1 class=\"font-weight-bold\">Sống phong cách - Dám bứt phá</h1><p>Điện Thoại Vsmart Live với 3 camera đẳng cấp, cảm biến vân tay dưới màn hình cùng hiệu năng xuất sắc, Vsmart Live mang đến cho bạn cuộc sống phong cách và đầy bứt phá.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/vsmart/live64gb/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Màn hình Super Amoled tích hợp cảm biến vân tay</h1><p>Nâng tầm nhiếp ảnh di động với bộ 3 camera hoàn hảo trên Vsmart Live. Camera chính có độ phân giải lên tới 48MP, khẩu độ cực lớn f/1.7, cho khả năng chụp siêu sắc nét và chụp đêm đẳng cấp. Hai camera còn lại có khả năng hỗ trợ chụp ảnh xóa phông và chụp góc siêu rộng 120 độ, mang tới những bức ảnh chuyên nghiệp, độc đáo của riêng bạn.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/vsmart/live64gb/mota/2.png\"/></br><h1 class=\"font-weight-bold\">Phối màu cực ngầu</h1><p>Tận hưởng những nội dung yêu thích qua màn hình 6,2 inch Super AMOLED cao cấp, độ phân giải Full HD+ sắc nét. Ngoài ra, Vsmart Live còn tích hợp cảm biến vân tay ngay dưới màn hình, một phương thức bảo mật tiện lợi của tương lai. Chỉ cần một cú chạm vào màn hình, điện thoại sẽ mở khóa ngay lập tức.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/vsmart/live64gb/mota/3.png\"/></div></br>');
INSERT INTO `product` VALUES (43, 'img/sanpham/oppo/f5youth/2.jpg', 'OPPO F5 YOUTH', 6, 4490000, 30, 2, 2, 3, 12, 'img/sanpham/oppo/f5youth/1.jpg', 'img/sanpham/oppo/f5youth/2.jpg', 'img/sanpham/oppo/f5youth/3.jpg', 'img/sanpham/oppo/f5youth/4.jpg', 'IPS LCD 6 inch Full HD', '16 MP', '13 MP', 'Thiết kế nguyên khối, màn hình tràn viền\r\n', 'Màn hình 6 inch, tấm nền IPS\r\n', 'Camera sắc nét, làm đẹp AI \r\n', 'Điện Thoại OPPO F5 Youth mang trong mình thiết kế nguyên khối toàn phần với mặt lưng liền mạch cho vẻ đẹp sang trọng và tối giản tinh tế. Chất liệu vỏ nhựa nhưng được gia công rất tốt với lớp sơn phủ giả kim loại cho cảm giác trên tay thực sự rất giống các máy vỏ nhôm khác. Trọng lượng nhẹ nhàng, các góc bo tròn cầm nắm thoải mái.\r\n\r\n', 'OPPO F5 Youth có kích thước màn hình 6 inch và có mặt trước được bảo vệ bởi tấm kính cường lực Corning Gorilla Glass và các góc cạnh bo cong 2.5D thời thượng tương tự các thế hệ OPPO trước.\r\n\r\n', 'Công nghệ chụp ảnh làm đẹp khuôn mặt của OPPO F5 Youth được nâng lên một tầm cao mới nhờ ứng dụng công nghệ trí tuệ nhân tạo AI. Theo công bố từ OPPO, công nghệ này giúp phân tích và tự rút kinh nghiệm để ảnh chụp đẹp hơn. Thông số camera cũng được rút gọn với độ phân giải camera trước 16 MP và camera sau 13 MP, độ sắc nét hình ảnh có thể giảm đi một chút bù lại các công nghệ vẫn được giữ lại. \r\n\r\n', 'img/sanpham/oppo/f5youth/mota/1.jpg', 'img/sanpham/oppo/f5youth/mota/2.jpg', 'img/sanpham/oppo/f5youth/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Thiết kế nguyên khối, màn hình tràn viền\r\n</h1><p>Điện Thoại OPPO F5 Youth mang trong mình thiết kế nguyên khối toàn phần với mặt lưng liền mạch cho vẻ đẹp sang trọng và tối giản tinh tế. Chất liệu vỏ nhựa nhưng được gia công rất tốt với lớp sơn phủ giả kim loại cho cảm giác trên tay thực sự rất giống các máy vỏ nhôm khác. Trọng lượng nhẹ nhàng, các góc bo tròn cầm nắm thoải mái.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/oppo/f5youth/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Màn hình 6 inch, tấm nền IPS\r\n</h1><p>OPPO F5 Youth có kích thước màn hình 6 inch và có mặt trước được bảo vệ bởi tấm kính cường lực Corning Gorilla Glass và các góc cạnh bo cong 2.5D thời thượng tương tự các thế hệ OPPO trước.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/oppo/f5youth/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Camera sắc nét, làm đẹp AI \r\n</h1><p>Công nghệ chụp ảnh làm đẹp khuôn mặt của OPPO F5 Youth được nâng lên một tầm cao mới nhờ ứng dụng công nghệ trí tuệ nhân tạo AI. Theo công bố từ OPPO, công nghệ này giúp phân tích và tự rút kinh nghiệm để ảnh chụp đẹp hơn. Thông số camera cũng được rút gọn với độ phân giải camera trước 16 MP và camera sau 13 MP, độ sắc nét hình ảnh có thể giảm đi một chút bù lại các công nghệ vẫn được giữ lại. \r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/oppo/f5youth/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (44, 'img/sanpham/vsmart/joy/2.jpg', 'Vsmart Joy 2+', 6, 3290000, 30, 2, 2, 3, 12, 'img/sanpham/vsmart/joy/1.jpg', 'img/sanpham/vsmart/joy/2.jpg', 'img/sanpham/vsmart/joy/3.jpg', 'img/sanpham/vsmart/joy/4.jpg', 'IPS LCD', '8 MP', 'Chính 13 MP & Phụ 5 MP', 'Mang trọn thiết kế đầy đẳng cấp', 'Sáng bừng đêm tới với camera kép AI', 'Hệ điều hành hoàn toàn mới', 'Điện Thoại Vsmart Joy 2+ (Hàng Chính Hãng) có thiết kế màn hình giọt nước thời thượng cùng mặt lưng sống động, sắc màu. Với phản xạ ánh sáng cho mỗi góc nhìn một màu sắc khác nhau.Vsmart Joy 2+ cũng là sản phẩm có sức mạnh vượt trội trong phân khúc do sử dụng bộ xử lý Snapdragon 450 từ Qualcomm - nhà sản xuất Chip hàng đầu thế giới. Snapdragon 450 mạnh hơn 25% so với thế hệ chip cũ trong khi tiết kiệm 30% năng lượng khi chơi game. Kết hợp với màn hình lớn 6,2” HD+ sắc nét, Vsmart Joy2+  hứa hẹn sẽ mang lại trải nghiệm sử dụng hoàn hảo cho khách hàng.', 'Về Camera, Joy 2+ tiếp tục kế thừa những tính năng camera cao cấp trên Vsmart Live: camera tự động sử dụng trí tuệ nhân tạo để chọn những chế độ chụp phù hợp nhất với điều kiện môi trường xung quanh, chế độ xóa phông ảo diệu với cụm camera 13MP + 5MP chất lượng cao, hiệu ứng làm đẹp và chế độ AR Sticker ghép mặt thú vị dành cho giới trẻ.', 'Joy 2+ tiếp tục được sử dụng VOS 2.0, hệ điều hành hoàn toàn mới được các chuyên gia và kỹ sư phần mềm Vsmart nghiên cứu. Cụ thể, VOS 2.0 của Vsmart tái thiết kế toàn bộ giao diện, tối ưu hóa thao tác sử dụng của người dùng như thao tác điều khiển bằng cử chỉ, không sử dụng thanh điều hướng, sao lưu, khôi phục và đồng bộ dữ liệu người dùng. VOS2.0 của Vsmart cũng có thêm chế độ đơn giản cho người lớn tuổi và có tính năng sử dụng hai tài khoản trên cùng một ứng dụng.', 'img/sanpham/vsmart/joy/mota/1.jpg', 'img/sanpham/vsmart/joy/mota/2.jpg', 'img/sanpham/vsmart/joy/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Mang trọn thiết kế đầy đẳng cấp</h1><p>Điện Thoại Vsmart Joy 2+ (Hàng Chính Hãng) có thiết kế màn hình giọt nước thời thượng cùng mặt lưng sống động, sắc màu. Với phản xạ ánh sáng cho mỗi góc nhìn một màu sắc khác nhau.Vsmart Joy 2+ cũng là sản phẩm có sức mạnh vượt trội trong phân khúc do sử dụng bộ xử lý Snapdragon 450 từ Qualcomm - nhà sản xuất Chip hàng đầu thế giới. Snapdragon 450 mạnh hơn 25% so với thế hệ chip cũ trong khi tiết kiệm 30% năng lượng khi chơi game. Kết hợp với màn hình lớn 6,2” HD+ sắc nét, Vsmart Joy2+  hứa hẹn sẽ mang lại trải nghiệm sử dụng hoàn hảo cho khách hàng.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/vsmart/joy/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Sáng bừng đêm tới với camera kép AI</h1><p>Về Camera, Joy 2+ tiếp tục kế thừa những tính năng camera cao cấp trên Vsmart Live: camera tự động sử dụng trí tuệ nhân tạo để chọn những chế độ chụp phù hợp nhất với điều kiện môi trường xung quanh, chế độ xóa phông ảo diệu với cụm camera 13MP + 5MP chất lượng cao, hiệu ứng làm đẹp và chế độ AR Sticker ghép mặt thú vị dành cho giới trẻ.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/vsmart/joy/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Hệ điều hành hoàn toàn mới</h1><p>Joy 2+ tiếp tục được sử dụng VOS 2.0, hệ điều hành hoàn toàn mới được các chuyên gia và kỹ sư phần mềm Vsmart nghiên cứu. Cụ thể, VOS 2.0 của Vsmart tái thiết kế toàn bộ giao diện, tối ưu hóa thao tác sử dụng của người dùng như thao tác điều khiển bằng cử chỉ, không sử dụng thanh điều hướng, sao lưu, khôi phục và đồng bộ dữ liệu người dùng. VOS2.0 của Vsmart cũng có thêm chế độ đơn giản cho người lớn tuổi và có tính năng sử dụng hai tài khoản trên cùng một ứng dụng.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/vsmart/joy/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (45, 'img/sanpham/vsmart/live32gb/2.jpg', 'Vsmart Live (4GB/64GB)', 6, 2980000, 30, 3, 3, 3, 12, 'img/sanpham/vsmart/live32gb/1.jpg', 'img/sanpham/vsmart/live32gb/2.jpg', 'img/sanpham/vsmart/live32gb/3.jpg', 'img/sanpham/vsmart/live32gb/4.jpg', 'AMOLED, 6.2\", Full HD+', '20 MP', 'Chính 48 MP & Phụ 8 MP, 5 MP', 'Sống phong cách - Dám bứt phá', 'Màn hình Super Amoled tích hợp cảm biến vân tay', 'Phối màu cực ngầu', 'Điện Thoại Vsmart Live với 3 camera đẳng cấp, cảm biến vân tay dưới màn hình cùng hiệu năng xuất sắc, Vsmart Live mang đến cho bạn cuộc sống phong cách và đầy bứt phá.', 'Nâng tầm nhiếp ảnh di động với bộ 3 camera hoàn hảo trên Vsmart Live. Camera chính có độ phân giải lên tới 48MP, khẩu độ cực lớn f/1.7, cho khả năng chụp siêu sắc nét và chụp đêm đẳng cấp. Hai camera còn lại có khả năng hỗ trợ chụp ảnh xóa phông và chụp góc siêu rộng 120 độ, mang tới những bức ảnh chuyên nghiệp, độc đáo của riêng bạn.', 'Tận hưởng những nội dung yêu thích qua màn hình 6,2 inch Super AMOLED cao cấp, độ phân giải Full HD+ sắc nét. Ngoài ra, Vsmart Live còn tích hợp cảm biến vân tay ngay dưới màn hình, một phương thức bảo mật tiện lợi của tương lai. Chỉ cần một cú chạm vào màn hình, điện thoại sẽ mở khóa ngay lập tức.', 'img/sanpham/vsmart/live64gb/mota/1.jpg', 'img/sanpham/vsmart/live64gb/mota/2.png', 'img/sanpham/vsmart/live64gb/mota/3.png', 1, '<h1 class=\"font-weight-bold\">Sống phong cách - Dám bứt phá</h1><p>Điện Thoại Vsmart Live với 3 camera đẳng cấp, cảm biến vân tay dưới màn hình cùng hiệu năng xuất sắc, Vsmart Live mang đến cho bạn cuộc sống phong cách và đầy bứt phá.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/vsmart/live64gb/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Màn hình Super Amoled tích hợp cảm biến vân tay</h1><p>Nâng tầm nhiếp ảnh di động với bộ 3 camera hoàn hảo trên Vsmart Live. Camera chính có độ phân giải lên tới 48MP, khẩu độ cực lớn f/1.7, cho khả năng chụp siêu sắc nét và chụp đêm đẳng cấp. Hai camera còn lại có khả năng hỗ trợ chụp ảnh xóa phông và chụp góc siêu rộng 120 độ, mang tới những bức ảnh chuyên nghiệp, độc đáo của riêng bạn.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/vsmart/live64gb/mota/2.png\"/></br><h1 class=\"font-weight-bold\">Phối màu cực ngầu</h1><p>Tận hưởng những nội dung yêu thích qua màn hình 6,2 inch Super AMOLED cao cấp, độ phân giải Full HD+ sắc nét. Ngoài ra, Vsmart Live còn tích hợp cảm biến vân tay ngay dưới màn hình, một phương thức bảo mật tiện lợi của tương lai. Chỉ cần một cú chạm vào màn hình, điện thoại sẽ mở khóa ngay lập tức.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/vsmart/live64gb/mota/3.png\"/></div></br>');
INSERT INTO `product` VALUES (46, 'img/sanpham/vivo/y91c/2.jpg', 'Vivo Y91C ', 7, 2190000, 30, 1, 1, 3, 12, 'img/sanpham/vivo/y91c/1.jpg', 'img/sanpham/vivo/y91c/2.jpg', 'img/sanpham/vivo/y91c/3.jpg', 'img/sanpham/vivo/y91c/4.jpg', '6.22\", HD+', '5 MP', '13 MP', 'Màn hình giọt nước hiện đại', 'Hiệu năng ổn định ', 'Camera chất lượng', 'Chiếc smartphone của Vivo ấn tượng người dùng bởi kiểu hiển thị màn hình khuyết hình giọt nước hiện đại  với kích thước 6.22 inch, độ phân giải HD+ cho bạn trải nghiệm hình ảnh mượt mà.', 'Vivo Y91C có cấu hình tầm trung được trang bị con chip xử lí MediaTek 6762R (bản nâng cấp của Helio P22) chạy trên hệ điều hành Android 8.1 (Oreo) kết hợp với giao diện FunTouch giúp máy có được độ mượt mà để trải nghiệm được tốt nhất.\r\n\r\nVới đặc điểm cấu hình này sản phẩm có thể chạy ổn định với các tựa game nhẹ và tầm trung như Liên quân Mobile ở mức cấu hình thấp, Temple Run 2, cho bạn có sự giải trí thư giãn sau những giờ học tập cũng như làm việc căng thẳng.', 'Camera sau của điện thoại Vivo Y91C có độ phân giải 13 MP có chức năng chụp ảnh bằng giọng nói và cử chỉ giúp bạn có thể thuận tiện trong chụp nhóm từ xa mà không cần phải ngại ngùng đi nhờ người chụp hộ.\r\n\r\nCamera trước độ phân giải 5 MP với chế độ chụp làm đẹp giúp bạn có thể tự tin tự sướng cho những tấm ảnh đẹp khoe với người thân và bạn bè.', 'img/sanpham/vivo/y91c/mota/1.jpg', 'img/sanpham/vivo/y91c/mota/2.jpg', 'img/sanpham/vivo/y91c/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Màn hình giọt nước hiện đại</h1><p>Chiếc smartphone của Vivo ấn tượng người dùng bởi kiểu hiển thị màn hình khuyết hình giọt nước hiện đại  với kích thước 6.22 inch, độ phân giải HD+ cho bạn trải nghiệm hình ảnh mượt mà.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/vivo/y91c/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Hiệu năng ổn định </h1><p>Vivo Y91C có cấu hình tầm trung được trang bị con chip xử lí MediaTek 6762R (bản nâng cấp của Helio P22) chạy trên hệ điều hành Android 8.1 (Oreo) kết hợp với giao diện FunTouch giúp máy có được độ mượt mà để trải nghiệm được tốt nhất.\r\n\r\nVới đặc điểm cấu hình này sản phẩm có thể chạy ổn định với các tựa game nhẹ và tầm trung như Liên quân Mobile ở mức cấu hình thấp, Temple Run 2, cho bạn có sự giải trí thư giãn sau những giờ học tập cũng như làm việc căng thẳng.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/vivo/y91c/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Camera chất lượng</h1><p>Camera sau của điện thoại Vivo Y91C có độ phân giải 13 MP có chức năng chụp ảnh bằng giọng nói và cử chỉ giúp bạn có thể thuận tiện trong chụp nhóm từ xa mà không cần phải ngại ngùng đi nhờ người chụp hộ.\r\n\r\nCamera trước độ phân giải 5 MP với chế độ chụp làm đẹp giúp bạn có thể tự tin tự sướng cho những tấm ảnh đẹp khoe với người thân và bạn bè.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/vivo/y91c/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (47, 'img/sanpham/vivo/y11/2.jpg', 'Vivo Y11', 7, 3290000, 30, 2, 2, 3, 12, 'img/sanpham/vivo/y11/1.jpg', 'img/sanpham/vivo/y11/2.jpg', 'img/sanpham/vivo/y11/3.jpg', 'img/sanpham/vivo/y11/4.jpg', 'IPS LCD, 6.35\", HD+', '8 MP', 'Chính 13 MP & Phụ 2 MP', 'Thiết kế sang trọng, sắc màu huyền ảo', 'Màn hình giọt nước 6,35 inch rộng lớn', 'Hiệu năng mượt mà', 'Điện thoại Vivo Y11 sở hữu thiết kế nguyên khối sang trọng, màu sắc được lấy cảm hứng từ những viên ngọc quý sáng lấp lánh. Trải qua quá trình chế tác thủ công tỉ mỉ, mặt lưng của Vivo Y11 có khả năng chuyển màu đẹp một cách huyền ảo. Cả hai phiên bản màu là Đỏ San Hô và Xanh Ngọc Bích đều tạo hiệu ứng đẹp lấp lánh, nổi bật.', 'Vivo Y11 sẽ đưa bạn tới những điều rộng lớn hơn nhờ màn hình lớn 6,35 inch tràn viền Halo đẹp mắt. Viền màn hình siêu mỏng giúp hình ảnh như nổi lên trước mắt, không có giới hạn, cho trải nghiệm thị giác vượt trội. Bên cạnh đó, các góc cạnh được bo tròn mềm mại sẽ hạn chế tình trạng cấn hoặc tê tay khi sử dụng trong thời gian dài.', 'Cung cấp sức mạnh cho máy là con chip Qualcomm Snapdragon 439 8 nhân 64-bit kết hợp với 3 GB RAM và 32 GB bộ nhớ trong. Với thông số này, thiết bị này hoàn toàn có thể xử lý mượt mà và trơn tru mọi tác vụ cơ bản như duyệt web, xem phim độ phân giải cao hay chỉnh sửa ảnh. ', 'img/sanpham/vivo/y11/mota/1.jpg', 'img/sanpham/vivo/y11/mota/2.jpg', 'img/sanpham/vivo/y11/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Thiết kế sang trọng, sắc màu huyền ảo</h1><p>Điện thoại Vivo Y11 sở hữu thiết kế nguyên khối sang trọng, màu sắc được lấy cảm hứng từ những viên ngọc quý sáng lấp lánh. Trải qua quá trình chế tác thủ công tỉ mỉ, mặt lưng của Vivo Y11 có khả năng chuyển màu đẹp một cách huyền ảo. Cả hai phiên bản màu là Đỏ San Hô và Xanh Ngọc Bích đều tạo hiệu ứng đẹp lấp lánh, nổi bật.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/vivo/y11/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Màn hình giọt nước 6,35 inch rộng lớn</h1><p>Vivo Y11 sẽ đưa bạn tới những điều rộng lớn hơn nhờ màn hình lớn 6,35 inch tràn viền Halo đẹp mắt. Viền màn hình siêu mỏng giúp hình ảnh như nổi lên trước mắt, không có giới hạn, cho trải nghiệm thị giác vượt trội. Bên cạnh đó, các góc cạnh được bo tròn mềm mại sẽ hạn chế tình trạng cấn hoặc tê tay khi sử dụng trong thời gian dài.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/vivo/y11/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Hiệu năng mượt mà</h1><p>Cung cấp sức mạnh cho máy là con chip Qualcomm Snapdragon 439 8 nhân 64-bit kết hợp với 3 GB RAM và 32 GB bộ nhớ trong. Với thông số này, thiết bị này hoàn toàn có thể xử lý mượt mà và trơn tru mọi tác vụ cơ bản như duyệt web, xem phim độ phân giải cao hay chỉnh sửa ảnh. </p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/vivo/y11/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (48, 'img/sanpham/vivo/v15/2.jpg', 'Vivo V15', 7, 5290000, 30, 3, 2, 3, 12, 'img/sanpham/vivo/v15/1.jpg', 'img/sanpham/vivo/v15/2.jpg', 'img/sanpham/vivo/v15/3.jpg', 'img/sanpham/vivo/v15/4.jpg', '6.53 inch FHD+ (1080 x 2340)', '32MP', '24MP DP (12MP) f/1.78 + 8MP f/2.2 + 5MP f/2.4 (3 Camera)', 'Thiết kế hoàn mĩ', 'Màn hình tràn không viền 6.53 inch FHD+', 'Trang bị con chip MTK Helio P70, 8 nhân', 'Điện Thoại VIVO V15 mang một thân hình vô cùng quyến rũ với không gian màn hình gần như chiếm trọn mặt trước của máy. Máy thiết kế mặt lưng với những họa tiết gợn sáng lung linh, thân hình thanh thoát, uyển chuyển bởi các đường cong mềm mại đan xen một chút mạnh mẽ, đem lại cảm giác cầm nắm trên tay vô cùng dễ chịu và thoải mái.', 'Màn hình tràn không viền mang đến tỉ lệ màn hình/thân máy đạt 90.95%, kích thước màn hình 6.53 inch, giúp mở rộng góc nhìn một cách đột phá. Kết hợp với độ phân giải FHD+ (1080 x 2340), kính cường lực Corning Gorilla Glass thế hệ thứ 5, giúp các trò chơi hay bộ phim trở nên hấp dẫn và thú vị hơn.', 'Được trang bị con chip MTK Helio P70, 8 nhân (2.1GHz) và bộ nhớ trong 128GB, RAM 6GB giúp người dùng có thể thoải máy đa nhiệm mà không sợ bị load lại ứng dụng trong quá trình sử dụng, giúp chơi game và vận hành nhiều ứng dụng cùng lúc mà vẫn mượt mà, không bị giật lag.', 'img/sanpham/vivo/v15/mota/1.jpg', 'img/sanpham/vivo/v15/mota/2.jpg', 'img/sanpham/vivo/v15/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Thiết kế hoàn mĩ</h1><p>Điện Thoại VIVO V15 mang một thân hình vô cùng quyến rũ với không gian màn hình gần như chiếm trọn mặt trước của máy. Máy thiết kế mặt lưng với những họa tiết gợn sáng lung linh, thân hình thanh thoát, uyển chuyển bởi các đường cong mềm mại đan xen một chút mạnh mẽ, đem lại cảm giác cầm nắm trên tay vô cùng dễ chịu và thoải mái.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/vivo/v15/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Màn hình tràn không viền 6.53 inch FHD+</h1><p>Màn hình tràn không viền mang đến tỉ lệ màn hình/thân máy đạt 90.95%, kích thước màn hình 6.53 inch, giúp mở rộng góc nhìn một cách đột phá. Kết hợp với độ phân giải FHD+ (1080 x 2340), kính cường lực Corning Gorilla Glass thế hệ thứ 5, giúp các trò chơi hay bộ phim trở nên hấp dẫn và thú vị hơn.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/vivo/v15/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Trang bị con chip MTK Helio P70, 8 nhân</h1><p>Được trang bị con chip MTK Helio P70, 8 nhân (2.1GHz) và bộ nhớ trong 128GB, RAM 6GB giúp người dùng có thể thoải máy đa nhiệm mà không sợ bị load lại ứng dụng trong quá trình sử dụng, giúp chơi game và vận hành nhiều ứng dụng cùng lúc mà vẫn mượt mà, không bị giật lag.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/vivo/v15/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (49, 'img/sanpham/vivo/y19/2.jpg', 'Vivo Y19', 7, 5695000, 30, 3, 2, 5, 12, 'img/sanpham/vivo/y19/1.jpg', 'img/sanpham/vivo/y19/2.jpg', 'img/sanpham/vivo/y19/3.jpg', 'img/sanpham/vivo/y19/4.jpg', 'IPS LCD, 6.53\", Full HD+', '16 MP', 'Chính 16 MP & Phụ 8 MP, 2 MP', 'Chiếc smartphone năng động và cá tính', 'Cụm 3 camera chất lượng cao', 'Dung lượng pin lớn thoải mái xài', 'Điện Thoại Vivo Y19 (128GB/6GB) là chiếc smartphone tập trung mạnh vào khả năng chụp ảnh ở camera chính lẫn camera selfie với công nghệ AI, hứa hẹn sẽ nhận được sự đón nhận tới từ người dùng là những bạn trẻ năng động và cá tính.', 'Vivo Y19 được trang bị 3 camera khá hầm hố ở mặt sau với độ phân giải lần lượt 16 MP + 8 MP + 2 MP.Khả năng lấy nét và lưu ảnh nhanh giúp người dùng không bị bỏ lỡ bất cứ khoảnh khắc đẹp nào trong cuộc sống.', 'Điểm nhấn đầu tiên trên Vivo Y19 là sở hữu viên pin dung lượng “khủng” đến 5.000 mAh và đi kèm công nghệ sạc nhanh.', 'img/sanpham/vivo/y19/mota/1.jpg', 'img/sanpham/vivo/y19/mota/2.jpg', 'img/sanpham/vivo/y19/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Chiếc smartphone năng động và cá tính</h1><p>Điện Thoại Vivo Y19 (128GB/6GB) là chiếc smartphone tập trung mạnh vào khả năng chụp ảnh ở camera chính lẫn camera selfie với công nghệ AI, hứa hẹn sẽ nhận được sự đón nhận tới từ người dùng là những bạn trẻ năng động và cá tính.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/vivo/y19/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Cụm 3 camera chất lượng cao</h1><p>Vivo Y19 được trang bị 3 camera khá hầm hố ở mặt sau với độ phân giải lần lượt 16 MP + 8 MP + 2 MP.Khả năng lấy nét và lưu ảnh nhanh giúp người dùng không bị bỏ lỡ bất cứ khoảnh khắc đẹp nào trong cuộc sống.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/vivo/y19/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Dung lượng pin lớn thoải mái xài</h1><p>Điểm nhấn đầu tiên trên Vivo Y19 là sở hữu viên pin dung lượng “khủng” đến 5.000 mAh và đi kèm công nghệ sạc nhanh.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/vivo/y19/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (50, 'img/sanpham/vivo/y81/2.jpg', 'Vivo Y81', 7, 2980000, 30, 2, 2, 3, 12, 'img/sanpham/vivo/y81/1.jpg', 'img/sanpham/vivo/y81/2.jpg', 'img/sanpham/vivo/y81/3.jpg', 'img/sanpham/vivo/y81/4.jpg', '6.22inch HD+ (1520 x 720)', '5MP', '13MP', 'Thiết kế tai thỏ thời thượng\r\n', 'Mở ra thế giới mới với màn hình tỷ lệ vàng 19:9', 'Trí thông minh nhân tạo hỗ trợ camera', 'Điện thoại Vivo Y81 là smartphone hướng đến người dùng phổ thông của hãng Vivo sau thành công của dòng điện thoại cận cao cấp Vivo V9, lần này Y81 trở lại vẫn với phong cách quen thuộc đó, tai thỏ thời thượng cùng với 2 màu sắc nổi bật là đen và đỏ nhưng hài hòa và cũng không kém phần sang trọng.', 'Với tỉ lệ màn hình trên thân máy lên đến 88%, Y81 giúp màn hình chiếm gần như toàn bộ mặt trước. Kích thước màn hình lớn 6.22 inch độ phân giải HD+ cùng tỷ lệ vàng 19:9 giúp trải nghiệm hình ảnh mang lại hoàn hảo, vượt xa giới hạn mong đợi của bạn.', 'Được thiết lập một ống kính 13 MP phía sau với khẩu độ f/2.2 cùng khả năng lấy nét theo pha nhanh chóng, Vivo Y81 giúp bạn bắt trọn mọi khoảnh khắc trong cuộc sống mà bạn muốn lưu lại. Máy cũng được trang bị tính năng Live Photo để bạn có thể lưu lại cả hình ảnh âm thanh trước và sau khi bấm nút chụp 1,5 giây, tạo thành một bức ảnh động đầy ấn tượng.', 'img/sanpham/vivo/y81/mota/1.jpg', 'img/sanpham/vivo/y81/mota/2.jpg', 'img/sanpham/vivo/y81/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Thiết kế tai thỏ thời thượng\r\n</h1><p>Điện thoại Vivo Y81 là smartphone hướng đến người dùng phổ thông của hãng Vivo sau thành công của dòng điện thoại cận cao cấp Vivo V9, lần này Y81 trở lại vẫn với phong cách quen thuộc đó, tai thỏ thời thượng cùng với 2 màu sắc nổi bật là đen và đỏ nhưng hài hòa và cũng không kém phần sang trọng.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/vivo/y81/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Mở ra thế giới mới với màn hình tỷ lệ vàng 19:9</h1><p>Với tỉ lệ màn hình trên thân máy lên đến 88%, Y81 giúp màn hình chiếm gần như toàn bộ mặt trước. Kích thước màn hình lớn 6.22 inch độ phân giải HD+ cùng tỷ lệ vàng 19:9 giúp trải nghiệm hình ảnh mang lại hoàn hảo, vượt xa giới hạn mong đợi của bạn.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/vivo/y81/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Trí thông minh nhân tạo hỗ trợ camera</h1><p>Được thiết lập một ống kính 13 MP phía sau với khẩu độ f/2.2 cùng khả năng lấy nét theo pha nhanh chóng, Vivo Y81 giúp bạn bắt trọn mọi khoảnh khắc trong cuộc sống mà bạn muốn lưu lại. Máy cũng được trang bị tính năng Live Photo để bạn có thể lưu lại cả hình ảnh âm thanh trước và sau khi bấm nút chụp 1,5 giây, tạo thành một bức ảnh động đầy ấn tượng.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/vivo/y81/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (51, 'img/sanpham/xiaomi/mi9lite/d2.jpg', 'XIAOMI MI9 LITE (Gobal_Đen)', 2, 9990000, 30, 4, 3, 3, 12, 'img/sanpham/xiaomi/mi9lite/d1.jpg', 'img/sanpham/xiaomi/mi9lite/d2.jpg', 'img/sanpham/xiaomi/mi9lite/d3.jpg', 'img/sanpham/xiaomi/mi9lite/d4.jpg', 'Super AMOLED, 6.39\", Full HD+', '32 MP', 'Chính 48 MP & Phụ 8 MP, 2 MP', 'Tổng quan sản phẩm\r\n', 'Màn hình OLED 6.39 inch\r\n', 'Bộ vi xử lý Qualcomm Snapdragon 710\r\n', 'Điện Thoại Xiaomi Mi 9 Lite có thiết kế tinh tế, cao cấp và sang trọng đến từng đường nét khi được chế tác từ kính gradient như người anh em Mi 8 Lite. Phần lưng kính cong cho trải nghiệm cầm nắm chắc chắn và đầy phong cách. Đồng thời, phần khung kim loại chắc chắn giúp chúng ta có được một chiếc điện thoại bền vững, yên tâm hơn khi sử dụng.\r\n\r\n', 'Xiaomi Mi 9 Lite có màn hình kích thước 6,39 inch khá lớn so với sản phẩm tiền nhiệm. Đây là tấm nền OLED với một notch giọt nước nhỏ ở chính giữa và độ phân giải Full HD +. Theo Xiaomi, màn hình này đạt được độ sáng tối đa 600 nits và tỷ lệ tương phản 6.000: 1. Để bảo vệ màn hình, Xiaomi Mi 9 Lite được trang bị kính cường lực Gorilla Glass 5 chống trầy xước và va đập.\r\n\r\n', 'Bên trong, Xiaomi Mi 9 Lite được trang bị bộ xử lý Qualcomm Snapdragon 710 với GPU Adreno 616, đi kèm với RAM 6GB và dung lượng lưu trữ 64 hoặc 128GB (bộ nhớ UFS 2.1). Đó là một phần cứng giúp người dùng có được hiệu suất rất tốt trong mọi tình huống trong khi vẫn duy trì mức tiêu thụ năng lượng khá thấp.\r\n\r\n', 'img/sanpham/xiaomi/mi9lite/mota/1.jpg', 'img/sanpham/xiaomi/mi9lite/mota/2.jpg', 'img/sanpham/xiaomi/mi9lite/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Tổng quan sản phẩm\r\n</h1><p>Điện Thoại Xiaomi Mi 9 Lite có thiết kế tinh tế, cao cấp và sang trọng đến từng đường nét khi được chế tác từ kính gradient như người anh em Mi 8 Lite. Phần lưng kính cong cho trải nghiệm cầm nắm chắc chắn và đầy phong cách. Đồng thời, phần khung kim loại chắc chắn giúp chúng ta có được một chiếc điện thoại bền vững, yên tâm hơn khi sử dụng.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/xiaomi/mi9lite/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Màn hình OLED 6.39 inch\r\n</h1><p>Xiaomi Mi 9 Lite có màn hình kích thước 6,39 inch khá lớn so với sản phẩm tiền nhiệm. Đây là tấm nền OLED với một notch giọt nước nhỏ ở chính giữa và độ phân giải Full HD +. Theo Xiaomi, màn hình này đạt được độ sáng tối đa 600 nits và tỷ lệ tương phản 6.000: 1. Để bảo vệ màn hình, Xiaomi Mi 9 Lite được trang bị kính cường lực Gorilla Glass 5 chống trầy xước và va đập.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/xiaomi/mi9lite/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Bộ vi xử lý Qualcomm Snapdragon 710\r\n</h1><p>Bên trong, Xiaomi Mi 9 Lite được trang bị bộ xử lý Qualcomm Snapdragon 710 với GPU Adreno 616, đi kèm với RAM 6GB và dung lượng lưu trữ 64 hoặc 128GB (bộ nhớ UFS 2.1). Đó là một phần cứng giúp người dùng có được hiệu suất rất tốt trong mọi tình huống trong khi vẫn duy trì mức tiêu thụ năng lượng khá thấp.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/xiaomi/mi9lite/mota/3.jpg\"/></div></br>');
