i bền vững, yên tâm hơn khi sử dụng.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/xiaomi/mi9lite/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Màn hình OLED 6.39 inch\r\n</h1><p>Xiaomi Mi 9 Lite có màn hình kích thước 6,39 inch khá lớn so với sản phẩm tiền nhiệm. Đây là tấm nền OLED với một notch giọt nước nhỏ ở chính giữa và độ phân giải Full HD +. Theo Xiaomi, màn hình này đạt được độ sáng tối đa 600 nits và tỷ lệ tương phản 6.000: 1. Để bảo vệ màn hình, Xiaomi Mi 9 Lite được trang bị kính cường lực Gorilla Glass 5 chống trầy xước và va đập.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/xiaomi/mi9lite/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Bộ vi xử lý Qualcomm Snapdragon 710\r\n</h1><p>Bên trong, Xiaomi Mi 9 Lite được trang bị bộ xử lý Qualcomm Snapdragon 710 với GPU Adreno 616, đi kèm với RAM 6GB và dung lượng lưu trữ 64 hoặc 128GB (bộ nhớ UFS 2.1). Đó là một phần cứng giúp người dùng có được hiệu suất rất tốt trong mọi tình huống trong khi vẫn duy trì mức tiêu thụ năng lượng khá thấp.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/xiaomi/mi9lite/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (53, 'img/sanpham/vsmart/live64gb/x1.jpg', 'Vsmart Live (64GB/6GB _ Xanh)', 6, 3299000, 30, 4, 3, 2, 12, 'img/sanpham/vsmart/live64gb/x1.jpg', 'img/sanpham/vsmart/live64gb/x2.jpg', 'img/sanpham/vsmart/live64gb/x3.jpg', 'img/sanpham/vsmart/live64gb/x4.jpg', '	AMOLED', '20MP', 'Chính 48 MP & Phụ 8 MP, 5 MP', 'Sống phong cách - Dám bứt phá', 'Màn hình Super Amoled tích hợp cảm biến vân tay', 'Phối màu cực ngầu', 'Điện Thoại Vsmart Live với 3 camera đẳng cấp, cảm biến vân tay dưới màn hình cùng hiệu năng xuất sắc, Vsmart Live mang đến cho bạn cuộc sống phong cách và đầy bứt phá.', 'Nâng tầm nhiếp ảnh di động với bộ 3 camera hoàn hảo trên Vsmart Live. Camera chính có độ phân giải lên tới 48MP, khẩu độ cực lớn f/1.7, cho khả năng chụp siêu sắc nét và chụp đêm đẳng cấp. Hai camera còn lại có khả năng hỗ trợ chụp ảnh xóa phông và chụp góc siêu rộng 120 độ, mang tới những bức ảnh chuyên nghiệp, độc đáo của riêng bạn.', 'Tận hưởng những nội dung yêu thích qua màn hình 6,2 inch Super AMOLED cao cấp, độ phân giải Full HD+ sắc nét. Ngoài ra, Vsmart Live còn tích hợp cảm biến vân tay ngay dưới màn hình, một phương thức bảo mật tiện lợi của tương lai. Chỉ cần một cú chạm vào màn hình, điện thoại sẽ mở khóa ngay lập tức.', 'img/sanpham/vsmart/live64gb/mota/1.jpg', 'img/sanpham/vsmart/live64gb/mota/2.png', 'img/sanpham/vsmart/live64gb/mota/3.png', 1, '<h1 class=\"font-weight-bold\">Sống phong cách - Dám bứt phá</h1><p>Điện Thoại Vsmart Live với 3 camera đẳng cấp, cảm biến vân tay dưới màn hình cùng hiệu năng xuất sắc, Vsmart Live mang đến cho bạn cuộc sống phong cách và đầy bứt phá.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/vsmart/live64gb/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Màn hình Super Amoled tích hợp cảm biến vân tay</h1><p>Nâng tầm nhiếp ảnh di động với bộ 3 camera hoàn hảo trên Vsmart Live. Camera chính có độ phân giải lên tới 48MP, khẩu độ cực lớn f/1.7, cho khả năng chụp siêu sắc nét và chụp đêm đẳng cấp. Hai camera còn lại có khả năng hỗ trợ chụp ảnh xóa phông và chụp góc siêu rộng 120 độ, mang tới những bức ảnh chuyên nghiệp, độc đáo của riêng bạn.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/vsmart/live64gb/mota/2.png\"/></br><h1 class=\"font-weight-bold\">Phối màu cực ngầu</h1><p>Tận hưởng những nội dung yêu thích qua màn hình 6,2 inch Super AMOLED cao cấp, độ phân giải Full HD+ sắc nét. Ngoài ra, Vsmart Live còn tích hợp cảm biến vân tay ngay dưới màn hình, một phương thức bảo mật tiện lợi của tương lai. Chỉ cần một cú chạm vào màn hình, điện thoại sẽ mở khóa ngay lập tức.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/vsmart/live64gb/mota/3.png\"/></div></br>');
