c nét và chụp đêm đẳng cấp. Hai camera còn lại có khả năng hỗ trợ chụp ảnh xóa phông và chụp góc siêu rộng 120 độ, mang tới những bức ảnh chuyên nghiệp, độc đáo của riêng bạn.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/vsmart/live64gb/mota/2.png\"/></br><h1 class=\"font-weight-bold\">Phối màu cực ngầu</h1><p>Tận hưởng những nội dung yêu thích qua màn hình 6,2 inch Super AMOLED cao cấp, độ phân giải Full HD+ sắc nét. Ngoài ra, Vsmart Live còn tích hợp cảm biến vân tay ngay dưới màn hình, một phương thức bảo mật tiện lợi của tương lai. Chỉ cần một cú chạm vào màn hình, điện thoại sẽ mở khóa ngay lập tức.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/vsmart/live64gb/mota/3.png\"/></div></br>');
INSERT INTO `product` VALUES (55, 'img/sanpham/samsung/m30s/x1.jpg', 'SAMSUNG M30s (Xanh)', 1, 6450000, 30, 4, 3, 3, 12, 'img/sanpham/samsung/m30s/x1.jpg', 'img/sanpham/samsung/m30s/x2.jpg', 'img/sanpham/samsung/m30s/x3.jpg', 'img/sanpham/samsung/m30s/x4.jpg', 'Super AMOLED, 6.39\", Full HD+', '32 MP', '48 MP, 8 MP và 5 MP (3 camera)', 'Tràn đầy năng lượng cùng siêu pin 6000 mAh khủng nhất thị trường\r\n', 'Chiến game mượt mà, không ngại xông pha với cấu hình cực khủng\r\n', 'Camera 48MP với nhiều chế độ chụp ảnh chuyên nghiệp\r\n', 'Samsung Galaxy M30s là chiếc smartphone đầu tiên của Samsung với dung lượng pin 6000mAh giúp bạn  tha hồ sử dụng điện thoại suốt cả ngày dài mà không lo bị gián đoạn vì hết pin.\r\n\r\n', 'Samsung Galaxy M30s được trang bị cấu hình mạnh mẽ mang đến khả năng đa nhiệm mượt mà, đáp ứng tốt các nhu cầu hàng ngày, kể cả các game nặng. Thiết bị được cung cấp năng lượng bởi con chip Exynos 9611 8 nhân 64-bit mạnh mẽ - đây là chip mới nhất của Samsung cho phân khúc tầm trung, kết hợp RAM 4GB và ROM 64GB, cùng viên pin có dung lượng lớn lên tới 6000mAh.', 'Galaxy M30s sở hữu hệ thống 3 camera mặt lưng bao gồm camera chính với độ phân giải 48MP, một ống kính góc rộng có độ phân giải 8MP, cuối cùng là ống kính đo chiều sâu có độ phân giải 5MP. Còn camera selfie có độ phân giải 16 MP, mang lại những bức ảnh selfie đầy mê hoặc.\r\n\r\n', 'img/sanpham/samsung/m30s/mota/1.jpg', 'img/sanpham/samsung/m30s/mota/2.jpg', 'img/sanpham/samsung/m30s/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Tràn đầy năng lượng cùng siêu pin 6000 mAh khủng nhất thị trường\r\n</h1><p>Samsung Galaxy M30s là chiếc smartphone đầu tiên của Samsung với dung lượng pin 6000mAh giúp bạn  tha hồ sử dụng điện thoại suốt cả ngày dài mà không lo bị gián đoạn vì hết pin.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/m30s/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Chiến game mượt mà, không ngại xông pha với cấu hình cực khủng\r\n</h1><p>Samsung Galaxy M30s được trang bị cấu hình mạnh mẽ mang đến khả năng đa nhiệm mượt mà, đáp ứng tốt các nhu cầu hàng ngày, kể cả các game nặng. Thiết bị được cung cấp năng lượng bởi con chip Exynos 9611 8 nhân 64-bit mạnh mẽ - đây là chip mới nhất của Samsung cho phân khúc tầm trung, kết hợp RAM 4GB và ROM 64GB, cùng viên pin có dung lượng lớn lên tới 6000mAh.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/m30s/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Camera 48MP với nhiều chế độ chụp ảnh chuyên nghiệp\r\n</h1><p>Galaxy M30s sở hữu hệ thống 3 camera mặt lưng bao gồm camera chính với độ phân giải 48MP, một ống kính góc rộng có độ phân giải 8MP, cuối cùng là ống kính đo chiều sâu có độ phân giải 5MP. Còn camera selfie có độ phân giải 16 MP, mang lại những bức ảnh selfie đầy mê hoặc.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/m30s/mota/3.jpg\"/></div></br>');
