=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/note10plus/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Biến chiếc điện thoại thành ổ cứng di động ngay trong tầm tay với bộ nhớ hơn 512GB\r\n</h1><p>Với bộ nhớ trong đến 512GB và có thể mở rộng lên tới 1TB qua thẻ nhớ microSD, bạn luôn có đủ không gian để lưu trữ toàn bộ kho nhạc, hình ảnh và video của mình.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/note10plus/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (65, 'img/sanpham/samsung/a50s/n1.jpeg', 'SAMSUNG GALAXY A50s (Xanh ngọc)', 1, 7790000, 30, 3, 3, 3, 12, 'img/sanpham/samsung/a50s/n1.jpg', 'img/sanpham/samsung/a50s/n2.jpeg', 'img/sanpham/samsung/a50s/n3.jpeg', 'img/sanpham/samsung/a50s/4.jpg', '6.4” Super AMOLED, chuẩn điện ảnh 19.5:9 Infinity-U FHD+', '32 MP', '48MP (F2.0) + 5MP (F2.2) + 8MP (F2.2)', 'Sắc màu sống động trên màn hình lớn\r\n', 'Thiết kế thời thượng, hoa văn ba chiều\r\n', 'Chi tiết ấn tượng\r\n', 'Điện Thoại Samsung Galaxy A50s mang đến trải nghiệm Kỷ Nguyên Trực Tuyến thêm sống động trên màn hình tràn viền 6.4 inch từ Galaxy A50s. Công nghệ Super AMOLED FHD+ cho mọi chất lượng hình ảnh trở nên sắc nét, màu sắc sống động như cuộc sống.\r\n\r\n', 'Nâng tầm phong cách thời thượng với kiểu dáng sang trọng, thiết kế vừa vặn trong lòng bàn tay từ Galaxy A50s. Mặt lưng sáng bóng kết hợp các lớp màu nổi ba chiều cho bạn thêm đậm dấu ấn khác biệt. Thoả thích lựa chọn các phối màu cá tính: Đen, Trắng, Tím hoặc Xanh làm hài lòng mọi tín đồ thời trang.\r\n\r\n', 'Chụp ảnh thêm chi tiết, sắc nét với Bộ Ba Camera cao cấp từ Galaxy A50s. Camera chính 48MP cho mọi khung hình trở nên sống động ấn tượng, bất chấp mọi điều kiện sáng. Thu lại khung hình rộng ấn tượng với camera Góc Siêu Rộng 8MP đỉnh cao. Thoả sức sáng tạo với camera Chiều Sâu 5MP xoá phông như máy chuyên nghiệp.\r\n\r\n', 'img/sanpham/samsung/a50s/mota/1.jpeg', 'img/sanpham/samsung/a50s/mota/2.jpeg', 'img/sanpham/samsung/a50s/mota/3.jpeg', 1, '<h1 class=\"font-weight-bold\">Sắc màu sống động trên màn hình lớn\r\n</h1><p>Điện Thoại Samsung Galaxy A50s mang đến trải nghiệm Kỷ Nguyên Trực Tuyến thêm sống động trên màn hình tràn viền 6.4 inch từ Galaxy A50s. Công nghệ Super AMOLED FHD+ cho mọi chất lượng hình ảnh trở nên sắc nét, màu sắc sống động như cuộc sống.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/a50s/mota/1.jpeg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Thiết kế thời thượng, hoa văn ba chiều\r\n</h1><p>Nâng tầm phong cách thời thượng với kiểu dáng sang trọng, thiết kế vừa vặn trong lòng bàn tay từ Galaxy A50s. Mặt lưng sáng bóng kết hợp các lớp màu nổi ba chiều cho bạn thêm đậm dấu ấn khác biệt. Thoả thích lựa chọn các phối màu cá tính: Đen, Trắng, Tím hoặc Xanh làm hài lòng mọi tín đồ thời trang.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/a50s/mota/2.jpeg\"/></br><h1 class=\"font-weight-bold\">Chi tiết ấn tượng\r\n</h1><p>Chụp ảnh thêm chi tiết, sắc nét với Bộ Ba Camera cao cấp từ Galaxy A50s. Camera chính 48MP cho mọi khung hình trở nên sống động ấn tượng, bất chấp mọi điều kiện sáng. Thu lại khung hình rộng ấn tượng với camera Góc Siêu Rộng 8MP đỉnh cao. Thoả sức sáng tạo với camera Chiều Sâu 5MP xoá phông như máy chuyên nghiệp.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/a50s/mota/3.jpeg\"/></div></br>');
