iết kế thời thượng, hoa văn ba chiều\r\n</h1><p>Nâng tầm phong cách thời thượng với kiểu dáng sang trọng, thiết kế vừa vặn trong lòng bàn tay từ Galaxy A50s. Mặt lưng sáng bóng kết hợp các lớp màu nổi ba chiều cho bạn thêm đậm dấu ấn khác biệt. Thoả thích lựa chọn các phối màu cá tính: Đen, Trắng, Tím hoặc Xanh làm hài lòng mọi tín đồ thời trang.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/a50s/mota/2.jpeg\"/></br><h1 class=\"font-weight-bold\">Chi tiết ấn tượng\r\n</h1><p>Chụp ảnh thêm chi tiết, sắc nét với Bộ Ba Camera cao cấp từ Galaxy A50s. Camera chính 48MP cho mọi khung hình trở nên sống động ấn tượng, bất chấp mọi điều kiện sáng. Thu lại khung hình rộng ấn tượng với camera Góc Siêu Rộng 8MP đỉnh cao. Thoả sức sáng tạo với camera Chiều Sâu 5MP xoá phông như máy chuyên nghiệp.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/a50s/mota/3.jpeg\"/></div></br>');
INSERT INTO `product` VALUES (67, 'img/sanpham/vivo/y91c/x1.jpg', 'Vivo Y91C (Xanh)', 7, 2190000, 30, 1, 1, 3, 12, 'img/sanpham/vivo/y91c/x1.jpg', 'img/sanpham/vivo/y91c/x2.jpg', 'img/sanpham/vivo/y91c/x3.jpg', 'img/sanpham/vivo/y91c/x4.jpg', '6.22\", HD+', '5 MP', '13 MP', 'Chiếc smartphone năng động và cá tính', 'Cụm 3 camera chất lượng cao', 'Dung lượng pin lớn thoải mái xài', 'Điện Thoại Vivo Y19 (128GB/6GB) là chiếc smartphone tập trung mạnh vào khả năng chụp ảnh ở camera chính lẫn camera selfie với công nghệ AI, hứa hẹn sẽ nhận được sự đón nhận tới từ người dùng là những bạn trẻ năng động và cá tính.', 'Vivo Y19 được trang bị 3 camera khá hầm hố ở mặt sau với độ phân giải lần lượt 16 MP + 8 MP + 2 MP.Khả năng lấy nét và lưu ảnh nhanh giúp người dùng không bị bỏ lỡ bất cứ khoảnh khắc đẹp nào trong cuộc sống.', 'Điểm nhấn đầu tiên trên Vivo Y19 là sở hữu viên pin dung lượng “khủng” đến 5.000 mAh và đi kèm công nghệ sạc nhanh.', 'img/sanpham/vivo/y19/mota/1.jpg', 'img/sanpham/vivo/y19/mota/2.jpg', 'img/sanpham/vivo/y19/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Chiếc smartphone năng động và cá tính</h1><p>Điện Thoại Vivo Y19 (128GB/6GB) là chiếc smartphone tập trung mạnh vào khả năng chụp ảnh ở camera chính lẫn camera selfie với công nghệ AI, hứa hẹn sẽ nhận được sự đón nhận tới từ người dùng là những bạn trẻ năng động và cá tính.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/vivo/y19/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Cụm 3 camera chất lượng cao</h1><p>Vivo Y19 được trang bị 3 camera khá hầm hố ở mặt sau với độ phân giải lần lượt 16 MP + 8 MP + 2 MP.Khả năng lấy nét và lưu ảnh nhanh giúp người dùng không bị bỏ lỡ bất cứ khoảnh khắc đẹp nào trong cuộc sống.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/vivo/y19/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Dung lượng pin lớn thoải mái xài</h1><p>Điểm nhấn đầu tiên trên Vivo Y19 là sở hữu viên pin dung lượng “khủng” đến 5.000 mAh và đi kèm công nghệ sạc nhanh.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/vivo/y19/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (68, 'img/sanpham/xiaomi/redmi7a/x1.jpg', 'XIAOMI REDMI 7A (Xanh)', 2, 2590000, 20, 1, 1, 3, 12, 'img/sanpham/xiaomi/redmi7a/x1.jpg', 'img/sanpham/xiaomi/redmi7a/x2.jpg', 'img/sanpham/xiaomi/redmi7a/x3.jpg', 'img/sanpham/xiaomi/redmi7a/x4.jpg', 'IPS LCD, 5.45\"\", HD+', '5 MP', '13 MP', 'Màn hình tràn viền IPS LCD 5.45\"\r\n', 'Khả năng kháng nước an toàn\r\n', 'Hiệu năng tốt với chip Qualcomm Snapdragon 439\r\n', 'Điện Thoại Xiaomi Redmi 7A (2GB/16GB) sở hữu vẻ ngoài khá thời trang với một màn hình tràn viền IPS LCD 5.45 inch ở mặt trước. Đặc biệt với thiết kế màn hình có độ sáng khá tốt giúp người tiêu dùng có thể dễ dàng sử dụng ngoài trời. Bên cạnh đó máy còn được tích hợp công nghệ lọc ánh sáng xanh gây hại được phát ra từ màn hình rất đáng khen.\r\n\r\n', 'Máy cũng có khả năng \"kháng nước nhẹ\" khi mặt lưng được phủ một lớp nano P2i còn các chi tiết khác như jack cắm tai nghe, lỗ cắm sạc cũng được bảo vệ bằng lớp vỏ bọc cao su để nước không thấm vào bên trong.\r\n\r\n', 'Xiaomi Redmi 7A được cung cấp sức mạnh bởi con chip Qualcomm Snapdragon 439 8 nhân 64-bit cùng với đó là 2 GB RAM và 16 GB bộ nhớ trong. Máy phản hồi khá nhanh các thao tác hằng ngày của người dùng từ lướt facebook, xem YouTube tới chơi một số game nhẹ. Ngoài ra chiếc smartphone này cũng hỗ trợ thẻ nhớ với dung lượng tối đa lên tới 512 GB thoải mái cho bạn lưu trữ dữ liệu.\r\n\r\n', 'img/sanpham/xiaomi/redmi7a/mota/1.jpg', 'img/sanpham/xiaomi/redmi7a/mota/2.jpg', 'img/sanpham/xiaomi/redmi7a/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Màn hình tràn viền IPS LCD 5.45\"\r\n</h1><p>Điện Thoại Xiaomi Redmi 7A (2GB/16GB) sở hữu vẻ ngoài khá thời trang với một màn hình tràn viền IPS LCD 5.45 inch ở mặt trước. Đặc biệt với thiết kế màn hình có độ sáng khá tốt giúp người tiêu dùng có thể dễ dàng sử dụng ngoài trời. Bên cạnh đó máy còn được tích hợp công nghệ lọc ánh sáng xanh gây hại được phát ra từ màn hình rất đáng khen.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/xiaomi/redmi7a/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Khả năng kháng nước an toàn\r\n</h1><p>Máy cũng có khả năng \"kháng nước nhẹ\" khi mặt lưng được phủ một lớp nano P2i còn các chi tiết khác như jack cắm tai nghe, lỗ cắm sạc cũng được bảo vệ bằng lớp vỏ bọc cao su để nước không thấm vào bên trong.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/xiaomi/redmi7a/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Hiệu năng tốt với chip Qualcomm Snapdragon 439\r\n</h1><p>Xiaomi Redmi 7A được cung cấp sức mạnh bởi con chip Qualcomm Snapdragon 439 8 nhân 64-bit cùng với đó là 2 GB RAM và 16 GB bộ nhớ trong. Máy phản hồi khá nhanh các thao tác hằng ngày của người dùng từ lướt facebook, xem YouTube tới chơi một số game nhẹ. Ngoài ra chiếc smartphone này cũng hỗ trợ thẻ nhớ với dung lượng tối đa lên tới 512 GB thoải mái cho bạn lưu trữ dữ liệu.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/xiaomi/redmi7a/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (69, 'img/sanpham/oppo/a5s/d1.jpg', 'OPPO A5S (Đỏ)', 5, 3690000, 30, 2, 2, 4, 12, 'img/sanpham/oppo/a5s/d1.jpg', 'img/sanpham/oppo/a5s/d2.jpg', 'img/sanpham/oppo/a5s/d3.jpg', 'img/sanpham/oppo/a5s/d4.jpg', 'IPS LCD, 6.2\", HD+', '8 MP', 'Chính 13 MP & Phụ 2 MP', 'Thiết kế tinh tế và sang trọng\r\n', 'Hiệu năng trên OPPO A5s ấn tượng cùng với chip Helio P35, 3GB RAM và ColorOS 5.1\r\n', 'OPPO A5s sở hữu camera selfie đặc trưng của OPPO và camera sau 13 MP\r\n', 'Điện Thoại OPPO A5s - Hàng Chính Hãng sở hữu ngôn ngữ thiết kế hiện đại với màn hình giọt nước giúp tối đa không gian màn hình. Các hình ảnh lộ diện gần đây cho thấy máy sẽ có 2 phiên bản màu sắc gồm đỏ và đen mang lại vẻ đẹp tinh tế, sang trọng và hợp thời trang. Bên cạnh đó, thiết bị còn có hệ thống cảm biến vân tay ở mặt lưng để tăng tính tiện lợi cho người dùng.\r\n\r\n', 'OPPO A5s mang sức mạnh đến từ con chip MediaTek Helio P35. Con chip này được tích hợp NeuroPilot - công nghệ khai thác kiến trúc tính toán AI nhằm mang lại hiệu năng tốt để hỗ trợ các ứng dụng AI như nhận diện khuôn mặt, nhận diện vật thể, giúp OPPO A5s trở thành chiếc điện thoải có khả năng selfie ảo diệu.\r\n\r\n', 'Nhắc đến OPPO là nhắc đến những dòng smartphone với camera selfie đỉnh cao và OPPO A5s sẽ không làm bạn thất vọng. Camera trước của máy với độ phân giải 8 MP kèm những chế độ làm đẹp “trứ danh” của OPPO chắc chắn sẽ cho người dùng những tấm ảnh selfie ảo diệu, ưng ý. Với sự hỗ trợ của công nghệ AI, những bức hình của bạn sẽ đẹp tự nhiên, nhìn không bị giả.\r\n\r\n', 'img/sanpham/oppo/a5s/mota/1.jpg', 'img/sanpham/oppo/a5s/mota/2.jpg', 'img/sanpham/oppo/a5s/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Thiết kế tinh tế và sang trọng\r\n</h1><p>Điện Thoại OPPO A5s - Hàng Chính Hãng sở hữu ngôn ngữ thiết kế hiện đại với màn hình giọt nước giúp tối đa không gian màn hình. Các hình ảnh lộ diện gần đây cho thấy máy sẽ có 2 phiên bản màu sắc gồm đỏ và đen mang lại vẻ đẹp tinh tế, sang trọng và hợp thời trang. Bên cạnh đó, thiết bị còn có hệ thống cảm biến vân tay ở mặt lưng để tăng tính tiện lợi cho người dùng.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/oppo/a5s/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Hiệu năng trên OPPO A5s ấn tượng cùng với chip Helio P35, 3GB RAM và ColorOS 5.1\r\n</h1><p>OPPO A5s mang sức mạnh đến từ con chip MediaTek Helio P35. Con chip này được tích hợp NeuroPilot - công nghệ khai thác kiến trúc tính toán AI nhằm mang lại hiệu năng tốt để hỗ trợ các ứng dụng AI như nhận diện khuôn mặt, nhận diện vật thể, giúp OPPO A5s trở thành chiếc điện thoải có khả năng selfie ảo diệu.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/oppo/a5s/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">OPPO A5s sở hữu camera selfie đặc trưng của OPPO và camera sau 13 MP\r\n</h1><p>Nhắc đến OPPO là nhắc đến những dòng smartphone với camera selfie đỉnh cao và OPPO A5s sẽ không làm bạn thất vọng. Camera trước của máy với độ phân giải 8 MP kèm những chế độ làm đẹp “trứ danh” của OPPO chắc chắn sẽ cho người dùng những tấm ảnh selfie ảo diệu, ưng ý. Với sự hỗ trợ của công nghệ AI, những bức hình của bạn sẽ đẹp tự nhiên, nhìn không bị giả.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/oppo/a5s/mota/3.jpg\"/></div></br>');
