M cũng tương tự. Đồng thời, Galaxy A70 còn được trang bị cổng kết nối USB-C hiện đại và jack cắm tai nghe 3.5mm truyền thống vẫn được giữ lại.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/a70/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Màn hình Infinity-U kích thước lớn\r\n</h1><p>Galaxy A70 được trang bị màn hình giọt nước có kích thước lên tới 6.7 inch cùng độ phân giải đạt Full HD+, so với A50 thì màn hình này lớn hơn một chút. Bên cạnh đó, thiết bị vẫn sử dụng tấm nền Super AMOLED mang đến chất lượng hiển thị màu sắc rực rỡ, chân thực, sắc nét.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/a70/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (75, 'img/sanpham/samsung/a70/t1.jpg', 'SAMSUNG GALAXY A70 (Trắng)', 1, 4590000, 30, 3, 3, 2, 12, 'img/sanpham/samsung/a70/t1.jpg', 'img/sanpham/samsung/a70/t2.jpg', 'img/sanpham/samsung/a70/t3.jpg', 'img/sanpham/samsung/a70/t4.jpg', 'Super AMOLED, 6.0\", Full HD+', '24 MP', '	Chính 24 MP & Phụ 8 MP, 5 MP', 'Tổng quan sản phẩm\r\n', 'Thiết bị có 3 tùy chọn màu sắc cho người dùng lựa chọn\r\n', 'Màn hình Infinity-U kích thước lớn\r\n', 'Điện Thoại Samsung Galaxy A70 (128GB/6GB) - Hàng Chính Hãng (Đã Kích Hoạt) Bảo Hành 12 Tháng sản phẩm vẫn được làm bằng chất liệu nhựa giả thủy tinh nhưng là nhựa cao cấp với tên gọi 3D Graffitistic, mang đến sự cứng cáp và chắc chắn khi cầm nắm.\r\n\r\n', 'Vị trí của nút tăng giảm âm lượng và nút nguồn không thay đổi, bao gồm cả thẻ nhớ và khay SIM cũng tương tự. Đồng thời, Galaxy A70 còn được trang bị cổng kết nối USB-C hiện đại và jack cắm tai nghe 3.5mm truyền thống vẫn được giữ lại.\r\n\r\n', 'Galaxy A70 được trang bị màn hình giọt nước có kích thước lên tới 6.7 inch cùng độ phân giải đạt Full HD+, so với A50 thì màn hình này lớn hơn một chút. Bên cạnh đó, thiết bị vẫn sử dụng tấm nền Super AMOLED mang đến chất lượng hiển thị màu sắc rực rỡ, chân thực, sắc nét.\r\n\r\n', 'img/sanpham/samsung/a70/mota/1.jpg', 'img/sanpham/samsung/a70/mota/2.jpg', 'img/sanpham/samsung/a70/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Tổng quan sản phẩm\r\n</h1><p>Điện Thoại Samsung Galaxy A70 (128GB/6GB) - Hàng Chính Hãng (Đã Kích Hoạt) Bảo Hành 12 Tháng sản phẩm vẫn được làm bằng chất liệu nhựa giả thủy tinh nhưng là nhựa cao cấp với tên gọi 3D Graffitistic, mang đến sự cứng cáp và chắc chắn khi cầm nắm.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/a70/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Thiết bị có 3 tùy chọn màu sắc cho người dùng lựa chọn\r\n</h1><p>Vị trí của nút tăng giảm âm lượng và nút nguồn không thay đổi, bao gồm cả thẻ nhớ và khay SIM cũng tương tự. Đồng thời, Galaxy A70 còn được trang bị cổng kết nối USB-C hiện đại và jack cắm tai nghe 3.5mm truyền thống vẫn được giữ lại.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/a70/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Màn hình Infinity-U kích thước lớn\r\n</h1><p>Galaxy A70 được trang bị màn hình giọt nước có kích thước lên tới 6.7 inch cùng độ phân giải đạt Full HD+, so với A50 thì màn hình này lớn hơn một chút. Bên cạnh đó, thiết bị vẫn sử dụng tấm nền Super AMOLED mang đến chất lượng hiển thị màu sắc rực rỡ, chân thực, sắc nét.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/a70/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (76, 'img/sanpham/oppo/f9/x1.jpg', 'OPPO A11 (Xanh)', 5, 6990000, 26, 3, 3, 2, 12, 'img/sanpham/oppo/f9/x1.jpg', 'img/sanpham/oppo/f9/x2.jpg', 'img/sanpham/oppo/f9/x3.jpg', 'img/sanpham/oppo/f9/x4.jpg', 'LTPS LCD, 6.3\", Full HD+', '25 MP', 'Chính 16 MP & Phụ 2 MP', 'Thiết kế cong 3D tuyệt đẹp\r\n', 'Sắc màu chuyển động không giới hạn\r\n', 'Sạc cực nhanh với sự trở lại của VOOC\r\n', 'Điện thoại OPPO F9 sở hữu màn hình viền mỏng ấn tượng hơn bao giờ hết, khoe trọn vẹn vẻ đẹp của thiết bị với duy nhất một phần khuyết cực nhỏ trên màn hình dành cho vị trí của camera trước, loa thoại được đặt khéo léo ở phần viền rất mỏng cạnh trên. Đây là thiết kế tuyệt đẹp với viền màn hình siêu mỏng mang lại trải nghiệm hình ảnh mở rộng với tỷ lệ hơn 90%. Độ phân giải FUll HD+ cùng màn hình Fullview 19:9 nhất định sẽ cho bạn những phút giây thư giãn đỉnh cao.\r\n\r\n', 'Thiết kế mặt lưng với vân kim cương cùng khả năng chuyển màu độc đáo. OPPO F9 mang lại vẻ đẹp khác biệt và sáng tạo không hòa lẫn với bất kỳ thiết bị di động nào, mỗi thao tác sử dụng, mặt lưng lại chuyển những sắc màu đậm nhạt khác nhau, sẽ thu hút bạn ngay từ cái nhìn đầu tiên.\r\n\r\n', 'Sạc nhanh có lẽ là một trong những tính năng mà OPPO tự hào nhất trên OPPO F9. Công nghệ sạc mới nhất VOOC của OPPO cho phép chỉ cần sạc 5 phút để có thêm 2 giờ đàm thoại, một con số rất ấn tượng. So với các công nghệ sạc nhanh khác thì VOOC không chỉ có tốc độ nhanh hơn mà còn an toàn hơn khi không kích cường độ dòng điện lên quá cao. Công nghệ mới sử dụng \"điện áp thấp và cường độ dòng điện cao\", tích hợp 5 cấp độ an toàn độc quyền của hãng, bộ sạc của OPPO F9 vừa giữ được tốc độ sạc nhanh, vừa đem lại sự an toàn tuyệt đối cho người sử dụng, kể cả khi vừa xài vừa chơi game.\r\n\r\n', 'img/sanpham/oppo/f9/mota/1.jpg', 'img/sanpham/oppo/f9/mota/2.jpg', 'img/sanpham/oppo/f9/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Thiết kế cong 3D tuyệt đẹp\r\n</h1><p>Điện thoại OPPO F9 sở hữu màn hình viền mỏng ấn tượng hơn bao giờ hết, khoe trọn vẹn vẻ đẹp của thiết bị với duy nhất một phần khuyết cực nhỏ trên màn hình dành cho vị trí của camera trước, loa thoại được đặt khéo léo ở phần viền rất mỏng cạnh trên. Đây là thiết kế tuyệt đẹp với viền màn hình siêu mỏng mang lại trải nghiệm hình ảnh mở rộng với tỷ lệ hơn 90%. Độ phân giải FUll HD+ cùng màn hình Fullview 19:9 nhất định sẽ cho bạn những phút giây thư giãn đỉnh cao.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/oppo/f9/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Sắc màu chuyển động không giới hạn\r\n</h1><p>Thiết kế mặt lưng với vân kim cương cùng khả năng chuyển màu độc đáo. OPPO F9 mang lại vẻ đẹp khác biệt và sáng tạo không hòa lẫn với bất kỳ thiết bị di động nào, mỗi thao tác sử dụng, mặt lưng lại chuyển những sắc màu đậm nhạt khác nhau, sẽ thu hút bạn ngay từ cái nhìn đầu tiên.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/oppo/f9/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Sạc cực nhanh với sự trở lại của VOOC\r\n</h1><p>Sạc nhanh có lẽ là một trong những tính năng mà OPPO tự hào nhất trên OPPO F9. Công nghệ sạc mới nhất VOOC của OPPO cho phép chỉ cần sạc 5 phút để có thêm 2 giờ đàm thoại, một con số rất ấn tượng. So với các công nghệ sạc nhanh khác thì VOOC không chỉ có tốc độ nhanh hơn mà còn an toàn hơn khi không kích cường độ dòng điện lên quá cao. Công nghệ mới sử dụng \"điện áp thấp và cường độ dòng điện cao\", tích hợp 5 cấp độ an toàn độc quyền của hãng, bộ sạc của OPPO F9 vừa giữ được tốc độ sạc nhanh, vừa đem lại sự an toàn tuyệt đối cho người sử dụng, kể cả khi vừa xài vừa chơi game.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/oppo/f9/mota/3.jpg\"/></div></br>');
