INSERT INTO `product` VALUES (78, 'img/sanpham/samsung/s10plus/t1.jpg', 'SAMSUNG GALAXY S10+ (Trắng)', 1, 22990000, 30, 5, 5, 3, 12, 'img/sanpham/samsung/s10plus/t1.jpg', 'img/sanpham/samsung/s10plus/t2.jpg', 'img/sanpham/samsung/s10plus/t3.jpg', 'img/sanpham/samsung/s10plus/t4.jpg', 'Super AMOLED, 6.44\"\", Quad HD+ (2K+)', 'Camera kép (10MP (2PD) f1.9, Depth Camera 8MP f2.2)', ' 3 camera (Tele 12MP (2PD) f2.4 + góc rộng 12MP f1.5/2.4 + siêu rộng 16MP f2.2 123 độ)', 'Thiết kế không chỉ nổi bật mà còn tạo nên sự khác biệt tuyệt đối\r\n', 'Hiển thị chuẩn điện ảnh sống động đến khó tin\r\n', 'Chế độ bảo vệ mắt\r\n', 'Điện Thoại Samsung Galaxy S10 Plus kiệt tác tái thiết kế hoàn hảo loại bỏ trở ngại tầm nhìn, không có tai thỏ, không bị hạn chế. Đường cắt viền laser tỉ mỉ, màn hình Dynamic AMOLED thân thiện đôi mắt giúp Màn Hình Infinity-O trở thành màn hình Galaxy mang tính cải tiến đỉnh cao nhất từ trước đến nay.\r\n\r\n', 'Công nghệ màn hình Dynamic AMOLED thế hệ mới sở hữu độ phân giải chuẩn HDR10+ cho khả năng điều chỉnh dải màu sắc tối ưu, mang đến sắc màu cùng độ tương phản chân thực trên từng khung hình - kể cả thước phim tối nhất. Màn hình sáng hơn giúp bạn nhìn rõ từng chi tiết ngay cả dưới ánh sáng ban ngày. Kết hợp cùng hệ thống loa vòm Dolby Atmos, bạn sẽ đắm mình vào những trải nghiệm giải trí đích thực.\r\n\r\n        *Màn hình của Galaxy S10e, S10 Plus và S10 Plus+ được Tổ chức VDE của Đức chứng nhận khả năng hiển thị 100% dải màu với tỷ lệ tương phản 2.000.000:1.', 'Chế độ bảo vệ mắt điều chỉnh ánh sáng cho trải nghiệm thị giác tối ưu. Một hỗn hợp chất lỏng đặc biệt của công nghệ Dynamic AMOLED giúp giảm đến 42% ánh sáng xanh có hại mà không thay đổi màu sắc trên màn hình. Ít mỏi mắt hơn dù xem phim đến tận tối muộn, giấc ngủ cũng ngon hơn.\r\n\r\n', 'img/sanpham/samsung/s10plus/mota/1.jpg', 'img/sanpham/samsung/s10plus/mota/2.jpg', 'img/sanpham/samsung/s10plus/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Thiết kế không chỉ nổi bật mà còn tạo nên sự khác biệt tuyệt đối\r\n</h1><p>Điện Thoại Samsung Galaxy S10 Plus kiệt tác tái thiết kế hoàn hảo loại bỏ trở ngại tầm nhìn, không có tai thỏ, không bị hạn chế. Đường cắt viền laser tỉ mỉ, màn hình Dynamic AMOLED thân thiện đôi mắt giúp Màn Hình Infinity-O trở thành màn hình Galaxy mang tính cải tiến đỉnh cao nhất từ trước đến nay.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/s10plus/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Hiển thị chuẩn điện ảnh sống động đến khó tin\r\n</h1><p>Công nghệ màn hình Dynamic AMOLED thế hệ mới sở hữu độ phân giải chuẩn HDR10+ cho khả năng điều chỉnh dải màu sắc tối ưu, mang đến sắc màu cùng độ tương phản chân thực trên từng khung hình - kể cả thước phim tối nhất. Màn hình sáng hơn giúp bạn nhìn rõ từng chi tiết ngay cả dưới ánh sáng ban ngày. Kết hợp cùng hệ thống loa vòm Dolby Atmos, bạn sẽ đắm mình vào những trải nghiệm giải trí đích thực.\r\n\r\n        *Màn hình của Galaxy S10e, S10 Plus và S10 Plus+ được Tổ chức VDE của Đức chứng nhận khả năng hiển thị 100% dải màu với tỷ lệ tương phản 2.000.000:1.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/s10plus/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Chế độ bảo vệ mắt\r\n</h1><p>Chế độ bảo vệ mắt điều chỉnh ánh sáng cho trải nghiệm thị giác tối ưu. Một hỗn hợp chất lỏng đặc biệt của công nghệ Dynamic AMOLED giúp giảm đến 42% ánh sáng xanh có hại mà không thay đổi màu sắc trên màn hình. Ít mỏi mắt hơn dù xem phim đến tận tối muộn, giấc ngủ cũng ngon hơn.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/s10plus/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (79, 'img/sanpham/xiaomi/redminote8/d1.jpg', 'XIAOMI REDMI NOTE 8 (Đen)', 2, 4990000, 30, 3, 3, 4, 12, 'img/sanpham/xiaomi/redminote8/d1.jpg', 'img/sanpham/xiaomi/redminote8/d2.jpg', 'img/sanpham/xiaomi/redminote8/d3.jpg', 'img/sanpham/xiaomi/redminote8/d4.jpg', 'Super AMOLED, 6.44\"\", Quad HD+ (2K+)', '13 MP', 'Chính 48 MP & Phụ 8 MP, 2 MP, 2 MP', 'Thiết kế màn hình Infinity-V\r\n', 'Thiết kế cực kỳ độc đáo\r\n', 'Màn hình 6.26 inch Full HD+\r\n', 'Điện Thoại Xiaomi Mi 8 Lite được Xiaomi trình làng trong sự kiện vào ngày 19.9 tại thành phố Thành Đô, Trung Quốc. Đây được xem là phiên bản rút gọn cấu hình và tùy chỉnh một chút thiết kế so với flagship Mi 8 hứa hẹn mang đến những trải nghiệm ấn tượng cho người dùng.\r\n\r\n', ' Redmi Note 8  có mặt lưng được làm bằng thủy tinh với hiệu ứng màu gradient cực kì độc đáo và đẹp mắt, áp dụng quy trình mạ nano nhúng gương tương tự như Huawei P20, mang lại vẻ ngoài cao cấp và sang trọng hơn. Xiaomi còn mạnh dạn so sánh Mi 8 Lite với iPhone XR và điện thoại của Xiaomi có khung máy mỏng hơn, viền bezel mỏng hơn và phần tai thỏ ở phía trên cũng nhỏ hơn.\r\n\r\n ', 'Redmi Note 8 Lite có màn hình 6.26 inch Full HD+ (2.560 x 1.080 pixel), tỉ lệ khung hình 19:9 mang đến những hình ảnh sắc nét vô cùng sống động  nâng cao chất lượng hình ảnh, video giúp bạn thưởng thức những hình ảnh, thước phim chân thực nhất.\r\n\r\n', 'img/sanpham/xiaomi/mi8lite/mota/1.jpg', 'img/sanpham/xiaomi/mi8lite/mota/2.jpg', 'img/sanpham/xiaomi/mi8lite/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Thiết kế màn hình Infinity-V\r\n</h1><p>Điện Thoại Xiaomi Mi 8 Lite được Xiaomi trình làng trong sự kiện vào ngày 19.9 tại thành phố Thành Đô, Trung Quốc. Đây được xem là phiên bản rút gọn cấu hình và tùy chỉnh một chút thiết kế so với flagship Mi 8 hứa hẹn mang đến những trải nghiệm ấn tượng cho người dùng.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/xiaomi/mi8lite/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Thiết kế cực kỳ độc đáo\r\n</h1><p> Redmi Note 8  có mặt lưng được làm bằng thủy tinh với hiệu ứng màu gradient cực kì độc đáo và đẹp mắt, áp dụng quy trình mạ nano nhúng gương tương tự như Huawei P20, mang lại vẻ ngoài cao cấp và sang trọng hơn. Xiaomi còn mạnh dạn so sánh Mi 8 Lite với iPhone XR và điện thoại của Xiaomi có khung máy mỏng hơn, viền bezel mỏng hơn và phần tai thỏ ở phía trên cũng nhỏ hơn.\r\n\r\n </p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/xiaomi/mi8lite/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Màn hình 6.26 inch Full HD+\r\n</h1><p>Redmi Note 8 Lite có màn hình 6.26 inch Full HD+ (2.560 x 1.080 pixel), tỉ lệ khung hình 19:9 mang đến những hình ảnh sắc nét vô cùng sống động  nâng cao chất lượng hình ảnh, video giúp bạn thưởng thức những hình ảnh, thước phim chân thực nhất.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/xiaomi/mi8lite/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (80, 'img/sanpham/xiaomi/redminote8/x1.jpg', 'XIAOMI REDMI NOTE 8 (Xanh)', 2, 4990000, 30, 3, 3, 4, 12, 'img/sanpham/xiaomi/redminote8/x1.jpg', 'img/sanpham/xiaomi/redminote8/x2.jpg', 'img/sanpham/xiaomi/redminote8/x3.jpg', 'img/sanpham/xiaomi/redminote8/x4.jpg', 'Super AMOLED, 6.44\"\", Quad HD+ (2K+)', '13 MP', 'Chính 48 MP & Phụ 8 MP, 2 MP, 2 MP', 'Thiết kế màn hình Infinity-V\r\n', 'Thiết kế cực kỳ độc đáo\r\n', 'Màn hình 6.26 inch Full HD+\r\n', 'Điện Thoại Xiaomi Mi 8 Lite được Xiaomi trình làng trong sự kiện vào ngày 19.9 tại thành phố Thành Đô, Trung Quốc. Đây được xem là phiên bản rút gọn cấu hình và tùy chỉnh một chút thiết kế so với flagship Mi 8 hứa hẹn mang đến những trải nghiệm ấn tượng cho người dùng.\r\n\r\n', ' Redmi Note 8 có mặt lưng được làm bằng thủy tinh với hiệu ứng màu gradient cực kì độc đáo và đẹp mắt, áp dụng quy trình mạ nano nhúng gương tương tự như Huawei P20, mang lại vẻ ngoài cao cấp và sang trọng hơn. Xiaomi còn mạnh dạn so sánh Mi 8 Lite với iPhone XR và điện thoại của Xiaomi có khung máy mỏng hơn, viền bezel mỏng hơn và phần tai thỏ ở phía trên cũng nhỏ hơn.\r\n\r\n ', 'Redmi Note 8 có màn hình 6.26 inch Full HD+ (2.560 x 1.080 pixel), tỉ lệ khung hình 19:9 mang đến những hình ảnh sắc nét vô cùng sống động  nâng cao chất lượng hình ảnh, video giúp bạn thưởng thức những hình ảnh, thước phim chân thực nhất.\r\n\r\n', 'img/sanpham/xiaomi/mi8lite/mota/1.jpg', 'img/sanpham/xiaomi/mi8lite/mota/2.jpg', 'img/sanpham/xiaomi/mi8lite/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Thiết kế màn hình Infinity-V\r\n</h1><p>Điện Thoại Xiaomi Mi 8 Lite được Xiaomi trình làng trong sự kiện vào ngày 19.9 tại thành phố Thành Đô, Trung Quốc. Đây được xem là phiên bản rút gọn cấu hình và tùy chỉnh một chút thiết kế so với flagship Mi 8 hứa hẹn mang đến những trải nghiệm ấn tượng cho người dùng.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/xiaomi/mi8lite/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Thiết kế cực kỳ độc đáo\r\n</h1><p> Redmi Note 8 có mặt lưng được làm bằng thủy tinh với hiệu ứng màu gradient cực kì độc đáo và đẹp mắt, áp dụng quy trình mạ nano nhúng gương tương tự như Huawei P20, mang lại vẻ ngoài cao cấp và sang trọng hơn. Xiaomi còn mạnh dạn so sánh Mi 8 Lite với iPhone XR và điện thoại của Xiaomi có khung máy mỏng hơn, viền bezel mỏng hơn và phần tai thỏ ở phía trên cũng nhỏ hơn.\r\n\r\n </p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/xiaomi/mi8lite/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Màn hình 6.26 inch Full HD+\r\n</h1><p>Redmi Note 8 có màn hình 6.26 inch Full HD+ (2.560 x 1.080 pixel), tỉ lệ khung hình 19:9 mang đến những hình ảnh sắc nét vô cùng sống động  nâng cao chất lượng hình ảnh, video giúp bạn thưởng thức những hình ảnh, thước phim chân thực nhất.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/xiaomi/mi8lite/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (81, 'img/sanpham/vivo/y11/d1.jpg', 'Vivo Y11 (Đỏ)', 7, 3290000, 30, 2, 2, 3, 12, 'img/sanpham/vivo/y11/d1.jpg', 'img/sanpham/vivo/y11/d2.jpg', 'img/sanpham/vivo/y11/d3.jpg', 'img/sanpham/vivo/y11/d4.jpg', 'IPS LCD, 6.35\", HD+', '8 MP', 'Chính 13 MP & Phụ 2 MP', 'Thiết kế sang trọng, sắc màu huyền ảo', 'Màn hình giọt nước 6,35 inch rộng lớn', 'Hiệu năng mượt mà', 'Điện thoại Vivo Y11 sở hữu thiết kế nguyên khối sang trọng, màu sắc được lấy cảm hứng từ những viên ngọc quý sáng lấp lánh. Trải qua quá trình chế tác thủ công tỉ mỉ, mặt lưng của Vivo Y11 có khả năng chuyển màu đẹp một cách huyền ảo. Cả hai phiên bản màu là Đỏ San Hô và Xanh Ngọc Bích đều tạo hiệu ứng đẹp lấp lánh, nổi bật.', 'Vivo Y11 sẽ đưa bạn tới những điều rộng lớn hơn nhờ màn hình lớn 6,35 inch tràn viền Halo đẹp mắt. Viền màn hình siêu mỏng giúp hình ảnh như nổi lên trước mắt, không có giới hạn, cho trải nghiệm thị giác vượt trội. Bên cạnh đó, các góc cạnh được bo tròn mềm mại sẽ hạn chế tình trạng cấn hoặc tê tay khi sử dụng trong thời gian dài.', 'Cung cấp sức mạnh cho máy là con chip Qualcomm Snapdragon 439 8 nhân 64-bit kết hợp với 3 GB RAM và 32 GB bộ nhớ trong. Với thông số này, thiết bị này hoàn toàn có thể xử lý mượt mà và trơn tru mọi tác vụ cơ bản như duyệt web, xem phim độ phân giải cao hay chỉnh sửa ảnh. ', 'img/sanpham/vivo/y11/mota/1.jpg', 'img/sanpham/vivo/y11/mota/2.jpg', 'img/sanpham/vivo/y11/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Thiết kế sang trọng, sắc màu huyền ảo</h1><p>Điện thoại Vivo Y11 sở hữu thiết kế nguyên khối sang trọng, màu sắc được lấy cảm hứng từ những viên ngọc quý sáng lấp lánh. Trải qua quá trình chế tác thủ công tỉ mỉ, mặt lưng của Vivo Y11 có khả năng chuyển màu đẹp một cách huyền ảo. Cả hai phiên bản màu là Đỏ San Hô và Xanh Ngọc Bích đều tạo hiệu ứng đẹp lấp lánh, nổi bật.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/vivo/y11/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Màn hình giọt nước 6,35 inch rộng lớn</h1><p>Vivo Y11 sẽ đưa bạn tới những điều rộng lớn hơn nhờ màn hình lớn 6,35 inch tràn viền Halo đẹp mắt. Viền màn hình siêu mỏng giúp hình ảnh như nổi lên trước mắt, không có giới hạn, cho trải nghiệm thị giác vượt trội. Bên cạnh đó, các góc cạnh được bo tròn mềm mại sẽ hạn chế tình trạng cấn hoặc tê tay khi sử dụng trong thời gian dài.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/vivo/y11/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Hiệu năng mượt mà</h1><p>Cung cấp sức mạnh cho máy là con chip Qualcomm Snapdragon 439 8 nhân 64-bit kết hợp với 3 GB RAM và 32 GB bộ nhớ trong. Với thông số này, thiết bị này hoàn toàn có thể xử lý mượt mà và trơn tru mọi tác vụ cơ bản như duyệt web, xem phim độ phân giải cao hay chỉnh sửa ảnh. </p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/vivo/y11/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (82, 'img/sanpham/samsung/m10/x1.jpg', 'SAMSUNG GALAXY M10 (Xanh)', 1, 3490000, 29, 1, 1, 3, 12, 'img/sanpham/samsung/m10/x1.jpg', 'img/sanpham/samsung/m10/x2.jpg', 'img/sanpham/samsung/m10/x3.jpg', 'img/sanpham/samsung/m10/x4.jpg', 'LCD 6.2\" HD+, Infinity V Display', '5 MP', '13 MP và 5 MP (2 camera)', 'Trải nghiệm đẳng cấp cùng màn hình siêu tràn viền Infinity-V 6.2 inch\r\n', 'Exynos 7870  \"cân\" mọi tác vụ cơ bản\r\n', 'Sáng tạo bất tận với khung hình rộng\r\n', 'Điện Thoại Samsung Galaxy M10 là chiếc smartphone đầu tiên của Samsung sở hữu màn hình tràn viền mới Infinity-V. Cùng với kích thước lớn 6.2 inch và độ phân giải HD+, máy cho diện tích trải nghiệm rộng rãi, hình ảnh được hiển thị đầy đủ và tối đa. Hơn nữa, thiết kế nguyên khối của máy cùng phần viền được bo cong nhẹ cho người dùng cảm giác cầm nắm được thoải mái.\r\n\r\n', 'Chiếc điện thoại Samsung mới này được trang bị chip Exynos 7870 \"cây nhà lá vườn\" do chính hãng sản xuất cùng với RAM 2 GB. Galaxy M10 chạy trên hệ điều hành Android 8.1 Oreo với giao diện Samsung Experience 9.5 giúp hiệu năng của máy được tối ưu tốt hơn, giao diện trực quan dễ sử dụng. Với cấu hình trên, Samsung M10 đáp ứng nhu cầu giải trí lướt web bình thường hay chơi các game nhẹ nhàng: Nông trại, kim cương,\r\n\r\n', 'Samsung Galaxy M10 trang bị camera sau kép với 01 Camera Chính và 01 Camera Góc Siêu Rộng sẵn sàng cùng bạn thu trọn mọi khung cảnh đáng nhớ chỉ trong một khung hình. Dễ dàng chụp được các chuyển động nhanh một cách mượt mà chuẩn như máy ảnh chuyên nghiệp.\r\n\r\n', 'img/sanpham/samsung/m10/mota/1.jpg', 'img/sanpham/samsung/m10/mota/2.jpg', 'img/sanpham/samsung/m10/mota/3.png', 1, '<h1 class=\"font-weight-bold\">Trải nghiệm đẳng cấp cùng màn hình siêu tràn viền Infinity-V 6.2 inch\r\n</h1><p>Điện Thoại Samsung Galaxy M10 là chiếc smartphone đầu tiên của Samsung sở hữu màn hình tràn viền mới Infinity-V. Cùng với kích thước lớn 6.2 inch và độ phân giải HD+, máy cho diện tích trải nghiệm rộng rãi, hình ảnh được hiển thị đầy đủ và tối đa. Hơn nữa, thiết kế nguyên khối của máy cùng phần viền được bo cong nhẹ cho người dùng cảm giác cầm nắm được thoải mái.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/m10/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Exynos 7870  \"cân\" mọi tác vụ cơ bản\r\n</h1><p>Chiếc điện thoại Samsung mới này được trang bị chip Exynos 7870 \"cây nhà lá vườn\" do chính hãng sản xuất cùng với RAM 2 GB. Galaxy M10 chạy trên hệ điều hành Android 8.1 Oreo với giao diện Samsung Experience 9.5 giúp hiệu năng của máy được tối ưu tốt hơn, giao diện trực quan dễ sử dụng. Với cấu hình trên, Samsung M10 đáp ứng nhu cầu giải trí lướt web bình thường hay chơi các game nhẹ nhàng: Nông trại, kim cương,\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/m10/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Sáng tạo bất tận với khung hình rộng\r\n</h1><p>Samsung Galaxy M10 trang bị camera sau kép với 01 Camera Chính và 01 Camera Góc Siêu Rộng sẵn sàng cùng bạn thu trọn mọi khung cảnh đáng nhớ chỉ trong một khung hình. Dễ dàng chụp được các chuyển động nhanh một cách mượt mà chuẩn như máy ảnh chuyên nghiệp.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/m10/mota/3.png\"/></div></br>');
INSERT INTO `product` VALUES (83, 'img/sanpham/samsung/a20/x1.jpg', 'SAMSUNG GALAXY A20 (Xanh)', 1, 4390000, 30, 2, 2, 3, 12, 'img/sanpham/samsung/a20/x1.jpg', 'img/sanpham/samsung/a20/x2.jpg', 'img/sanpham/samsung/a20/x3.jpg', 'img/sanpham/samsung/a20/x4.jpg', 'Super AMOLED, 6.4\", HD+', '	8 MP', 'Chính 13 MP & Phụ 5 MP', 'Trang bị các tính năng cao cấp từ các dòng flagship\r\n', 'Màn hình Infinity-U hoàn toàn mới mẻ\r\n', 'Camera kép xóa phông, selfie đẹp\r\n', 'Điện Thoại Samsung Galaxy A20 vừa mới được trình làng tại thị trường Việt Nam. Máy nằm giữa A10 và A30 cả về thông số và mức giá. Đây là chiếc máy rẻ nhất trong dòng Galaxy A của Samsung mang lại cho người dùng những trải nghiệm cao cấp. Samsung Galaxy A20 có thiết kế nguyên khối vuống vắn, các đường góc bo cong mềm mại mang đúng “chất” Samsung.\r\n\r\n', 'Chiếc điện thoại Samsung dòng A mới mang trong mình màn hình có kích thước lên tới 6.4 inch mang lại một không gian rất thoải mái để các bạn chơi game hay xem phim. Nhờ tỉ lệ màn hình 19:9 cùng thiết kế Infinity-U, bạn sẽ có một trải nghiệm khá mới mẻ và thích thú so với các màn hình 18:9 thông thường.\r\n\r\n', 'Samsung Galaxy A20 sở hữu cho mình cụm camera kép ở mặt lưng có độ phân giải lần lượt là chính 13 MP (khẩu độ f/1.9) và ống kính góc siêu rộng 5MP (khẩu độ f/2.2, 123 độ). Điểm mạnh của máy chính là khả năng chụp và lưu ảnh rất nhanh giúp bạn không bị bỏ lỡ bất cứ khoảnh khắc đẹp nào trong cuộc sống. Ngoài ra, những tính năng hấp dẫn như chụp ảnh xóa phông, tự động lấy nét, HDR, Parorama, sẽ đáp ứng được hầu hết các nhu cầu hằng ngày của người dùng.\r\n\r\n', 'img/sanpham/samsung/a20/mota/1.jpg', 'img/sanpham/samsung/a20/mota/2.jpg', 'img/sanpham/samsung/a20/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Trang bị các tính năng cao cấp từ các dòng flagship\r\n</h1><p>Điện Thoại Samsung Galaxy A20 vừa mới được trình làng tại thị trường Việt Nam. Máy nằm giữa A10 và A30 cả về thông số và mức giá. Đây là chiếc máy rẻ nhất trong dòng Galaxy A của Samsung mang lại cho người dùng những trải nghiệm cao cấp. Samsung Galaxy A20 có thiết kế nguyên khối vuống vắn, các đường góc bo cong mềm mại mang đúng “chất” Samsung.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/a20/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Màn hình Infinity-U hoàn toàn mới mẻ\r\n</h1><p>Chiếc điện thoại Samsung dòng A mới mang trong mình màn hình có kích thước lên tới 6.4 inch mang lại một không gian rất thoải mái để các bạn chơi game hay xem phim. Nhờ tỉ lệ màn hình 19:9 cùng thiết kế Infinity-U, bạn sẽ có một trải nghiệm khá mới mẻ và thích thú so với các màn hình 18:9 thông thường.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/a20/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Camera kép xóa phông, selfie đẹp\r\n</h1><p>Samsung Galaxy A20 sở hữu cho mình cụm camera kép ở mặt lưng có độ phân giải lần lượt là chính 13 MP (khẩu độ f/1.9) và ống kính góc siêu rộng 5MP (khẩu độ f/2.2, 123 độ). Điểm mạnh của máy chính là khả năng chụp và lưu ảnh rất nhanh giúp bạn không bị bỏ lỡ bất cứ khoảnh khắc đẹp nào trong cuộc sống. Ngoài ra, những tính năng hấp dẫn như chụp ảnh xóa phông, tự động lấy nét, HDR, Parorama, sẽ đáp ứng được hầu hết các nhu cầu hằng ngày của người dùng.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/a20/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (84, 'img/sanpham/samsung/a20/d1.jpg', 'SAMSUNG GALAXY A20 (Đỏ)', 1, 4390000, 29, 2, 2, 3, 12, 'img/sanpham/samsung/a20/d1.jpg', 'img/sanpham/samsung/a20/d2.jpg', 'img/sanpham/samsung/a20/d3.jpg', 'img/sanpham/samsung/a20d/4.jpg', 'Super AMOLED, 6.4\", HD+', '	8 MP', 'Chính 13 MP & Phụ 5 MP', 'Trang bị các tính năng cao cấp từ các dòng flagship\r\n', 'Màn hình Infinity-U hoàn toàn mới mẻ\r\n', 'Camera kép xóa phông, selfie đẹp\r\n', 'Điện Thoại Samsung Galaxy A20 vừa mới được trình làng tại thị trường Việt Nam. Máy nằm giữa A10 và A30 cả về thông số và mức giá. Đây là chiếc máy rẻ nhất trong dòng Galaxy A của Samsung mang lại cho người dùng những trải nghiệm cao cấp. Samsung Galaxy A20 có thiết kế nguyên khối vuống vắn, các đường góc bo cong mềm mại mang đúng “chất” Samsung.\r\n\r\n', 'Chiếc điện thoại Samsung dòng A mới mang trong mình màn hình có kích thước lên tới 6.4 inch mang lại một không gian rất thoải mái để các bạn chơi game hay xem phim. Nhờ tỉ lệ màn hình 19:9 cùng thiết kế Infinity-U, bạn sẽ có một trải nghiệm khá mới mẻ và thích thú so với các màn hình 18:9 thông thường.\r\n\r\n', 'Samsung Galaxy A20 sở hữu cho mình cụm camera kép ở mặt lưng có độ phân giải lần lượt là chính 13 MP (khẩu độ f/1.9) và ống kính góc siêu rộng 5MP (khẩu độ f/2.2, 123 độ). Điểm mạnh của máy chính là khả năng chụp và lưu ảnh rất nhanh giúp bạn không bị bỏ lỡ bất cứ khoảnh khắc đẹp nào trong cuộc sống. Ngoài ra, những tính năng hấp dẫn như chụp ảnh xóa phông, tự động lấy nét, HDR, Parorama, sẽ đáp ứng được hầu hết các nhu cầu hằng ngày của người dùng.\r\n\r\n', 'img/sanpham/samsung/a20/mota/1.jpg', 'img/sanpham/samsung/a20/mota/2.jpg', 'img/sanpham/samsung/a20/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Trang bị các tính năng cao cấp từ các dòng flagship\r\n</h1><p>Điện Thoại Samsung Galaxy A20 vừa mới được trình làng tại thị trường Việt Nam. Máy nằm giữa A10 và A30 cả về thông số và mức giá. Đây là chiếc máy rẻ nhất trong dòng Galaxy A của Samsung mang lại cho người dùng những trải nghiệm cao cấp. Samsung Galaxy A20 có thiết kế nguyên khối vuống vắn, các đường góc bo cong mềm mại mang đúng “chất” Samsung.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/a20/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Màn hình Infinity-U hoàn toàn mới mẻ\r\n</h1><p>Chiếc điện thoại Samsung dòng A mới mang trong mình màn hình có kích thước lên tới 6.4 inch mang lại một không gian rất thoải mái để các bạn chơi game hay xem phim. Nhờ tỉ lệ màn hình 19:9 cùng thiết kế Infinity-U, bạn sẽ có một trải nghiệm khá mới mẻ và thích thú so với các màn hình 18:9 thông thường.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/a20/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Camera kép xóa phông, selfie đẹp\r\n</h1><p>Samsung Galaxy A20 sở hữu cho mình cụm camera kép ở mặt lưng có độ phân giải lần lượt là chính 13 MP (khẩu độ f/1.9) và ống kính góc siêu rộng 5MP (khẩu độ f/2.2, 123 độ). Điểm mạnh của máy chính là khả năng chụp và lưu ảnh rất nhanh giúp bạn không bị bỏ lỡ bất cứ khoảnh khắc đẹp nào trong cuộc sống. Ngoài ra, những tính năng hấp dẫn như chụp ảnh xóa phông, tự động lấy nét, HDR, Parorama, sẽ đáp ứng được hầu hết các nhu cầu hằng ngày của người dùng.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/a20/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (85, 'img/sanpham/samsung/a10s/x1.jpg', 'SAMSUNG GALAXY A10s (Xám)', 3, 3690000, 29, 1, 2, 2, 12, 'img/sanpham/samsung/a10s/x1.jpg', 'img/sanpham/samsung/a10s/x2.jpg', 'img/sanpham/samsung/a10s/x3.jpg', 'img/sanpham/samsung/a10s/4.jpg', '6.2 inch HD+ PLS TFT LCD', ' 5MP', '13.0 MP + 2.0 MP', 'Trải Nghiệm Hoàn Hảo Trên Màn Hình Lớn\r\n', 'Bộ Đôi Camera Kép Bắt Trọn Mọi Khoảnh Khắc\r\n', 'Bảo Vệ Tối Ưu\r\n', 'Điện Thoại Samsung Galaxy A10s (32GB/2GB) - Hàng Chính Hãng xem phim bất tận hay chơi game nhập vai MMORPG đỉnh cao trên Màn Hình Tràn Viền Infinity-V rộng 6.2 inch từ Galaxy A10s. Độ phân giải HD+ PLS mang đến cả thế giới giải trí sống động, chân thực hoàn hảo ngay trong bàn tay bạn.\r\n\r\n', 'Bức hình thêm rõ ràng và sắc nét với bộ đôi camera kép từ Galaxy A10s. Thoả sức sáng tạo, chụp trên mọi hành trình với Camera Chiều Sâu 13MP và 2MP cho ra những bức ảnh cực chất, đậm cá tính riêng bạn.\r\n', 'Galaxy A10s trang bị công nghệ bảo mật quét vân tay tối ưu tại mặt sau, giúp bạn dễ dàng mở khóa điện thoại hay đăng nhập vào các ứng dụng có hỗ trợ. Tiện lợi hơn, an toàn hơn.\r\n', 'img/sanpham/samsung/a10s/mota/1.bmp', 'img/sanpham/samsung/a10s/mota/2.bmp', 'img/sanpham/samsung/a10s/mota/3.bmp', 1, '<h1 class=\"font-weight-bold\">Trải Nghiệm Hoàn Hảo Trên Màn Hình Lớn\r\n</h1><p>Điện Thoại Samsung Galaxy A10s (32GB/2GB) - Hàng Chính Hãng xem phim bất tận hay chơi game nhập vai MMORPG đỉnh cao trên Màn Hình Tràn Viền Infinity-V rộng 6.2 inch từ Galaxy A10s. Độ phân giải HD+ PLS mang đến cả thế giới giải trí sống động, chân thực hoàn hảo ngay trong bàn tay bạn.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/a10s/mota/1.bmp\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Bộ Đôi Camera Kép Bắt Trọn Mọi Khoảnh Khắc\r\n</h1><p>Bức hình thêm rõ ràng và sắc nét với bộ đôi camera kép từ Galaxy A10s. Thoả sức sáng tạo, chụp trên mọi hành trình với Camera Chiều Sâu 13MP và 2MP cho ra những bức ảnh cực chất, đậm cá tính riêng bạn.\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/a10s/mota/2.bmp\"/></br><h1 class=\"font-weight-bold\">Bảo Vệ Tối Ưu\r\n</h1><p>Galaxy A10s trang bị công nghệ bảo mật quét vân tay tối ưu tại mặt sau, giúp bạn dễ dàng mở khóa điện thoại hay đăng nhập vào các ứng dụng có hỗ trợ. Tiện lợi hơn, an toàn hơn.\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/a10s/mota/3.bmp\"/></div></br>');
INSERT INTO `product` VALUES (86, 'img/sanpham/samsung/a10s/d1.jpg', 'SAMSUNG GALAXY A10s (Đỏ)', 3, 3690000, 28, 1, 2, 2, 12, 'img/sanpham/samsung/a10s/d1.jpg', 'img/sanpham/samsung/a10s/d2.jpg', 'img/sanpham/samsung/a10s/d3.jpg', 'img/sanpham/samsung/a10s/d4.jpg', '6.2 inch HD+ PLS TFT LCD', ' 5MP', '13.0 MP + 2.0 MP', 'Trải Nghiệm Hoàn Hảo Trên Màn Hình Lớn\r\n', 'Bộ Đôi Camera Kép Bắt Trọn Mọi Khoảnh Khắc\r\n', 'Bảo Vệ Tối Ưu\r\n', 'Điện Thoại Samsung Galaxy A10s (32GB/2GB) - Hàng Chính Hãng xem phim bất tận hay chơi game nhập vai MMORPG đỉnh cao trên Màn Hình Tràn Viền Infinity-V rộng 6.2 inch từ Galaxy A10s. Độ phân giải HD+ PLS mang đến cả thế giới giải trí sống động, chân thực hoàn hảo ngay trong bàn tay bạn.\r\n\r\n', 'Bức hình thêm rõ ràng và sắc nét với bộ đôi camera kép từ Galaxy A10s. Thoả sức sáng tạo, chụp trên mọi hành trình với Camera Chiều Sâu 13MP và 2MP cho ra những bức ảnh cực chất, đậm cá tính riêng bạn.\r\n', 'Galaxy A10s trang bị công nghệ bảo mật quét vân tay tối ưu tại mặt sau, giúp bạn dễ dàng mở khóa điện thoại hay đăng nhập vào các ứng dụng có hỗ trợ. Tiện lợi hơn, an toàn hơn.\r\n', 'img/sanpham/samsung/a10s/mota/1.bmp', 'img/sanpham/samsung/a10s/mota/2.bmp', 'img/sanpham/samsung/a10s/mota/3.bmp', 1, '<h1 class=\"font-weight-bold\">Trải Nghiệm Hoàn Hảo Trên Màn Hình Lớn\r\n</h1><p>Điện Thoại Samsung Galaxy A10s (32GB/2GB) - Hàng Chính Hãng xem phim bất tận hay chơi game nhập vai MMORPG đỉnh cao trên Màn Hình Tràn Viền Infinity-V rộng 6.2 inch từ Galaxy A10s. Độ phân giải HD+ PLS mang đến cả thế giới giải trí sống động, chân thực hoàn hảo ngay trong bàn tay bạn.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/a10s/mota/1.bmp\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Bộ Đôi Camera Kép Bắt Trọn Mọi Khoảnh Khắc\r\n</h1><p>Bức hình thêm rõ ràng và sắc nét với bộ đôi camera kép từ Galaxy A10s. Thoả sức sáng tạo, chụp trên mọi hành trình với Camera Chiều Sâu 13MP và 2MP cho ra những bức ảnh cực chất, đậm cá tính riêng bạn.\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/a10s/mota/2.bmp\"/></br><h1 class=\"font-weight-bold\">Bảo Vệ Tối Ưu\r\n</h1><p>Galaxy A10s trang bị công nghệ bảo mật quét vân tay tối ưu tại mặt sau, giúp bạn dễ dàng mở khóa điện thoại hay đăng nhập vào các ứng dụng có hỗ trợ. Tiện lợi hơn, an toàn hơn.\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/a10s/mota/3.bmp\"/></div></br>');
INSERT INTO `product` VALUES (87, 'img/sanpham/oppo/f11pro/x1.jpg', 'OPPO F11 PRO', 5, 8490000, 30, 4, 3, 3, 12, 'img/sanpham/oppo/f11pro/x1.jpg', 'img/sanpham/oppo/f11pro/x2.jpg', 'img/sanpham/oppo/f11pro/x3.jpg', 'img/sanpham/oppo/f11pro/x4.jpg', 'LTPS LCD, 6.53\", Full HD+ (1080 x 2340 Pixels)', '16 MP', '48MP + 5MP (2 camera)', 'Thiết kế độc đáo, thu hút ánh nhìn\r\n', 'Hiệu năng mạnh mẽ\r\n', 'Camera trước với chế độ làm đẹp Al\r\n', 'Điện thoại Oppo F11 Pro được khoác lên mình thiết kế khung viền kim loại cùng 2 mặt kính bóng bẩy. Mặt lưng được thiết kế theo hiệu ứng gradient đổi màu hứa hẹn sẽ khiến giới trẻ \"phát cuồng\". Các viền kính được làm bo cong ôm sát vào viền kim loại để cung cấp trải nghiệm cầm nắm thoải mái, dù điện thoại có kích thước khá lớn.\r\n\r\n', 'Máy được trang bị con chip MediaTek Helio P70 8 nhân đủ để trải nghiệm các dòng game hot: PUBG, Liên quân ở mức cấu hình tầm trung và đặc biệt máy sở hữu tới 6 GB RAM. Với dung lượng RAM này bạn có thể tự tin sử dụng nhiều ứng dụng cùng lúc mà máy vẫn chuyển qua lại một cách mượt mà. Một điểm cộng khác là máy chạy sẵn Android 9.0 (Pie) ngay khi bán ra cho bạn nhiều trải nghiệm mới mẻ.\r\n\r\n', 'Oppo F11 Pro sở hữu camera trước độ phân giải 16 MP. Chế độ làm đẹp bằng AI hay những công nghệ mà những chiếc smartphone Oppo đã mang đến thì bạn hoàn toàn có thể tự tin với khả năng selfie của Oppo F11 Pro. Camera trước có chức năng nhận diện khuôn mặt, chế độ làm đẹp, quay video Full HD, tự động lấy nét, Selfie ngược sáng HDR, sticker AR (biểu tượng thực tế ảo), quay video HD, cho bạn những bức hình sống động.\r\n\r\n', 'img/sanpham/oppo/f11pro/mota/1.jpg', 'img/sanpham/oppo/f11pro/mota/2.jpg', 'img/sanpham/oppo/f11pro/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Thiết kế độc đáo, thu hút ánh nhìn\r\n</h1><p>Điện thoại Oppo F11 Pro được khoác lên mình thiết kế khung viền kim loại cùng 2 mặt kính bóng bẩy. Mặt lưng được thiết kế theo hiệu ứng gradient đổi màu hứa hẹn sẽ khiến giới trẻ \"phát cuồng\". Các viền kính được làm bo cong ôm sát vào viền kim loại để cung cấp trải nghiệm cầm nắm thoải mái, dù điện thoại có kích thước khá lớn.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/oppo/f11pro/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Hiệu năng mạnh mẽ\r\n</h1><p>Máy được trang bị con chip MediaTek Helio P70 8 nhân đủ để trải nghiệm các dòng game hot: PUBG, Liên quân ở mức cấu hình tầm trung và đặc biệt máy sở hữu tới 6 GB RAM. Với dung lượng RAM này bạn có thể tự tin sử dụng nhiều ứng dụng cùng lúc mà máy vẫn chuyển qua lại một cách mượt mà. Một điểm cộng khác là máy chạy sẵn Android 9.0 (Pie) ngay khi bán ra cho bạn nhiều trải nghiệm mới mẻ.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/oppo/f11pro/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Camera trước với chế độ làm đẹp Al\r\n</h1><p>Oppo F11 Pro sở hữu camera trước độ phân giải 16 MP. Chế độ làm đẹp bằng AI hay những công nghệ mà những chiếc smartphone Oppo đã mang đến thì bạn hoàn toàn có thể tự tin với khả năng selfie của Oppo F11 Pro. Camera trước có chức năng nhận diện khuôn mặt, chế độ làm đẹp, quay video Full HD, tự động lấy nét, Selfie ngược sáng HDR, sticker AR (biểu tượng thực tế ảo), quay video HD, cho bạn những bức hình sống động.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/oppo/f11pro/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (88, 'img/sanpham/xiaomi/mi9t/d1.jpg', 'XIAOMI M9T (Đen)', 2, 8490000, 30, 4, 3, 3, 12, 'img/sanpham/xiaomi/mi9t/d1.jpg', 'img/sanpham/xiaomi/mi9t/d2.jpg', 'img/sanpham/xiaomi/mi9t/d3.jpg', 'img/sanpham/xiaomi/mi9t/d4.jpg', 'AMOLED, 6.39\", Full HD+', '20 MP', 'Chính 48 MP & Phụ 13 MP, 8 MP', 'Tổng quan sản phẩm\r\n', 'Màn hình tràn viền với 91.9% diện tích mặt trước\r\n', 'Con chip Snapdragon 730 mạnh mẽ nhất\r\n', 'Điện Thoại Xiaomi Mi 9T mang một phong cách độc đáo đầy mê hoặc. Chỉ cần ánh sáng chiếu vào, bạn sẽ thấy các họa tiết trên mặt lưng lấp lánh rất thú vị. Hơn thế nữa, mỗi màu sắc của Xiaomi Mi 9T 64GB đều mang sắc thái riêng. Bạn có thể lựa chọn màu đỏ hoặc xanh năng động, hiện đại. Ngoài ra còn có phiên bản màu đen carbon cổ điển thể hiện sự đứng đắn, từng trải. Với thiết kế cong 3D, Xiaomi Mi 9T nằm gọn trong lòng bàn tay một cách mượt mà.\r\n\r\n', 'Với camera trước dạng pop-up, Xiaomi Mi 9T 64GB sở hữu màn hình tràn viền đúng nghĩa, không hề có bất cứ điểm khuyết nào ảnh hưởng đến trải nghiệm xem của bạn. Bạn sẽ được tận hưởng những nội dung tuyệt vời trên màn hình 6,39 inch AMOLED tràn viền cả 4 cạnh, chiếm tới 91.9% diện tích mặt trước. Màn hình sáng đẹp rực rỡ và tràn viền hoàn hảo, Xiaomi Mi 9T mang tới trải nghiệm thực sự khác biệt khi xem phim hay chơi game.\r\n\r\n', 'Được trang bị bộ vi xử lý Snapdragon 730, con chip mới và mạnh mẽ hàng đầu hiện nay, Xiaomi Mi 9T 64GB có hiệu năng đáp ứng hoàn hảo mọi yêu cầu của bạn. Snapdragon 730 sản xuất trên tiến trình 8nm, mạnh hơn tới 35% và tiết kiệm điện hơn 10%. Ngoài ra bạn còn có GPU đồ họa Adreno 618 và tính năng Dual Turbo, cho trải nghiệm game tuyệt vời. Tha hồ “chiến” những game nặng và luôn luôn mượt mà, hãy yên tâm về Xiaomi Mi 9T.\r\n\r\n', 'img/sanpham/xiaomi/mi9t/mota/1.jpg', 'img/sanpham/xiaomi/mi9lite/mota/2.jpg', 'img/sanpham/xiaomi/mi9lite/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Tổng quan sản phẩm\r\n</h1><p>Điện Thoại Xiaomi Mi 9T mang một phong cách độc đáo đầy mê hoặc. Chỉ cần ánh sáng chiếu vào, bạn sẽ thấy các họa tiết trên mặt lưng lấp lánh rất thú vị. Hơn thế nữa, mỗi màu sắc của Xiaomi Mi 9T 64GB đều mang sắc thái riêng. Bạn có thể lựa chọn màu đỏ hoặc xanh năng động, hiện đại. Ngoài ra còn có phiên bản màu đen carbon cổ điển thể hiện sự đứng đắn, từng trải. Với thiết kế cong 3D, Xiaomi Mi 9T nằm gọn trong lòng bàn tay một cách mượt mà.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/xiaomi/mi9t/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Màn hình tràn viền với 91.9% diện tích mặt trước\r\n</h1><p>Với camera trước dạng pop-up, Xiaomi Mi 9T 64GB sở hữu màn hình tràn viền đúng nghĩa, không hề có bất cứ điểm khuyết nào ảnh hưởng đến trải nghiệm xem của bạn. Bạn sẽ được tận hưởng những nội dung tuyệt vời trên màn hình 6,39 inch AMOLED tràn viền cả 4 cạnh, chiếm tới 91.9% diện tích mặt trước. Màn hình sáng đẹp rực rỡ và tràn viền hoàn hảo, Xiaomi Mi 9T mang tới trải nghiệm thực sự khác biệt khi xem phim hay chơi game.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/xiaomi/mi9lite/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Con chip Snapdragon 730 mạnh mẽ nhất\r\n</h1><p>Được trang bị bộ vi xử lý Snapdragon 730, con chip mới và mạnh mẽ hàng đầu hiện nay, Xiaomi Mi 9T 64GB có hiệu năng đáp ứng hoàn hảo mọi yêu cầu của bạn. Snapdragon 730 sản xuất trên tiến trình 8nm, mạnh hơn tới 35% và tiết kiệm điện hơn 10%. Ngoài ra bạn còn có GPU đồ họa Adreno 618 và tính năng Dual Turbo, cho trải nghiệm game tuyệt vời. Tha hồ “chiến” những game nặng và luôn luôn mượt mà, hãy yên tâm về Xiaomi Mi 9T.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/xiaomi/mi9lite/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (89, 'img/sanpham/vivo/v15/x1.jpg', 'Vivo V15 (Xanh)', 7, 5290000, 30, 3, 2, 3, 12, 'img/sanpham/vivo/v15/x1.jpg', 'img/sanpham/vivo/v15/x2.jpg', 'img/sanpham/vivo/v15/x3.jpg', 'img/sanpham/vivo/v15/x4.jpg', '6.53 inch FHD+ (1080 x 2340)', '32MP', '24MP DP (12MP) f/1.78 + 8MP f/2.2 + 5MP f/2.4 (3 Camera)', 'Thiết kế hoàn mĩ', 'Màn hình tràn không viền 6.53 inch FHD+', 'Trang bị con chip MTK Helio P70, 8 nhân', 'Điện Thoại VIVO V15 mang một thân hình vô cùng quyến rũ với không gian màn hình gần như chiếm trọn mặt trước của máy. Máy thiết kế mặt lưng với những họa tiết gợn sáng lung linh, thân hình thanh thoát, uyển chuyển bởi các đường cong mềm mại đan xen một chút mạnh mẽ, đem lại cảm giác cầm nắm trên tay vô cùng dễ chịu và thoải mái.', 'Màn hình tràn không viền mang đến tỉ lệ màn hình/thân máy đạt 90.95%, kích thước màn hình 6.53 inch, giúp mở rộng góc nhìn một cách đột phá. Kết hợp với độ phân giải FHD+ (1080 x 2340), kính cường lực Corning Gorilla Glass thế hệ thứ 5, giúp các trò chơi hay bộ phim trở nên hấp dẫn và thú vị hơn.', 'Được trang bị con chip MTK Helio P70, 8 nhân (2.1GHz) và bộ nhớ trong 128GB, RAM 6GB giúp người dùng có thể thoải máy đa nhiệm mà không sợ bị load lại ứng dụng trong quá trình sử dụng, giúp chơi game và vận hành nhiều ứng dụng cùng lúc mà vẫn mượt mà, không bị giật lag.', 'img/sanpham/vivo/v15/mota/1.jpg', 'img/sanpham/vivo/v15/mota/2.jpg', 'img/sanpham/vivo/v15/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Thiết kế hoàn mĩ</h1><p>Điện Thoại VIVO V15 mang một thân hình vô cùng quyến rũ với không gian màn hình gần như chiếm trọn mặt trước của máy. Máy thiết kế mặt lưng với những họa tiết gợn sáng lung linh, thân hình thanh thoát, uyển chuyển bởi các đường cong mềm mại đan xen một chút mạnh mẽ, đem lại cảm giác cầm nắm trên tay vô cùng dễ chịu và thoải mái.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/vivo/v15/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Màn hình tràn không viền 6.53 inch FHD+</h1><p>Màn hình tràn không viền mang đến tỉ lệ màn hình/thân máy đạt 90.95%, kích thước màn hình 6.53 inch, giúp mở rộng góc nhìn một cách đột phá. Kết hợp với độ phân giải FHD+ (1080 x 2340), kính cường lực Corning Gorilla Glass thế hệ thứ 5, giúp các trò chơi hay bộ phim trở nên hấp dẫn và thú vị hơn.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/vivo/v15/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Trang bị con chip MTK Helio P70, 8 nhân</h1><p>Được trang bị con chip MTK Helio P70, 8 nhân (2.1GHz) và bộ nhớ trong 128GB, RAM 6GB giúp người dùng có thể thoải máy đa nhiệm mà không sợ bị load lại ứng dụng trong quá trình sử dụng, giúp chơi game và vận hành nhiều ứng dụng cùng lúc mà vẫn mượt mà, không bị giật lag.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/vivo/v15/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (90, 'img/sanpham/xiaomi/mia3/x1.jpg', 'XIAOMI MIA3 (Xám)', 2, 4990000, 30, 3, 3, 3, 12, 'img/sanpham/xiaomi/mia3/x1.jpg', 'img/sanpham/xiaomi/mia3/x2.jpg', 'img/sanpham/xiaomi/mia3/x3.jpg', 'img/sanpham/xiaomi/mia3/x4.jpg', 'AMOLED, 6.01\", HD+', '32 MP', 'Chính 48 MP & Phụ 8 MP, 2 MP', 'Thiết kế màn hình Infinity-V\r\n', 'Vi xử lý mới siêu mạnh mẽ và tiết kiệm điện\r\n', 'Cảm biến vân tay trong màn hình\r\n', 'Điện Thoại Xiaomi Mi A3 sử dụng tới 3 camera sau, trong đó cảm biến camera chính đến từ Sony có độ phân giải lên tới 48MP có độ phân giải lên đến 48MP, cao gấp 4 lần so với 12MP của smartphone thông thường. Bạn có thể chụp ảnh và phóng to để xem rõ hơn từng chi tiết mà mọi thứ vẫn rất sắc nét kể cả trong đêm tối. Camera góc siêu rộng mang đến những góc nhìn thực sự khác biệt, thu gọn khung cảnh rộng lớn vào trong một khung hình duy nhất.\r\n\r\n', 'Sức mạnh của Xiaomi Mi A3 đến từ bộ vi xử lý Snapdragon 665 sản xuất trên tiến trình mới 11nm, mạnh mẽ hơn nhưng cũng tiết kiệm điện năng hơn. Với 8 nhân Kryo 260 CPU cùng GPU Adreno 610, Xiaomi Mi A3 đủ sức chạy mượt mà mọi ứng dụng và chơi tốt tất cả những tựa game bạn yêu thích.\r\n\r\n', 'Sử dụng công nghệ cảm biến vân tay dưới màn hình tiên tiến, điện thoại nhận diện chính xác và mở khóa ngay lập tức khi bạn chạm tay vào khu vực cảm biến. Cảm biến vân tay trong màn hình giúp cho thiết kế máy hoàn toàn liền lạc vì không phải mất vị trí cho cảm biến, đồng thời nằm ngay trên màn hình mặt trước thao tác vô cùng tiện lợi. Tất nhiên Mi A3 cũng đi kèm nhận diện khuôn mặt AI để bạn có thể mở khóa theo bất cứ cách nào.\r\n\r\n', 'img/sanpham/xiaomi/mia3/mota/1.jpg', 'img/sanpham/xiaomi/mia3/mota/2.jpg', 'img/sanpham/xiaomi/mia3/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Thiết kế màn hình Infinity-V\r\n</h1><p>Điện Thoại Xiaomi Mi A3 sử dụng tới 3 camera sau, trong đó cảm biến camera chính đến từ Sony có độ phân giải lên tới 48MP có độ phân giải lên đến 48MP, cao gấp 4 lần so với 12MP của smartphone thông thường. Bạn có thể chụp ảnh và phóng to để xem rõ hơn từng chi tiết mà mọi thứ vẫn rất sắc nét kể cả trong đêm tối. Camera góc siêu rộng mang đến những góc nhìn thực sự khác biệt, thu gọn khung cảnh rộng lớn vào trong một khung hình duy nhất.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/xiaomi/mia3/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Vi xử lý mới siêu mạnh mẽ và tiết kiệm điện\r\n</h1><p>Sức mạnh của Xiaomi Mi A3 đến từ bộ vi xử lý Snapdragon 665 sản xuất trên tiến trình mới 11nm, mạnh mẽ hơn nhưng cũng tiết kiệm điện năng hơn. Với 8 nhân Kryo 260 CPU cùng GPU Adreno 610, Xiaomi Mi A3 đủ sức chạy mượt mà mọi ứng dụng và chơi tốt tất cả những tựa game bạn yêu thích.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/xiaomi/mia3/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Cảm biến vân tay trong màn hình\r\n</h1><p>Sử dụng công nghệ cảm biến vân tay dưới màn hình tiên tiến, điện thoại nhận diện chính xác và mở khóa ngay lập tức khi bạn chạm tay vào khu vực cảm biến. Cảm biến vân tay trong màn hình giúp cho thiết kế máy hoàn toàn liền lạc vì không phải mất vị trí cho cảm biến, đồng thời nằm ngay trên màn hình mặt trước thao tác vô cùng tiện lợi. Tất nhiên Mi A3 cũng đi kèm nhận diện khuôn mặt AI để bạn có thể mở khóa theo bất cứ cách nào.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/xiaomi/mia3/mota/3.jpg\"/></div></br>');
