INSERT INTO `product` VALUES (92, 'img/sanpham/samsung/a30s/x1.jpg', 'SAMSUNG GALAXY A30s (Xanh)', 1, 6990000, 30, 3, 3, 3, 12, 'img/sanpham/samsung/a30s/x1.jpg', 'img/sanpham/samsung/a30s/x2.jpg', 'img/sanpham/samsung/a30s/x3.jpg', 'img/sanpham/samsung/a30s/x4.jpg', '6.4 inches, 720 x 1560 (HD+) Super AMOLED', '16.0 MP', '25.0 MP + 5.0 MP + 8.0 MP', 'Màn hình lớn, vân tay thời thượng\r\n', 'Bộ 3 camera đỉnh cao\r\n', 'Hiệu suất mạnh mẽ cho trải nghiệm hoàn hảo\r\n', 'Điện Thoại Samsung Galaxy A30s (64GB/4GB) đắm chìm trong thế giới giải trí đỉnh cao trên Màn Hình Vô Cực Infinity-V 6.4 inch, tỷ lệ khung hình rộng ấn tượng. Công nghệ Super AMOLED chuẩn HD+ cho bạn thoả sức chơi game, xem phim hay quay video trực tuyến với chi tiết hình ảnh luôn sắc nét và hoàn hảo.\r\n\r\n', 'Máy sở hữu ống kính chính sẽ có độ phân giải 25 MP, ống kính thứ 2 là ống kính góc siêu rộng có độ phân giải 8 MP và một ống kính 5 MP hỗ trợ đo độ sâu trường ảnh. Ngoài ra, những tính năng chụp ảnh xóa phông, tự động lấy nét, HDR, Parorama, sẽ đáp ứng được nhu cầu nắm bắt khoảnh khắc hàng ngày của bạn và chia sẻ với bạn bè. Tính năng Live Focus trên Galaxy A30s cho khả năng xóa phông thời thượng bằng cách nhận diện khuôn mặt và làm mờ phần phông nền phía sau.\r\n\r\n', 'RAM 4GB và bộ xử lý Octa-core mạnh mẽ từ Galaxy A30s giúp mọi tác vụ và trải nghiệm của bạn luôn mượt mà hoàn hảo. Tải xuống hay lưu trữ bất tận mọi dữ liệu với bộ nhớ trong lên đến 128GB và thẻ nhớ microSD ngoài đến 512GB.\r\n\r\n', 'img/sanpham/samsung/a30s/mota/1.jfif', 'img/sanpham/samsung/a30s/mota/2.jfif', 'img/sanpham/samsung/a30s/mota/3.jfif', 1, '<h1 class=\"font-weight-bold\">Màn hình lớn, vân tay thời thượng\r\n</h1><p>Điện Thoại Samsung Galaxy A30s (64GB/4GB) đắm chìm trong thế giới giải trí đỉnh cao trên Màn Hình Vô Cực Infinity-V 6.4 inch, tỷ lệ khung hình rộng ấn tượng. Công nghệ Super AMOLED chuẩn HD+ cho bạn thoả sức chơi game, xem phim hay quay video trực tuyến với chi tiết hình ảnh luôn sắc nét và hoàn hảo.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/a30s/mota/1.jfif\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Bộ 3 camera đỉnh cao\r\n</h1><p>Máy sở hữu ống kính chính sẽ có độ phân giải 25 MP, ống kính thứ 2 là ống kính góc siêu rộng có độ phân giải 8 MP và một ống kính 5 MP hỗ trợ đo độ sâu trường ảnh. Ngoài ra, những tính năng chụp ảnh xóa phông, tự động lấy nét, HDR, Parorama, sẽ đáp ứng được nhu cầu nắm bắt khoảnh khắc hàng ngày của bạn và chia sẻ với bạn bè. Tính năng Live Focus trên Galaxy A30s cho khả năng xóa phông thời thượng bằng cách nhận diện khuôn mặt và làm mờ phần phông nền phía sau.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/a30s/mota/2.jfif\"/></br><h1 class=\"font-weight-bold\">Hiệu suất mạnh mẽ cho trải nghiệm hoàn hảo\r\n</h1><p>RAM 4GB và bộ xử lý Octa-core mạnh mẽ từ Galaxy A30s giúp mọi tác vụ và trải nghiệm của bạn luôn mượt mà hoàn hảo. Tải xuống hay lưu trữ bất tận mọi dữ liệu với bộ nhớ trong lên đến 128GB và thẻ nhớ microSD ngoài đến 512GB.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/a30s/mota/3.jfif\"/></div></br>');
