rên nền tảng Android 9 Pie).\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/xiaomi/redmi8a/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Bộ đôi camera hỗ trợ AI\r\n</h1><p>Camera chính 12 MP AI sử dụng cảm biến Sony IMX363 khẩu độ f/1.8, giao diện chụp ảnh có nhiều chế độ chụp như HDR, chụp đêm, thủ công, đáp ứng đầy đủ các nhu cầu chụp ảnh thường ngày của người dùng.\r\n\r\nẢnh chụp bằng Xiaomi Redmi 8A theo khuynh hướng chân thực, giữ màu sắc chính xác, không nịnh mắt, ảnh chụp ban ngày cho độ chi tiết rất tốt, tuy nhiên ở điều kiện thiếu sáng, đã xuất hiện một số chi tiết nhiễu.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/xiaomi/redmi8a/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (96, 'img/sanpham/samsung/a80/d2.jpg', 'SAMSUNG GALAXY A80 (Đen)', 1, 11990000, 30, 4, 4, 4, 12, 'img/sanpham/samsung/a80/d1.jpg', 'img/sanpham/samsung/a80/d2.jpg', 'img/sanpham/samsung/a80/d3.jpg', 'img/sanpham/samsung/a80/d4.jpg', 'Super AMOLED', 'Chính 48 MP & Phụ 8 MP, TOF 3D', 'Chính 48 MP & Phụ 8 MP, TOF 3D', 'Camera vừa trượt vừa xoay đầu tiên trên thế giới\r\n', 'Chất lượng camera không kém flagship\r\n', 'Dung lượng pin lớn, hỗ trợ sạc nhanh\r\n', 'Điện Thoại Samsung Galaxy A80 (128GB/8GB) là chiếc smartphone mang trong mình rất nhiều đột phá của Samsung và hứa hẹn sẽ là \"ngọn cờ đầu\" cho những chiếc smartphone sở hữu một màn hình tràn viền thật sự.\r\n\r\nThực tế thì xu hướng màn hình tràn viền đã bắt đầu cách đây khá lâu nhưng có rất ít các hãng có thể mang một màn hình tràn viền đúng nghĩa lên chiếc smartphone của mình.', 'Samsung Galaxy A80 là chiếc smartphone dòng A đầu tiên được Samsung ưu ái mang lên cảm biến 3D ToF giúp tăng khả năng nhận diện độ sâu, hỗ trợ quay video xoá phông và các tính năng AR thú vị.', 'Samsung Galaxy A80 được cung cấp năng lượng bởi viên pin 3.700 mAh với hỗ trợ sạc siêu nhanh 25W, hỗ trợ chế độ tiết kiệm năng lượng cAdaptive Power Saving.\r\n\r\nCảm biến vân tay dưới màn hình cũng xuất hiện trên Samsung Galaxy A80 giúp người dùng được trải nghiệm những công nghệ bảo mật tiên tiến nhất hiện nay.', 'img/sanpham/samsung/a80/mota/1.jpg', 'img/sanpham/samsung/a80/mota/2.jpg', 'img/sanpham/samsung/a80/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Camera vừa trượt vừa xoay đầu tiên trên thế giới\r\n</h1><p>Điện Thoại Samsung Galaxy A80 (128GB/8GB) là chiếc smartphone mang trong mình rất nhiều đột phá của Samsung và hứa hẹn sẽ là \"ngọn cờ đầu\" cho những chiếc smartphone sở hữu một màn hình tràn viền thật sự.\r\n\r\nThực tế thì xu hướng màn hình tràn viền đã bắt đầu cách đây khá lâu nhưng có rất ít các hãng có thể mang một màn hình tràn viền đúng nghĩa lên chiếc smartphone của mình.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/a80/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Chất lượng camera không kém flagship\r\n</h1><p>Samsung Galaxy A80 là chiếc smartphone dòng A đầu tiên được Samsung ưu ái mang lên cảm biến 3D ToF giúp tăng khả năng nhận diện độ sâu, hỗ trợ quay video xoá phông và các tính năng AR thú vị.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/a80/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Dung lượng pin lớn, hỗ trợ sạc nhanh\r\n</h1><p>Samsung Galaxy A80 được cung cấp năng lượng bởi viên pin 3.700 mAh với hỗ trợ sạc siêu nhanh 25W, hỗ trợ chế độ tiết kiệm năng lượng cAdaptive Power Saving.\r\n\r\nCảm biến vân tay dưới màn hình cũng xuất hiện trên Samsung Galaxy A80 giúp người dùng được trải nghiệm những công nghệ bảo mật tiên tiến nhất hiện nay.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/a80/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (97, 'img/sanpham/samsung/a80/t2.jpg', 'SAMSUNG GALAXY A80 (Trắng)', 1, 11990000, 30, 4, 4, 4, 12, 'img/sanpham/samsung/a80/t1.jpg', 'img/sanpham/samsung/a80/t2.jpg', 'img/sanpham/samsung/a80/t3.jpg', 'img/sanpham/samsung/a80/t4.jpg', 'Super AMOLED', 'Chính 48 MP & Phụ 8 MP, TOF 3D', 'Chính 48 MP & Phụ 8 MP, TOF 3D', 'Camera vừa trượt vừa xoay đầu tiên trên thế giới\r\n', 'Chất lượng camera không kém flagship\r\n', 'Dung lượng pin lớn, hỗ trợ sạc nhanh\r\n', 'Điện Thoại Samsung Galaxy A80 (128GB/8GB) là chiếc smartphone mang trong mình rất nhiều đột phá của Samsung và hứa hẹn sẽ là \"ngọn cờ đầu\" cho những chiếc smartphone sở hữu một màn hình tràn viền thật sự.\r\n\r\nThực tế thì xu hướng màn hình tràn viền đã bắt đầu cách đây khá lâu nhưng có rất ít các hãng có thể mang một màn hình tràn viền đúng nghĩa lên chiếc smartphone của mình.', 'Samsung Galaxy A80 là chiếc smartphone dòng A đầu tiên được Samsung ưu ái mang lên cảm biến 3D ToF giúp tăng khả năng nhận diện độ sâu, hỗ trợ quay video xoá phông và các tính năng AR thú vị.', 'Samsung Galaxy A80 được cung cấp năng lượng bởi viên pin 3.700 mAh với hỗ trợ sạc siêu nhanh 25W, hỗ trợ chế độ tiết kiệm năng lượng cAdaptive Power Saving.\r\n\r\nCảm biến vân tay dưới màn hình cũng xuất hiện trên Samsung Galaxy A80 giúp người dùng được trải nghiệm những công nghệ bảo mật tiên tiến nhất hiện nay.', 'img/sanpham/samsung/a80/mota/1.jpg', 'img/sanpham/samsung/a80/mota/2.jpg', 'img/sanpham/samsung/a80/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Camera vừa trượt vừa xoay đầu tiên trên thế giới\r\n</h1><p>Điện Thoại Samsung Galaxy A80 (128GB/8GB) là chiếc smartphone mang trong mình rất nhiều đột phá của Samsung và hứa hẹn sẽ là \"ngọn cờ đầu\" cho những chiếc smartphone sở hữu một màn hình tràn viền thật sự.\r\n\r\nThực tế thì xu hướng màn hình tràn viền đã bắt đầu cách đây khá lâu nhưng có rất ít các hãng có thể mang một màn hình tràn viền đúng nghĩa lên chiếc smartphone của mình.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/a80/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Chất lượng camera không kém flagship\r\n</h1><p>Samsung Galaxy A80 là chiếc smartphone dòng A đầu tiên được Samsung ưu ái mang lên cảm biến 3D ToF giúp tăng khả năng nhận diện độ sâu, hỗ trợ quay video xoá phông và các tính năng AR thú vị.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/a80/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Dung lượng pin lớn, hỗ trợ sạc nhanh\r\n</h1><p>Samsung Galaxy A80 được cung cấp năng lượng bởi viên pin 3.700 mAh với hỗ trợ sạc siêu nhanh 25W, hỗ trợ chế độ tiết kiệm năng lượng cAdaptive Power Saving.\r\n\r\nCảm biến vân tay dưới màn hình cũng xuất hiện trên Samsung Galaxy A80 giúp người dùng được trải nghiệm những công nghệ bảo mật tiên tiến nhất hiện nay.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/a80/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (98, 'img/sanpham/samsung/a30/d1.jpg', 'SAMSUNG GALAXY A30 (Đen)', 1, 6290000, 30, 3, 3, 3, 12, 'img/sanpham/samsung/a30/d1.jpg', 'img/sanpham/samsung/a30/d2.jpg', 'img/sanpham/samsung/a30/d3.jpg', 'img/sanpham/samsung/a30/d4.jpg', 'Super AMOLED, 6.4\", Full HD+', '16 MP', '	Chính 16 MP & Phụ 5 MP', 'Trang bị các tính năng cao cấp từ các dòng flagship\r\n', 'Cụm camera kép góc rộng\r\n', 'Mở khóa vân tay mặt sau\r\n', 'Có thể bạn sẽ bất ngờ bởi chiếc điện thoại Samsung Galaxy A30 (32GB/3GB) mới sở hữu cho mình màn hình có kích thước lên tới 6.4 inch, tương đương với màn hình của chiếc Samsung Galaxy S10+.\r\n\r\n', 'Bộ đôi camera kép ở mặt sau của máy có độ phân giải chính 16 MP và phụ 5 MP, trong đó ống kính phụ góc rộng là 5 MP cho phép chụp ảnh được bao quát và lạ mắt hơn.\r\n\r\n', 'Samsung đã chuyển cảm biến vân tay của mình ra mặt sau của máy và đặt nó khá vừa tầm tay khi cầm, để người dùng có thể mở khóa nhanh, đây là một sự thay đổi hợp lí.\r\n\r\n', 'img/sanpham/samsung/a30/mota/1.jpg', 'img/sanpham/samsung/a30/mota/2.jpg', 'img/sanpham/samsung/a30/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Trang bị các tính năng cao cấp từ các dòng flagship\r\n</h1><p>Có thể bạn sẽ bất ngờ bởi chiếc điện thoại Samsung Galaxy A30 (32GB/3GB) mới sở hữu cho mình màn hình có kích thước lên tới 6.4 inch, tương đương với màn hình của chiếc Samsung Galaxy S10+.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/a30/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Cụm camera kép góc rộng\r\n</h1><p>Bộ đôi camera kép ở mặt sau của máy có độ phân giải chính 16 MP và phụ 5 MP, trong đó ống kính phụ góc rộng là 5 MP cho phép chụp ảnh được bao quát và lạ mắt hơn.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/a30/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Mở khóa vân tay mặt sau\r\n</h1><p>Samsung đã chuyển cảm biến vân tay của mình ra mặt sau của máy và đặt nó khá vừa tầm tay khi cầm, để người dùng có thể mở khóa nhanh, đây là một sự thay đổi hợp lí.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/a30/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (99, 'img/sanpham/oppo/reno2f/1.jpg', 'OPPO Reno 2F (Đen)', 5, 6290000, 30, 3, 4, 3, 12, 'img/sanpham/oppo/reno2f/1.jpg', 'img/sanpham/oppo/reno2f/2.jpg', 'img/sanpham/oppo/reno2f/3.jpg', 'img/sanpham/oppo/reno2f/4.jpg', 'AMOLED, 6.5\", Full HD+', ' 16 MP', 'Chính 48 MP & Phụ 8 MP, 2 MP, 2 MP', 'Thiết kế hiện đại, thanh lịch\r\n', 'Màn hình AMOLED tràn viền, độ phân giải 2400x1080 pixel\r\n', '4 camera sau siêu zoom\r\n', 'Điện Thoại OPPO Reno 2F sở hữu thiết kế mỏng gọn cùng các đường bo góc tinh tế khiến chiếc điện thoại này vừa vặn trong lòng bàn tay, cho phép bạn cầm giữ một cách dễ dàng và thoải mái và chắc chắn hơn. Tổng thể sản phẩm nổi bật lên với vẻ đẹp thanh lịch sang trọng và không kém phần tinh tế.\r\n\r\n', 'OPPO Reno 2F sẽ có màn hình tràn viền hoàn hảo đúng nghĩa nhờ thiết kế camera selfie độc đáo, thực sự không có bất cứ một phần khuyết nào trên màn hình. Màn hình tràn viền tỷ lệ 19,5:9 cùng với một kích thước lên tới 6.5 inch, nhưng thực chất chỉ nằm gọn trong lòng bàn tay vì tỉ lệ màn hình chiếm tới 93% mặt trước.\r\n\r\n', 'Camera sau là tính năng đáng chú ý của chiếc máy này. OPPO Reno 2F được trang bị tới bốn camera sau với camera chính 48MP, khẩu độ f/1.7, đi kèm với cảm biến góc siêu rộng 8MP, ống kính tele 2MP và camera đơn sắc 2MP. Với độ phân giải này, bạn có thể thỏa sức ghi lại những khoảnh khắc của cuộc sống một cách sống động và chân thật, giúp bạn có những bức ảnh ưng ý nhất bao gồm chụp ảnh nhiều người, chụp ảnh xóa phông và chụp ảnh trắng đen.', 'img/sanpham/oppo/reno2f/mota/1.png', 'img/sanpham/oppo/reno2f/mota/2.png', 'img/sanpham/oppo/reno2f/mota/3.png', 1, '<h1 class=\"font-weight-bold\">Thiết kế hiện đại, thanh lịch\r\n</h1><p>Điện Thoại OPPO Reno 2F sở hữu thiết kế mỏng gọn cùng các đường bo góc tinh tế khiến chiếc điện thoại này vừa vặn trong lòng bàn tay, cho phép bạn cầm giữ một cách dễ dàng và thoải mái và chắc chắn hơn. Tổng thể sản phẩm nổi bật lên với vẻ đẹp thanh lịch sang trọng và không kém phần tinh tế.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/oppo/reno2f/mota/1.png\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Màn hình AMOLED tràn viền, độ phân giải 2400x1080 pixel\r\n</h1><p>OPPO Reno 2F sẽ có màn hình tràn viền hoàn hảo đúng nghĩa nhờ thiết kế camera selfie độc đáo, thực sự không có bất cứ một phần khuyết nào trên màn hình. Màn hình tràn viền tỷ lệ 19,5:9 cùng với một kích thước lên tới 6.5 inch, nhưng thực chất chỉ nằm gọn trong lòng bàn tay vì tỉ lệ màn hình chiếm tới 93% mặt trước.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/oppo/reno2f/mota/2.png\"/></br><h1 class=\"font-weight-bold\">4 camera sau siêu zoom\r\n</h1><p>Camera sau là tính năng đáng chú ý của chiếc máy này. OPPO Reno 2F được trang bị tới bốn camera sau với camera chính 48MP, khẩu độ f/1.7, đi kèm với cảm biến góc siêu rộng 8MP, ống kính tele 2MP và camera đơn sắc 2MP. Với độ phân giải này, bạn có thể thỏa sức ghi lại những khoảnh khắc của cuộc sống một cách sống động và chân thật, giúp bạn có những bức ảnh ưng ý nhất bao gồm chụp ảnh nhiều người, chụp ảnh xóa phông và chụp ảnh trắng đen.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/oppo/reno2f/mota/3.png\"/></div></br>');
