hông kém phần tinh tế.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/oppo/reno2f/mota/1.png\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Màn hình AMOLED tràn viền, độ phân giải 2400x1080 pixel\r\n</h1><p>OPPO Reno 2F sẽ có màn hình tràn viền hoàn hảo đúng nghĩa nhờ thiết kế camera selfie độc đáo, thực sự không có bất cứ một phần khuyết nào trên màn hình. Màn hình tràn viền tỷ lệ 19,5:9 cùng với một kích thước lên tới 6.5 inch, nhưng thực chất chỉ nằm gọn trong lòng bàn tay vì tỉ lệ màn hình chiếm tới 93% mặt trước.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/oppo/reno2f/mota/2.png\"/></br><h1 class=\"font-weight-bold\">4 camera sau siêu zoom\r\n</h1><p>Camera sau là tính năng đáng chú ý của chiếc máy này. OPPO Reno 2F được trang bị tới bốn camera sau với camera chính 48MP, khẩu độ f/1.7, đi kèm với cảm biến góc siêu rộng 8MP, ống kính tele 2MP và camera đơn sắc 2MP. Với độ phân giải này, bạn có thể thỏa sức ghi lại những khoảnh khắc của cuộc sống một cách sống động và chân thật, giúp bạn có những bức ảnh ưng ý nhất bao gồm chụp ảnh nhiều người, chụp ảnh xóa phông và chụp ảnh trắng đen.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/oppo/reno2f/mota/3.png\"/></div></br>');
INSERT INTO `product` VALUES (101, 'img/sanpham/samsung/a20s/1.jpg', 'SAMSUNG A20s', 1, 4390000, 30, 2, 2, 2, 12, 'img/sanpham/samsung/a20s/1.jpg', 'img/sanpham/samsung/a20s/2.jpg', 'img/sanpham/samsung/a20s/3.jpg', 'img/sanpham/samsung/a20s/4.jpg', 'Super AMOLED', '16 MP', '25.0 MP + 5.0 MP + 8.0 MP', 'Màn hình lớn cho những trải nghiệm lớn\r\n', 'Mặt lưng bóng bẩy, màu sắc phong cách\r\n', '3 camera sau cao cấp\r\n', 'Điện Thoại Samsung Galaxy A20s sở hữu màn hình lớn mang đến cho bạn không gian trải nghiệm lớn hơn. Trước mắt chúng ta sẽ là màn hình 6,5 inch vô cực dạng Infinity-V tuyệt hảo, hiển thị sống động, hình ảnh sắc nét, hiệu ứng tràn viền hấp dẫn. Mỗi ngày trôi qua bạn đều được trải nghiệm những điều tuyệt vời mà màn hình Infinity-V mang lại.\r\n\r\n', 'Samsung Galaxy A20s có thiết kế trẻ trung với mặt lưng bóng bẩy thời trang. Mặt lưng A20s được hoàn thiện mượt mà, hiệu ứng đổi màu và phản chiếu ánh sáng nhẹ nhàng, bo cong mềm mại để cầm nắm dễ dàng hơn. Bạn sẽ có 3 sự lựa chọn màu sắc đầy phong cách là đen, đỏ và xanh để lựa chọn.\r\n\r\n', 'Galaxy A20s có khả năng chụp ảnh chuyên nghiệp khi sở hữu 3 camera sau cao cấp với 3 vai trò khác nhau. Bạn sẽ có camera chính 13MP, camera đo độ sâu 5MP và camera góc siêu rộng 8MP. Camera đo độ sâu hỗ trợ chụp ảnh xóa phông, làm mờ hậu cảnh và nổi bật chủ thể. Trong khi đó camera góc siêu rộng mang đến góc chụp rộng tới 120 độ, lưu lại những khung cảnh hùng vĩ rộng lớn.\r\n\r\n', 'img/sanpham/samsung/a20s/mota/1.jpg', 'img/sanpham/samsung/a20s/mota/2.jpg', 'img/sanpham/samsung/a20s/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Màn hình lớn cho những trải nghiệm lớn\r\n</h1><p>Điện Thoại Samsung Galaxy A20s sở hữu màn hình lớn mang đến cho bạn không gian trải nghiệm lớn hơn. Trước mắt chúng ta sẽ là màn hình 6,5 inch vô cực dạng Infinity-V tuyệt hảo, hiển thị sống động, hình ảnh sắc nét, hiệu ứng tràn viền hấp dẫn. Mỗi ngày trôi qua bạn đều được trải nghiệm những điều tuyệt vời mà màn hình Infinity-V mang lại.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/a20s/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Mặt lưng bóng bẩy, màu sắc phong cách\r\n</h1><p>Samsung Galaxy A20s có thiết kế trẻ trung với mặt lưng bóng bẩy thời trang. Mặt lưng A20s được hoàn thiện mượt mà, hiệu ứng đổi màu và phản chiếu ánh sáng nhẹ nhàng, bo cong mềm mại để cầm nắm dễ dàng hơn. Bạn sẽ có 3 sự lựa chọn màu sắc đầy phong cách là đen, đỏ và xanh để lựa chọn.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/a20s/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">3 camera sau cao cấp\r\n</h1><p>Galaxy A20s có khả năng chụp ảnh chuyên nghiệp khi sở hữu 3 camera sau cao cấp với 3 vai trò khác nhau. Bạn sẽ có camera chính 13MP, camera đo độ sâu 5MP và camera góc siêu rộng 8MP. Camera đo độ sâu hỗ trợ chụp ảnh xóa phông, làm mờ hậu cảnh và nổi bật chủ thể. Trong khi đó camera góc siêu rộng mang đến góc chụp rộng tới 120 độ, lưu lại những khung cảnh hùng vĩ rộng lớn.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/a20s/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (102, 'img/sanpham/oppo/a9/x1.jpg', 'OPPO A9 2020', 1, 4290000, 29, 5, 4, 2, 12, 'img/sanpham/oppo/a9/x1.jpg', 'img/sanpham/oppo/a9/x2.jpg', 'img/sanpham/oppo/a9/x3.jpg', 'img/sanpham/oppo/a9/x4.jpg', 'TFT, 6.5\", HD+', '	16 MP', 'Chính 48 MP & Phụ 8 MP, 2 MP, 2 MP', 'Thiết kế tinh tế và sang trọng\r\n', 'Chụp ảnh sắc nét với cụm 4 camera\r\n', 'Màn hình giọt nước trải nghiệm tối ưu\r\n', 'Điện Thoại OPPO A9 (128G/8GB) được trang bị con chip tầm trung mới Snapdragon 665 mang đến hiệu năng mạnh mẽ và tối ưu tiết kiệm điện hơn, cho trải nghiệm giải trí, chơi game trở nên mượt mà và dễ dàng hơn bao giờ hết.\r\n\r\n', 'OPPO A9 (2020) có sự thay đổi lớn về số camera cũng như độ phân giải camera sau, giúp hình ảnh đạt độ chi tiết và sắc nét cao hơn hẳn.\r\n\r\nMáy bao gồm một camera chính 48 MP và ba cảm biến phụ có độ phân giải lần lượt là 8 MP, 2 MP và 2 MP.\r\n\r\n', 'OPPO A9 (2020) có màn hình giọt nước rộng đến 6.5 inch, độ phân giải HD+, tỉ lệ 19.5:9 và đạt đến 90.7% diện tích trải nghiệm.\r\n\r\nViệc xem phim, chơi game sẽ trở nên đã mắt và không còn gặp nhiều giới hạn cùng với dung lượng pin khủng đến 5000 mAh.\r\n\r\n', 'img/sanpham/oppo/a9/mota/1.jpg', 'img/sanpham/oppo/a9/mota/2.jpg', 'img/sanpham/oppo/a9/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Thiết kế tinh tế và sang trọng\r\n</h1><p>Điện Thoại OPPO A9 (128G/8GB) được trang bị con chip tầm trung mới Snapdragon 665 mang đến hiệu năng mạnh mẽ và tối ưu tiết kiệm điện hơn, cho trải nghiệm giải trí, chơi game trở nên mượt mà và dễ dàng hơn bao giờ hết.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/oppo/a9/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Chụp ảnh sắc nét với cụm 4 camera\r\n</h1><p>OPPO A9 (2020) có sự thay đổi lớn về số camera cũng như độ phân giải camera sau, giúp hình ảnh đạt độ chi tiết và sắc nét cao hơn hẳn.\r\n\r\nMáy bao gồm một camera chính 48 MP và ba cảm biến phụ có độ phân giải lần lượt là 8 MP, 2 MP và 2 MP.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/oppo/a9/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Màn hình giọt nước trải nghiệm tối ưu\r\n</h1><p>OPPO A9 (2020) có màn hình giọt nước rộng đến 6.5 inch, độ phân giải HD+, tỉ lệ 19.5:9 và đạt đến 90.7% diện tích trải nghiệm.\r\n\r\nViệc xem phim, chơi game sẽ trở nên đã mắt và không còn gặp nhiều giới hạn cùng với dung lượng pin khủng đến 5000 mAh.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/oppo/a9/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (103, 'img/sanpham/xiaomi/mia2lite/1.jpg', 'XIAOMI MI A2 Lite', 2, 4490000, 30, 2, 2, 3, 12, 'img/sanpham/xiaomi/mia2lite/1.jpg', 'img/sanpham/xiaomi/mia2lite/2.jpg', 'img/sanpham/xiaomi/mia2lite/3.jpg', 'img/sanpham/xiaomi/mia2lite/4.jpg', 'IPS LCD', '5 MP', '12 MP + 5 MP', 'Màn hình tai thỏ hiện đại\r\n', 'Hiệu năng mạnh mẽ\r\n', 'Camera selfie làm đẹp 4.0\r\n', 'Chiếc điện thoại được trang bị màn hình “tai thỏ” tương tự như iPhone X hiện đại và thời thượng. Bên cạnh đó, màn hình Mi A2 Lite có kích thước lớn 5.84 inch, tỉ lệ rộng 19:9 với độ phân giải Full HD+ (1080 x 2280 pixels) cho bạn trải nghiệm xem cực tốt, bạn cũng dễ dàng cầm nắm và sử dụng mà không gặp quá nhiều khó khăn.', 'Xiaomi Mi A2 Lite đi kèm với bộ vi xử lý Snapdragon 625 tám nhân xung nhịp 2.0 GHz, song song đó là card đồ họa Adreno 506 mạnh mẽ cùng bộ nhớ RAM 3GB, cho tốc độ xử lý nhanh và tốt các game 3D, lướt web, giải trí, xem phim. Bên cạnh đó, với bộ nhớ trong lên đến 32GB, chiếc điện thoại giúp người dùng lưu trữ dữ liệu cũng như hình ảnh, video một cách thoải mái. Mi A2 Lite chạy hệ điều hành Android One gần với giao diện gốc của Google cho khả năng xử lý mượt mà, luôn được cập nhật sớm nhất. \r\n\r\n', 'Ở mặt trước, Mi A2 Lite được trang bị camera làm đẹp 4.0 với độ phân giải 5MP, ống kính góc rộng 67,9 độ, chụp ảnh HDR giúp khuôn mặt bạn được làm đẹp một cách tự nhiên qua các quá trình xóa thâm quầng dưới mắt, xóa mụn hay nhược điểm, nổi bật ưu điểm và sáng da và đặc biệt là vẫn có thể chụp ảnh xóa phông hiệu ứng bokeh nhờ sự giả lập từ trí tuệ nhân tạo AI. \r\n\r\n', 'img/sanpham/xiaomi/mia2lite/mota/1.jpg', 'img/sanpham/xiaomi/mia2lite/mota/2.jpg', 'img/sanpham/xiaomi/mia2lite/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Màn hình tai thỏ hiện đại\r\n</h1><p>Chiếc điện thoại được trang bị màn hình “tai thỏ” tương tự như iPhone X hiện đại và thời thượng. Bên cạnh đó, màn hình Mi A2 Lite có kích thước lớn 5.84 inch, tỉ lệ rộng 19:9 với độ phân giải Full HD+ (1080 x 2280 pixels) cho bạn trải nghiệm xem cực tốt, bạn cũng dễ dàng cầm nắm và sử dụng mà không gặp quá nhiều khó khăn.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/xiaomi/mia2lite/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Hiệu năng mạnh mẽ\r\n</h1><p>Xiaomi Mi A2 Lite đi kèm với bộ vi xử lý Snapdragon 625 tám nhân xung nhịp 2.0 GHz, song song đó là card đồ họa Adreno 506 mạnh mẽ cùng bộ nhớ RAM 3GB, cho tốc độ xử lý nhanh và tốt các game 3D, lướt web, giải trí, xem phim. Bên cạnh đó, với bộ nhớ trong lên đến 32GB, chiếc điện thoại giúp người dùng lưu trữ dữ liệu cũng như hình ảnh, video một cách thoải mái. Mi A2 Lite chạy hệ điều hành Android One gần với giao diện gốc của Google cho khả năng xử lý mượt mà, luôn được cập nhật sớm nhất. \r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/xiaomi/mia2lite/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Camera selfie làm đẹp 4.0\r\n</h1><p>Ở mặt trước, Mi A2 Lite được trang bị camera làm đẹp 4.0 với độ phân giải 5MP, ống kính góc rộng 67,9 độ, chụp ảnh HDR giúp khuôn mặt bạn được làm đẹp một cách tự nhiên qua các quá trình xóa thâm quầng dưới mắt, xóa mụn hay nhược điểm, nổi bật ưu điểm và sáng da và đặc biệt là vẫn có thể chụp ảnh xóa phông hiệu ứng bokeh nhờ sự giả lập từ trí tuệ nhân tạo AI. \r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/xiaomi/mia2lite/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (104, 'img/sanpham/realme/c2/d1.jpg', 'REALME C2 (Đen)', 4, 2990000, 30, 2, 2, 3, 12, 'img/sanpham/realme/c2/d1.jpg', 'img/sanpham/realme/c2/d2.jpg', 'img/sanpham/realme/c2/d3.jpg', 'img/sanpham/realme/c2/d4.jpg', 'IPS LCD, 6.1\", HD+', '5 MP', 'Chính 13 MP & Phụ 2 MP', 'Thiết kế đơn giản và tinh tế\r\n', 'Camera kép AI thế hệ mới\r\n', 'Pin dung lượng cao 4000 mAh\r\n', 'Điện Thoại Realme C2 (2GB/16GB) sở hữu màn hình tràn viền dạng “giọt nước” thời thượng, màn hình lớn 6,1 inch tỉ lệ 19.5:9 chuẩn điện ảnh. Việc viền màn hình được thu lại cực mỏng giúp màn hình chiếm tới 89,35% diện tích hiển thị mặt trước, mang lại không gian màn hình rộng lớn nhưng vẫn đảm bảo máy nhỏ gọn. Những đoạn video được xem trên Realme C2 sẽ thú vị hơn bao giờ hết với màn hình lớn, sống động dạng tràn viền cực đã.\r\n\r\n', 'Với cụm camera kép mặt sau, Realme C2 hỗ trợ trí tuệ nhân tạo AI, camera chính 13MP và camera phụ 2MP đo độ sâu trường ảnh, giúp bạn dễ dàng chụp được những bức ảnh chân dung xóa phông, làm mờ hậu cảnh đầy kỳ ảo. Khả năng quay video cũng không kém phần ấn tượng khi Realme C2 có thể quay video độ phân giải Full HD và những đoạn video chuyển động chậm slow-motion rất nghệ thuật.\r\n\r\n', 'Với viên pin dung lượng cao 4000 mAh và bộ vi xử lý sản xuất trên tiến trình 12nm tiết kiệm năng lượng, Realme C2 cho phép bạn sử dụng thoải mái trong suốt cả ngày dài mà không lo hết pin. Tha hồ làm những điều mình thích, từ nghe nhạc, xem Youtube, nhắn tin cho bạn bè cho đến chơi game, chụp ảnh. Điện thoại vẫn luôn đồng hành bên bạn.\r\n\r\n', 'img/sanpham/realme/c2/mota/1.jpg', 'img/sanpham/realme/c2/mota/2.jpg', 'img/sanpham/realme/c2/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Thiết kế đơn giản và tinh tế\r\n</h1><p>Điện Thoại Realme C2 (2GB/16GB) sở hữu màn hình tràn viền dạng “giọt nước” thời thượng, màn hình lớn 6,1 inch tỉ lệ 19.5:9 chuẩn điện ảnh. Việc viền màn hình được thu lại cực mỏng giúp màn hình chiếm tới 89,35% diện tích hiển thị mặt trước, mang lại không gian màn hình rộng lớn nhưng vẫn đảm bảo máy nhỏ gọn. Những đoạn video được xem trên Realme C2 sẽ thú vị hơn bao giờ hết với màn hình lớn, sống động dạng tràn viền cực đã.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/realme/c2/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Camera kép AI thế hệ mới\r\n</h1><p>Với cụm camera kép mặt sau, Realme C2 hỗ trợ trí tuệ nhân tạo AI, camera chính 13MP và camera phụ 2MP đo độ sâu trường ảnh, giúp bạn dễ dàng chụp được những bức ảnh chân dung xóa phông, làm mờ hậu cảnh đầy kỳ ảo. Khả năng quay video cũng không kém phần ấn tượng khi Realme C2 có thể quay video độ phân giải Full HD và những đoạn video chuyển động chậm slow-motion rất nghệ thuật.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/realme/c2/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Pin dung lượng cao 4000 mAh\r\n</h1><p>Với viên pin dung lượng cao 4000 mAh và bộ vi xử lý sản xuất trên tiến trình 12nm tiết kiệm năng lượng, Realme C2 cho phép bạn sử dụng thoải mái trong suốt cả ngày dài mà không lo hết pin. Tha hồ làm những điều mình thích, từ nghe nhạc, xem Youtube, nhắn tin cho bạn bè cho đến chơi game, chụp ảnh. Điện thoại vẫn luôn đồng hành bên bạn.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/realme/c2/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (105, 'img/sanpham/realme/3/x1.jpg', 'REALME 3 (Xanh)', 4, 6990000, 30, 3, 3, 4, 12, 'img/sanpham/realme/3/x1.jpg', 'img/sanpham/realme/3/2.jpg', 'img/sanpham/realme/3/x3.jpg', 'img/sanpham/realme/3/x4.jpg', '	IPS LCD, 6.22\", HD+', '13 MP', 'Chính 13 MP & Phụ 2 MP', 'Màn hình lớn tương đương Galaxy S10+\r\n', 'Màn hình giọt nước tràn viền\r\n', 'Hiệu năng vượt trội\r\n', 'Điện Thoại Realme 3 có thiết kế nguyên khối kim loại chắc chắn, bốn góc bo tròn nhẹ nhàng. Cùng với đó là mặt lưng với hiệu ứng đổi màu gradient sắc sảo và tinh tế. Viền màn hình mỏng khiến chiếc điện thoại càng gọn gàng, cầm chắc tay, cho bạn dễ dàng mang theo bất cứ nơi đâu.\r\n\r\nĐiện Thoại Realme 3 có thiết kế nguyên khối kim loại chắc chắn, bốn góc bo tròn nhẹ nhàng. Cùng với đó là mặt lưng với hiệu ứng đổi màu gradient sắc sảo và tinh tế. Viền màn hình mỏng khiến chiếc điện thoại càng gọn gàng, cầm chắc tay, cho bạn dễ dàng mang theo bất cứ nơi đâu.\r\n\r\n', 'Realme 3 sở hữu màn hình kích thước lớn tới 6.22 inch được thiết kế kiểu màn hình giọt nước viền siêu mỏng tiên tiến, mang đến trải nghiệm xem tuyệt vời. Mọi thứ đều được hiển thị lớn hơn, đẹp hơn, dễ dàng cho bạn các thông tin trực quan và giải trí hấp dẫn. Nhờ viền mỏng nên dù màn hình lớn thì Realme 3 vẫn đủ gọn gàng trong bàn tay bạn.\r\n\r\n', 'Về thông số cấu hình, Realme 3 dùng vi xử lý MediaTek Helio P60 8 nhân 64-bit, card đồ họa Adreno 506 mạnh mẽ cùng bộ nhớ RAM 3GB, cho tốc độ xử lý ổn định khi bạn lướt web, giải trí, xem phim. Bên cạnh đó, với bộ nhớ trong 32GB cùng khe cắm thẻ nhớ ngoài tối đa lên đến 256GB, chiếc điện thoại giúp người dùng lưu trữ dữ liệu cũng như hình ảnh, video một cách thoải mái. \r\n\r\n', 'img/sanpham/realme/3/mota/1.jpg', 'img/sanpham/realme/3/mota/2.jpg', 'img/sanpham/realme/3/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Màn hình lớn tương đương Galaxy S10+\r\n</h1><p>Điện Thoại Realme 3 có thiết kế nguyên khối kim loại chắc chắn, bốn góc bo tròn nhẹ nhàng. Cùng với đó là mặt lưng với hiệu ứng đổi màu gradient sắc sảo và tinh tế. Viền màn hình mỏng khiến chiếc điện thoại càng gọn gàng, cầm chắc tay, cho bạn dễ dàng mang theo bất cứ nơi đâu.\r\n\r\nĐiện Thoại Realme 3 có thiết kế nguyên khối kim loại chắc chắn, bốn góc bo tròn nhẹ nhàng. Cùng với đó là mặt lưng với hiệu ứng đổi màu gradient sắc sảo và tinh tế. Viền màn hình mỏng khiến chiếc điện thoại càng gọn gàng, cầm chắc tay, cho bạn dễ dàng mang theo bất cứ nơi đâu.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/realme/3/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Màn hình giọt nước tràn viền\r\n</h1><p>Realme 3 sở hữu màn hình kích thước lớn tới 6.22 inch được thiết kế kiểu màn hình giọt nước viền siêu mỏng tiên tiến, mang đến trải nghiệm xem tuyệt vời. Mọi thứ đều được hiển thị lớn hơn, đẹp hơn, dễ dàng cho bạn các thông tin trực quan và giải trí hấp dẫn. Nhờ viền mỏng nên dù màn hình lớn thì Realme 3 vẫn đủ gọn gàng trong bàn tay bạn.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/realme/3/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Hiệu năng vượt trội\r\n</h1><p>Về thông số cấu hình, Realme 3 dùng vi xử lý MediaTek Helio P60 8 nhân 64-bit, card đồ họa Adreno 506 mạnh mẽ cùng bộ nhớ RAM 3GB, cho tốc độ xử lý ổn định khi bạn lướt web, giải trí, xem phim. Bên cạnh đó, với bộ nhớ trong 32GB cùng khe cắm thẻ nhớ ngoài tối đa lên đến 256GB, chiếc điện thoại giúp người dùng lưu trữ dữ liệu cũng như hình ảnh, video một cách thoải mái. \r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/realme/3/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (106, 'img/sanpham/oppo/a1k/1.jpg', 'OPPO A1K', 5, 2990000, 30, 2, 2, 2, 12, 'img/sanpham/oppo/a1k/1.jpg', 'img/sanpham/oppo/a1k/2.jpg', 'img/sanpham/oppo/a1k/3.jpg', 'img/sanpham/oppo/a1k/4.jpg', 'IPS LCD, 6.1\", HD+', '5 MP', '8 MP', 'Thiết kế bắt mắt, hiếm có đối thủ trong phân khúc\r\n', 'Camera selfie hài lòng mọi người dùng\r\n', 'Nhiều tính năng hỗ trợ đắt giá\r\n', 'Màn hình giọt nước ở mặt trước sẽ gây ấn tượng cho người dùng ngay từ cái nhìn đầu tiên với kích thước 6.1 inch.\r\n\r\nDiện tích trải nghiệm toàn màn hình rộng hơn, xem phim hay chơi game đều cảm thấy thoải mái và không còn cảm giác mỏi mắt.', 'Camera chính cũng làm khá tốt nhiệm vụ của mình tới độ phân giải 8 MP hỗ trợ công nghệ chống rung đa khung giúp ảnh chụp sắc nét hơn.\r\n\r\n', 'OPPO A1K cũng được tích hợp khả năng nhận diện khuôn mặt mở máy hiện đại và cao cấp giúp bạn có thể sử dụng một cách dễ dàng.\r\n\r\nĐiểm Antutu của OPPO A1k ở mức khoảng 75000 điểm, không quá cao nhưng hỗ trợ tốt các ứng dụng lướt web, cơ bản hằng ngày.', 'img/sanpham/oppo/a1k/mota/1.jpg', 'img/sanpham/oppo/a1k/mota/2.jpg', 'img/sanpham/oppo/a1k/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Thiết kế bắt mắt, hiếm có đối thủ trong phân khúc\r\n</h1><p>Màn hình giọt nước ở mặt trước sẽ gây ấn tượng cho người dùng ngay từ cái nhìn đầu tiên với kích thước 6.1 inch.\r\n\r\nDiện tích trải nghiệm toàn màn hình rộng hơn, xem phim hay chơi game đều cảm thấy thoải mái và không còn cảm giác mỏi mắt.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/oppo/a1k/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Camera selfie hài lòng mọi người dùng\r\n</h1><p>Camera chính cũng làm khá tốt nhiệm vụ của mình tới độ phân giải 8 MP hỗ trợ công nghệ chống rung đa khung giúp ảnh chụp sắc nét hơn.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/oppo/a1k/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Nhiều tính năng hỗ trợ đắt giá\r\n</h1><p>OPPO A1K cũng được tích hợp khả năng nhận diện khuôn mặt mở máy hiện đại và cao cấp giúp bạn có thể sử dụng một cách dễ dàng.\r\n\r\nĐiểm Antutu của OPPO A1k ở mức khoảng 75000 điểm, không quá cao nhưng hỗ trợ tốt các ứng dụng lướt web, cơ bản hằng ngày.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/oppo/a1k/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (107, 'img/sanpham/oppo/a1k/d1.jpg', 'OPPO A1K (Đen)', 5, 2990000, 30, 2, 2, 2, 12, 'img/sanpham/oppo/a1k/d1.jpg', 'img/sanpham/oppo/a1k/d2.jpg', 'img/sanpham/oppo/a1k/d3.jpg', 'img/sanpham/oppo/a1k/d4.jpg', 'IPS LCD, 6.1\", HD+', '5 MP', '8 MP', 'Thiết kế bắt mắt, hiếm có đối thủ trong phân khúc\r\n', 'Camera selfie hài lòng mọi người dùng\r\n', 'Nhiều tính năng hỗ trợ đắt giá\r\n', 'Màn hình giọt nước ở mặt trước sẽ gây ấn tượng cho người dùng ngay từ cái nhìn đầu tiên với kích thước 6.1 inch.\r\n\r\nDiện tích trải nghiệm toàn màn hình rộng hơn, xem phim hay chơi game đều cảm thấy thoải mái và không còn cảm giác mỏi mắt.', 'Camera chính cũng làm khá tốt nhiệm vụ của mình tới độ phân giải 8 MP hỗ trợ công nghệ chống rung đa khung giúp ảnh chụp sắc nét hơn.\r\n\r\n', 'OPPO A1K cũng được tích hợp khả năng nhận diện khuôn mặt mở máy hiện đại và cao cấp giúp bạn có thể sử dụng một cách dễ dàng.\r\n\r\nĐiểm Antutu của OPPO A1k ở mức khoảng 75000 điểm, không quá cao nhưng hỗ trợ tốt các ứng dụng lướt web, cơ bản hằng ngày.', 'img/sanpham/oppo/a1k/mota/1.jpg', 'img/sanpham/oppo/a1k/mota/2.jpg', 'img/sanpham/oppo/a1k/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Thiết kế bắt mắt, hiếm có đối thủ trong phân khúc\r\n</h1><p>Màn hình giọt nước ở mặt trước sẽ gây ấn tượng cho người dùng ngay từ cái nhìn đầu tiên với kích thước 6.1 inch.\r\n\r\nDiện tích trải nghiệm toàn màn hình rộng hơn, xem phim hay chơi game đều cảm thấy thoải mái và không còn cảm giác mỏi mắt.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/oppo/a1k/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Camera selfie hài lòng mọi người dùng\r\n</h1><p>Camera chính cũng làm khá tốt nhiệm vụ của mình tới độ phân giải 8 MP hỗ trợ công nghệ chống rung đa khung giúp ảnh chụp sắc nét hơn.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/oppo/a1k/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Nhiều tính năng hỗ trợ đắt giá\r\n</h1><p>OPPO A1K cũng được tích hợp khả năng nhận diện khuôn mặt mở máy hiện đại và cao cấp giúp bạn có thể sử dụng một cách dễ dàng.\r\n\r\nĐiểm Antutu của OPPO A1k ở mức khoảng 75000 điểm, không quá cao nhưng hỗ trợ tốt các ứng dụng lướt web, cơ bản hằng ngày.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/oppo/a1k/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (108, 'img/sanpham/vivo/s1/1.jpg', 'Vivo S1', 7, 6990000, 30, 4, 4, 2, 12, 'img/sanpham/vivo/s1/1.jpg', 'img/sanpham/vivo/s1/2.jpg', 'img/sanpham/vivo/s1/3.jpg', 'img/sanpham/vivo/s1/4.jpg', 'PS LCD, 6.1\", HD+', '32MP', '16MP+8MP(góc rộng)+2MP', 'Màn Hình Tràn Halo -Tầm Nhìn Vượt Giới Hạn\r\n', 'Camera Trước 32MP - Chụp Chân Dung Sắc Nét Hơn\r\n', 'Cảm Biến Vân Tay Dưới Màn Hình \r\nMở Ra Tương Lai', 'Vivo S1 sở hữu Màn Hình Tràn Halo với tỷ lệ màn hình trên thân máy cao. Sự đối xứng hoàn hảo mang đến trải nghiệm hiệu ứng thị giác tuyệt vời. Màn hình Super AMOLED 6.38 inch với tỷ lệ 19.5:9 và tỷ lệ màn hình trên thân máy 90% cho phép bạn tận hưởng không gian giải trí vượt mọi giới hạn.\r\n\r\n', 'Vivo S1 sở hữu camera trước 32MP dẫn đầu ngành. Độ phân giải Ultra HD cho phép bạn chụp selfie với chi tiết và chất lượng hình ảnh sắc nét hơn. Nhiều chế độ selfie đa dạng như AI Face Beauty, Trợ Sáng Camera Selfie, AR Stickers, Bộ lọc AI… mang đến trải nghiệm chụp ảnh “tự sướng” đầy niềm vui và hứng khởi.\r\n\r\n', 'Từ khi cho ra mắt công nghệ Cảm Biến Vân Tay Dưới Màn Hình, vivo đã và đang dẫn đầu ngành trong việc mang đến cho người dùng trải nghiệm mở khóa ngày càng tuyệt vời hơn. Chỉ cần một cú chạm nhẹ trên màn hình vivo S1, điện thoại đã có thể mở khóa một cách nhanh chóng. Bên cạnh đó, việc mở khóa sẽ trở nên dễ dàng và thú vị hơn nhờ các hiệu ứng hoạt hình đa dạng được tích hợp sẵn trên điện thoại.\r\n\r\n', 'img/sanpham/vivo/s1/mota/1.png', 'img/sanpham/vivo/s1/mota/2.jpg', 'img/sanpham/vivo/s1/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Màn Hình Tràn Halo -Tầm Nhìn Vượt Giới Hạn\r\n</h1><p>Vivo S1 sở hữu Màn Hình Tràn Halo với tỷ lệ màn hình trên thân máy cao. Sự đối xứng hoàn hảo mang đến trải nghiệm hiệu ứng thị giác tuyệt vời. Màn hình Super AMOLED 6.38 inch với tỷ lệ 19.5:9 và tỷ lệ màn hình trên thân máy 90% cho phép bạn tận hưởng không gian giải trí vượt mọi giới hạn.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/vivo/s1/mota/1.png\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Camera Trước 32MP - Chụp Chân Dung Sắc Nét Hơn\r\n</h1><p>Vivo S1 sở hữu camera trước 32MP dẫn đầu ngành. Độ phân giải Ultra HD cho phép bạn chụp selfie với chi tiết và chất lượng hình ảnh sắc nét hơn. Nhiều chế độ selfie đa dạng như AI Face Beauty, Trợ Sáng Camera Selfie, AR Stickers, Bộ lọc AI… mang đến trải nghiệm chụp ảnh “tự sướng” đầy niềm vui và hứng khởi.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/vivo/s1/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Cảm Biến Vân Tay Dưới Màn Hình \r\nMở Ra Tương Lai</h1><p>Từ khi cho ra mắt công nghệ Cảm Biến Vân Tay Dưới Màn Hình, vivo đã và đang dẫn đầu ngành trong việc mang đến cho người dùng trải nghiệm mở khóa ngày càng tuyệt vời hơn. Chỉ cần một cú chạm nhẹ trên màn hình vivo S1, điện thoại đã có thể mở khóa một cách nhanh chóng. Bên cạnh đó, việc mở khóa sẽ trở nên dễ dàng và thú vị hơn nhờ các hiệu ứng hoạt hình đa dạng được tích hợp sẵn trên điện thoại.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/vivo/s1/mota/3.jpg\"/></div></br>');
