" src=\"https://st5group08.000webhostapp.com/img/sanpham/vivo/s1/mota/1.png\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Camera Trước 32MP - Chụp Chân Dung Sắc Nét Hơn\r\n</h1><p>Vivo S1 sở hữu camera trước 32MP dẫn đầu ngành. Độ phân giải Ultra HD cho phép bạn chụp selfie với chi tiết và chất lượng hình ảnh sắc nét hơn. Nhiều chế độ selfie đa dạng như AI Face Beauty, Trợ Sáng Camera Selfie, AR Stickers, Bộ lọc AI… mang đến trải nghiệm chụp ảnh “tự sướng” đầy niềm vui và hứng khởi.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/vivo/s1/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Cảm Biến Vân Tay Dưới Màn Hình \r\nMở Ra Tương Lai</h1><p>Từ khi cho ra mắt công nghệ Cảm Biến Vân Tay Dưới Màn Hình, vivo đã và đang dẫn đầu ngành trong việc mang đến cho người dùng trải nghiệm mở khóa ngày càng tuyệt vời hơn. Chỉ cần một cú chạm nhẹ trên màn hình vivo S1, điện thoại đã có thể mở khóa một cách nhanh chóng. Bên cạnh đó, việc mở khóa sẽ trở nên dễ dàng và thú vị hơn nhờ các hiệu ứng hoạt hình đa dạng được tích hợp sẵn trên điện thoại.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/vivo/s1/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (110, 'img/sanpham/oppo/a5/d1.jpg', 'OPPO A5 2020 (Đen)', 5, 5490000, 30, 3, 4, 3, 12, 'img/sanpham/oppo/a5/d1.jpg', 'img/sanpham/oppo/a5/d2.jpg', 'img/sanpham/oppo/a5/d3.jpg', 'img/sanpham/oppo/a5/d4.jpg', 'TFT, 6.5\", HD+', '8 MP', 'Chính 12 MP & Phụ 8 MP, 2 MP, 2 MP', 'Thiết kế hiện đại, bắt mắt\r\n', 'Hiệu năng mạnh mẽ\r\n', 'Pin trâu không lo bị hết\r\n', 'Điện Thoại Oppo A5 ( 4GB/128GB) sở hữu cho mình một ngoại hình rất thu hút sẽ khiến người dùng có nhiều cảm tình hơn và dẫn tới quyết định mua một chiếc smartphone.\r\n\r\n', 'OPPO A5 cũng được trang bị bộ vi xử lý Snapdragon 665 nhưng đi kèm với RAM 3GB + ROM 64GB hoặc RAM 4GB + ROM 128GB. Ngoài ra, nó cũng có 1 khay cắm 2 SIM + thẻ microSD.\r\n\r\n', 'Chiếc smartphone OPPO này được cung cấp năng lượng bởi viên pin dung lượng lên đến 5.000 mAh, kết hợp với hệ điều hành ColorOS 6.1 và phần cứng mới giúp sản phẩm tối ưu hơn trong việc sử dụng.\r\n\r\n', 'img/sanpham/oppo/a5/mota/1.jpg', 'img/sanpham/oppo/a5/mota/2.jpg', 'img/sanpham/oppo/a5/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Thiết kế hiện đại, bắt mắt\r\n</h1><p>Điện Thoại Oppo A5 ( 4GB/128GB) sở hữu cho mình một ngoại hình rất thu hút sẽ khiến người dùng có nhiều cảm tình hơn và dẫn tới quyết định mua một chiếc smartphone.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/oppo/a5/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Hiệu năng mạnh mẽ\r\n</h1><p>OPPO A5 cũng được trang bị bộ vi xử lý Snapdragon 665 nhưng đi kèm với RAM 3GB + ROM 64GB hoặc RAM 4GB + ROM 128GB. Ngoài ra, nó cũng có 1 khay cắm 2 SIM + thẻ microSD.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/oppo/a5/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Pin trâu không lo bị hết\r\n</h1><p>Chiếc smartphone OPPO này được cung cấp năng lượng bởi viên pin dung lượng lên đến 5.000 mAh, kết hợp với hệ điều hành ColorOS 6.1 và phần cứng mới giúp sản phẩm tối ưu hơn trong việc sử dụng.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/oppo/a5/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (111, 'img/sanpham/samsung/a20s/d1.jpg', 'SAMSUNG A20s (Đỏ)', 1, 4390000, 30, 2, 2, 2, 12, 'img/sanpham/samsung/a20s/d1.jpg', 'img/sanpham/samsung/a20s/d2.jpg', 'img/sanpham/samsung/a20s/d3.jpg', 'img/sanpham/samsung/a20s/d4.jpg', 'Super AMOLED', '16 MP', '25.0 MP + 5.0 MP + 8.0 MP', 'Màn hình lớn cho những trải nghiệm lớn\r\n', 'Mặt lưng bóng bẩy, màu sắc phong cách\r\n', '3 camera sau cao cấp\r\n', 'Điện Thoại Samsung Galaxy A20s sở hữu màn hình lớn mang đến cho bạn không gian trải nghiệm lớn hơn. Trước mắt chúng ta sẽ là màn hình 6,5 inch vô cực dạng Infinity-V tuyệt hảo, hiển thị sống động, hình ảnh sắc nét, hiệu ứng tràn viền hấp dẫn. Mỗi ngày trôi qua bạn đều được trải nghiệm những điều tuyệt vời mà màn hình Infinity-V mang lại.\r\n\r\n', 'Samsung Galaxy A20s có thiết kế trẻ trung với mặt lưng bóng bẩy thời trang. Mặt lưng A20s được hoàn thiện mượt mà, hiệu ứng đổi màu và phản chiếu ánh sáng nhẹ nhàng, bo cong mềm mại để cầm nắm dễ dàng hơn. Bạn sẽ có 3 sự lựa chọn màu sắc đầy phong cách là đen, đỏ và xanh để lựa chọn.\r\n\r\n', 'Galaxy A20s có khả năng chụp ảnh chuyên nghiệp khi sở hữu 3 camera sau cao cấp với 3 vai trò khác nhau. Bạn sẽ có camera chính 13MP, camera đo độ sâu 5MP và camera góc siêu rộng 8MP. Camera đo độ sâu hỗ trợ chụp ảnh xóa phông, làm mờ hậu cảnh và nổi bật chủ thể. Trong khi đó camera góc siêu rộng mang đến góc chụp rộng tới 120 độ, lưu lại những khung cảnh hùng vĩ rộng lớn.\r\n\r\n', 'img/sanpham/samsung/a20s/mota/1.jpg', 'img/sanpham/samsung/a20s/mota/2.jpg', 'img/sanpham/samsung/a20s/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Màn hình lớn cho những trải nghiệm lớn\r\n</h1><p>Điện Thoại Samsung Galaxy A20s sở hữu màn hình lớn mang đến cho bạn không gian trải nghiệm lớn hơn. Trước mắt chúng ta sẽ là màn hình 6,5 inch vô cực dạng Infinity-V tuyệt hảo, hiển thị sống động, hình ảnh sắc nét, hiệu ứng tràn viền hấp dẫn. Mỗi ngày trôi qua bạn đều được trải nghiệm những điều tuyệt vời mà màn hình Infinity-V mang lại.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/a20s/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Mặt lưng bóng bẩy, màu sắc phong cách\r\n</h1><p>Samsung Galaxy A20s có thiết kế trẻ trung với mặt lưng bóng bẩy thời trang. Mặt lưng A20s được hoàn thiện mượt mà, hiệu ứng đổi màu và phản chiếu ánh sáng nhẹ nhàng, bo cong mềm mại để cầm nắm dễ dàng hơn. Bạn sẽ có 3 sự lựa chọn màu sắc đầy phong cách là đen, đỏ và xanh để lựa chọn.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/a20s/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">3 camera sau cao cấp\r\n</h1><p>Galaxy A20s có khả năng chụp ảnh chuyên nghiệp khi sở hữu 3 camera sau cao cấp với 3 vai trò khác nhau. Bạn sẽ có camera chính 13MP, camera đo độ sâu 5MP và camera góc siêu rộng 8MP. Camera đo độ sâu hỗ trợ chụp ảnh xóa phông, làm mờ hậu cảnh và nổi bật chủ thể. Trong khi đó camera góc siêu rộng mang đến góc chụp rộng tới 120 độ, lưu lại những khung cảnh hùng vĩ rộng lớn.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/samsung/a20s/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (112, 'img/sanpham/vivo/y93/2.jpg', 'Vivo Y93', 7, 3790000, 30, 2, 2, 3, 12, 'img/sanpham/vivo/y93/1.jpg', 'img/sanpham/vivo/y93/2.jpg', 'img/sanpham/vivo/y93/3.jpg', 'img/sanpham/vivo/y93/4.jpg', 'IPS LCD', '8 MP', 'Chính 13MP và Phụ 2MP', 'Thiết kế bắt mắt, thời trang\r\n', 'Chip Snapdragon 439 mới mẻ\r\n', 'Bộ đôi camera hoàn hảo\r\n', 'Điện Thoại Vivo Y93 sở hữu thiết kế thời thượng với phần mặt lưng bắt mắt kết hợp công nghệ 3D micro-arc cho bạn trải nghiệm mới mẻ và nổi bật giữa đám đông. Phần khung và mặt lưng của máy có sự kết nối chặt chẽ với nhau giúp vuốt từ khung vào mặt lưng và ngược lại sẽ không thấy cấn.\r\n\r\n', 'Vivo Y93 là chiếc smartphone đầu tiên dùng chip Snapdragon 439 trên tiến trình 12 nm giúp máy tiết kiệm năng lượng hơn so với các thế hệ cũ. Máy cũng sở hữu bộ nhớ RAM lên tới 4 GB và 64 GB bộ nhớ trong cho bạn sử dụng mượt mà trong nhiều ngày mà không cần khởi động lại máy.\r\n\r\n', 'Vivo Y93 sở hữu bộ đôi camera kép ở mặt lưng với độ phân giải lần lượt là 13 MP + 2 MP cho khả năng chụp ảnh xóa phông khá ảo diệu. Trong điều kiện đủ sáng, Vivo Y95 lấy nét và lưu ảnh đều nhanh, bạn có thể dễ dàng chuyển sang chế độ chụp chân dung xóa phông chỉ với 1 nút nhấn. Ngoài ra máy còn có chế độ làm đẹp bằng trí tuệ nhân tạo, hay bộ lọc màu nhiều chế độ cùng với khả năng chụp thủ công để bạn có được những tấm ảnh ưng ý nhất.\r\n\r\n', 'img/sanpham/vivo/y93/mota/1.jpg', 'img/sanpham/vivo/y93/mota/2.jpg', 'img/sanpham/vivo/y93/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Thiết kế bắt mắt, thời trang\r\n</h1><p>Điện Thoại Vivo Y93 sở hữu thiết kế thời thượng với phần mặt lưng bắt mắt kết hợp công nghệ 3D micro-arc cho bạn trải nghiệm mới mẻ và nổi bật giữa đám đông. Phần khung và mặt lưng của máy có sự kết nối chặt chẽ với nhau giúp vuốt từ khung vào mặt lưng và ngược lại sẽ không thấy cấn.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/vivo/y93/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Chip Snapdragon 439 mới mẻ\r\n</h1><p>Vivo Y93 là chiếc smartphone đầu tiên dùng chip Snapdragon 439 trên tiến trình 12 nm giúp máy tiết kiệm năng lượng hơn so với các thế hệ cũ. Máy cũng sở hữu bộ nhớ RAM lên tới 4 GB và 64 GB bộ nhớ trong cho bạn sử dụng mượt mà trong nhiều ngày mà không cần khởi động lại máy.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/vivo/y93/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Bộ đôi camera hoàn hảo\r\n</h1><p>Vivo Y93 sở hữu bộ đôi camera kép ở mặt lưng với độ phân giải lần lượt là 13 MP + 2 MP cho khả năng chụp ảnh xóa phông khá ảo diệu. Trong điều kiện đủ sáng, Vivo Y95 lấy nét và lưu ảnh đều nhanh, bạn có thể dễ dàng chuyển sang chế độ chụp chân dung xóa phông chỉ với 1 nút nhấn. Ngoài ra máy còn có chế độ làm đẹp bằng trí tuệ nhân tạo, hay bộ lọc màu nhiều chế độ cùng với khả năng chụp thủ công để bạn có được những tấm ảnh ưng ý nhất.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/vivo/y93/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (113, 'img/sanpham/vivo/y12/d1.jpg', 'Vivo Y12 ', 7, 4290000, 30, 2, 3, 5, 12, 'img/sanpham/vivo/y12/d1.jpg', 'img/sanpham/vivo/y12/d2.jpg', 'img/sanpham/vivo/y12/d3.jpg', 'img/sanpham/vivo/y12/d4.jpg', 'IPS LCD, 6.2\", HD+ (720 x 1520 Pixels)', '8MP', '13MP+8MP+2MP', 'Màn Hình Tràn Halo 6.35-inch\r\n', 'Bộ 3 Camera Sau AI - Hơn Cả Những Bức Ảnh Chuyên Nghiệp\r\n', 'Pin Siêu Khủng 5000mAh: Năng Lượng Bền Bỉ\r\n', 'Y12 sở hữu Màn Hình Tràn Halo 6.35 inch với tỷ lệ 19.3:9. Cạnh viền siêu mỏng cho tỷ lệ màn hình trên thân máy lên đến 89%, mang đến trải nghiệm hình ảnh chất lượngchuẩn cao cấp. Điều khiển cử chỉ được thiết kế đặc biệt giúp việc sử dụng màn hình rộng bằng một tay hết sức dễ dàng.\r\n\r\n', 'Phá bỏ mọi rào cản về thị giác, mang đến những bức ảnh chuyên nghiệp. Khi bạn nhìn thế giới qua Bộ 3 Camera sau AI, việc tạo ra những kiệt tác nhiếp ảnh trở nên dễ dàng hơn bao giờ hết. Y12 có thiết kế Bộ 3 Camera với Camera Chính 13MP, Camera Góc Siêu Rộng 8MP và Camera Xóa Phông 2MP. Từ phong cảnh hùng vĩ đến chân dung lung linh, Bộ 3 Camera AI này đều sẽ giúp bạn chụp được những bức ảnh ấn tượng nhất một cách dễ dàng.\r\n\r\n', 'Y12 sở hữu dung lượng pin siêu khủng 5.000mAh dẫn đầu ngành, được hỗ trợ bởi các công nghệ tiết kiệm năng lượng thông minh để kéo dài thời gian sử dụng.\r\n\r\n', 'img/sanpham/vivo/y12/mota/1.png', 'img/sanpham/vivo/y12/mota/2.png', 'img/sanpham/vivo/y12/mota/3.png', 1, '<h1 class=\"font-weight-bold\">Màn Hình Tràn Halo 6.35-inch\r\n</h1><p>Y12 sở hữu Màn Hình Tràn Halo 6.35 inch với tỷ lệ 19.3:9. Cạnh viền siêu mỏng cho tỷ lệ màn hình trên thân máy lên đến 89%, mang đến trải nghiệm hình ảnh chất lượngchuẩn cao cấp. Điều khiển cử chỉ được thiết kế đặc biệt giúp việc sử dụng màn hình rộng bằng một tay hết sức dễ dàng.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/vivo/y12/mota/1.png\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Bộ 3 Camera Sau AI - Hơn Cả Những Bức Ảnh Chuyên Nghiệp\r\n</h1><p>Phá bỏ mọi rào cản về thị giác, mang đến những bức ảnh chuyên nghiệp. Khi bạn nhìn thế giới qua Bộ 3 Camera sau AI, việc tạo ra những kiệt tác nhiếp ảnh trở nên dễ dàng hơn bao giờ hết. Y12 có thiết kế Bộ 3 Camera với Camera Chính 13MP, Camera Góc Siêu Rộng 8MP và Camera Xóa Phông 2MP. Từ phong cảnh hùng vĩ đến chân dung lung linh, Bộ 3 Camera AI này đều sẽ giúp bạn chụp được những bức ảnh ấn tượng nhất một cách dễ dàng.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/vivo/y12/mota/2.png\"/></br><h1 class=\"font-weight-bold\">Pin Siêu Khủng 5000mAh: Năng Lượng Bền Bỉ\r\n</h1><p>Y12 sở hữu dung lượng pin siêu khủng 5.000mAh dẫn đầu ngành, được hỗ trợ bởi các công nghệ tiết kiệm năng lượng thông minh để kéo dài thời gian sử dụng.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/vivo/y12/mota/3.png\"/></div></br>');
INSERT INTO `product` VALUES (114, 'img/sanpham/vivo/y12/x1.jpg', 'Vivo Y12  (Xanh)', 7, 4290000, 30, 2, 3, 5, 12, 'img/sanpham/vivo/y12/x1.jpg', 'img/sanpham/vivo/y12/x2.jpg', 'img/sanpham/vivo/y12/x3.jpg', 'img/sanpham/vivo/y12/x4.jpg', 'IPS LCD, 6.2\", HD+ (720 x 1520 Pixels)', '8MP', '13MP+8MP+2MP', 'Màn Hình Tràn Halo 6.35-inch\r\n', 'Bộ 3 Camera Sau AI - Hơn Cả Những Bức Ảnh Chuyên Nghiệp\r\n', 'Pin Siêu Khủng 5000mAh: Năng Lượng Bền Bỉ\r\n', 'Y12 sở hữu Màn Hình Tràn Halo 6.35 inch với tỷ lệ 19.3:9. Cạnh viền siêu mỏng cho tỷ lệ màn hình trên thân máy lên đến 89%, mang đến trải nghiệm hình ảnh chất lượngchuẩn cao cấp. Điều khiển cử chỉ được thiết kế đặc biệt giúp việc sử dụng màn hình rộng bằng một tay hết sức dễ dàng.\r\n\r\n', 'Phá bỏ mọi rào cản về thị giác, mang đến những bức ảnh chuyên nghiệp. Khi bạn nhìn thế giới qua Bộ 3 Camera sau AI, việc tạo ra những kiệt tác nhiếp ảnh trở nên dễ dàng hơn bao giờ hết. Y12 có thiết kế Bộ 3 Camera với Camera Chính 13MP, Camera Góc Siêu Rộng 8MP và Camera Xóa Phông 2MP. Từ phong cảnh hùng vĩ đến chân dung lung linh, Bộ 3 Camera AI này đều sẽ giúp bạn chụp được những bức ảnh ấn tượng nhất một cách dễ dàng.\r\n\r\n', 'Y12 sở hữu dung lượng pin siêu khủng 5.000mAh dẫn đầu ngành, được hỗ trợ bởi các công nghệ tiết kiệm năng lượng thông minh để kéo dài thời gian sử dụng.\r\n\r\n', 'img/sanpham/vivo/y12/mota/1.png', 'img/sanpham/vivo/y12/mota/2.png', 'img/sanpham/vivo/y12/mota/3.png', 1, '<h1 class=\"font-weight-bold\">Màn Hình Tràn Halo 6.35-inch\r\n</h1><p>Y12 sở hữu Màn Hình Tràn Halo 6.35 inch với tỷ lệ 19.3:9. Cạnh viền siêu mỏng cho tỷ lệ màn hình trên thân máy lên đến 89%, mang đến trải nghiệm hình ảnh chất lượngchuẩn cao cấp. Điều khiển cử chỉ được thiết kế đặc biệt giúp việc sử dụng màn hình rộng bằng một tay hết sức dễ dàng.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/vivo/y12/mota/1.png\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Bộ 3 Camera Sau AI - Hơn Cả Những Bức Ảnh Chuyên Nghiệp\r\n</h1><p>Phá bỏ mọi rào cản về thị giác, mang đến những bức ảnh chuyên nghiệp. Khi bạn nhìn thế giới qua Bộ 3 Camera sau AI, việc tạo ra những kiệt tác nhiếp ảnh trở nên dễ dàng hơn bao giờ hết. Y12 có thiết kế Bộ 3 Camera với Camera Chính 13MP, Camera Góc Siêu Rộng 8MP và Camera Xóa Phông 2MP. Từ phong cảnh hùng vĩ đến chân dung lung linh, Bộ 3 Camera AI này đều sẽ giúp bạn chụp được những bức ảnh ấn tượng nhất một cách dễ dàng.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/vivo/y12/mota/2.png\"/></br><h1 class=\"font-weight-bold\">Pin Siêu Khủng 5000mAh: Năng Lượng Bền Bỉ\r\n</h1><p>Y12 sở hữu dung lượng pin siêu khủng 5.000mAh dẫn đầu ngành, được hỗ trợ bởi các công nghệ tiết kiệm năng lượng thông minh để kéo dài thời gian sử dụng.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/vivo/y12/mota/3.png\"/></div></br>');
INSERT INTO `product` VALUES (115, 'img/sanpham/oppo/findx/1.jpg', 'OPPO FindX', 5, 12990000, 30, 5, 5, 3, 12, 'img/sanpham/oppo/findx/1.jpg', 'img/sanpham/oppo/findx/2.jpg', 'img/sanpham/oppo/findx/3.jpg', 'img/sanpham/oppo/findx/4.jpg', 'IPS LCD 6.42 inch 2340 x 1080 (FHD+)', '25 MP', '20 MP + 16 MP', 'Màn hình cong tràn siêu cực ', 'Công nghệ điểm màu lấp lánh phân tầng 3D\r\n', 'Hệ thống camera kép sắc nét\r\n', 'OPPO Find X sở hữu thiết kế đột phá vô cùng ấn tượng với khung viền hẹp nhất, tỉ lệ màn hình lớn nhất, thân nguyên khối không khuyết điểm duy nhất kết hợp màu sắc chuyển tiếp với công nghệ tiên tiến nhất. Find X giữ vai trò tiên phong khi sử dụng màn hình cong tràn siêu cực không chỉ là màn hình tràn viền thông thường mà còn được vát cong tràn 3D hai cạnh bên, đồng thời đưa không gian trải nghiệm rộng hết mức có thể, bung tràn 4 cạnh, chiếm trọn mặt trước của điện thoại, mang lại hiệu quả trải nghiệm thị giác kinh ngạc.\r\n\r\n', 'Find X lấy màu đen làm tông chủ đạo khi kết hợp với 2 màu đỏ Bordeaux và Xanh Glacier giúp OPPO Find X trở nên lung linh huyền ảo nhưng không kém phần quyến rũ và tỏa sáng như những viên đá quý. Để tạo nên hiệu ứng chuyển màu, OPPO đã ứng dụng công nghệ xử lý màu 3D đa diện hiện đại, giúp Find X trở thành một phẩm nghệ thuật ấn tượng hay một món trang sức cao cấp mà ai cũng muốn sở hữu. Vì vậy, Find X tiếp tục chiếm giữ vị trí là điện thoại có màu sắc chuyển tiếp đẹp mắt với công nghệ tiên tiến nhất hiện nay.\r\n\r\n', 'Camera Find X trang bị hai ống kính và hệ thống chống rung quang học OIS để tạo hiệu ứng chiều sâu tuyệt vời hơn. Bên cạnh đó, công nghệ nhận dạng cảnh thông minh AI Scene giúp Find X xác được 800 loại khung cảnh, để trở thành một \"phụ tá kỹ thuật nhiếp ảnh\" thật sự. Cụm camera 3D không chỉ ẩn mình sau màn hình siêu cực, mà nó còn sở hữu rất nhiều công nghệ mới đến từ camera trước và cụm camera kép ở mặt sau. Camera 3D ẩn tự động với nhận dạng gương mặt 3D sẽ tạo ra chuẩn mực mới và tái định nghĩa nhiếp ảnh trên điện thoại.\r\n\r\n', 'img/sanpham/oppo/findx/mota/1.jpg', 'img/sanpham/oppo/findx/mota/2.jpg', 'img/sanpham/oppo/findx/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Màn hình cong tràn siêu cực </h1><p>OPPO Find X sở hữu thiết kế đột phá vô cùng ấn tượng với khung viền hẹp nhất, tỉ lệ màn hình lớn nhất, thân nguyên khối không khuyết điểm duy nhất kết hợp màu sắc chuyển tiếp với công nghệ tiên tiến nhất. Find X giữ vai trò tiên phong khi sử dụng màn hình cong tràn siêu cực không chỉ là màn hình tràn viền thông thường mà còn được vát cong tràn 3D hai cạnh bên, đồng thời đưa không gian trải nghiệm rộng hết mức có thể, bung tràn 4 cạnh, chiếm trọn mặt trước của điện thoại, mang lại hiệu quả trải nghiệm thị giác kinh ngạc.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/oppo/findx/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Công nghệ điểm màu lấp lánh phân tầng 3D\r\n</h1><p>Find X lấy màu đen làm tông chủ đạo khi kết hợp với 2 màu đỏ Bordeaux và Xanh Glacier giúp OPPO Find X trở nên lung linh huyền ảo nhưng không kém phần quyến rũ và tỏa sáng như những viên đá quý. Để tạo nên hiệu ứng chuyển màu, OPPO đã ứng dụng công nghệ xử lý màu 3D đa diện hiện đại, giúp Find X trở thành một phẩm nghệ thuật ấn tượng hay một món trang sức cao cấp mà ai cũng muốn sở hữu. Vì vậy, Find X tiếp tục chiếm giữ vị trí là điện thoại có màu sắc chuyển tiếp đẹp mắt với công nghệ tiên tiến nhất hiện nay.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/oppo/findx/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Hệ thống camera kép sắc nét\r\n</h1><p>Camera Find X trang bị hai ống kính và hệ thống chống rung quang học OIS để tạo hiệu ứng chiều sâu tuyệt vời hơn. Bên cạnh đó, công nghệ nhận dạng cảnh thông minh AI Scene giúp Find X xác được 800 loại khung cảnh, để trở thành một \"phụ tá kỹ thuật nhiếp ảnh\" thật sự. Cụm camera 3D không chỉ ẩn mình sau màn hình siêu cực, mà nó còn sở hữu rất nhiều công nghệ mới đến từ camera trước và cụm camera kép ở mặt sau. Camera 3D ẩn tự động với nhận dạng gương mặt 3D sẽ tạo ra chuẩn mực mới và tái định nghĩa nhiếp ảnh trên điện thoại.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/oppo/findx/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (116, 'img/sanpham/oppo/r17/1.jpg', 'OPPO R17 Pro', 5, 10990000, 30, 5, 4, 3, 12, 'img/sanpham/oppo/r17/1.jpg', 'img/sanpham/oppo/r17/2.jpg', 'img/sanpham/oppo/r17/3.jpg', 'img/sanpham/oppo/r17/4.jpg', '6.4 inch AMOLED, 2340 x 1080 (FHD+)', '25 MP (Hỗ trợ công nghệ A.I)', '12 MP (Bộ cảm biến 24 MP) + 20 MP (3 camera)', 'Thiết kế màu sắc đầy cảm hứng\r\n', 'Màn hình tràn viền 6.4 inch\r\n', 'Cấu hình mạnh mẽ\r\n', 'Điện Thoại Oppo R17 Pro được xem là chiếc smartphone của cái đẹp khi được khoác lên mình một thiết kế trẻ trung và hiện đại sẽ khiến bạn phải mê mẩn. Chiếc điện thoại với thân hình uyển chuyển, các đường góc bo cong mềm mại. Mặt lưng bằng kính kết hợp hài hòa giữa màu xanh và tím tạo nên hiệu ứng gradient đa sắc độ khi bạn ngắm nhìn ở các góc nghiêng khác nhau. Màn hình giọt nước gần như chiếm trọn mặt trước thu hút mọi ánh nhìn. Chế tác bằng các kỹ thuật khắc bề mặt tinh tế, Oppo R17 Pro không bị bám bẩn và dấu vân tay, kết nối liền lạc, để bạn cảm nhận được sự cao cấp đến từng chi tiết ở mỗi lần chạm.\r\n\r\n', 'Oppo R17 Pro sở hữu thiết kế đột phá vô cùng ấn tượng với màn hình mô phỏng giọt nước đang rơi, một khoảng khắc ngắn ngủi và tĩnh lặng. Kích thước màn hình lớn 6.4 inch chiếm tới 91.5% diện tích mặt trước và là một trong những smartphone có màn hình lớn nhất hiện nay. Bên cạnh đó, màn hình được bảo vệ bằng kính cường lực Corning Gorilla Glass 6 mới nhất cho Oppo R17 Pro vừa đẹp lại vừa vô cùng bền vững. Về khả năng hiển thị, R17 Pro hứa hẹn sẽ mang lại cho bạn một trải nghiệm tuyệt vời nhất với tấm nền AMOLED rực rỡ cùng độ phân giải Full HD+ siêu nét.\r\n\r\n', 'Chiếc điện thoại được trang bị một trong những bộ vi xử lý mạnh nhất thế giới Android hiện nay là Snapdragon 710 kết hợp 8 GB RAM cùng 128 GB bộ nhớ trong. Oppo R17 Pro có thể chơi mọi game 3D nặng ở mức đồ họa cao nhất. Tất cả những tựa game như PUBG Mobile, Liên quân Mobile đều được tối ưu và mang lại trải nghiệm xuất sắc. Từ tốc độ khởi chạy, tốc độ khung hình cho đến đồ họa trong game đều thể hiện hoản hảo. \r\n\r\n', 'img/sanpham/oppo/r17/mota/1.jpg', 'img/sanpham/oppo/r17/mota/2.jpg', 'img/sanpham/oppo/r17/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Thiết kế màu sắc đầy cảm hứng\r\n</h1><p>Điện Thoại Oppo R17 Pro được xem là chiếc smartphone của cái đẹp khi được khoác lên mình một thiết kế trẻ trung và hiện đại sẽ khiến bạn phải mê mẩn. Chiếc điện thoại với thân hình uyển chuyển, các đường góc bo cong mềm mại. Mặt lưng bằng kính kết hợp hài hòa giữa màu xanh và tím tạo nên hiệu ứng gradient đa sắc độ khi bạn ngắm nhìn ở các góc nghiêng khác nhau. Màn hình giọt nước gần như chiếm trọn mặt trước thu hút mọi ánh nhìn. Chế tác bằng các kỹ thuật khắc bề mặt tinh tế, Oppo R17 Pro không bị bám bẩn và dấu vân tay, kết nối liền lạc, để bạn cảm nhận được sự cao cấp đến từng chi tiết ở mỗi lần chạm.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/oppo/r17/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Màn hình tràn viền 6.4 inch\r\n</h1><p>Oppo R17 Pro sở hữu thiết kế đột phá vô cùng ấn tượng với màn hình mô phỏng giọt nước đang rơi, một khoảng khắc ngắn ngủi và tĩnh lặng. Kích thước màn hình lớn 6.4 inch chiếm tới 91.5% diện tích mặt trước và là một trong những smartphone có màn hình lớn nhất hiện nay. Bên cạnh đó, màn hình được bảo vệ bằng kính cường lực Corning Gorilla Glass 6 mới nhất cho Oppo R17 Pro vừa đẹp lại vừa vô cùng bền vững. Về khả năng hiển thị, R17 Pro hứa hẹn sẽ mang lại cho bạn một trải nghiệm tuyệt vời nhất với tấm nền AMOLED rực rỡ cùng độ phân giải Full HD+ siêu nét.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/oppo/r17/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Cấu hình mạnh mẽ\r\n</h1><p>Chiếc điện thoại được trang bị một trong những bộ vi xử lý mạnh nhất thế giới Android hiện nay là Snapdragon 710 kết hợp 8 GB RAM cùng 128 GB bộ nhớ trong. Oppo R17 Pro có thể chơi mọi game 3D nặng ở mức đồ họa cao nhất. Tất cả những tựa game như PUBG Mobile, Liên quân Mobile đều được tối ưu và mang lại trải nghiệm xuất sắc. Từ tốc độ khởi chạy, tốc độ khung hình cho đến đồ họa trong game đều thể hiện hoản hảo. \r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/oppo/r17/mota/3.jpg\"/></div></br>');
INSERT INTO `product` VALUES (117, 'img/sanpham/oppo/reno/1.jpg', 'OPPO Reno', 5, 9990000, 30, 4, 5, 3, 12, 'img/sanpham/oppo/reno/1.jpg', 'img/sanpham/oppo/reno/2.jpg', 'img/sanpham/oppo/reno/3.jpg', 'img/sanpham/oppo/reno/4.jpg', 'AMOLED, 6.4\", Full HD+', '16MP', 'Chính 48 MP và Phụ 5MP', 'Thiết kế hiện đại, thanh lịch\r\n', 'Màn hình AMOLED tràn viền, độ phân giải 2400x1080 pixel\r\n', '4 camera sau siêu zoom\r\n', 'Điện Thoại OPPO Reno 2F sở hữu thiết kế mỏng gọn cùng các đường bo góc tinh tế khiến chiếc điện thoại này vừa vặn trong lòng bàn tay, cho phép bạn cầm giữ một cách dễ dàng và thoải mái và chắc chắn hơn. Tổng thể sản phẩm nổi bật lên với vẻ đẹp thanh lịch sang trọng và không kém phần tinh tế.\r\n\r\n', 'OPPO Reno 2F sẽ có màn hình tràn viền hoàn hảo đúng nghĩa nhờ thiết kế camera selfie độc đáo, thực sự không có bất cứ một phần khuyết nào trên màn hình. Màn hình tràn viền tỷ lệ 19,5:9 cùng với một kích thước lên tới 6.5 inch, nhưng thực chất chỉ nằm gọn trong lòng bàn tay vì tỉ lệ màn hình chiếm tới 93% mặt trước.\r\n\r\n', 'Camera sau là tính năng đáng chú ý của chiếc máy này. OPPO Reno 2F được trang bị tới bốn camera sau với camera chính 48MP, khẩu độ f/1.7, đi kèm với cảm biến góc siêu rộng 8MP, ống kính tele 2MP và camera đơn sắc 2MP. Với độ phân giải này, bạn có thể thỏa sức ghi lại những khoảnh khắc của cuộc sống một cách sống động và chân thật, giúp bạn có những bức ảnh ưng ý nhất bao gồm chụp ảnh nhiều người, chụp ảnh xóa phông và chụp ảnh trắng đen.', 'img/sanpham/oppo/reno2f/mota/1.png', 'img/sanpham/oppo/reno2f/mota/2.png', 'img/sanpham/oppo/reno2f/mota/3.png', 1, '<h1 class=\"font-weight-bold\">Thiết kế hiện đại, thanh lịch\r\n</h1><p>Điện Thoại OPPO Reno 2F sở hữu thiết kế mỏng gọn cùng các đường bo góc tinh tế khiến chiếc điện thoại này vừa vặn trong lòng bàn tay, cho phép bạn cầm giữ một cách dễ dàng và thoải mái và chắc chắn hơn. Tổng thể sản phẩm nổi bật lên với vẻ đẹp thanh lịch sang trọng và không kém phần tinh tế.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/oppo/reno2f/mota/1.png\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Màn hình AMOLED tràn viền, độ phân giải 2400x1080 pixel\r\n</h1><p>OPPO Reno 2F sẽ có màn hình tràn viền hoàn hảo đúng nghĩa nhờ thiết kế camera selfie độc đáo, thực sự không có bất cứ một phần khuyết nào trên màn hình. Màn hình tràn viền tỷ lệ 19,5:9 cùng với một kích thước lên tới 6.5 inch, nhưng thực chất chỉ nằm gọn trong lòng bàn tay vì tỉ lệ màn hình chiếm tới 93% mặt trước.\r\n\r\n</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/oppo/reno2f/mota/2.png\"/></br><h1 class=\"font-weight-bold\">4 camera sau siêu zoom\r\n</h1><p>Camera sau là tính năng đáng chú ý của chiếc máy này. OPPO Reno 2F được trang bị tới bốn camera sau với camera chính 48MP, khẩu độ f/1.7, đi kèm với cảm biến góc siêu rộng 8MP, ống kính tele 2MP và camera đơn sắc 2MP. Với độ phân giải này, bạn có thể thỏa sức ghi lại những khoảnh khắc của cuộc sống một cách sống động và chân thật, giúp bạn có những bức ảnh ưng ý nhất bao gồm chụp ảnh nhiều người, chụp ảnh xóa phông và chụp ảnh trắng đen.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/oppo/reno2f/mota/3.png\"/></div></br>');
INSERT INTO `product` VALUES (118, 'img/sanpham/vivo/v17/d1.jpg', 'Vivo V17 Pro (Đen)', 7, 9990000, 30, 5, 4, 4, 12, 'img/sanpham/vivo/v17/d1.jpg', 'img/sanpham/vivo/v17/d2.jpg', 'img/sanpham/vivo/v17/d3.jpg', 'img/sanpham/vivo/v17/d4.jpg', '6.44 inches, Full HD +(1080 x 2400 Pixels)', '32MP + 8MP', '48 MP, 8 MP + 2MP + 2MP (4 camera)', 'Thiết kế hoàn mĩ', 'Màn hình tràn không viền 6.53 inch FHD+', 'Trang bị con chip MTK Helio P70, 8 nhân', 'Điện Thoại VIVO V17 Pro mang một thân hình vô cùng quyến rũ với không gian màn hình gần như chiếm trọn mặt trước của máy. Máy thiết kế mặt lưng với những họa tiết gợn sáng lung linh, thân hình thanh thoát, uyển chuyển bởi các đường cong mềm mại đan xen một chút mạnh mẽ, đem lại cảm giác cầm nắm trên tay vô cùng dễ chịu và thoải mái.', 'Màn hình tràn không viền mang đến tỉ lệ màn hình/thân máy đạt 90.95%, kích thước màn hình 6.53 inch, giúp mở rộng góc nhìn một cách đột phá. Kết hợp với độ phân giải FHD+ (1080 x 2340), kính cường lực Corning Gorilla Glass thế hệ thứ 5, giúp các trò chơi hay bộ phim trở nên hấp dẫn và thú vị hơn.', 'Được trang bị con chip MTK Helio P70, 8 nhân (2.1GHz) và bộ nhớ trong 128GB, RAM 6GB giúp người dùng có thể thoải máy đa nhiệm mà không sợ bị load lại ứng dụng trong quá trình sử dụng, giúp chơi game và vận hành nhiều ứng dụng cùng lúc mà vẫn mượt mà, không bị giật lag.', 'img/sanpham/vivo/v15/mota/1.jpg', 'img/sanpham/vivo/v15/mota/2.jpg', 'img/sanpham/vivo/v15/mota/3.jpg', 1, '<h1 class=\"font-weight-bold\">Thiết kế hoàn mĩ</h1><p>Điện Thoại VIVO V17 Pro mang một thân hình vô cùng quyến rũ với không gian màn hình gần như chiếm trọn mặt trước của máy. Máy thiết kế mặt lưng với những họa tiết gợn sáng lung linh, thân hình thanh thoát, uyển chuyển bởi các đường cong mềm mại đan xen một chút mạnh mẽ, đem lại cảm giác cầm nắm trên tay vô cùng dễ chịu và thoải mái.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/vivo/v15/mota/1.jpg\"/></br><div id=\"more\"><h1 class=\"font-weight-bold\">Màn hình tràn không viền 6.53 inch FHD+</h1><p>Màn hình tràn không viền mang đến tỉ lệ màn hình/thân máy đạt 90.95%, kích thước màn hình 6.53 inch, giúp mở rộng góc nhìn một cách đột phá. Kết hợp với độ phân giải FHD+ (1080 x 2340), kính cường lực Corning Gorilla Glass thế hệ thứ 5, giúp các trò chơi hay bộ phim trở nên hấp dẫn và thú vị hơn.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/vivo/v15/mota/2.jpg\"/></br><h1 class=\"font-weight-bold\">Trang bị con chip MTK Helio P70, 8 nhân</h1><p>Được trang bị con chip MTK Helio P70, 8 nhân (2.1GHz) và bộ nhớ trong 128GB, RAM 6GB giúp người dùng có thể thoải máy đa nhiệm mà không sợ bị load lại ứng dụng trong quá trình sử dụng, giúp chơi game và vận hành nhiều ứng dụng cùng lúc mà vẫn mượt mà, không bị giật lag.</p><img  class =\"mb-5\" src=\"https://st5group08.000webhostapp.com/img/sanpham/vivo/v15/mota/3.jpg\"/></div></br>');
