INSERT INTO `product_detail` VALUES (53, 'Sống phong cách - Dám bứt phá', 'Màn hình Super Amoled tích hợp cảm biến vân tay', 'Phối màu cực ngầu', 'Điện Thoại Vsmart Live với 3 camera đẳng cấp, cảm biến vân tay dưới màn hình cùng hiệu năng xuất sắc, Vsmart Live mang đến cho bạn cuộc sống phong cách và đầy bứt phá.', 'Nâng tầm nhiếp ảnh di động với bộ 3 camera hoàn hảo trên Vsmart Live. Camera chính có độ phân giải lên tới 48MP, khẩu độ cực lớn f/1.7, cho khả năng chụp siêu sắc nét và chụp đêm đẳng cấp. Hai camera còn lại có khả năng hỗ trợ chụp ảnh xóa phông và chụp góc siêu rộng 120 độ, mang tới những bức ảnh chuyên nghiệp, độc đáo của riêng bạn.', 'Tận hưởng những nội dung yêu thích qua màn hình 6,2 inch Super AMOLED cao cấp, độ phân giải Full HD+ sắc nét. Ngoài ra, Vsmart Live còn tích hợp cảm biến vân tay ngay dưới màn hình, một phương thức bảo mật tiện lợi của tương lai. Chỉ cần một cú chạm vào màn hình, điện thoại sẽ mở khóa ngay lập tức.', 'img/sanpham/vsmart/live64gb/mota/1.jpg', 'img/sanpham/vsmart/live64gb/mota/2.png', 'img/sanpham/vsmart/live64gb/mota/3.png', '1', '<h1>Sống phong cách - Dám bứt phá</h1><p>Điện Thoại Vsmart Live với 3 camera đẳng cấp, cảm biến vân tay dưới màn hình cùng hiệu năng xuất sắc, Vsmart Live mang đến cho bạn cuộc sống phong cách và đầy bứt phá.</p><img src=\"img/sanpham/vsmart/live64gb/mota/');
