INSERT INTO `product_detail` VALUES (98, 'Trang bị các tính năng cao cấp từ các dòng flagship\r\n', 'Cụm camera kép góc rộng\r\n', 'Mở khóa vân tay mặt sau\r\n', 'Có thể bạn sẽ bất ngờ bởi chiếc điện thoại Samsung Galaxy A30 (32GB/3GB) mới sở hữu cho mình màn hình có kích thước lên tới 6.4 inch, tương đương với màn hình của chiếc Samsung Galaxy S10+.\r\n\r\n', 'Bộ đôi camera kép ở mặt sau của máy có độ phân giải chính 16 MP và phụ 5 MP, trong đó ống kính phụ góc rộng là 5 MP cho phép chụp ảnh được bao quát và lạ mắt hơn.\r\n\r\n', 'Samsung đã chuyển cảm biến vân tay của mình ra mặt sau của máy và đặt nó khá vừa tầm tay khi cầm, để người dùng có thể mở khóa nhanh, đây là một sự thay đổi hợp lí.\r\n\r\n', 'img/sanpham/samsung/a30/mota/1.jpg', 'img/sanpham/samsung/a30/mota/2.jpg', 'img/sanpham/samsung/a30/mota/3.jpg', '1', '<h1>Trang bị các tính năng cao cấp từ các dòng flagship\r\n</h1><p>Có thể bạn sẽ bất ngờ bởi chiếc điện thoại Samsung Galaxy A30 (32GB/3GB) mới sở hữu cho mình màn hình có kích thước lên tới 6.4 inch, tương đương với màn hình của chiếc Samsung Galaxy S10+.\r');
INSERT INTO `product_detail` VALUES (99, 'Thiết kế hiện đại, thanh lịch\r\n', 'Màn hình AMOLED tràn viền, độ phân giải 2400x1080 pixel\r\n', '4 camera sau siêu zoom\r\n', 'Điện Thoại OPPO Reno 2F sở hữu thiết kế mỏng gọn cùng các đường bo góc tinh tế khiến chiếc điện thoại này vừa vặn trong lòng bàn tay, cho phép bạn cầm giữ một cách dễ dàng và thoải mái và chắc chắn hơn. Tổng thể sản phẩm nổi bật lên với vẻ đẹp thanh lịch sang trọng và không kém phần tinh tế.\r\n\r\n', 'OPPO Reno 2F sẽ có màn hình tràn viền hoàn hảo đúng nghĩa nhờ thiết kế camera selfie độc đáo, thực sự không có bất cứ một phần khuyết nào trên màn hình. Màn hình tràn viền tỷ lệ 19,5:9 cùng với một kích thước lên tới 6.5 inch, nhưng thực chất chỉ nằm gọn trong lòng bàn tay vì tỉ lệ màn hình chiếm tới 93% mặt trước.\r\n\r\n', 'Camera sau là tính năng đáng chú ý của chiếc máy này. OPPO Reno 2F được trang bị tới bốn camera sau với camera chính 48MP, khẩu độ f/1.7, đi kèm với cảm biến góc siêu rộng 8MP, ống kính tele 2MP và camera đơn sắc 2MP. Với độ phân giải này, bạn có thể thỏa sức ghi lại những khoảnh khắc của cuộc sống một cách sống động và chân thật, giúp bạn có những bức ảnh ưng ý nhất bao gồm chụp ảnh nhiều người, chụp ảnh xóa phông và chụp ảnh trắng đen.', 'img/sanpham/oppo/reno2f/mota/1.png', 'img/sanpham/oppo/reno2f/mota/2.png', 'img/sanpham/oppo/reno2f/mota/3.png', '1', '<h1>Thiết kế hiện đại, thanh lịch\r\n</h1><p>Điện Thoại OPPO Reno 2F sở hữu thiết kế mỏng gọn cùng các đường bo góc tinh tế khiến chiếc điện thoại này vừa vặn trong lòng bàn tay, cho phép bạn cầm giữ một cách dễ dàng và thoải mái và chắc chắn hơn. Tổng thể ');
