INSERT INTO `product_detail` VALUES (101, 'Màn hình lớn cho những trải nghiệm lớn\r\n', 'Mặt lưng bóng bẩy, màu sắc phong cách\r\n', '3 camera sau cao cấp\r\n', 'Điện Thoại Samsung Galaxy A20s sở hữu màn hình lớn mang đến cho bạn không gian trải nghiệm lớn hơn. Trước mắt chúng ta sẽ là màn hình 6,5 inch vô cực dạng Infinity-V tuyệt hảo, hiển thị sống động, hình ảnh sắc nét, hiệu ứng tràn viền hấp dẫn. Mỗi ngày trôi qua bạn đều được trải nghiệm những điều tuyệt vời mà màn hình Infinity-V mang lại.\r\n\r\n', 'Samsung Galaxy A20s có thiết kế trẻ trung với mặt lưng bóng bẩy thời trang. Mặt lưng A20s được hoàn thiện mượt mà, hiệu ứng đổi màu và phản chiếu ánh sáng nhẹ nhàng, bo cong mềm mại để cầm nắm dễ dàng hơn. Bạn sẽ có 3 sự lựa chọn màu sắc đầy phong cách là đen, đỏ và xanh để lựa chọn.\r\n\r\n', 'Galaxy A20s có khả năng chụp ảnh chuyên nghiệp khi sở hữu 3 camera sau cao cấp với 3 vai trò khác nhau. Bạn sẽ có camera chính 13MP, camera đo độ sâu 5MP và camera góc siêu rộng 8MP. Camera đo độ sâu hỗ trợ chụp ảnh xóa phông, làm mờ hậu cảnh và nổi bật chủ thể. Trong khi đó camera góc siêu rộng mang đến góc chụp rộng tới 120 độ, lưu lại những khung cảnh hùng vĩ rộng lớn.\r\n\r\n', 'img/sanpham/samsung/a20s/mota/1.jpg', 'img/sanpham/samsung/a20s/mota/2.jpg', 'img/sanpham/samsung/a20s/mota/3.jpg', '1', '<h1>Màn hình lớn cho những trải nghiệm lớn\r\n</h1><p>Điện Thoại Samsung Galaxy A20s sở hữu màn hình lớn mang đến cho bạn không gian trải nghiệm lớn hơn. Trước mắt chúng ta sẽ là màn hình 6,5 inch vô cực dạng Infinity-V tuyệt hảo, hiển thị sống động, hình ả');
INSERT INTO `product_detail` VALUES (102, 'Thiết kế tinh tế và sang trọng\r\n', 'Chụp ảnh sắc nét với cụm 4 camera\r\n', 'Màn hình giọt nước trải nghiệm tối ưu\r\n', 'Điện Thoại OPPO A9 (128G/8GB) được trang bị con chip tầm trung mới Snapdragon 665 mang đến hiệu năng mạnh mẽ và tối ưu tiết kiệm điện hơn, cho trải nghiệm giải trí, chơi game trở nên mượt mà và dễ dàng hơn bao giờ hết.\r\n\r\n', 'OPPO A9 (2020) có sự thay đổi lớn về số camera cũng như độ phân giải camera sau, giúp hình ảnh đạt độ chi tiết và sắc nét cao hơn hẳn.\r\n\r\nMáy bao gồm một camera chính 48 MP và ba cảm biến phụ có độ phân giải lần lượt là 8 MP, 2 MP và 2 MP.\r\n\r\n', 'OPPO A9 (2020) có màn hình giọt nước rộng đến 6.5 inch, độ phân giải HD+, tỉ lệ 19.5:9 và đạt đến 90.7% diện tích trải nghiệm.\r\n\r\nViệc xem phim, chơi game sẽ trở nên đã mắt và không còn gặp nhiều giới hạn cùng với dung lượng pin khủng đến 5000 mAh.\r\n\r\n', 'img/sanpham/oppo/a9/mota/1.jpg', 'img/sanpham/oppo/a9/mota/2.jpg', 'img/sanpham/oppo/a9/mota/3.jpg', '1', '<h1>Thiết kế tinh tế và sang trọng\r\n</h1><p>Điện Thoại OPPO A9 (128G/8GB) được trang bị con chip tầm trung mới Snapdragon 665 mang đến hiệu năng mạnh mẽ và tối ưu tiết kiệm điện hơn, cho trải nghiệm giải trí, chơi game trở nên mượt mà và dễ dàng hơn bao g');
INSERT INTO `product_detail` VALUES (103, 'Màn hình tai thỏ hiện đại\r\n', 'Hiệu năng mạnh mẽ\r\n', 'Camera selfie làm đẹp 4.0\r\n', 'Chiếc điện thoại được trang bị màn hình “tai thỏ” tương tự như iPhone X hiện đại và thời thượng. Bên cạnh đó, màn hình Mi A2 Lite có kích thước lớn 5.84 inch, tỉ lệ rộng 19:9 với độ phân giải Full HD+ (1080 x 2280 pixels) cho bạn trải nghiệm xem cực tốt, bạn cũng dễ dàng cầm nắm và sử dụng mà không gặp quá nhiều khó khăn.', 'Xiaomi Mi A2 Lite đi kèm với bộ vi xử lý Snapdragon 625 tám nhân xung nhịp 2.0 GHz, song song đó là card đồ họa Adreno 506 mạnh mẽ cùng bộ nhớ RAM 3GB, cho tốc độ xử lý nhanh và tốt các game 3D, lướt web, giải trí, xem phim. Bên cạnh đó, với bộ nhớ trong lên đến 32GB, chiếc điện thoại giúp người dùng lưu trữ dữ liệu cũng như hình ảnh, video một cách thoải mái. Mi A2 Lite chạy hệ điều hành Android One gần với giao diện gốc của Google cho khả năng xử lý mượt mà, luôn được cập nhật sớm nhất. \r\n\r\n', 'Ở mặt trước, Mi A2 Lite được trang bị camera làm đẹp 4.0 với độ phân giải 5MP, ống kính góc rộng 67,9 độ, chụp ảnh HDR giúp khuôn mặt bạn được làm đẹp một cách tự nhiên qua các quá trình xóa thâm quầng dưới mắt, xóa mụn hay nhược điểm, nổi bật ưu điểm và sáng da và đặc biệt là vẫn có thể chụp ảnh xóa phông hiệu ứng bokeh nhờ sự giả lập từ trí tuệ nhân tạo AI. \r\n\r\n', 'img/sanpham/xiaomi/mia2lite/mota/1.jpg', 'img/sanpham/xiaomi/mia2lite/mota/2.jpg', 'img/sanpham/xiaomi/mia2lite/mota/3.jpg', '1', '<h1>Màn hình tai thỏ hiện đại\r\n</h1><p>Chiếc điện thoại được trang bị màn hình “tai thỏ” tương tự như iPhone X hiện đại và thời thượng. Bên cạnh đó, màn hình Mi A2 Lite có kích thước lớn 5.84 inch, tỉ lệ rộng 19:9 với độ phân giải Full HD+ (1080 x 2280 pi');
INSERT INTO `product_detail` VALUES (104, 'Thiết kế đơn giản và tinh tế\r\n', 'Camera kép AI thế hệ mới\r\n', 'Pin dung lượng cao 4000 mAh\r\n', 'Điện Thoại Realme C2 (2GB/16GB) sở hữu màn hình tràn viền dạng “giọt nước” thời thượng, màn hình lớn 6,1 inch tỉ lệ 19.5:9 chuẩn điện ảnh. Việc viền màn hình được thu lại cực mỏng giúp màn hình chiếm tới 89,35% diện tích hiển thị mặt trước, mang lại không gian màn hình rộng lớn nhưng vẫn đảm bảo máy nhỏ gọn. Những đoạn video được xem trên Realme C2 sẽ thú vị hơn bao giờ hết với màn hình lớn, sống động dạng tràn viền cực đã.\r\n\r\n', 'Với cụm camera kép mặt sau, Realme C2 hỗ trợ trí tuệ nhân tạo AI, camera chính 13MP và camera phụ 2MP đo độ sâu trường ảnh, giúp bạn dễ dàng chụp được những bức ảnh chân dung xóa phông, làm mờ hậu cảnh đầy kỳ ảo. Khả năng quay video cũng không kém phần ấn tượng khi Realme C2 có thể quay video độ phân giải Full HD và những đoạn video chuyển động chậm slow-motion rất nghệ thuật.\r\n\r\n', 'Với viên pin dung lượng cao 4000 mAh và bộ vi xử lý sản xuất trên tiến trình 12nm tiết kiệm năng lượng, Realme C2 cho phép bạn sử dụng thoải mái trong suốt cả ngày dài mà không lo hết pin. Tha hồ làm những điều mình thích, từ nghe nhạc, xem Youtube, nhắn tin cho bạn bè cho đến chơi game, chụp ảnh. Điện thoại vẫn luôn đồng hành bên bạn.\r\n\r\n', 'img/sanpham/realme/c2/mota/1.jpg', 'img/sanpham/realme/c2/mota/2.jpg', 'img/sanpham/realme/c2/mota/3.jpg', '1', '<h1>Thiết kế đơn giản và tinh tế\r\n</h1><p>Điện Thoại Realme C2 (2GB/16GB) sở hữu màn hình tràn viền dạng “giọt nước” thời thượng, màn hình lớn 6,1 inch tỉ lệ 19.5:9 chuẩn điện ảnh. Việc viền màn hình được thu lại cực mỏng giúp màn hình chiếm tới 89,35% di');
INSERT INTO `product_detail` VALUES (105, 'Màn hình lớn tương đương Galaxy S10+\r\n', 'Màn hình giọt nước tràn viền\r\n', 'Hiệu năng vượt trội\r\n', 'Điện Thoại Realme 3 có thiết kế nguyên khối kim loại chắc chắn, bốn góc bo tròn nhẹ nhàng. Cùng với đó là mặt lưng với hiệu ứng đổi màu gradient sắc sảo và tinh tế. Viền màn hình mỏng khiến chiếc điện thoại càng gọn gàng, cầm chắc tay, cho bạn dễ dàng mang theo bất cứ nơi đâu.\r\n\r\nĐiện Thoại Realme 3 có thiết kế nguyên khối kim loại chắc chắn, bốn góc bo tròn nhẹ nhàng. Cùng với đó là mặt lưng với hiệu ứng đổi màu gradient sắc sảo và tinh tế. Viền màn hình mỏng khiến chiếc điện thoại càng gọn gàng, cầm chắc tay, cho bạn dễ dàng mang theo bất cứ nơi đâu.\r\n\r\n', 'Realme 3 sở hữu màn hình kích thước lớn tới 6.22 inch được thiết kế kiểu màn hình giọt nước viền siêu mỏng tiên tiến, mang đến trải nghiệm xem tuyệt vời. Mọi thứ đều được hiển thị lớn hơn, đẹp hơn, dễ dàng cho bạn các thông tin trực quan và giải trí hấp dẫn. Nhờ viền mỏng nên dù màn hình lớn thì Realme 3 vẫn đủ gọn gàng trong bàn tay bạn.\r\n\r\n', 'Về thông số cấu hình, Realme 3 dùng vi xử lý MediaTek Helio P60 8 nhân 64-bit, card đồ họa Adreno 506 mạnh mẽ cùng bộ nhớ RAM 3GB, cho tốc độ xử lý ổn định khi bạn lướt web, giải trí, xem phim. Bên cạnh đó, với bộ nhớ trong 32GB cùng khe cắm thẻ nhớ ngoài tối đa lên đến 256GB, chiếc điện thoại giúp người dùng lưu trữ dữ liệu cũng như hình ảnh, video một cách thoải mái. \r\n\r\n', 'img/sanpham/realme/3/mota/1.jpg', 'img/sanpham/realme/3/mota/2.jpg', 'img/sanpham/realme/3/mota/3.jpg', '1', '<h1>Màn hình lớn tương đương Galaxy S10+\r\n</h1><p>Điện Thoại Realme 3 có thiết kế nguyên khối kim loại chắc chắn, bốn góc bo tròn nhẹ nhàng. Cùng với đó là mặt lưng với hiệu ứng đổi màu gradient sắc sảo và tinh tế. Viền màn hình mỏng khiến chiếc điện thoạ');
INSERT INTO `product_detail` VALUES (106, 'Thiết kế bắt mắt, hiếm có đối thủ trong phân khúc\r\n', 'Camera selfie hài lòng mọi người dùng\r\n', 'Nhiều tính năng hỗ trợ đắt giá\r\n', 'Màn hình giọt nước ở mặt trước sẽ gây ấn tượng cho người dùng ngay từ cái nhìn đầu tiên với kích thước 6.1 inch.\r\n\r\nDiện tích trải nghiệm toàn màn hình rộng hơn, xem phim hay chơi game đều cảm thấy thoải mái và không còn cảm giác mỏi mắt.', 'Camera chính cũng làm khá tốt nhiệm vụ của mình tới độ phân giải 8 MP hỗ trợ công nghệ chống rung đa khung giúp ảnh chụp sắc nét hơn.\r\n\r\n', 'OPPO A1K cũng được tích hợp khả năng nhận diện khuôn mặt mở máy hiện đại và cao cấp giúp bạn có thể sử dụng một cách dễ dàng.\r\n\r\nĐiểm Antutu của OPPO A1k ở mức khoảng 75000 điểm, không quá cao nhưng hỗ trợ tốt các ứng dụng lướt web, cơ bản hằng ngày.', 'img/sanpham/oppo/a1k/mota/1.jpg', 'img/sanpham/oppo/a1k/mota/2.jpg', 'img/sanpham/oppo/a1k/mota/3.jpg', '1', '<h1>Thiết kế bắt mắt, hiếm có đối thủ trong phân khúc\r\n</h1><p>Màn hình giọt nước ở mặt trước sẽ gây ấn tượng cho người dùng ngay từ cái nhìn đầu tiên với kích thước 6.1 inch.\r\n\r\nDiện tích trải nghiệm toàn màn hình rộng hơn, xem phim hay chơi game đều cảm');
