INSERT INTO `product_detail` VALUES (108, 'Màn Hình Tràn Halo -Tầm Nhìn Vượt Giới Hạn\r\n', 'Camera Trước 32MP - Chụp Chân Dung Sắc Nét Hơn\r\n', 'Cảm Biến Vân Tay Dưới Màn Hình \r\nMở Ra Tương Lai', 'Vivo S1 sở hữu Màn Hình Tràn Halo với tỷ lệ màn hình trên thân máy cao. Sự đối xứng hoàn hảo mang đến trải nghiệm hiệu ứng thị giác tuyệt vời. Màn hình Super AMOLED 6.38 inch với tỷ lệ 19.5:9 và tỷ lệ màn hình trên thân máy 90% cho phép bạn tận hưởng không gian giải trí vượt mọi giới hạn.\r\n\r\n', 'Vivo S1 sở hữu camera trước 32MP dẫn đầu ngành. Độ phân giải Ultra HD cho phép bạn chụp selfie với chi tiết và chất lượng hình ảnh sắc nét hơn. Nhiều chế độ selfie đa dạng như AI Face Beauty, Trợ Sáng Camera Selfie, AR Stickers, Bộ lọc AI… mang đến trải nghiệm chụp ảnh “tự sướng” đầy niềm vui và hứng khởi.\r\n\r\n', 'Từ khi cho ra mắt công nghệ Cảm Biến Vân Tay Dưới Màn Hình, vivo đã và đang dẫn đầu ngành trong việc mang đến cho người dùng trải nghiệm mở khóa ngày càng tuyệt vời hơn. Chỉ cần một cú chạm nhẹ trên màn hình vivo S1, điện thoại đã có thể mở khóa một cách nhanh chóng. Bên cạnh đó, việc mở khóa sẽ trở nên dễ dàng và thú vị hơn nhờ các hiệu ứng hoạt hình đa dạng được tích hợp sẵn trên điện thoại.\r\n\r\n', 'img/sanpham/vivo/s1/mota/1.png', 'img/sanpham/vivo/s1/mota/2.jpg', 'img/sanpham/vivo/s1/mota/3.jpg', '1', '<h1>Màn Hình Tràn Halo -Tầm Nhìn Vượt Giới Hạn\r\n</h1><p>Vivo S1 sở hữu Màn Hình Tràn Halo với tỷ lệ màn hình trên thân máy cao. Sự đối xứng hoàn hảo mang đến trải nghiệm hiệu ứng thị giác tuyệt vời. Màn hình Super AMOLED 6.38 inch với tỷ lệ 19.5:9 và tỷ l');
