INSERT INTO `product_detail` VALUES (110, 'Thiết kế hiện đại, bắt mắt\r\n', 'Hiệu năng mạnh mẽ\r\n', 'Pin trâu không lo bị hết\r\n', 'Điện Thoại Oppo A5 ( 4GB/128GB) sở hữu cho mình một ngoại hình rất thu hút sẽ khiến người dùng có nhiều cảm tình hơn và dẫn tới quyết định mua một chiếc smartphone.\r\n\r\n', 'OPPO A5 cũng được trang bị bộ vi xử lý Snapdragon 665 nhưng đi kèm với RAM 3GB + ROM 64GB hoặc RAM 4GB + ROM 128GB. Ngoài ra, nó cũng có 1 khay cắm 2 SIM + thẻ microSD.\r\n\r\n', 'Chiếc smartphone OPPO này được cung cấp năng lượng bởi viên pin dung lượng lên đến 5.000 mAh, kết hợp với hệ điều hành ColorOS 6.1 và phần cứng mới giúp sản phẩm tối ưu hơn trong việc sử dụng.\r\n\r\n', 'img/sanpham/oppo/a5/mota/1.jpg', 'img/sanpham/oppo/a5/mota/2.jpg', 'img/sanpham/oppo/a5/mota/3.jpg', '1', '<h1>Thiết kế hiện đại, bắt mắt\r\n</h1><p>Điện Thoại Oppo A5 ( 4GB/128GB) sở hữu cho mình một ngoại hình rất thu hút sẽ khiến người dùng có nhiều cảm tình hơn và dẫn tới quyết định mua một chiếc smartphone.\r\n\r\n</p><img src=\"img/sanpham/oppo/a5/mota/1.jpg\"/>');
INSERT INTO `product_detail` VALUES (111, 'Màn hình lớn cho những trải nghiệm lớn\r\n', 'Mặt lưng bóng bẩy, màu sắc phong cách\r\n', '3 camera sau cao cấp\r\n', 'Điện Thoại Samsung Galaxy A20s sở hữu màn hình lớn mang đến cho bạn không gian trải nghiệm lớn hơn. Trước mắt chúng ta sẽ là màn hình 6,5 inch vô cực dạng Infinity-V tuyệt hảo, hiển thị sống động, hình ảnh sắc nét, hiệu ứng tràn viền hấp dẫn. Mỗi ngày trôi qua bạn đều được trải nghiệm những điều tuyệt vời mà màn hình Infinity-V mang lại.\r\n\r\n', 'Samsung Galaxy A20s có thiết kế trẻ trung với mặt lưng bóng bẩy thời trang. Mặt lưng A20s được hoàn thiện mượt mà, hiệu ứng đổi màu và phản chiếu ánh sáng nhẹ nhàng, bo cong mềm mại để cầm nắm dễ dàng hơn. Bạn sẽ có 3 sự lựa chọn màu sắc đầy phong cách là đen, đỏ và xanh để lựa chọn.\r\n\r\n', 'Galaxy A20s có khả năng chụp ảnh chuyên nghiệp khi sở hữu 3 camera sau cao cấp với 3 vai trò khác nhau. Bạn sẽ có camera chính 13MP, camera đo độ sâu 5MP và camera góc siêu rộng 8MP. Camera đo độ sâu hỗ trợ chụp ảnh xóa phông, làm mờ hậu cảnh và nổi bật chủ thể. Trong khi đó camera góc siêu rộng mang đến góc chụp rộng tới 120 độ, lưu lại những khung cảnh hùng vĩ rộng lớn.\r\n\r\n', 'img/sanpham/samsung/a20s/mota/1.jpg', 'img/sanpham/samsung/a20s/mota/2.jpg', 'img/sanpham/samsung/a20s/mota/3.jpg', '1', '<h1>Màn hình lớn cho những trải nghiệm lớn\r\n</h1><p>Điện Thoại Samsung Galaxy A20s sở hữu màn hình lớn mang đến cho bạn không gian trải nghiệm lớn hơn. Trước mắt chúng ta sẽ là màn hình 6,5 inch vô cực dạng Infinity-V tuyệt hảo, hiển thị sống động, hình ả');
INSERT INTO `product_detail` VALUES (112, 'Thiết kế bắt mắt, thời trang\r\n', 'Chip Snapdragon 439 mới mẻ\r\n', 'Bộ đôi camera hoàn hảo\r\n', 'Điện Thoại Vivo Y93 sở hữu thiết kế thời thượng với phần mặt lưng bắt mắt kết hợp công nghệ 3D micro-arc cho bạn trải nghiệm mới mẻ và nổi bật giữa đám đông. Phần khung và mặt lưng của máy có sự kết nối chặt chẽ với nhau giúp vuốt từ khung vào mặt lưng và ngược lại sẽ không thấy cấn.\r\n\r\n', 'Vivo Y93 là chiếc smartphone đầu tiên dùng chip Snapdragon 439 trên tiến trình 12 nm giúp máy tiết kiệm năng lượng hơn so với các thế hệ cũ. Máy cũng sở hữu bộ nhớ RAM lên tới 4 GB và 64 GB bộ nhớ trong cho bạn sử dụng mượt mà trong nhiều ngày mà không cần khởi động lại máy.\r\n\r\n', 'Vivo Y93 sở hữu bộ đôi camera kép ở mặt lưng với độ phân giải lần lượt là 13 MP + 2 MP cho khả năng chụp ảnh xóa phông khá ảo diệu. Trong điều kiện đủ sáng, Vivo Y95 lấy nét và lưu ảnh đều nhanh, bạn có thể dễ dàng chuyển sang chế độ chụp chân dung xóa phông chỉ với 1 nút nhấn. Ngoài ra máy còn có chế độ làm đẹp bằng trí tuệ nhân tạo, hay bộ lọc màu nhiều chế độ cùng với khả năng chụp thủ công để bạn có được những tấm ảnh ưng ý nhất.\r\n\r\n', 'img/sanpham/vivo/y93/mota/1.jpg', 'img/sanpham/vivo/y93/mota/2.jpg', 'img/sanpham/vivo/y93/mota/3.jpg', '1', '<h1>Thiết kế bắt mắt, thời trang\r\n</h1><p>Điện Thoại Vivo Y93 sở hữu thiết kế thời thượng với phần mặt lưng bắt mắt kết hợp công nghệ 3D micro-arc cho bạn trải nghiệm mới mẻ và nổi bật giữa đám đông. Phần khung và mặt lưng của máy có sự kết nối chặt chẽ v');
INSERT INTO `product_detail` VALUES (113, 'Màn Hình Tràn Halo 6.35-inch\r\n', 'Bộ 3 Camera Sau AI - Hơn Cả Những Bức Ảnh Chuyên Nghiệp\r\n', 'Pin Siêu Khủng 5000mAh: Năng Lượng Bền Bỉ\r\n', 'Y12 sở hữu Màn Hình Tràn Halo 6.35 inch với tỷ lệ 19.3:9. Cạnh viền siêu mỏng cho tỷ lệ màn hình trên thân máy lên đến 89%, mang đến trải nghiệm hình ảnh chất lượngchuẩn cao cấp. Điều khiển cử chỉ được thiết kế đặc biệt giúp việc sử dụng màn hình rộng bằng một tay hết sức dễ dàng.\r\n\r\n', 'Phá bỏ mọi rào cản về thị giác, mang đến những bức ảnh chuyên nghiệp. Khi bạn nhìn thế giới qua Bộ 3 Camera sau AI, việc tạo ra những kiệt tác nhiếp ảnh trở nên dễ dàng hơn bao giờ hết. Y12 có thiết kế Bộ 3 Camera với Camera Chính 13MP, Camera Góc Siêu Rộng 8MP và Camera Xóa Phông 2MP. Từ phong cảnh hùng vĩ đến chân dung lung linh, Bộ 3 Camera AI này đều sẽ giúp bạn chụp được những bức ảnh ấn tượng nhất một cách dễ dàng.\r\n\r\n', 'Y12 sở hữu dung lượng pin siêu khủng 5.000mAh dẫn đầu ngành, được hỗ trợ bởi các công nghệ tiết kiệm năng lượng thông minh để kéo dài thời gian sử dụng.\r\n\r\n', 'img/sanpham/vivo/y12/mota/1.png', 'img/sanpham/vivo/y12/mota/2.png', 'img/sanpham/vivo/y12/mota/3.png', '1', '<h1>Màn Hình Tràn Halo 6.35-inch\r\n</h1><p>Y12 sở hữu Màn Hình Tràn Halo 6.35 inch với tỷ lệ 19.3:9. Cạnh viền siêu mỏng cho tỷ lệ màn hình trên thân máy lên đến 89%, mang đến trải nghiệm hình ảnh chất lượngchuẩn cao cấp. Điều khiển cử chỉ được thiết kế đặ');
