INSERT INTO `product_detail` VALUES (115, 'Màn hình cong tràn siêu cực ', 'Công nghệ điểm màu lấp lánh phân tầng 3D\r\n', 'Hệ thống camera kép sắc nét\r\n', 'OPPO Find X sở hữu thiết kế đột phá vô cùng ấn tượng với khung viền hẹp nhất, tỉ lệ màn hình lớn nhất, thân nguyên khối không khuyết điểm duy nhất kết hợp màu sắc chuyển tiếp với công nghệ tiên tiến nhất. Find X giữ vai trò tiên phong khi sử dụng màn hình cong tràn siêu cực không chỉ là màn hình tràn viền thông thường mà còn được vát cong tràn 3D hai cạnh bên, đồng thời đưa không gian trải nghiệm rộng hết mức có thể, bung tràn 4 cạnh, chiếm trọn mặt trước của điện thoại, mang lại hiệu quả trải nghiệm thị giác kinh ngạc.\r\n\r\n', 'Find X lấy màu đen làm tông chủ đạo khi kết hợp với 2 màu đỏ Bordeaux và Xanh Glacier giúp OPPO Find X trở nên lung linh huyền ảo nhưng không kém phần quyến rũ và tỏa sáng như những viên đá quý. Để tạo nên hiệu ứng chuyển màu, OPPO đã ứng dụng công nghệ xử lý màu 3D đa diện hiện đại, giúp Find X trở thành một phẩm nghệ thuật ấn tượng hay một món trang sức cao cấp mà ai cũng muốn sở hữu. Vì vậy, Find X tiếp tục chiếm giữ vị trí là điện thoại có màu sắc chuyển tiếp đẹp mắt với công nghệ tiên tiến nhất hiện nay.\r\n\r\n', 'Camera Find X trang bị hai ống kính và hệ thống chống rung quang học OIS để tạo hiệu ứng chiều sâu tuyệt vời hơn. Bên cạnh đó, công nghệ nhận dạng cảnh thông minh AI Scene giúp Find X xác được 800 loại khung cảnh, để trở thành một \"phụ tá kỹ thuật nhiếp ảnh\" thật sự. Cụm camera 3D không chỉ ẩn mình sau màn hình siêu cực, mà nó còn sở hữu rất nhiều công nghệ mới đến từ camera trước và cụm camera kép ở mặt sau. Camera 3D ẩn tự động với nhận dạng gương mặt 3D sẽ tạo ra chuẩn mực mới và tái định nghĩa nhiếp ảnh trên điện thoại.\r\n\r\n', 'img/sanpham/oppo/findx/mota/1.jpg', 'img/sanpham/oppo/findx/mota/2.jpg', 'img/sanpham/oppo/findx/mota/3.jpg', '1', '<h1>Màn hình cong tràn siêu cực </h1><p>OPPO Find X sở hữu thiết kế đột phá vô cùng ấn tượng với khung viền hẹp nhất, tỉ lệ màn hình lớn nhất, thân nguyên khối không khuyết điểm duy nhất kết hợp màu sắc chuyển tiếp với công nghệ tiên tiến nhất. Find X giữ');
INSERT INTO `product_detail` VALUES (116, 'Thiết kế màu sắc đầy cảm hứng\r\n', 'Màn hình tràn viền 6.4 inch\r\n', 'Cấu hình mạnh mẽ\r\n', 'Điện Thoại Oppo R17 Pro được xem là chiếc smartphone của cái đẹp khi được khoác lên mình một thiết kế trẻ trung và hiện đại sẽ khiến bạn phải mê mẩn. Chiếc điện thoại với thân hình uyển chuyển, các đường góc bo cong mềm mại. Mặt lưng bằng kính kết hợp hài hòa giữa màu xanh và tím tạo nên hiệu ứng gradient đa sắc độ khi bạn ngắm nhìn ở các góc nghiêng khác nhau. Màn hình giọt nước gần như chiếm trọn mặt trước thu hút mọi ánh nhìn. Chế tác bằng các kỹ thuật khắc bề mặt tinh tế, Oppo R17 Pro không bị bám bẩn và dấu vân tay, kết nối liền lạc, để bạn cảm nhận được sự cao cấp đến từng chi tiết ở mỗi lần chạm.\r\n\r\n', 'Oppo R17 Pro sở hữu thiết kế đột phá vô cùng ấn tượng với màn hình mô phỏng giọt nước đang rơi, một khoảng khắc ngắn ngủi và tĩnh lặng. Kích thước màn hình lớn 6.4 inch chiếm tới 91.5% diện tích mặt trước và là một trong những smartphone có màn hình lớn nhất hiện nay. Bên cạnh đó, màn hình được bảo vệ bằng kính cường lực Corning Gorilla Glass 6 mới nhất cho Oppo R17 Pro vừa đẹp lại vừa vô cùng bền vững. Về khả năng hiển thị, R17 Pro hứa hẹn sẽ mang lại cho bạn một trải nghiệm tuyệt vời nhất với tấm nền AMOLED rực rỡ cùng độ phân giải Full HD+ siêu nét.\r\n\r\n', 'Chiếc điện thoại được trang bị một trong những bộ vi xử lý mạnh nhất thế giới Android hiện nay là Snapdragon 710 kết hợp 8 GB RAM cùng 128 GB bộ nhớ trong. Oppo R17 Pro có thể chơi mọi game 3D nặng ở mức đồ họa cao nhất. Tất cả những tựa game như PUBG Mobile, Liên quân Mobile đều được tối ưu và mang lại trải nghiệm xuất sắc. Từ tốc độ khởi chạy, tốc độ khung hình cho đến đồ họa trong game đều thể hiện hoản hảo. \r\n\r\n', 'img/sanpham/oppo/r17/mota/1.jpg', 'img/sanpham/oppo/r17/mota/2.jpg', 'img/sanpham/oppo/r17/mota/3.jpg', '1', '<h1>Thiết kế màu sắc đầy cảm hứng\r\n</h1><p>Điện Thoại Oppo R17 Pro được xem là chiếc smartphone của cái đẹp khi được khoác lên mình một thiết kế trẻ trung và hiện đại sẽ khiến bạn phải mê mẩn. Chiếc điện thoại với thân hình uyển chuyển, các đường góc bo c');
INSERT INTO `product_detail` VALUES (117, 'Thiết kế hiện đại, thanh lịch\r\n', 'Màn hình AMOLED tràn viền, độ phân giải 2400x1080 pixel\r\n', '4 camera sau siêu zoom\r\n', 'Điện Thoại OPPO Reno 2F sở hữu thiết kế mỏng gọn cùng các đường bo góc tinh tế khiến chiếc điện thoại này vừa vặn trong lòng bàn tay, cho phép bạn cầm giữ một cách dễ dàng và thoải mái và chắc chắn hơn. Tổng thể sản phẩm nổi bật lên với vẻ đẹp thanh lịch sang trọng và không kém phần tinh tế.\r\n\r\n', 'OPPO Reno 2F sẽ có màn hình tràn viền hoàn hảo đúng nghĩa nhờ thiết kế camera selfie độc đáo, thực sự không có bất cứ một phần khuyết nào trên màn hình. Màn hình tràn viền tỷ lệ 19,5:9 cùng với một kích thước lên tới 6.5 inch, nhưng thực chất chỉ nằm gọn trong lòng bàn tay vì tỉ lệ màn hình chiếm tới 93% mặt trước.\r\n\r\n', 'Camera sau là tính năng đáng chú ý của chiếc máy này. OPPO Reno 2F được trang bị tới bốn camera sau với camera chính 48MP, khẩu độ f/1.7, đi kèm với cảm biến góc siêu rộng 8MP, ống kính tele 2MP và camera đơn sắc 2MP. Với độ phân giải này, bạn có thể thỏa sức ghi lại những khoảnh khắc của cuộc sống một cách sống động và chân thật, giúp bạn có những bức ảnh ưng ý nhất bao gồm chụp ảnh nhiều người, chụp ảnh xóa phông và chụp ảnh trắng đen.', 'img/sanpham/oppo/reno2f/mota/1.png', 'img/sanpham/oppo/reno2f/mota/2.png', 'img/sanpham/oppo/reno2f/mota/3.png', '1', '<h1>Thiết kế hiện đại, thanh lịch\r\n</h1><p>Điện Thoại OPPO Reno 2F sở hữu thiết kế mỏng gọn cùng các đường bo góc tinh tế khiến chiếc điện thoại này vừa vặn trong lòng bàn tay, cho phép bạn cầm giữ một cách dễ dàng và thoải mái và chắc chắn hơn. Tổng thể ');
INSERT INTO `product_detail` VALUES (118, 'Thiết kế hoàn mĩ', 'Màn hình tràn không viền 6.53 inch FHD+', 'Trang bị con chip MTK Helio P70, 8 nhân', 'Điện Thoại VIVO V17 Pro mang một thân hình vô cùng quyến rũ với không gian màn hình gần như chiếm trọn mặt trước của máy. Máy thiết kế mặt lưng với những họa tiết gợn sáng lung linh, thân hình thanh thoát, uyển chuyển bởi các đường cong mềm mại đan xen một chút mạnh mẽ, đem lại cảm giác cầm nắm trên tay vô cùng dễ chịu và thoải mái.', 'Màn hình tràn không viền mang đến tỉ lệ màn hình/thân máy đạt 90.95%, kích thước màn hình 6.53 inch, giúp mở rộng góc nhìn một cách đột phá. Kết hợp với độ phân giải FHD+ (1080 x 2340), kính cường lực Corning Gorilla Glass thế hệ thứ 5, giúp các trò chơi hay bộ phim trở nên hấp dẫn và thú vị hơn.', 'Được trang bị con chip MTK Helio P70, 8 nhân (2.1GHz) và bộ nhớ trong 128GB, RAM 6GB giúp người dùng có thể thoải máy đa nhiệm mà không sợ bị load lại ứng dụng trong quá trình sử dụng, giúp chơi game và vận hành nhiều ứng dụng cùng lúc mà vẫn mượt mà, không bị giật lag.', 'img/sanpham/vivo/v15/mota/1.jpg', 'img/sanpham/vivo/v15/mota/2.jpg', 'img/sanpham/vivo/v15/mota/3.jpg', '1', '<h1>Thiết kế hoàn mĩ</h1><p>Điện Thoại VIVO V17 Pro mang một thân hình vô cùng quyến rũ với không gian màn hình gần như chiếm trọn mặt trước của máy. Máy thiết kế mặt lưng với những họa tiết gợn sáng lung linh, thân hình thanh thoát, uyển chuyển ');
