INSERT INTO `product_detail` VALUES (120, 'Thiết kế tai thỏ thời thượng\r\n', 'Mở ra thế giới mới với màn hình tỷ lệ vàng 19:9', 'Trí thông minh nhân tạo hỗ trợ camera', 'Điện thoại Vivo Y81 là smartphone hướng đến người dùng phổ thông của hãng Vivo sau thành công của dòng điện thoại cận cao cấp Vivo V9, lần này Y81 trở lại vẫn với phong cách quen thuộc đó, tai thỏ thời thượng cùng với 2 màu sắc nổi bật là đen và đỏ nhưng hài hòa và cũng không kém phần sang trọng.', 'Với tỉ lệ màn hình trên thân máy lên đến 88%, Y81 giúp màn hình chiếm gần như toàn bộ mặt trước. Kích thước màn hình lớn 6.22 inch độ phân giải HD+ cùng tỷ lệ vàng 19:9 giúp trải nghiệm hình ảnh mang lại hoàn hảo, vượt xa giới hạn mong đợi của bạn.', 'Được thiết lập một ống kính 13 MP phía sau với khẩu độ f/2.2 cùng khả năng lấy nét theo pha nhanh chóng, Vivo Y81 giúp bạn bắt trọn mọi khoảnh khắc trong cuộc sống mà bạn muốn lưu lại. Máy cũng được trang bị tính năng Live Photo để bạn có thể lưu lại cả hình ảnh âm thanh trước và sau khi bấm nút chụp 1,5 giây, tạo thành một bức ảnh động đầy ấn tượng.', 'img/sanpham/vivo/y81/mota/1.jpg', 'img/sanpham/vivo/y81/mota/2.jpg', 'img/sanpham/vivo/y81/mota/3.jpg', '1', '<h1>Thiết kế tai thỏ thời thượng\r\n</h1><p>Điện thoại Vivo Y81 là smartphone hướng đến người dùng phổ thông của hãng Vivo sau thành công của dòng điện thoại cận cao cấp Vivo V9, lần này Y81 trở lại vẫn với phong cách quen thuộc đó, tai thỏ thời thượng cùng');
INSERT INTO `product_detail` VALUES (121, 'Thiết kế đơn giản và tinh tế\r\n', 'Hiệu năng cải tiến mạnh mẽ\r\n', 'Camera selfie chất lượng\r\n', 'Điện Thoại Realme 3 Pro (128GB/6GB) có thiết kế ấn tượng, không thua kém các smartphone cao cấp và đắt tiền nào. Máy sở hữu mặt lưng với khả năng thay đổi màu sắc rất độc đáo, người dùng sẽ có các màu sắc khác nhau tùy vào góc nghiêng khác nhau rất thích mắt. Với kích thước nhỏ gọn và trọng lượng nhẹ, chiếc điện thoại cho phép bạn dễ dàng mang theo bất cứ đâu.\r\n\r\n', 'Hiệu năng của Realme 3 Pro đã được cải tiến khá đáng kể với con chip vi xử lý Snapdragon 710 8 nhân 64-bit. Ưu điểm của con chip này là khả năng tiết kiệm năng lượng hơn 30% so với Snapdragon 660 trang bị trên thế hệ cũ. Mức RAM của máy lên đến 6 GB cùng bộ nhớ trong 128GB cho bạn thoải mái lưu trữ được nhiều dữ liệu và hình ảnh. Trải nghiệm thực tế cho thấy, Realme 3 Pro hoàn toàn có thể xử lý mượt mà và trơn tru mọi tác vụ cơ bản như duyệt web, xem phim độ phân giải cao hay chỉnh sửa ảnh.\r\n\r\n', 'Camera luôn là điểm mạnh của các sản phẩm Realme và trên Realme 3 Pro thì hãng tiếp tục duy trì lợi thế này của mình. Camera trước độ phân giải 25 MP với tính năng làm đẹp bằng AI hứa hẹn sẽ làm hài lòng ngay cả những người dùng khó tính nhất.\r\n\r\n', 'img/sanpham/realme/3pro/mota/1.gif', 'img/sanpham/realme/3pro/mota/2.jpg', 'img/sanpham/realme/3pro/mota/3.jpg', '1', '<h1>Thiết kế đơn giản và tinh tế\r\n</h1><p>Điện Thoại Realme 3 Pro (128GB/6GB) có thiết kế ấn tượng, không thua kém các smartphone cao cấp và đắt tiền nào. Máy sở hữu mặt lưng với khả năng thay đổi màu sắc rất độc đáo, người dùng sẽ có các màu sắc khác nha');
INSERT INTO `product_detail` VALUES (122, 'Mang một phong cách hiện đại\r\n', 'Camera kép chất lượng, đầy ấn tượng\r\n', 'Chip MediaTek MT6762\r\n', 'Điện Thoại Vivo Y91 - Hàng Chính Hãng sở hữu cho mình lối thiết kế unibody tuyệt đẹp, được tô điểm bởi những sắc màu trẻ trung, năng động và quyến rũ.Ngoài ra kích thước màn hình lên đến 6.22 inch được cách điệu bởi chiếc tai thỏ hình giọt nước vô cùng xinh xắn, đáng yêu. Bao quanh thân máy là những đường cong mềm mại, đảm bảo bạn sẽ luôn cảm thấy thoải mái, dễ chịu mỗi khi cầm nắm máy trên tay.\r\n\r\n', 'Dù sở hữu thông số camera sau không quá ấn tượng khi có độ phân giải chỉ là 13 MP và 2 MP nhưng bạn sẽ cảm thấy ngạc nhiên về khả năng chụp ảnh của máy. Nhờ có sự hỗ trợ đắc lực từ công nghệ AI camera cùng khả năng lấy nét theo pha nên mỗi bức ảnh cho ra luôn có độ nét cao và màu sắc được tối ưu riêng theo từng chủ thể.\r\n\r\n', 'Sản phẩm dù không được trang bị cấu hình quá mạnh nhưng với chip MediaTek MT6762 kết hợp 3 GB RAM cũng đã đủ để cho Vivo Y91 có được những trải nghiệm mượt mà và ổn định nhất.\r\n\r\n', 'img/sanpham/vivo/y91/mota/1.jpg', 'img/sanpham/vivo/y91/mota/2.jpg', 'img/sanpham/vivo/y91/mota/3.jpg', '1', '<h1>Mang một phong cách hiện đại\r\n</h1><p>Điện Thoại Vivo Y91 - Hàng Chính Hãng sở hữu cho mình lối thiết kế unibody tuyệt đẹp, được tô điểm bởi những sắc màu trẻ trung, năng động và quyến rũ.Ngoài ra kích thước màn hình lên đến 6.22 inch được cách điệu b');
INSERT INTO `product_detail` VALUES (123, 'Mang một phong cách hiện đại\r\n', 'Camera kép chất lượng, đầy ấn tượng\r\n', 'Chip MediaTek MT6762\r\n', 'Điện Thoại Vivo Y91 - Hàng Chính Hãng sở hữu cho mình lối thiết kế unibody tuyệt đẹp, được tô điểm bởi những sắc màu trẻ trung, năng động và quyến rũ.Ngoài ra kích thước màn hình lên đến 6.22 inch được cách điệu bởi chiếc tai thỏ hình giọt nước vô cùng xinh xắn, đáng yêu. Bao quanh thân máy là những đường cong mềm mại, đảm bảo bạn sẽ luôn cảm thấy thoải mái, dễ chịu mỗi khi cầm nắm máy trên tay.\r\n\r\n', 'Dù sở hữu thông số camera sau không quá ấn tượng khi có độ phân giải chỉ là 13 MP và 2 MP nhưng bạn sẽ cảm thấy ngạc nhiên về khả năng chụp ảnh của máy. Nhờ có sự hỗ trợ đắc lực từ công nghệ AI camera cùng khả năng lấy nét theo pha nên mỗi bức ảnh cho ra luôn có độ nét cao và màu sắc được tối ưu riêng theo từng chủ thể.\r\n\r\n', 'Sản phẩm dù không được trang bị cấu hình quá mạnh nhưng với chip MediaTek MT6762 kết hợp 3 GB RAM cũng đã đủ để cho Vivo Y91 có được những trải nghiệm mượt mà và ổn định nhất.\r\n\r\n', 'img/sanpham/vivo/y91/mota/1.jpg', 'img/sanpham/vivo/y91/mota/2.jpg', 'img/sanpham/vivo/y91/mota/3.jpg', '1', '<h1>Mang một phong cách hiện đại\r\n</h1><p>Điện Thoại Vivo Y91 - Hàng Chính Hãng sở hữu cho mình lối thiết kế unibody tuyệt đẹp, được tô điểm bởi những sắc màu trẻ trung, năng động và quyến rũ.Ngoài ra kích thước màn hình lên đến 6.22 inch được cách điệu b');
INSERT INTO `product_detail` VALUES (124, 'Thiết kế sang trọng, hiện đại\r\n', 'Màn hình giọt nước tràn viền\r\n', 'Hiệu năng mượt mà\r\n', 'Điện thoại Vivo Y15 có thiết kế chắc chắn và đầm tay. Mặt lưng hoàn thiện từ nhựa giả kính, hiệu ứng đổi màu gradient từ nhạt đến đậm tạo hiệu ứng màu đẹp mắt. Trên mặt lưng là cảm biến vân tay quen thuộc cho bạn dễ dàng thao tác. Cạnh của Vivo Y15 cũng được làm bằng nhựa và đồng màu với phần mặt lưng máy tạo nên cảm giác liền lạc. Kích thước nhỏ gọn giúp bạn có thể mang chiếc điện thoại theo bên mình bất cứ đâu.\r\n\r\n', 'Điện Thoại Vivo Y15 sở hữu màn hình LCD kích thước 6.35 inch, notch giọt nước chứa camera selfie 8MP, độ phân giải Full HD+ cộng thêm với thiết kế tràn viền mang lại không gian trải nghiệm rộng rãi và sinh động cho bạn. \r\n\r\n', 'Vivo Y15 sử dụng chip xử lý MediaTek MT6762 với RAM 4GB. Sản phẩm cũng có 64GB dung lượng lưu trữ có thể mở rộng thông qua khe cắm thẻ nhớ microSD (hỗ trợ tối đa 256 GB) tạo không gian bộ nhớ rộng rãi để thiết bị chạy các ứng dụng trơn tru mượt mà hơn và còn có cài đặt sẵn hệ điều hành Funtouch OS 9, được tạo dựa trên nền tảng của Android 9.0 Pie với giao diện hiển thị dễ nhìn, dễ sử dụng và thao tác nhanh.\r\n\r\n', 'img/sanpham/vivo/y15/mota/1.jpg', 'img/sanpham/vivo/y15/mota/2.jpg', 'img/sanpham/vivo/y15/mota/3.jpg', '1', '<h1>Thiết kế sang trọng, hiện đại\r\n</h1><p>Điện thoại Vivo Y15 có thiết kế chắc chắn và đầm tay. Mặt lưng hoàn thiện từ nhựa giả kính, hiệu ứng đổi màu gradient từ nhạt đến đậm tạo hiệu ứng màu đẹp mắt. Trên mặt lưng là cảm biến vân tay quen thuộc cho bạn');
